INSERT INTO `mx_category` (`id`, `name`, `alias`, `hot`, `title`, `intro`, `pid`, `sort`, `open`) VALUES
(2, '云服务器(VPS)', 'vps', 0, '', '云服务器VPS依托虚拟化技术构建独立运行平台，具备专用系统、独享资源及安全隔离优势。用户可灵活配置、快速部署应用，享受高效低成本、便捷管理服务，是企业与个人实现网络托管、业务扩展及数字化转型的理想选择', 59, 2, 1),
(3, '香港服务器', 'hkserver', 0, '', '香港服务器指位于中国香港数据中心的物理或云服务器，凭借其国际网络枢纽地位，提供全球低延迟访问和高速带宽（尤其是连接中国大陆及海外）。优势包括免备案政策、高度自由的网络环境、严格的数据隐私保护及国际合规性，适合外贸、游戏、金融等跨国业务。', 59, 5, 1),
(4, '美国服务器', 'usaserver', 0, '', '美国服务器指部署于美国数据中心的物理或云服务器，依托其全球领先的网络基础设施，提供高带宽、低延迟的全球访问能力，尤其覆盖欧美及美洲地区。优势包括丰富IP资源、高配置灵活性（如独立服务器、云主机、裸金属等），以及符合欧美数据合规要求（如GDPL/FCC）。', 59, 6, 1),
(8, '阿里云国际版', 'alibabacloud', 0, '', '阿里云国际版提供全球云计算服务覆盖弹性计算数据存储网络安全大数据人工智能CDN加速等产品助力企业数字化转型与跨国拓展依托全球数据中心与高速网络构建安全高效平台实现应用创新并推动产业升级引领全球数智未来', 80, 1, 1),
(9, '腾讯云国际站', 'tencentcloud', 0, '代开腾讯云国际账户，快速接入全球云服务', '腾讯云国际站提供弹性计算、存储、大数据、人工智能、网络安全、CDN加速等全系列云产品，依托全球数据中心和高速网络，为跨国企业及各行业构建安全、稳定、高效的信息平台，助力数字化转型与创新发展共创未来。', 80, 2, 1),
(10, '华为云国际版', 'huaweicloud', 0, '', '华为云国际提供弹性计算、数据存储、网络安全、大数据、人工智能、物联网、容器服务等产品，依托全球数据中心与高性能网络，为企业打造高可用、高安全、高效率的信息化平台，助力数字化转型、业务创新及跨国稳健发展', 80, 3, 1),
(11, '亚马逊云(AWS)', 'amazon', 0, '', '亚马逊云AWS提供弹性计算、海量存储、数据库、大数据分析、人工智能、物联网、容器与安全服务等全套云产品。依托全球数据中心、边缘网络及混合云实现高性能、高可用、高可靠，助力企业数字化转型与全球业务拓展。', 80, 5, 1),
(12, '谷歌云(GCP)', 'googlecloud', 0, '', '谷歌云（GCP）提供计算、存储、数据库、大数据分析、机器学习、人工智能、容器、物联网与安全服务。依托全球高性能基础设施及先进网络，不断革新，助力企业构建创新应用，实现数字化转型与全球业务稳步拓展共赢。', 80, 6, 1),
(13, '微软云(Azure)', 'azure', 0, '', '微软云（Azure）提供全方位云服务，含计算、存储、数据库、人工智能、大数据、物联网、DevOps及混合云。依托全球数据中心、高速网络，支撑跨平台开发、安控，助企实现数转、智创及全球协同发展共赢未来。', 80, 7, 1),
(14, '香港云服务器', 'hk-cloud-server', 1, '', '香港云服务器是基于云计算技术的服务器产品，提供了高效、稳定、弹性、可靠的计算资源，适合各类企业和个人用户在香港及亚太地区进行网站托管、应用部署、大数据分析、游戏服务器、线上教育、电子商务等业务。由于香港地理位置优越，成为连接中国大陆、东南亚以及全球市场的理想位置，香港云服务器广泛用于跨境电商、国际化网站和全球应用的部署。', 2, 50, 1),
(15, '新加坡云服务器', 'singapore-cloud-server', 1, '', '新加坡云服务器凭借其低延迟、高性能、高可靠性和灵活的资源配置，为全球用户提供了一流的云计算服务。作为东南亚及亚太地区的云计算中心，新加坡云服务器帮助企业拓展跨境业务，特别是在东南亚、全球电子商务、大数据分析、AI应用等领域，提供了稳定的计算和网络支持。通过与其他云服务产品的集成，新加坡云服务器为用户提供了一整套的云解决方案，助力企业提升运营效率、降低成本并实现数字化转型。', 2, 50, 1),
(16, '美国云服务器', 'us-cloud-server', 1, '', '美国云服务器凭借其全球化的网络优势、高性能计算资源、弹性扩展能力和强大的安全保障，成为全球企业和开发者的理想选择。无论是跨境电商、大数据分析、人工智能，还是视频直播和游戏应用，美国云服务器都能为您提供高可用、低延迟的服务，支持您的业务持续增长和创新。在全球化和数字化转型的背景下，美国云服务器为企业提供了一个强大的云计算平台，助力企业实现数字化转型、提升运营效率并拓展国际市场。', 2, 50, 1),
(18, '裸金属服务器', 'baremetal', 0, '', '裸金属服务器是一种纯物理服务器，未经过虚拟化处理，提供独享计算资源。其性能稳定、响应迅速，适合高负载、大数据与高性能计算等应用，保障数据安全，满足定制化部署需求，是广大企业关键业务和高端应用的理想选择', 59, 3, 1),
(19, '香港云站群服务器', 'hk-cloud-station-group-server', 1, '', '香港云站群服务器是一种基于云计算技术的服务器解决方案，特别适用于需要部署多个网站或应用并且在多个域名下同时运行的站群（站点集群）业务。通过香港云站群服务器，用户可以高效、灵活地管理多个网站和内容，享受香港地区优质的网络连接、低延迟和高速稳定的服务，满足站群网站的带宽需求以及全球用户的访问体验。', 2, 50, 1),
(20, '香港裸金属服务器', 'hk-bare-metal-server', 1, '', '香港裸金属服务器（Bare Metal Server）是指未经过虚拟化的物理服务器，用户可以直接访问硬件资源，享有完全的计算、存储、网络和处理能力。与传统的虚拟化服务器相比，裸金属服务器没有资源共享，能够提供更高的性能、灵活性和定制性，适合对性能要求极高的应用场景。香港作为全球重要的国际金融和科技中心，其地理优势和网络连接能力使得香港裸金属服务器成为许多跨境企业和全球用户的首选。', 18, 50, 1),
(21, '新加坡裸金属服务器', 'singapore-bare-metal-server', 1, '', '新加坡裸金属服务器凭借其卓越的计算性能、高度的安全性、灵活的配置选项和稳定的网络连接，成为了高性能计算、数据处理、金融交易、云游戏等行业的理想选择。无论是大规模数据分析、机器学习训练，还是高频交易、游戏托管，新加坡裸金属服务器都能提供强大的硬件支持，确保企业业务的顺畅运行。对于希望在亚太地区开展业务或需要全球连接的企业，新加坡裸金属服务器提供了一个可靠、安全且高效的基础设施解决方案。', 18, 50, 1),
(22, '美国裸金属服务器', 'bare-metal-servers-in-the-united-states', 1, '', '美国裸金属服务器（Bare Metal Server）是一种没有虚拟化层的物理服务器，提供完全独立和专用的硬件资源。用户可以直接访问服务器的所有硬件资源，包括 CPU、内存、存储等，享受最佳的性能和高可靠性。与虚拟机相比，裸金属服务器消除了虚拟化带来的性能开销，能够提供更高的计算能力和更低的延迟。美国作为全球科技和数据中心的重要枢纽，提供的裸金属服务器为用户提供强大的计算能力、高安全性和灵活性。无论是大型企业，还是需要高性能计算、高可用性、数据隐私保障的应用，美国裸金属服务器都是理想的选择。', 18, 50, 1),
(23, '香港裸金属站群服务器', 'hk-bare-metal-station-group-server', 1, '', '香港裸金属站群服务器是专为站群系统、大规模网站托管和高流量应用而设计的物理服务器解决方案。与传统虚拟服务器不同，裸金属服务器提供独享的硬件资源，用户无需通过虚拟化层共享服务器资源，因此能够享受更高的性能和更低的延迟。香港裸金属站群服务器结合了香港的优越地理位置和高速网络优势，成为了跨境业务和全球流量网站的理想选择。', 18, 50, 1),
(24, '美国裸金属站群服务器', 'us-bare-metal-station-cluster-server', 1, '', '美国裸金属站群服务器是一种专为大型网站和站群系统设计的高性能物理服务器解决方案。与虚拟化服务器相比，裸金属服务器提供独享的硬件资源，完全避免了虚拟化带来的性能损失，能够确保更高的处理能力、更低的延迟和更稳定的服务。特别适用于需要大规模网站托管、SEO优化和高流量访问的场景。', 18, 50, 1),
(25, '香港算力云服务器', 'hk-computing-cloud-server', 1, '', '香港算力云服务器是一款为高性能计算、深度学习、大数据分析、科学计算等任务设计的云服务，具备强大的计算能力、GPU加速、高带宽和低延迟的优势。其灵活的资源配置和高可用性，能够满足企业对高效计算资源的需求，同时提供安全、合规的服务保障。无论是跨境电商、AI研发、视频渲染，还是科研计算，香港算力云服务器都能为您提供高效、稳定、灵活的计算平台，帮助您快速实现业务目标。', 2, 50, 1),
(26, '新加坡算力云服务器', 'singapore-computing-cloud-server', 1, '', '新加坡算力云服务器通过提供高性能的计算资源、GPU加速、低延迟网络和高带宽支持，成为大数据分析、人工智能训练、视频渲染、科学计算等领域的理想选择。其灵活的资源配置和高可用性架构，能够帮助企业实现高效计算和业务创新。无论是初创公司、科研机构还是跨国企业，新加坡算力云服务器都能够提供稳定、安全和高效的计算平台，助力各类高计算需求的任务实现。', 2, 50, 1),
(29, '香港独立服务器', 'hk-independent-server', 1, '', '香港独立服务器（Dedicated Server）是一种高性能、独享资源的物理服务器解决方案，适用于需要强大计算能力、大带宽和高安全性的用户。与虚拟主机或云服务器不同，独立服务器为用户提供了完整的服务器资源，包括CPU、内存、存储和带宽，所有资源都专属于单一客户。香港独立服务器的主要优势是高性能、灵活性以及完全的控制权，特别适合处理高负载、敏感数据和对性能要求极高的应用。', 3, 50, 1),
(30, '香港站群服务器', 'hk-site-group-server', 1, '', '香港站群服务器是指在香港地区部署的多个独立服务器，用于支撑大规模网站群（站群）系统的高效运作。站群服务器通常用于SEO优化、企业多站点管理、内容分发和大流量网站的托管。通过多个服务器的协同工作，可以实现网站分布式托管，提升网站的访问速度、负载能力以及SEO优化效果。香港站群服务器具有稳定的性能、低延迟、高带宽的优势，非常适合需要多站点管理的企业或需要进行大规模SEO优化的用户。', 3, 50, 1),
(31, '香港大带宽服务器', 'hk-high-bandwidth-server', 0, '', '香港大带宽服务器是指在香港地区部署的专用服务器，具有高带宽、快速的数据传输能力，适用于需要大规模数据传输、高并发访问和高速网络连接的业务场景。这类服务器通常用于支撑高流量网站、大型应用、视频流媒体平台、大数据分析和跨境电商等对带宽要求极高的服务。', 3, 50, 1),
(32, '香港高防服务器', 'hk-advanced-defense-server', 1, '', '香港高防服务器是指在香港地区部署的具有强大防御能力的专用服务器，专门设计用于抵御各种网络攻击，保障企业网站和应用的安全性。这些服务器通常采用先进的防火墙技术、DDoS防护、流量清洗等安全防护措施，能够有效防止黑客攻击、DDoS攻击、流量洪水等恶意入侵，确保服务器和网络的稳定性与安全性。', 3, 50, 1),
(34, '美国独立服务器', 'independent-servers-in-the-united-states', 0, '', '美国独立服务器凭借其强大的性能、高度的自定义和安全保障，成为众多企业和开发者的首选。无论是大型企业网站、高负载应用、在线游戏，还是数据存储和备份，独立服务器都能够提供稳定、安全和高效的解决方案。选择美国独立服务器不仅能够享受强大的技术支持，还能利用美国优越的网络连接，提升业务的全球竞争力。', 4, 50, 1),
(35, '美国站群服务器', 'us-site-group-server', 1, '', '美国站群服务器是专为需要大量高效、稳定且分布广泛的服务器资源支持的站群业务而设计的服务器解决方案。站群服务器指的是多个服务器在同一网络架构下，支持多个独立网站的运营，通常用于SEO（搜索引擎优化）优化、企业多站点管理以及其他需要大量网站支持的场景。美国站群服务器提供了高带宽、稳定性和安全性，适用于需要高效管理、监控和操作大量站点的企业和个人用户。', 4, 50, 1),
(37, '美国高防服务器', 'us-advanced-defense-server', 0, '', '美国高防服务器是一种专门设计用于防御大规模网络攻击、特别是DDoS攻击（分布式拒绝服务攻击）的云服务器产品。它结合了高性能的硬件配置与强大的安全防护功能，为网站、应用程序和在线服务提供一个安全、可靠的托管环境。高防服务器常用于金融、电商、游戏、政府网站等需要高度安全防护的领域。', 4, 50, 1),
