您的业务需求，选择适合的Claude AI服务套餐，我们会提供专业的配置建议，确保满足您的特定需求。</p>\n<p><strong>3、快速部署与集成：</strong> 配置完成后，您可以立即在AWS云平台上部署Claude AI服务，并与您的现有业务系统进行集成。</p>\n<p><strong>4、技术支持与优化：</strong> 我们为您提供全程技术支持，帮助您优化Claude AI的应用与功能，确保高效稳定运行。</p>\n<h3><strong>优势：</strong></h3>\n<p><strong>顶级AI技术：</strong> Claude AI由亚马逊云平台强大的计算资源支持，提供业界领先的<a href=\"https://www.kaihu123.com/tag/.html\" title=\"\" target=\"_blank\"></a>能力，能够处理复杂的自然语言任务、深度学习和数据分析任务。</p>\n<p><strong>灵活的计费模式：</strong> AWS为Claude AI提供按需计费模式，您只需为使用的计算资源付费，避免不必要的支出，降低企业成本。</p>\n<p><strong>无缝集成：</strong> Claude AI的API支持与其他AWS服务和第三方应用的集成，帮助企业快速构建和扩展智能应用。</p>\n<p><strong>强大的数据处理能力：</strong> 结合AWS的全球数据中心，Claude AI可以处理大规模的数据，支持复杂的数据分析和实时处理任务。</p>\n<p><strong>高安全性与合规：</strong> AWS为Claude AI提供多层次的安全保障，包括数据加密、身份验证、防火墙等，确保客户数据的隐私和安全。</p>\n<h3><strong>聯絡我們：</strong></h3>\n<p>如需了解更多关于亚马逊云(AWS) Claude AI的详细信息，或有任何疑问，欢迎随时聯絡我們。我们的专业团队将为您提供全程技术支持，帮助您快速实现智能化转型，提升业务效率和客户体验。</p>', 0, 1739732402),
(19, '谷歌云(Gcp)人工智能AI gemini账户', '人工智能AI gemini账户', 'google-cloud-gcp-artificial-intelligence-ai-gemini-account', 159, '谷歌云（Google Cloud Platform，简称GCP）推出的人工智能AI Gemini为企业和开发者提供了强大的AI模型和机器学习工具，旨在通过创新的人工智能技术推动企业的数字化转型。Gemini AI结合了Google在深度学习、自然语言处理、图像识别和机器学习等领域的领先技术，帮助用户实现智能化业务优化、数据分析和自动化操作。无论是在语音识别、内容生成、客户服务还是个性化推荐等领域，GCP Gemini都能提供高效、精准的解决方案。', '500.00', '<p>谷歌云（Google Cloud Platform，简称GCP）推出的人工智能AI Gemini为企业和开发者提供了强大的AI模型和机器学习工具，旨在通过创新的人工智能技术推动企业的数字化转型。Gemini AI结合了Google在深度学习、自然语言处理、图像识别和机器学习等领域的领先技术，帮助用户实现智能化业务优化、数据分析和自动化操作。无论是在语音识别、内容生成、客户服务还是个性化推荐等领域，GCP Gemini都能提供高效、精准的解决方案。</p>\n<h3><strong>主要特点：</strong></h3>\n<p><strong>1、顶级人工智能技术：</strong></p>\n<p>GCP Gemini AI基于Google最新的深度学习和自然语言处理技术，具备强大的智能分析能力，能够处理各种复杂的任务和需求。</p>\n<p><strong>2、多模态AI能力：</strong></p>\n<p>Gemini支持多种数据类型的处理，包括文本、图像、视频、语音等，满足不同业务场景的需求，广泛应用于多媒体内容生成、智能客服、产品推荐等。</p>\n<p><strong>3、自然语言处理（NLP）：</strong></p>\n<p>Gemini在自然语言理解（NLU）和生成（NLG）方面具有领先优势，能够生成符合语境的自然语言文本，应用于自动化内容生成、语音助手、聊天机器人等领域。</p>\n<p><strong>4、高效的机器学习工具：</strong></p>\n<p>GCP Gemini提供了易于使用的机器学习框架和工具，帮助开发者快速构建和训练AI模型。支持自动机器学习（AutoML）、深度学习（TensorFlow）、训练加速（TPU）等，适用于各类数据分析和预测任务。</p>\n<p><strong>5、强大的API与集成支持：</strong></p>\n<p>通过GCP Gemini提供的API，用户可以轻松将AI功能集成到现有业务系统或应用中，实现智能化的自动化流程和增强客户体验。</p>\n<p><strong>6、灵活的云资源管理：</strong></p>\n<p>基于GCP的全球云基础设施，Gemini AI提供高度可扩展的计算资源，用户可以根据实际需求随时调整资源配置，确保高效、低成本的AI计算。</p>\n<h3><strong>适用场景：</strong></h3>\n<p><strong>智能客服与对话系统：</strong> 利用GCP Gemini的自然语言处理能力，构建智能客服和聊天机器人，提升客户服务效率和满意度。</p>\n<p><strong>自动化内容生成：</strong> Gemini AI可以自动生成高质量的文章、报告、博客等内容，广泛应用于媒体、教育、营销等领域。</p>\n<p><strong>个性化推荐：</strong> 通过分析用户行为和偏好，Gemini AI能够为用户提供精准的个性化内容、商品或服务推荐，提升转化率。</p>\n<p><strong>图像与视频分析：</strong> 利用AI图像识别和视频分析功能，Gemini可以帮助企业快速处理和分析大量的多媒体数据，适用于安防、医疗、零售等行业。</p>\n<p><strong>数据分析与预测：</strong> 借助机器学习能力，Gemini AI可以处理大规模数据，进行模式识别、趋势预测，帮助企业实现精准营销、财务分析、市场预测等任务。</p>\n<h3><strong>购买流程：</strong></h3>\n<p><strong>1、账户代开申请：</strong> 通过我们的代开服务，您可以快速获得谷歌云(GCP) Gemini AI账户，开启您的智能化转型之路。</p>\n<p><strong>2、选择AI服务套餐：</strong> 根据您的业务需求，选择适合的Gemini AI服务套餐，我们会为您提供专业的定制化方案，确保满足您的特定需求。</p>\n<p><strong>3、快速部署与集成：</strong> 完成账户开设后，您可以在GCP平台上快速部署Gemini AI服务，并将其集成到您的现有业务系统中。</p>\n<p><strong>4、技术支持与优化：</strong> 我们提供全程的技术支持，帮助您优化Gemini AI的应用和配置，确保服务高效、稳定运行。</p>\n<h3><strong>优势：</strong></h3>\n<p><strong>先进的AI技术：</strong> GCP Gemini依托Google强大的技术积累和AI研究，提供世界一流的自然语言处理、机器学习和深度学习能力，适用于各种行业需求。</p>\n<p><strong>强大的计算与存储支持：</strong> 基于Google Cloud的基础设施，Gemini AI能够支持大规模的数据处理和高性能计算，保证AI任务的快速执行。</p>\n<p><strong>灵活的计费方式：</strong> GCP提供按需计费、包月计费等灵活模式，您只需为实际使用的资源付费，避免不必要的支出。</p>\n<p><strong>跨领域应用支持：</strong> 无论是电商、金融、医疗、教育还是娱乐等行业，GCP Gemini的AI服务都能提供定制化解决方案，帮助企业提高运营效率。</p>\n<p><strong>高安全性与合规性：</strong> GCP为Gemini AI提供全球领先的安全保障，确保数据隐私、合规性和应用安全，符合GDPR、ISO 27001等国际标准。</p>\n<h3><strong>聯絡我們：</strong></h3>\n<p>如果您希望了解更多关于谷歌云(GCP) Gemini AI的详细信息，或有任何疑问，欢迎随时聯絡我們。我们的专业团队将为您提供全面的咨询和技术支持，帮助您实现智能化转型，提升业务竞争力。</p>', 0, 1739818801),
(20, '微软云Azure 云服务器账户', '云服务器', 'microsoft-cloud-azure-cloud-server', 163, '微软云Azure云服务器是全球领先的云计算平台之一，提供强大的计算、存储、网络和AI服务，帮助企业实现数字化转型，提升业务效率和竞争力。Azure云服务器依托微软强大的技术实力和全球数据中心，为用户提供高效、安全、可靠的云计算服务。无论是基础设施管理、应用托管，还是人工智能、大数据分析等高级任务，Azure云服务器都能为您提供灵活的解决方案。', '500.00', '<p>微软云Azure云服务器是全球领先的云计算平台之一，提供强大的计算、存储、网络和AI服务，帮助企业实现数字化转型，提升业务效率和竞争力。Azure云服务器依托微软强大的技术实力和全球<a href=\"https://www.kaihu123.com/stand/Hong-Kong-Computing-Cloud-Server-Universal-Computing-12-Core-24-Thread.html\" title=\"数据中心\" target=\"_blank\">数据中心</a>，为用户提供高效、安全、可靠的云计算服务。无论是基础设施管理、应用托管，还是人工智能、大数据分析等高级任务，Azure云服务器都能为您提供灵活的解决方案。</p>\n<h3><strong>主要特点：</strong></h3>\n<p><strong>1、全球覆盖与高可用性：</strong></p>\n<p>微软Azure云服务器覆盖全球多个<a href=\"https://www.kaihu123.com/stand/Hong-Kong-Computing-Cloud-Server-Universal-Computing-12-Core-24-Thread.html\" title=\"数据中心\" target=\"_blank\">数据中心</a>，确保用户能够在全球范围内享受到低延迟、高可靠性的服务。Azure的全球化网络使得跨国企业能够在不同地区部署应用，保障全球用户的快速响应。</p>\n<p><strong>2、弹性计算资源：</strong></p>\n<p>Azure云服务器提供多种实例类型，适用于从小型开发到大规模企业级应用的各种需求。用户可以根据需求灵活调整计算资源，实现弹性伸缩，确保业务的高效运作。</p>\n<p><strong>3、高效的虚拟化技术：</strong></p>\n<p>通过Azure的虚拟化技术，用户可以在云环境中创建虚拟机，快速部署操作系统和应用程序，实现快速、低成本的应用交付。</p>\n<p><strong>4、强大的存储与数据库服务：</strong></p>\n<p>Azure云服务器不仅提供高效的存储解决方案（如Azure Blob存储、Azure文件存储），还支持多种数据库服务（如Azure SQL数据库、Cosmos DB），满足企业在数据存储和管理方面的需求。</p>\n<p><strong>5、AI与机器学习支持：</strong></p>\n<p>微软Azure提供强大的人工智能和机器学习工具，帮助企业通过Azure AI、Azure Machine Learning等服务，快速实现智能化业务，提升数据分析能力和预测能力。</p>\n<p><strong>6、全面的安全保障：</strong></p>\n<p>Azure云服务器具有多层次的安全防护，支持加密、身份验证、DDoS防护等，确保数据安全和隐私保护。此外，Azure还符合全球合规标准，如ISO 27001、GDPR等。</p>\n<h3><strong>适用场景：</strong></h3>\n<p><strong>网站与应用托管：</strong> 微软Azure云服务器适合企业用来托管网站和应用，确保高可用性、可扩展性和全球快速响应。</p>\n<p><strong>大数据与人工智能：</strong> 借助Azure强大的大数据处理与人工智能工具，企业可以对海量数据进行实时分析与处理，提供精准的业务洞察。</p>\n<p><strong>容器化与微服务架构：</strong> Azure支持容器化部署，用户可以通过Azure Kubernetes Service（AKS）等服务管理容器应用，构建现代化的微服务架构。</p>\n<p><strong>跨境电商：</strong> Azure的全球<a href=\"https://www.kaihu123.com/stand/Hong-Kong-Computing-Cloud-Server-Universal-Computing-12-Core-24-Thread.html\" title=\"数据中心\" target=\"_blank\">数据中心</a>帮助跨境电商企业在多个地区部署应用，确保用户访问速度和稳定性。</p>\n<p><strong>灾难恢复与备份：</strong> Azure云服务器提供备份与灾难恢复解决方案，帮助企业有效应对意外中断，保障业务连续性。</p>\n<h3><strong>购买流程：</strong></h3>\n<p><strong>1、账户代开申请：</strong> 通过我们的代开服务，您可以快速获得微软云Azure的云服务器账户，开始使用高效、灵活的云计算资源。</p>\n<p><strong>2、选择服务器规格：</strong> 根据您的业务需求，选择合适的Azure云服务器规格，我们会提供定制化的建议，帮助您选择最佳配置。</p>\n<p><strong>3、资源配置与部署：</strong> 完成账户开设后，您可以在Azure平台上灵活配置计算资源、存储和网络，快速部署应用或服务。</p>\n<p><strong>4、全程技术支持：</strong> 我们提供全方位的技术支持，帮助您优化Azure云服务器配置，确保高效、稳定的云服务运行。</p>\n<h3><strong>优势：</strong></h3>\n<p><strong>全球<a href=\"https://www.kaihu123.com/stand/Hong-Kong-Computing-Cloud-Server-Universal-Computing-12-Core-24-Thread.html\" title=\"数据中心\" target=\"_blank\">数据中心</a>与高可用性：</strong> Azure通过全球多个<a href=\"https://www.kaihu123.com/stand/Hong-Kong-Computing-Cloud-Server-Universal-Computing-12-Core-24-Thread.html\" title=\"数据中心\" target=\"_blank\">数据中心</a>的支持，为用户提供低延迟、高可用的云计算服务，满足全球化业务需求。</p>\n<p><strong>弹性与高效：</strong> 通过Azure云服务器的弹性伸缩，用户可以根据实际需求调整资源配置，确保高效利用资源并降低成本。</p>\n<p><strong>全面的云服务：</strong> Azure不仅仅是云服务器，提供从计算、存储、数据库到AI、IoT、DevOps等全方位的云服务，适用于各类企业需求。</p>\n<p><strong>强大的安全与合规：</strong> Azure采用企业级安全标准，并符合全球多项合规认证，确保客户数据和应用的安全性和隐私保护。</p>\n<p><strong>智能化与自动化支持：</strong> 通过Azure的AI和自动化工具，企业能够简化运维，优化资源管理，提升工作效率。</p>\n<h3><strong>聯絡我們：</strong></h3>\n<p>如需了解更多关于微软云Azure云服务器的详细信息，或有任何疑问，欢迎随时聯絡我們。我们将为您提供专业的咨询服务，帮助您选择最适合的Azure云服务器方案，实现数字化转型与业务增长。</p>', 1, 1739818801),
(21, '微软云Azure人工智能openAi', '人工智能openAi', 'microsoft-cloud-azure-artificial-intelligence-openai', 167, 'Azure OpenAI服务通过与微软云的深度集成，使得用户不仅能够访问OpenAI的语言模型（如GPT系列、Codex等），还能够利用Azure强大的计算、存储、网络等资源，提供高效、灵活、可扩展的AI应用开发与部署平台。', '500.00', '<p><a href=\"https://www.kaihu123.com/vps/Microsoft-Cloud-Azure-Cloud-Server.html\" title=\"微软云\" target=\"_blank\">微软云</a>Azure与OpenAI强强联手，为企业提供领先的人工智能解决方案。通过Azure平台，用户可以快速访问OpenAI的先进AI技术，充分利用其在自然语言处理、图像生成、对话系统等领域的卓越能力。OpenAI作为全球最前沿的AI研究机构之一，致力于为开发者、企业和研究人员提供强大的AI工具和API，助力各类业务智能化转型，提升企业效率、创新能力与市场竞争力。</p>\n<p>Azure OpenAI服务通过与<a href=\"https://www.kaihu123.com/vps/Microsoft-Cloud-Azure-Cloud-Server.html\" title=\"微软云\" target=\"_blank\">微软云</a>的深度集成，使得用户不仅能够访问OpenAI的语言模型（如GPT系列、Codex等），还能够利用Azure强大的计算、存储、网络等资源，提供高效、灵活、可扩展的AI应用开发与部署平台。</p>\n<h3><strong>主要特点：</strong></h3>\n<p><strong>1、先进的自然语言处理（NLP）技术：</strong></p>\n<p>OpenAI的GPT系列模型通过深度学习技术，能够理解并生成高质量的自然语言文本，广泛应用于自动化写作、内容生成、聊天机器人、客户服务等场景。</p>\n<p><strong>2、多模态AI能力：</strong></p>\n<p>OpenAI的多模态AI模型能够同时处理文本、图像、音频等多种数据类型，支持文本生成、图像生成、语音识别等多种智能功能，适用于更加复杂和多样化的业务需求。</p>\n<p><strong>3、代码生成与编程助手：</strong></p>\n<p>OpenAI的Codex模型可以理解自然语言并生成相应的编程代码，帮助开发者加速应用开发，提供智能编程助手，广泛应用于自动化开发、代码审查等领域。</p>\n<p><strong>4、灵活的API与开发工具：</strong></p>\n<p>通过Azure OpenAI，用户可以通过简单的API调用，将强大的AI能力集成到自己的应用中，快速实现智能化功能。提供易于使用的开发工具和SDK，帮助开发者轻松构建和部署AI应用。</p>\n<p><strong>5、与Azure深度集成：</strong></p>\n<p>Azure OpenAI服务与Azure的计算、存储和安全服务无缝集成，支持大规模并发访问，确保数据的安全性和合规性，适应企业的高要求。</p>\n<p><strong>6、高效的机器学习与训练环境：</strong></p>\n<p>借助Azure的计算资源，用户可以训练和微调OpenAI模型，适应特定的业务需求和场景，进行个性化定制，提升AI应用的准确度和实用性。</p>\n<h3><strong>适用场景：</strong></h3>\n<p><strong>智能客服与对话系统：</strong> 通过OpenAI的自然语言理解和生成能力，构建智能客服系统或聊天机器人，提供7*24小时自动化客户服务，提升客户满意度和运营效率。</p>\n<p><strong>自动化内容生成：</strong> OpenAI可以根据给定的主题生成文章、报告、广告文案等内容，适用于新闻媒体、电商平台、营销公司等自动化内容创作场景。</p>\n<p><strong>编程与代码生成：</strong> OpenAI的Codex能够帮助开发者自动生成代码，提升开发效率，减少重复劳动，广泛应用于软件开发、自动化测试、代码审查等领域。</p>\n<p><strong>智能数据分析与报告生成：</strong> OpenAI结合Azure强大的数据分析能力，帮助企业自动生成数据分析报告、市场预测报告等，提升决策效率。</p>\n<p><strong>教育与培训：</strong> 借助OpenAI的强大语言能力，开发智能辅导系统、学习助手等工具，帮助学员快速掌握知识，提供个性化的学习路径。</p>\n<h3><strong>购买流程：</strong></h3>\n<p><strong>1、账户代开申请：</strong> 通过我们的代开服务，您可以迅速获得<a href=\"https://www.kaihu123.com/vps/Microsoft-Cloud-Azure-Cloud-Server.html\" title=\"微软云\" target=\"_blank\">微软云</a>Azure OpenAI账户，开始使用先进的AI技术。</p>\n<p><strong>2、选择AI服务套餐：</strong> 根据您的需求，选择合适的Azure OpenAI服务套餐，我们将为您提供专业的方案建议，确保服务满足您的业务要求。</p>\n<p><strong>3、快速部署与集成：</strong> 账户开设完成后，您可以通过Azure平台快速部署OpenAI服务，并将其集成到您的业务系统或应用中。</p>\n<p><strong>4、技术支持与优化：</strong> 我们提供全程技术支持，帮助您优化OpenAI应用，确保高效、稳定的AI服务运行。</p>\n<h3><strong>优势：</strong></h3>\n<p><strong>顶级AI技术：</strong> OpenAI是全球领先的人工智能研究机构之一，依托其强大的技术积累，提供行业领先的自然语言处理和生成能力。</p>\n<p><strong>与Azure深度集成：</strong> Azure OpenAI服务与Azure的计算、存储和网络资源紧密结合，提供无缝、灵活的云计算平台，支持大规模AI应用的快速部署。</p>\n<p><strong>灵活计费：</strong> 通过Azure，用户可以根据实际使用量按需付费，降低企业运营成本，同时可以根据需求进行资源扩展。</p>\n<p><strong>安全与合规：</strong> Azure为OpenAI提供多层次的安全保障，符合ISO、GDPR等国际安全标准，确保用户数据的隐私和安全。</p>\n<p><strong>广泛应用场景：</strong> OpenAI不仅适用于自然语言生成、对话系统等场景，还可以应用于编程助手、数据分析、教育培训等多个领域，满足各行业企业的智能化需求。</p>\n<h3><strong>聯絡我們：</strong></h3>\n<p>如需了解更多关于<a href=\"https://www.kaihu123.com/vps/Microsoft-Cloud-Azure-Cloud-Server.html\" title=\"微软云\" target=\"_blank\">微软云</a>Azure OpenAI的详细信息，或有任何疑问，欢迎随时聯絡我們。我们的专业团队将为您提供全面的咨询服务，帮助您快速实现智能化转型，提升业务竞争力。</p>', 0, 1739905202),
(22, '阿里云云盒公共云', '阿里云云盒', 'alibaba-cloud-box', 98, '阿里云提供软硬一体化的基础设施（计算、存储、网络）部署在您的数据中心，以满足数据合规要求、数据本地处理、低延时等业务需求。云盒采用42U标准机柜，并已完成了预安装，送达后只需要通电、通网，并做简单调试，您就能在公共云控制台上使用云盒内的计算和存储资源。', '100.00', '<p><a href=\"https://www.kaihu123.com/Cloud/aliyun-cloud-computing/\">阿里云</a>提供软硬一体化的基础设施（<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、存储、网络）部署在您的数据中心，以满足数据合规要求、数据本地处理、低延时等业务需求。<br /><br />云盒采用42U标准机柜，并已完成了预安装，送达后只需要通电、通网，并做简单调试，您就能在公共云控制台上使用云盒内的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和存储资源。在此基础上，您还可以在本地使用阿里云提供的PaaS服务，如数据库、容器服务等；以及利用公共云上的云服务来运维管理云盒内的资源。</p>', 0, 1739905202),
(23, '计算巢服务企业应用云化新引擎', '计算巢服务', 'computing-nest-service', 98, '计算巢服务（Compute Nest）是阿里云开放给企业应用服务商和其客户的服务管理PaaS平台。以计算为巢，深度被集成 服务商能够在计算巢上发布私有化部署服务，为其客户提供云上软件一键部署的能力；同时也支持全托管模式的服务，赋能服务商托管其客户资源。', '100.00', '<h2 class=\"h3 title\" data-spm-anchor-id=\"a3c0i.24675359.5546756150.i0.76931030vAOKqm\">计算巢服务优势</h2>\n<h3>服务商优势</h3>\n<p>1、简便的服务发布和管理平台，实现自动化的智能交付、智能故障检测等，降低交付成本</p>\n<p>2、提升服务的交付效率、管理效率和服务能力，在提升用户满意度的同时，降低50%以上运营成本</p>\n<p>3、服务管理：服务部署后，为服务商和客户提供联接，赋能服务商进⾏代运维，运维效率提升10倍以上</p>\n<h3 class=\"text-md text-bold\" data-spm-anchor-id=\"a3c0i.24675359.5546756150.i3.76931030vAOKqm\">最终用户优势</h3>\n<p>1、⾃动化完成云<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和软件的部署，上⼿门槛低</p>\n<p>2、通过计算巢统⼀管理多家服务商提供的服务</p>\n<p>3、享受安全可靠的代运维服务：安全的⽹络联通设计，服务流程可审计、可追溯</p>\n<p>4、故障实时上报，服务商主动快速响应</p>\n<h2>什么是计算巢服务？</h2>\n<p>计算巢服务是一个开放给服务商（包括：企业应用服务商、IT集成服务商、交付服务商和管理服务提供商等）和用户的服务管理PaaS平台。计算巢服务为服务商和用户提供了高效、便捷、安全的服务使用体验，服务商能更好地在阿里云上部署、交付和管理服务，用户能集中管理在阿里云上订阅的各类服务商提供的服务。</p>', 0, 1739991601),
(24, '阿里云国际无影云手机|虚拟手机', '无影云手机', 'alibabacloud-cloud-phone', 98, '无影云手机（Cloud Phone）是一台运行在云端的虚拟手机，利用ARM服务器以及虚拟化技术，为用户构建一个云上Android应用平台。用户基于电脑、手机等客户端，以串流的方式，远程实时操控Android系统以及应用。本文介绍什么是无影云手机。', '100.00', '<h3>1、什么是无影云手机？</h3>\n<p><span id=\"dfe48ef0dcket\" class=\"ph\" data-tag=\"ph\" data-spm-anchor-id=\"a2c63.p38356.0.i0.d1e51011t8eQIV\">无影云手机</span>是一台运行在云端的虚拟手机，利用ARM服务器以及虚拟化技术，为用户构建一个云上Android应用平台。用户基于电脑、手机等客户端，以串流的方式，远程实时操控Android系统以及应用。本文介绍什么是<span id=\"320003fe2c277\" class=\"ph\" data-tag=\"ph\">无影云手机</span>。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250124/85289530ef2cb8ea2de8ec66d584d69c.png\" /></p>\n<h3>2、为什么选择无影云手机？</h3>\n<p>无影云手机专为满足<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>端算力上云的需求而设计。它提升了大规模云手机部署与管理的效率，通过ARM服务器以及虚拟化技术，构建了一个支持端云协同的安卓应用运行环境，并基于无影的ASP协议与多种客户端实现跨端接入的流畅交互体验，为用户提供高效、灵活的云手机服务。<br /><br />用户无需实体手机，仅需借助电脑、平板等设备，就能通过串流技术和无影云手机进行实时的交互，在云端运行安卓应用程序。无影云手机可广泛应用于<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>办公、游戏以及广告营销等场景。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250124/43964120f1f4dda2759cc710d6cf1376.png\" /></p>\n<p>&nbsp;</p>', 0, 1739991601),
(25, '阿里云国际专有宿主机', '专有宿主机', 'alibabacloud-exclusive-host', 98, '专有宿主机（Dedicated Host，简称DDH）是阿里云专为企业用户定制优化的全托管云服务器。具有物理资源独享、部署更灵活、配置更丰富、性价比更高等特点。专有宿主机为单租户独享物理资源，作为该云主机的唯一租户，您不需要与其他租户共享云主机所有物理资源。同时宿主机上可以灵活创建ECS云服务器，并和其他ECS云服务器一样，可以挂载云盘，可以通过VPC联通，具有高度的灵活性和使用便捷性。', '200.00', '<h2>什么是专有宿主机？</h2>\n<p>公共云上的专有资源池，提供<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、灵活资源的物理独占部署方案，为企业级用户提供更加可控的云上环境。</p>\n<p>专有宿主机（Dedicated Host，简称DDH）是阿里云专为企业用户定制优化的全托管云服务器。具有物理资源独享、部署更灵活、配置更丰富、性价比更高等特点。专有宿主机为单租户独享物理资源，作为该云主机的唯一租户，您不需要与其他租户共享云主机所有物理资源。同时宿主机上可以灵活创建ECS云服务器，并和其他ECS云服务器一样，可以挂载云盘，可以通过VPC联通，具有高度的灵活性和使用便捷性。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250124/43867a8660521cb29bdc671dc5cbc65e.png\" /></p>\n<h3 class=\"content-title text-lg\"><strong data-spm-anchor-id=\"a3c0i.17704498.3893875490.i0.5ffe74cd0YWmwr\">成本优化型部署方案</strong></h3>\n<div class=\"content-item bottom-line\">\n<h3 class=\"item-title text-base\"><strong>提升资源利用率降低成本</strong></h3>\n<p class=\"item-text text-sm\">对于非突发性的稳态业务，专有宿主机（DDH）能够有效的提升资源利用率资源。对于低CPU负载的业务，如内部系统、开发和测试环境等，可以通过CPU超分技术有效的控制成本。 对于项目和团队，可以使用专有宿主机形成独享资源池，有效管理资源使用和IT预算。</p>\n</div>\n<div class=\"content-item bottom-line\">\n<h3 class=\"item-title text-base\"><strong>方案优势</strong></h3>\n<p class=\"item-text text-sm\">避免CPU使用率低造成IT投入浪费，提高对云资源管理程度，有效控制成本。</p>\n<h3 class=\"content-title text-lg\"><strong data-spm-anchor-id=\"a3c0i.17704498.3893875490.i3.5ffe74cd0YWmwr\">新零售行业部署方案</strong></h3>\n<div class=\"content-item bottom-line\">\n<h3 class=\"item-title text-base\"><strong>独享服务器下更高层级的安全可控</strong></h3>\n<p class=\"item-text text-sm\">基于灵活的规格配比形式，实现互联网业务更多样的架构部署需求。对于不同的业务负载采用不同的方案提升资源利用率。对于消费者（2C）业务采用CPU锁定技术保证高负载情况下的性能稳定，对于内部系统和开发测试环境采用CPU超分技术降低成本。</p>\n</div>\n<div class=\"content-item bottom-line\">\n<h3 class=\"item-title text-base\"><strong>方案优势</strong></h3>\n<p class=\"item-text text-sm\">独享物理机的所有资源，包括CPU、内存、网卡，保证性能的绝对稳定，保证实例间互访的稳定性。</p>\n<h3 class=\"content-title text-lg\"><strong data-spm-anchor-id=\"a3c0i.17704498.3893875490.i6.5ffe74cd0YWmwr\">游戏行业部署方案</strong></h3>\n<div class=\"content-item bottom-line\">\n<h3 class=\"item-title text-base\"><strong>灵活自主的业务层级构建</strong></h3>\n<p class=\"item-text text-sm\">利用资源池隔离的产品特性，实现不同游戏业务的分池管理，同时可根据游戏的不同生命周期阶段进行灵活调配，达到较高的资源使用率。</p>\n</div>\n<div class=\"content-item bottom-line\">\n<h3 class=\"item-title text-base\"><strong>方案优势</strong></h3>\n<p class=\"item-text text-sm\">资源方案匹配游戏生命，达到最优性价比。</p>\n<h3 class=\"content-title text-lg\"><strong data-spm-anchor-id=\"a3c0i.17704498.3893875490.i9.5ffe74cd0YWmwr\">新零售行业部署方案</strong></h3>\n<div class=\"content-item bottom-line\">\n<h3 class=\"item-title text-base\"><strong>低CPU负载业务场景下的最优架构</strong></h3>\n<p class=\"item-text text-sm\">依托于新零售行业的业务使用形态，借助于CPU超分技术从而达到更高的资源利用率。</p>\n</div>\n<div class=\"content-item bottom-line\">\n<h3 class=\"item-title text-base\"><strong>方案优势</strong></h3>\n<p class=\"item-text text-sm\">根据业务场景及资源使用情况，实现最优业务配比。</p>\n</div>\n</div>\n</div>\n</div>', 0, 1740078001),
(26, '阿里云国际神龙弹性裸金属服务器', '弹性裸金属服务器', 'alibabacloud-elastic-bare-metal-server', 98, '弹性裸金属服务器（ECS Bare Metal Instance）是一款同时兼具虚拟机弹性和物理机性能及特性的新型计算类产品，是基于阿里云完全自主研发的下一代虚拟化技术而打造的新型计算类服务器产品。与上一代虚拟化技术相比，下一代虚拟化技术的主要创新在于，不仅支持普通虚拟云服务器，而且全面支持嵌套虚拟化技术，保留了普通云服务器的资源弹性，并借助嵌套虚拟化技术保留了物理机的体验。', '500.00', '<p>弹性裸金属服务器（ECS Bare Metal Instance）是一种弹性可<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>伸缩的高性能计算服务，计算性能与传统物理机无差别，具有安全物理隔离的特点，分钟级的交付周期助你的企业获得实时的业务响应能力，助力核心业务飞速成长。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250124/d0b4b87fea105c0423d03ab6090cd31f.png\" /></p>\n<h2 id=\"title-f3a-ej5-hkl\" class=\"title\" data-tag=\"title\" data-spm-anchor-id=\"a2c63.p38356.0.i1.680f342af2ljyj\">弹性裸金属服务器介绍</h2>\n<p id=\"p-v3q-udi-s6t\" class=\"p\" data-tag=\"p\">弹性裸金属服务器（ECS Bare Metal Instance）是基于阿里云完全自主研发的下一代虚拟化技术而打造的新型计算类服务器产品，兼具虚拟机的弹性和物理机的性能及功能特性。与上一代虚拟化技术相比，下一代虚拟化技术不仅保留了普通云服务器的弹性体验，而且保留了物理机的性能与特性，全面支持嵌套虚拟化技术。</p>\n<div id=\"ee18bad03fojm\" class=\"note note-note\">\n<div class=\"noteContentSpan\">\n<p id=\"92e7bfc36bqe0\">弹性裸金属服务器二次虚拟化能力默认开启。</p>\n</div>\n</div>\n<p id=\"p-zei-vjo-opa\" class=\"p\" data-tag=\"p\">弹性裸金属服务器融合了物理机与云服务器的优势，实现超强超稳的计算能力。通过阿里云自主研发的虚拟化2.0技术，您的业务应用可以直接访问弹性裸金属服务器的处理器和内存，无任何虚拟化开销。弹性裸金属服务器具备物理机级别的完整处理器特性（例如Intel VT-x），以及物理机级别的资源隔离优势，特别适合上云部署传统非虚拟化场景的应用。</p>\n<p id=\"p-19c-cb5-yd4\" class=\"p\" data-tag=\"p\">弹性裸金属服务器是阿里云通过自研芯片、自研Hypervisor系统以及重新定义服务器硬件架构等软硬件技术打造的深度融合了物理机和虚拟机特性的创新型计算产品。弹性裸金属服务器开创了一种新型的云服务器形式，它能与阿里云产品家族中的其他产品（例如存储、网络、数据库等）无缝对接，并完全兼容ECS云服务器实例的镜像系统，从而可更多元化地结合您的业务场景进行资源构建。</p>\n<div id=\"p-3lx-qig-ld1\" class=\"p\" data-tag=\"p\">\n<p id=\"a166717030bev\">使用弹性裸金属服务器时，请注意：</p>\n<p id=\"a166717130pef\">1、不支持规格变配。</p>\n<p id=\"a166717230cky\">2、当弹性裸金属服务器发生硬件故障时，支持故障转移，数据都保留在云盘中。</p>\n<p id=\"e929cb723coyl\">3、暂无法获取EBM弹性裸金属实例的CPU基础监控信息，您可通过安装云监控插件获取CPU监控信息。</p>\n<h2 id=\"title-gqi-tj7-216\" class=\"title\" data-tag=\"title\" data-spm-anchor-id=\"a2c63.p38356.0.i3.680f342af2ljyj\">产品优势</h2>\n<div id=\"p-fgu-4gt-ozo\" class=\"p\" data-tag=\"p\">\n<p id=\"a166717330p41\">弹性裸金属服务器通过技术创新实现客户价值。具体而言，弹性裸金属服务器具有以下优势：</p>\n<p id=\"a1667174300qq\">1、用户独占计算资源</p>\n<p id=\"dcaaac0f04c7y\">作为一款云端弹性计算类产品，弹性裸金属服务器具备了物理机级的性能和隔离性。您可以独占计算资源，并且没有虚拟化性能开销和特性损失。在CPU规格选择上支持80核、96核、104核、128核、192核等多个规格实例。</p>\n<p id=\"a1667175307az\">2、加密计算</p>\n<p id=\"p-zto-1w9-b39\" class=\"p\" data-tag=\"p\">在安全性方面，弹性裸金属服务器除了具备物理隔离特性外，为了更好地保障您云上数据的安全性，弹性裸金属服务器采用了芯片级可信执行环境（Intel&nbsp;<sup>&reg;</sup> SGX），能确保加密数据只能在安全可信的环境中计算。芯片级的硬件安全保障相当于为您云上的数据提供了一个保险箱功能，您可以自己掌控数据加密和密钥保护的全部流程。</p>\n<p id=\"a1675bd030rjm\">3、兼容多种专有云</p>\n<p id=\"p-1l2-dtc-hwc\" class=\"p\" data-tag=\"p\">弹性裸金属服务器可以进一步解决您对高性能计算的强需求，更好地帮助您搭建新型混合云。弹性裸金属服务器不仅具有虚拟机的灵活性和弹性，同时具备物理机的一切特性和优势，因此也具备再次虚拟化的能力，线下的私有云均可无缝平移到阿里云上，而不用担心嵌套虚拟化带来的性能开销，为您上云提供一种新途径。</p>\n<p id=\"a16782e0306p6\">4、异构指令集处理器支持</p>\n<p id=\"p-bz3-cyf-25g\" class=\"p\" data-tag=\"p\">弹性裸金属服务器采用阿里云完全自主研发的虚拟化2.0技术，支持ARM等其他指令集处理器。</p>\n<p class=\"p\" data-tag=\"p\">&nbsp;</p>\n</div>\n</div>', 0, 1740078001),
(27, '阿里云国际GPU云服务器', 'GPU云服务器', 'alibaba-cloud-international-gpu-cloud-server', 98, '阿里云GPU云服务器提供软件与硬件结合的完整服务体系，助力您在人工智能业务中实现资源的灵活分配、弹性扩展、算力的提升以及成本的控制，通常适用于深度学习，视频编解码，视频处理，科学计算，图形可视化，云游戏等场景。', '500.00', '<h2 class=\"solution-title\"><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.28229797.2738286620.i1.2ffd2d49t8WYYJ\">GPU云服务器</span></h2>\n<p class=\"solution-text text-base font-color\">包含了GPU计算加速器的弹性计算实例，适用于人工智能（深度学习，机器学习等）、高性能计算、<br />专业图形图像处理等场景</p>\n<p class=\"solution-text text-base font-color\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250124/770fd5433345c76b066055aa9d5d05ec.png\" /></p>\n<h3 class=\"adv-title text-xxl col-md-4\" data-spm-anchor-id=\"a3c0i.28229797.9369764240.i2.2ffd2d49t8WYYJ\">全场景支持异构计算</h3>\n<p class=\"adv-desc\" data-spm-anchor-id=\"a3c0i.28229797.9369764240.i0.2ffd2d49t8WYYJ\">阿里云GPU云服务器提供软件与硬件结合的完整服务体系，助力您在人工智能业务中实现资源的灵活分配、弹性<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、算力的提升以及成本的控制，通常适用于深度学习，视频编解码，视频处理，科学计算，图形可视化，云游戏等场景。</p>\n<p class=\"adv-desc\">阿里云GPU云服务器提供GPU加速计算能力，实现GPU计算资源的即开即用和弹性伸缩。GPU在执行复杂的数学和几何计算方面有着独特的优势，特别是在浮点运算、并行运算等方面，GPU可以提供上百倍于CPU的计算能力。</p>\n<h3 class=\"text-md list-title otherLister\" data-spm-anchor-id=\"a3c0i.28229797.9369764240.i3.2ffd2d49t8WYYJ\">多样化计算能力</h3>\n<p class=\"text-sm list-desc lister\">拥有大量擅长处理大规模并发计算的算术逻辑单元（ALU），持续采用最新GPU加速芯片，提供FPGA, GPU, ASIC等多种加速卡，为AI，图形，转码，加密等不同业务提供服务。</p>\n<h3 class=\"text-md list-title otherLister\" data-spm-anchor-id=\"a3c0i.28229797.9369764240.i5.2ffd2d49t8WYYJ\">简单易用</h3>\n<p class=\"text-sm list-desc lister\">全球部署GPU资源充裕，分布广泛，逻辑控制单元相对简单，可以随时应对客户业务弹性扩容。 提供AIACC AI加速引擎，FastGPU套件，cGPU套件等专有的辅助工具。</p>\n<h3 class=\"text-md list-title otherLister\" data-spm-anchor-id=\"a3c0i.28229797.9369764240.i7.2ffd2d49t8WYYJ\">高网络性能</h3>\n<p class=\"text-sm list-desc lister\">采用神龙计算架构提升服务器性能降低IO延迟，最大支持2400万pps和64GbpsVPC网络及800G高带宽RDMA网络，能够支持多线程并行的高吞吐量运算。</p>\n<p class=\"text-sm list-desc lister\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250124/8fa0f272912ff70eb784d544edc8edfb.png\" /></p>', 0, 1740164401),
(28, '阿里云国际弹性伸缩服务', '弹性伸缩', 'alibaba-cloud-international-elastic-scalability-service', 98, '弹性伸缩（Auto Scaling）是根据用户的业务需求和策略，自动调整其弹性计算资源的管理服务。用户根据自己的业务需求自动调整其弹性计算资源，在业务需求增长时，无缝地增加ECS实例，并在业务需求下降时，自动减少ECS实例以节约成本。弹性伸缩是一个免费的服务，但是通过弹性伸缩自动创建的ECS实例，需要按照ECS按量付费类型的实例标准进行付费。', '100.00', '<h2 data-spm-anchor-id=\"a2c63.p38356.0.i1.3c3455a0kEzCPm\">什么是弹性伸缩ESS？</h2>\n<p>弹性伸缩（Elastic Scaling Service，简称ESS），也称为Auto Scaling，其能根据您设定的策略自动调整计算资源数量（即业务所需的实例数量），帮助您应对业务流量波动的同时，提高资源利用率，有效降低成本。</p>\n<h3 id=\"title-u70-33s-7t1\" class=\"title\" data-tag=\"title\" data-spm-anchor-id=\"a2c63.p38356.0.i3.3c3455a0kEzCPm\">为什么选择弹性伸缩</h3>\n<p>在业务需求增长时，弹性伸缩自动增加指定类型的实例（即ECS实例或ECI实例），来保证计算能力；在业务需求下降时，弹性伸缩自动减少指定类型的实例（即ECS实例或ECI实例），来节约成本。当您的业务需求量有波动时，弹性伸缩能够帮助您自动调整指定类型的实例数量，以满足业务需求。</p>\n<p id=\"p-dx9-bf2-acy\" class=\"p\" data-tag=\"p\" data-spm-anchor-id=\"a2c63.p38356.0.i5.3c3455a0kEzCPm\">弹性伸缩仅支持ECS实例或ECI实例数量的增加和减少，但不支持单个ECS实例或ECI实例的配置变更。例如需要调整ECS实例的CPU、内存和带宽等配置，您可以通过阿里云运维编排服务（Operation Orchestration Service，简称OOS）功能来实现。</p>\n<p id=\"p-gbj-y8w-6lg\" class=\"p\" data-tag=\"p\">弹性伸缩可以根据业务需求，自动创建或者移出ECS实例或ECI实例。</p>', 0, 1740164401),
(29, '阿里云国际批量计算服务', '批量计算', 'alibaba-cloud-international-batch-computing-service', 98, '批量计算（BatchCompute）是一种适用于大规模并行批处理作业的分布式云服务。BatchCompute支持海量作业并发规模，系统自动完成资源管理、作业调度和数据加载，并按实际使用量计费。BatchCompute广泛应用于电影动画渲染、生物数据分析、多媒体转码、金融保险分析、科学计算等领域。', '200.00', '<h2 class=\"solution-title\"><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.17706395.1571533340.i0.529321c47E4JK0\">批量计算</span></h2>\n<p class=\"solution-text text-base font-color\">简单易用的大规模批处理计算服务</p>\n<h3 id=\"h2-u4EC0u4E48u662Fu6279u91CFu8BA1u7B971\" data-spm-anchor-id=\"a2c63.p38356.0.i1.1d102ebbvQKXBa\">什么是批量计算</h3>\n<p>批量计算（BatchCompute）是一种适用于大规模并行批处理作业的分布式云服务。BatchCompute可支持海量作业并发规模，系统自动完成资源管理、作业调度和数据加载，并按实际使用量计费。</p>\n<p>通俗的讲，就是您可以提交一个任意的计算机程序，让它在阿里云的多个VM实例上同时运行，然后把结果写入到指定的持久化存储位置（如阿里云对象存储OSS或者文件存储NAS），然后您可以去指定的位置查看结果。</p>', 0, 1740250801),
(30, '阿里云国际版块存储', '块存储', 'alibaba-cloud-international-storage', 99, '块存储是为云服务器ECS提供的低时延、持久性、高可靠的数据块级存储产品。块存储支持在可用区内自动复制您的数据，防止意外硬件故障导致的数据不可用，保护您的业务免于组件故障的威胁。就像对待硬盘一样，您可以对挂载到ECS实例上的块存储做分区、创建文件系统等操作，并对数据持久化存储。', '100.00', '<h2><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.20891936.9568391180.i0.69e36803BE65Iw\">块存储</span></h2>\n<p><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.20891936.9568391180.i0.69e36803BE65Iw\">为云服务器ECS提供的高性能、低延时、高可靠的数据块级存储产品</span></p>\n<p><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.20891936.9568391180.i0.69e36803BE65Iw\">块存储介绍：</span></p>\n<p><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.20891936.9568391180.i0.69e36803BE65Iw\">块存储是为云服务器ECS提供的低时延、持久性、高可靠的数据块级存储产品。块存储支持在可用区内自动复制您的数据，防止意外硬件故障导致的数据不可用，保护您的业务免于组件故障的威胁。就像对待硬盘一样，您可以对挂载到ECS实例上的块存储做分区、创建文件系统等操作，并对数据持久化存储。</span></p>\n<p><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.20891936.9568391180.i0.69e36803BE65Iw\"><img title=\"\" src=\"https://kaihudata.oss-cn-shenzhen.com/storage/editor/20250201/af362f68e6c32c641667822aecf9a706.png\" /></span></p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/af362f68e6c32c641667822aecf9a706.png\" /></p>', 0, 1740250801),
(31, 'alibabaCloud文件存储 NAS', '文件存储 NAS', 'alibaba-cloud-file-storage-nas', 99, '文件存储 NAS（ File Storage NAS）是一种分布式的网络文件存储，为ECS、HPC、Docker、BatchCompute 等提供安全、无限容量、高性能、高可靠、简单易用的文件存储服务。', '200.00', '<h2 class=\"solution-title\" data-spm-anchor-id=\"a2796.10410706.6353276190.i1.4be11af8TkhXDv\"><span class=\"font-color\" data-spm-anchor-id=\"a2796.10410706.6353276190.i0.4be11af8TkhXDv\">文件存储 NAS</span></h2>\n<p><span class=\"font-color\" data-spm-anchor-id=\"a2796.10410706.6353276190.i0.4be11af8TkhXDv\">无需对现有应用做任何修改，即可使用具备无限容量及性能扩展等特性的分布式文件系统</span></p>\n<h3><span class=\"font-color\" data-spm-anchor-id=\"a2796.10410706.6353276190.i0.4be11af8TkhXDv\">什么是文件存储？</span></h3>\n<p><span class=\"font-color\" data-spm-anchor-id=\"a2796.10410706.6353276190.i0.4be11af8TkhXDv\">文件存储 NAS（ File Storage NAS）是一种分布式的网络文件存储，为ECS、HPC、Docker、BatchCompute 等提供安全、无限容量、高性能、高可靠、简单易用的文件存储服务。</span></p>\n<h3><span class=\"font-color\" data-spm-anchor-id=\"a2796.10410706.6353276190.i0.4be11af8TkhXDv\">文件存储有什么优点？</span></h3>\n<p><span class=\"font-color\" data-spm-anchor-id=\"a2796.10410706.6353276190.i0.4be11af8TkhXDv\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/6b8647b4541e0226726b4df384061171.png\" /></span></p>\n<p data-spm-anchor-id=\"a2796.10410706.9689719970.i1.4be11af8TkhXDv\">基于阿里云新一代分布式存储技术，超低时延，超高IOPS</p>\n<p class=\"body-h2-keep\">高性能</p>\n<p>基于RDMA 协议 (RoCE) 网络缩短IO访问的网络时延，NVMe SSD磁盘技术，提供超高性能。</p>\n<p class=\"body-h2-keep\">高可靠</p>\n<p>多份数据拷贝，99.999999999%的数据可靠性设计，远高于传统存储厂商提供的磁盘<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>raid的可靠性。</p>\n<p class=\"body-h2-keep\">高可用</p>\n<p>所有节点无单点问题，99.9%的高可用设计。</p>', 0, 1740337201),
(32, 'AlibabaCloud文件存储 CPFS', '文件存储 CPFS', 'alibabacloud-cpfs-file-storage', 99, '文件存储CPFS（Cloud Parallel File Storage）是阿里云完全托管、可扩展的并行文件存储系统，针对高性能计算场景的性能要求进行了深度优化，提供对数据毫秒级的访问和百万级IOPS的数据读写请求，可以用于AI深度训练、自动驾驶、基因计算、EDA仿真、石油勘探、气象分析、机器学习、大数据分析以及影视渲染等业务场景中。', '200.00', '<h2>文件存储 CPFS</h2>\n<p>文件存储CPFS（Cloud Parallel File Storage）是阿里云完全托管、可扩展的并行文件存储系统，针对高性能计算场景的性能要求进行了深度优化，提供对数据毫秒级的访问和百万级IOPS的数据读写请求，可以用于AI深度训练、自动驾驶、基因计算、EDA仿真、石油勘探、气象分析、机器学习、大数据分析以及影视渲染等业务场景中。</p>\n<h3 data-spm-anchor-id=\"a3c0i.28525325.4370041850.i0.20de66e1xuMwZ7\">高性能文件存储服务</h3>\n<p class=\"text-base \">文件存储 CPFS（Cloud Parallel File Storage）是阿里云推出的全托管、可扩展并行文件系统，满足高性能计算场景的需求。</p>\n<p class=\"text-base \">文件存储 CPFS 提供了统一的命名空间，支持成百上千的机器同时访问，拥有数十 GB 的吞吐、数百万的 IOPS 能力的同时还能保证亚毫秒级的延时。</p>\n<p class=\"text-base \">文件存储 CPFS 应用于 AI 训练、自动驾驶、基因计算、影视渲染、石油勘探、气象分析、EDA 仿真等场景，适用于高吞吐、高IOPS，海量文件的 IO 密集型业务。</p>\n<p class=\"text-base \"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/71a38b0a66a84ee0a67f1a1aac0bd365.png\" /></p>\n<p class=\"text-base \"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/317c3390d1fc5ea4a6659c8c870cd542.png\" /></p>', 0, 1740337201),
(33, 'AlibabaCloud 表格存储', '表格存储', 'alibabacloud-table-storage', 99, '表格存储（Tablestore）是构建在阿里云飞天分布式系统之上的分布式NoSQL数据存储服务，根据99.99%的高可用以及11个9的数据可靠性的标准设计。表格存储通过数据分片和负载均衡技术，实现数据规模与访问并发上的无缝扩展，提供海量结构化数据的存储和实时访问。', '200.00', '<h2 class=\"solution-title\" data-spm-anchor-id=\"a2796.7980079.8063492900.i1.2f053ea5WeFc4I\"><span class=\"font-color\" data-spm-anchor-id=\"a2796.7980079.8063492900.i0.2f053ea5WeFc4I\">表格存储</span></h2>\n<p class=\"solution-text text-base font-color\">表格存储是构建在阿里云飞天分布式系统之上的NoSQL数据存储服务，提供海量结构化和半结构化<br />数据的存储和实时访问。</p>\n<h3 class=\"solution-text text-base font-color\">产品详情</h3>\n<p data-spm-anchor-id=\"a2796.7980079.7702765500.i0.2f053ea5WeFc4I\">多维度、多层次的的安全防护与访问控制，保障您的数据安全</p>\n<p class=\"body-h2-keep\">灵活的鉴权、授权机制</p>\n<p>提供表级别和API级别的鉴权，授权机制，支持STS临时授权和自定义权限认证及主子账号功能</p>\n<p class=\"body-h2-keep\">多种网络支持</p>\n<p>支持互联网、ECS内网及VPC私有网络访问，提供网络访问控制功能</p>\n<p class=\"body-h2-keep\">资源隔离</p>\n<p>有一个系统可以按用户级别分隔对资源的访问。</p>\n<p><img title=\"\" src=\"https://kaihudata.oss-cn-shenzhen.com/storage/editor/20250201/a283ac3e684e745ce892ac36ced41041.png\" /><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/a283ac3e684e745ce892ac36ced41041.png\" alt=\"\" width=\"756\" height=\"525\" /></p>', 0, 1740423601),
(34, '阿里云国际版存储容量单位包', '存储容量单位包', 'alibabacloud-international-edition-storage-capacity-unit-pack', 99, '存储容量单位包，Storage Capacity Unit (SCU) 可用于抵扣多种不同类型云存储产品的按量付费账单，致力于简化您的存储产品采购过程。搭配ECS预留实例券使用，您可以更加便利地规划您的云计算资源支出。同时可以轻松将计算与存储资源解耦，支持云盘与实例的任意挂载和卸载，让云资源更加灵活的匹配您的业务需求。', '200.00', '<h2 class=\"solution-title\"><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.15045698.3645379440.i0.304555065QlyZD\">存储容量单位包</span></h2>\n<p class=\"solution-text text-base font-color\">降低资源规划难度，优化总持有成本， 同时保持存储产品使用灵活性。</p>\n<h4 class=\"font-common \" data-spm-anchor-id=\"a3c0i.15045698.9853105780.i2.304555065QlyZD\">兼具性价比与资源使用的灵活性</h4>\n<p class=\"text-base \" data-spm-anchor-id=\"a3c0i.15045698.9853105780.i0.304555065QlyZD\">存储容量单位包，Storage Capacity Unit (SCU) 可用于抵扣多种不同类型云存储产品的按量<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>账单，致力于简化您的存储产品采购过程。</p>\n<p class=\"text-base \">搭配ECS预留实例券使用，您可以更加便利地规划您的云计算资源支出。同时可以轻松将计算与存储资源解耦，支持云盘与实例的任意挂载和卸载，让云资源更加灵活的匹配您的业务需求。</p>\n<p class=\"text-base \"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/7d4b958236cb6dbd322b47d9e26024de.png\" alt=\"\" width=\"682\" height=\"484\" /></p>', 0, 1740423601),
(35, '阿里云国际版日志服务', '日志服务', 'alibabacloud-international-log-service', 99, '日志服务SLS是云原生观测与分析平台，为Log、Metric、Trace等数据提供大规模、低成本、实时的平台化服务。日志服务一站式提供数据采集、加工、查询与分析、可视化、告警、消费与投递等功能，全面提升您在研发、运维、运营、安全等场景的数字化能力。', '200.00', '<h2 class=\"solution-title\" data-spm-anchor-id=\"a2796.139174.3353161500.i1.42751d36Kov8kj\"><span class=\"font-color\" data-spm-anchor-id=\"a2796.139174.3353161500.i0.42751d36Kov8kj\">日志服务</span></h2>\n<p class=\"solution-text text-base font-color\" data-spm-anchor-id=\"a2796.139174.3353161500.i3.42751d36Kov8kj\">针对日志类数据一站式服务</p>\n<p class=\"solution-text text-base font-color\" data-spm-anchor-id=\"a2796.139174.3353161500.i3.42751d36Kov8kj\">日志服务（SLS）是针对实时数据一站式服务，在阿里集团经历大量大数据场景锤炼而成。提供日志类数据采集、消费、投递及查询分析功能，全面提升海量日志处理/分析能力。</p>\n<p data-spm-anchor-id=\"a2796.139174.3536858100.i1.42751d36Kov8kj\">使用便捷，5分钟即可接入，无管理成本。</p>\n<p class=\"body-h2-keep\">易用性强</p>\n<p>5分钟即可接入服务进行使用，Agent支持任意网络下数据采集。</p>\n<p class=\"body-h2-keep\">LogHub</p>\n<p>覆盖Kafka 100%功能，并提供弹性伸缩、延迟报警等机制；完整支持各种流计算系统：Spark Streaming/Storm/StreamCompute/Flink/ConsumerLibrary(自动负载均衡模式）；与第三方服务深度<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>：Cloud Monitor，ARMS 等；使用成本为自建50%以下。</p>\n<p class=\"body-h2-keep\">LogSearch/Analytics</p>\n<p>提供保存查询、仪表盘和报警功能、使用成本为自建 20%以下。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/65cc35c59f82dd123cc3270f7499bbf6.png\" alt=\"\" width=\"763\" height=\"736\" /></p>', 0, 1740510001),
(36, '阿里云国际云备份', '云备份', 'alibabacloud-international-cloud-backup', 99, '云备份作为阿里云统一灾备平台，是一种简单易用、敏捷高效、安全可靠的公共云数据管理服务，可以为阿里云ECS整机、ECS数据库、文件系统、NAS、OSS以及自建机房内的文件、数据库、虚拟机、大规模NAS等提供备份、容灾保护以及策略化归档管理。', '200.00', '<h2 class=\"solution-title col-md-7\"><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.15210085.9696602100.i0.358671dbABJe3P\">云备份</span></h2>\n<p class=\"solution-&lt;a href=\" title=\"\">云备份作为阿里云统一灾备平台，是一种简单易用、敏捷高效、安全可靠的公共云数据管理服务，可以为阿里云ECS整机、ECS数据库、文件系统、NAS、OSS以及自建机房内的文件、数据库、虚拟机、大规模NAS等提供备份、容灾保护以及策略化归档管理。</p>\n<h3 class=\"h2s\" data-spm-anchor-id=\"a3c0i.15210085.6691962290.i0.358671dbABJe3P\">安全且可扩展的数据保护解决方案</h3>\n<p class=\"desc\">云备份为您的云上和自建数据中心内的数据提供兼具安全性，经济性和可扩展性的备份保护。云备份高效的重删压缩引擎和AES256加密功能在极大压缩网络存储的成本的同时保证了安全性，为阿里云上ECS，NAS，OSS上的数据备份，企业数据中心的海量文件和VMware虚拟机备份，以及VMware虚拟机迁移上云提供理想的方案。<br /><br />云备份同时提供软硬一体的灾备存储，用于简化本地数据中心的备份的部署，您无需自备硬件以及安装备份客户端。</p>\n<p class=\"desc\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/25b203eca727e8e56a64ff9098969a5b.png\" alt=\"\" width=\"622\" height=\"618\" /></p>', 0, 1740510001),
(37, '阿里云国际版网盘与相册服务（Beta）', '网盘与相册服务（Beta）', 'online-storage-and-photo-album-service-beta', 99, '网盘与相册服务是提供一站式数据存储、数据分析、AI识别的数据管理开放平台。企业与开发者可快速高效的构建可支撑海量用户的网盘与相册服务。基于阿里云高可用存储及高安全水位的能力提供企业级文件数据管理方案，帮助您解决办公数据的搜索、管理、共享、审计等文件管理难题。同时网盘与相册服务也可根据企业需求定制最佳服务方案，为企业办公新形态升级提供一站式服务。', '200.00', '<h2 class=\"solution-title\"><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.27701000.2242424890.i0.3da65161ZZkLDO\">网盘与相册服务（Beta）</span></h2>\n<p class=\"solution-text text-base font-color\">低代码、高可用、高安全的企业文件管理构建与应用平台</p>\n<div class=\"col-md-7 box\" data-spm-anchor-id=\"a3c0i.27701000.1234094560.i2.3da65161ZZkLDO\">\n<h3 class=\"h2s\" data-spm-anchor-id=\"a3c0i.27701000.1234094560.i1.3da65161ZZkLDO\">轻松打造您的企业存储空间</h3>\n<p class=\"desc\" data-spm-anchor-id=\"a3c0i.27701000.1234094560.i0.3da65161ZZkLDO\">网盘与相册服务是提供一站式数据存储、数据分析、AI识别的数据管理开放平台。企业与开发者可快速高效的构建可支撑海量用户的网盘与相册服务。<br /><br />基于阿里云高可用存储及高安全水位的能力提供企业级文件数据管理方案，帮助您解决办公数据的搜索、管理、共享、审计等文件管理难题。同时网盘与相册服务也可根据企业需求定制最佳服务方案，为企业办公新形态升级提供一站式服务。</p>\n<p class=\"desc\" data-spm-anchor-id=\"a3c0i.27701000.1234094560.i0.3da65161ZZkLDO\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/022592ced86ffc0acfff4808f9f3c1b5.png\" alt=\"\" width=\"548\" height=\"337\" /></p>\n<h3 class=\"text-xl\" data-spm-anchor-id=\"a3c0i.27701000.2764177250.i0.3da65161ZZkLDO\">多种文件管理功能</h3>\n<p class=\"text-sm\">统一存放和管理企业重要的文件资料，提供各类文件增删改查功能，符合用户在本地电脑管理文件的使用习惯，实现本地与云上无差别管理。</p>\n<h3 class=\"text-sm\"><strong>统一存储</strong></h3>\n<p class=\"text-sm\">提供文件上传下载、新建文件及文件夹、移动、复制、删除、排序、收藏、备注等等一系列的文件管理能力。</p>\n<h3 class=\"text-sm\"><strong>在线预览</strong></h3>\n<p class=\"text-sm\">提供文档、图片、音频、视频等十几种文件格式的预览。</p>\n<h3 class=\"text-sm\"><strong>文件<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a></strong></h3>\n<p class=\"text-sm\">支持按照文件名称、文件类型、文件内容等搜索，也支持各种排序方式方便查找文件。</p>\n<h3 class=\"text-sm\"><strong>回收站</strong></h3>\n<p class=\"text-sm\">提供默认保留90天的文件回收站功能，90天内可以恢复文件，90天后文件自动清除。</p>\n<p class=\"text-sm\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/51a356800c39fca65d0540b15d6acb26.png\" alt=\"\" width=\"628\" height=\"572\" /></p>\n</div>', 0, 1740596401),
(38, '阿里云国际智能媒体管理 IMM', '智能媒体管理 IMM', 'alibabacloud-international-intelligent-media-management-imm', 99, 'IMM 是一款云上数据处理产品，通过简单的 Restful API 调用，便可以对云存储中的海量数据发起数据处理操作，如图片处理、视频处理、音频处理、文档处理和文件处理等。', '200.00', '<h2 class=\"solution-title col-md-6\" data-spm-anchor-id=\"a3c0i.29609048.4189431290.i1.1dbb6fc8J7UhOd\"><span class=\"font-color font-title\" data-spm-anchor-id=\"a3c0i.29609048.4189431290.i0.1dbb6fc8J7UhOd\">智能媒体管理 IMM</span></h2>\n<p class=\"solution-&lt;a href=\" title=\"\">IMM 是一款云上数据处理产品，通过简单的 Restful API 调用，便可以对云存储中的海量数据发起数据处理操作，如图片处理、视频处理、音频处理、文档处理和文件处理等。</p>\n<h3 class=\"text-xxl\" data-spm-anchor-id=\"a3c0i.29609048.1820345250.i0.1dbb6fc8J7UhOd\">为什么选择智能媒体管理</h3>\n<p class=\"content text-base\">智能媒体管理提供 60 余项数据处理能力，功能涵盖图片处理、音视频处理、文档处理和文件处理等领域，能够满足如互联网社交、电商、工具、传媒出版、AI 数据准备等众多场景的数据处理需求，具有处理能力多样化、算子智能化、近存储低延迟等优势。</p>\n<h3 class=\"text-xl\" data-spm-anchor-id=\"a3c0i.29609048.5428867140.i0.1dbb6fc8J7UhOd\">互联网社交 APP 图片处理</h3>\n<p class=\"text-sm\">利用对象存储 OSS 进行数据存储，客户端请求 OSS 图片文件时，可携带图片处理参数，如添加图文水印、裁剪图片尺寸，以满足不同终端的需求。同时，可利用智能处理能力生成特定任务或场景相册，并进行元数据管理及语义检索（如检索&rdquo;去年今日的出游照片&ldquo;）。<br /><br /><img src=\"https://img.alicdn.com/tfs/TB1n1c8q7Y2gK0jSZFgXXc5OFXa-32-24.png_.webp\" width=\"20\" />&nbsp;<strong>一站式的多样化原子能力</strong>：提供基础图片处理及智能处理能力，快速构建趣味应用，如场景相册或多模态内容检索。<br /><br /><img src=\"https://img.alicdn.com/tfs/TB1n1c8q7Y2gK0jSZFgXXc5OFXa-32-24.png_.webp\" width=\"20\" />&nbsp;<strong>无需数据搬迁</strong>：只需将数据上传到对象存储 OSS 即可通过 OSS API 快速实现数据处理，无需数据的迁移和复制。<br /><br /><img src=\"https://img.alicdn.com/tfs/TB1n1c8q7Y2gK0jSZFgXXc5OFXa-32-24.png_.webp\" width=\"20\" />&nbsp;<strong>高度兼容性</strong>：支持主流的内容分发架构，无需改变已有业务架构，便于集成使用。</p>\n<p class=\"text-sm\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/5915eb79a9b81e875fb1d3a54e341081.png\" alt=\"\" /></p>', 0, 1740596401),
(39, '阿里云国际版闪电立方', '闪电立方', 'alibabacloud-international-version-lightning-cube', 99, '闪电立方通过使用定制的离线迁移设备，安全地将海量用户数据传输到阿里云。该服务解决了本地数据中心大规模数据传输上云的各种问题，包括迁移周期长、网络专线费用昂贵、数据复制效率低、迁移过程数据安全等。', '200.00', '<h2 class=\"solution-title\" data-spm-anchor-id=\"a2796.11283920.1065973470.i1.5f904a5ccu8kXB\"><span class=\"font-color\" data-spm-anchor-id=\"a2796.11283920.1065973470.i0.5f904a5ccu8kXB\">闪电立方</span></h2>\n<p class=\"solution-text text-base font-color\">提供PB级别端到端的离线数据迁移服务。快速、安全、高效，降低90%的数据迁移成本。</p>\n<p class=\"solution-text text-base font-color\">闪电立方通过使用定制的离线迁移设备，安全地将海量用户数据传输到阿里云。该服务解决了本地数据中心大规模数据传输上云的各种问题，包括迁移周期长、网络专线费用昂贵、数据复制效率低、迁移过程数据安全等。</p>\n<p class=\"body-h2-keep\" data-spm-anchor-id=\"a2796.11283920.9766906190.i0.5f904a5ccu8kXB\">支持多种数据源</p>\n<p>本地文件系统、NAS、HDFS、FastDFS等。</p>\n<p class=\"body-h2-keep\">高效部署</p>\n<p>为数据迁移而生的专业设备、标准机架和电源，可多套同时部署，提升迁移效率。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/6d6625d1ade2382b6586f539ad61c8fd.png\" alt=\"\" width=\"1530\" height=\"1140\" /></p>\n<h3 class=\"tit\" data-spm-anchor-id=\"a2796.11283920.8054499230.i1.5f904a5ccu8kXB\">自助式离线数据迁移</h3>\n<p class=\"intr\">丰富的本地数据源支持，包含本地共享存储，本地存储系统，本地存储阵列，HDFS，fastDFS等。</p>\n<div class=\"&lt;a href=\" title=\"part \">\n<h3>能够提供：</h3>\n<ul>\n<li>\n<p class=\"list-tit\">低成本</p>\n<p class=\"list-con\">相比专线和互联网网络，使用全国次日达的物流体系</p>\n</li>\n<li>\n<p class=\"list-tit\">服务体验佳</p>\n<p class=\"list-con\">提供远程半自助化服务和专人上门</p>\n</li>\n<li>\n<p class=\"list-tit\">低门槛</p>\n<p class=\"list-con\">支持几十TB到上PB的数据迁移</p>\n</li>\n</ul>\n</div>', 0, 1740682801),
(40, '阿里云国际版云存储网关', '云存储网关', 'alibaba-cloud-international-cloud-storage-gateway', 99, '云存储网关（Cloud Storage Gateway：简称CSG）是一款可以部署在用户本地数据中心和阿里云上的网关产品。它以阿里云对象存储（OSS）为后端存储，为云上和云下应用提供业界标准的文件服务（NFS和SMB）和块存储服务（iSCSI），使您可以像操作本地文件夹和磁盘一样操作OSS资源。', '200.00', '<h1 data-spm-anchor-id=\"a2c63.p38356.0.i2.45f37fe7eGlNFc\">什么是云存储网关CSG</h1>\n<p>云存储网关（Cloud Storage Gateway：简称CSG）是一款可以部署在用户本地数据中心和阿里云上的网关产品。它以阿里云对象存储（OSS）为后端存储，为云上和云下应用提供业界标准的文件服务（NFS和SMB）和块存储服务（iSCSI），使您可以像操作本地文件夹和磁盘一样操作OSS资源。</p>\n<h2 id=\"b19a1330ceo56\" data-spm-anchor-id=\"a2c63.p38356.0.i4.45f37fe7eGlNFc\"><strong data-spm-anchor-id=\"a2c63.p38356.0.i3.45f37fe7eGlNFc\">产品概述</strong></h2>\n<p id=\"c24f2bd3646wn\" data-spm-anchor-id=\"a2c63.p38356.0.i5.45f37fe7eGlNFc\">云存储网关（CSG）提供了文件网关和块网关两种形态，请根据使用场景选择合适的类型：</p>\n<h3 id=\"de96e3d746hxt\">1、文件网关</h3>\n<p id=\"p-j57-9o9-x5x\" class=\"p\" data-tag=\"p\">文件网关将OSS Bucket的对象结构与NAS文件系统的目录/文件建立映射关系。用户通过标准的NFS和SMB协议即可读写指定OSS Bucket里的对象。并且利用本地存储空间作为热数据缓存，使用户在享受OSS Bucket海量空间的同时，保障数据访问的高性能。文件网关还高度兼容POSIX和第三方备份软件。如果是小文件的备份和共享读写场景，推荐使用标准型或基础型文件网关；如果对性能有一定要求或者同时有多个客户端访问数据的用户，推荐使用增强型/性能型文件网关。</p>\n<h3 id=\"946433906d2p1\">2、块网关</h3>\n<p id=\"p-uu1-fyi-2qp\" class=\"p\" data-tag=\"p\">块网关在OSS中创建存储卷，并通过Internet小型计算机系统接口（iSCSI）协议访问。挂载客户端的本地应用程序可将这些卷作为iSCSI目标进行访问。块网关提供两种模式：透传模式和缓存模式。</p>\n<p id=\"79cbe900cci8c\">透传模式可以将块卷数据切片同步上云，适用于高速链路（如专线）的客户。</p>\n<p id=\"49e7a287a11qq\">缓存模式通过对网关机器本身的本地缓存盘进行读写加速，并将缓存数据异步上云，适用于期望本地快速访问而上云链路慢的客户。</p>\n<h3 id=\"title-biw-67a-y56\" class=\"title\" data-tag=\"title\" data-spm-anchor-id=\"a2c63.p38356.0.i7.45f37fe7eGlNFc\">产品架构</h3>\n<p id=\"p-paq-vtv-bz2\" class=\"p\" data-tag=\"p\">云存储网关的云上服务和部署在客户<span id=\"76491445d5zf8\" class=\"ph\" data-tag=\"ph\" data-cond-props=\"intl\">数据中心</span>的存储网关实例可以形成存储网关集群。通过这个集群，文件数据可以在云上集群和线下集群之间自由流动，帮助实现数据和业务的协同迁移，典型的场景有文件备份、数据分发和容灾。同时通过集群也可以实现在多个物理机房快速<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>数据。</p>\n<p id=\"p-7iv-a28-htk\" class=\"p\" data-tag=\"p\">作为一个轻量级的存储网关，可在用户本地的数据中心部署，也可在阿里云上部署。</p>\n<p class=\"p\" data-tag=\"p\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/b785952536d903b45ff7a7bc604718d6.png\" alt=\"\" width=\"1756\" height=\"832\" /></p>', 0, 1740682801);
INSERT INTO `mx_cloud` (`id`, `title`, `name`, `alias`, `cid`, `des`, `usd`, `intro`, `status`, `addtime`) VALUES
(41, '阿里云国际版混合云存储阵列', '混合云存储阵列', 'alibaba-cloud-international-hybrid-cloud-storage-array', 99, '集成了阿里云云存储网关的企业级统一存储阵列，将云存储的低成本和可扩展性与生产环境的高性能和高可用性相结合，提供了一种经济高效，易于管理的存储解决方案。本地存储通过云缓存、云同步、云分层、云备份等方式无缝连通云存储。混合云存储阵列和云存储服务相结合提供了一种经济高效，易于管理的混合云存储解决方案。', '200.00', '<h1 data-spm-anchor-id=\"a2c63.p38356.0.i0.4a3363b8q5eFYu\">什么是混合云存储？</h1>\n<p id=\"shortdesc-x18-w78-ulo\" class=\"shortdesc\" data-tag=\"shortdesc\" data-spm-anchor-id=\"a2c63.p38356.0.i1.4a3363b8q5eFYu\">阿里云提供针对私有云、容器、数据库、海量数据存储、HPC、AI和大数据等业务场景，基于混合云架构，提供云上弹性空间、软硬件一体集成的混合云存储服务。本文介绍混合云存储的基本信息等，帮助您选择最适合您业务场景和需求的混合云存储服务。</p>\n<div id=\"conbody-fjo-m0g-qpu\" class=\"conbody body\" data-tag=\"conbody\">\n<p id=\"p-44j-sqm-utt\" class=\"p\" data-tag=\"p\">混合云存储包括<span id=\"b795c5c88dd64\" class=\"ph\" data-tag=\"ph\">SA混合云存储阵列</span>、<span id=\"0de0cefaf3x8t\" class=\"ph\" data-tag=\"ph\">CPFS并行文件存储</span>、<span id=\"e4385be4574td\" class=\"ph\" data-tag=\"ph\">SDS分布式存储</span>等多种形态，您可以像使用本地存储一样使用和管理本地和云端的各种存储资源（块、文件和对象）。本地存储可以通过云缓存、云同步、云分层、云备份等方式无缝连通云存储，为不同的数据应用场景提供针对性优化的混合云存储解决方案。</p>\n<h3 data-spm-anchor-id=\"a2c63.p38356.0.i3.5f9052b80puEk5\">SA混合云存储阵列</h3>\n<h3 id=\"efc920804eapw\">产品优势</h3>\n<p id=\"p-noj-ap3-t5d\" class=\"p\" data-tag=\"p\">随着云计算技术的普及，越来越多的企业开始选择了部署云计算方案，公共云的灵活性，易用性和可靠性也被大家广泛认可。但也有很多企业对传统存储阵列的依赖度很高，在短期内完全迁移到云端会有诸多的挑战，可能会涉及到系统的重新构建或者应用程序的开发，对客户来说改动量很大，也会面临不小的风险。同时还有很多客户对敏感数据的物理存放地有要求，所以越来越多的企业开始采用混合云来实现面向未来的数字化转型。</p>\n<p id=\"p-abj-mje-g27\" class=\"p\" data-tag=\"p\"></p>\n<p id=\"p-ytt-gdt-y0n\" class=\"p\" data-tag=\"p\">阿里云混合云存储阵列作为软硬一体的存储设备，集成了阿里云存储服务，融合了公共云存储和传统存储阵列的优点：</p>\n<ul id=\"ul-pkm-7ak-yel\" class=\"ul\" data-tag=\"ul\">\n<li id=\"li-ui1-4yq-0xg\" class=\"li\" data-tag=\"li\">\n<p id=\"231a32804aiz7\"><strong id=\"uicontrol-gr0-zob-8hk\" class=\"uicontrol\" data-tag=\"uicontrol\">简单</strong></p>\n<p id=\"p-nxj-n2x-qh3\" class=\"p\" data-tag=\"p\">客户无需更改原有的IT架构，就可以像使用本地存储设备一样使用阿里云混合云存储阵列，同时使用本地存储空间和云端存储空间，无需关注本地设备存储协议同云存储协议之间的兼容性。</p>\n</li>\n<li id=\"li-buy-eo2-vpt\" class=\"li\" data-tag=\"li\">\n<p id=\"231a59904a2fr\"><strong id=\"uicontrol-yyo-vxt-dkj\" class=\"uicontrol\" data-tag=\"uicontrol\">灵活</strong></p>\n<p id=\"p-j35-vww-yxh\" class=\"p\" data-tag=\"p\">与阿里云存储无缝结合，充分利用公共云存储的易于扩展、快速部署、按需付费的优势，快速响应客户业务需求的变化。</p>\n</li>\n<li id=\"li-5f0-c9a-zlx\" class=\"li\" data-tag=\"li\">\n<p id=\"231a59914a05t\"><strong id=\"uicontrol-k6b-wjs-4tp\" class=\"uicontrol\" data-tag=\"uicontrol\">高效</strong></p>\n<p id=\"ef74d4706dw67\">自动云复制，在云端和本地各保存一份数据。如果阵列故障，所有数据保存在云可访问；如果网络故障，所有数据保存在阵列可访问。</p>\n<p id=\"daefe4847cqbw\">云缓存功能确保当数据存放在云端的时候，也能利用本地存储空间的缓存功能，为应用提供快速响应。其中热数据存放在本地存储空间，确保了数据的高速访问。冷数据放在云端，充分利用公共云存储的海量空间。</p>\n</li>\n</ul>\n<ul id=\"6ee88706646n8\">\n<li id=\"li-p8v-v8v-gr2\" class=\"li\" data-tag=\"li\">\n<p id=\"231a80a04apyk\"><strong id=\"uicontrol-qsg-4c9-im3\" class=\"uicontrol\" data-tag=\"uicontrol\">可靠</strong></p>\n<p id=\"p-kzj-cei-bgk\" class=\"p\" data-tag=\"p\">阿里云混合云存储阵列采用了全冗余的硬件设计，支持数据加密、集成AD/LDAP、支持ACL，云端分布式存储提供多副本跨区域保护，11个9的数据高可靠性，完备的数据一致性校验，确保用户数据的安全和可靠。</p>\n</li>\n</ul>\n<p id=\"p-q96-4p7-bmx\" class=\"p\" data-tag=\"p\">阿里云混合云存储阵列专为对存储有高性能和稳定性要求，并且希望无缝上云的企业客户而设计：</p>\n<ul id=\"ul-77k-xpp-nhn\" class=\"ul\" data-tag=\"ul\">\n<li id=\"li-ssc-440-iwg\" class=\"li\" data-tag=\"li\">\n<p id=\"231a80a14axyf\">数据能按照策略自动同步到云端，实现数据的云端备份容灾。</p>\n</li>\n<li id=\"li-3ye-y2u-akf\" class=\"li\" data-tag=\"li\">\n<p id=\"231aa7b04afq4\">支持自动云复制和云缓存功能，保证数据的高速访问和存储空间的有效利用。</p>\n</li>\n<li id=\"li-bft-vp6-rig\" class=\"li\" data-tag=\"li\">\n<p id=\"231aa7b14aazn\">数据压缩和去重，提升数据在云端和本地存储无缝流动的效率。</p>\n</li>\n<li id=\"li-lkh-ybq-j0t\" class=\"li\" data-tag=\"li\">\n<p id=\"231aa7b24aevm\">支持完备的主机端协议， 包括FC/iSCSI/FCoE、NFS/CIFS、Cinder等。</p>\n</li>\n<li id=\"li-53j-ddl-qs2\" class=\"li\" data-tag=\"li\">\n<p id=\"231aa7b34abq6\">提供多版本快照、复制等丰富的企业数据服务。</p>\n</li>\n<li id=\"li-txd-7pc-7ho\" class=\"li\" data-tag=\"li\">\n<p id=\"231aa7b44ahxc\">支持免<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>阵列双活容灾，护驾企业关键应用。</p>\n</li>\n<li id=\"li-4o5-b3s-jfv\" class=\"li\" data-tag=\"li\">\n<p id=\"231acec04a1ux\">支持异构虚拟化，提高旧阵列利用率，降低总IT成本。</p>\n</li>\n<li id=\"li-f0g-py9-emo\" class=\"li\" data-tag=\"li\">\n<p id=\"231acec14azjc\">存储阵列多控扩展，全面提升阵列性能和容量。</p>\n</li>\n<li id=\"li-ndt-mwj-gtc\" class=\"li\" data-tag=\"li\">\n<p id=\"231acec24apv7\">全冗余设计，安全可靠，支持数据中心机架部署。</p>\n</li>\n<li id=\"li-euh-qfr-15t\" class=\"li\" data-tag=\"li\">\n<p id=\"231acec34ae4w\">克隆功能：支持卷克隆功能，可创建读写的卷克隆副本。</p>\n</li>\n<li id=\"li-s77-tn2-7xg\" class=\"li\" data-tag=\"li\">\n<p id=\"231acec44aglo\">故障恢复：支持故障切换和故障恢复功能。当控制器故障时，支持在线故障切换，业务连续性不受影响。</p>\n</li>\n</ul>\n<p id=\"p-7f9-fbb-76m\" class=\"p\" data-tag=\"p\" data-spm-anchor-id=\"a2c63.p38356.0.i5.5f9052b80puEk5\">阿里云混合云存储阵列将云存储的高性价比和可扩展性与本地数据中心架构相结合，帮助客户轻松实现数据在本地数据中心和公共云之间的无缝流动。</p>\n<p class=\"p\" data-tag=\"p\" data-spm-anchor-id=\"a2c63.p38356.0.i5.5f9052b80puEk5\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/bd5c426869eb6e204ee9020d82ca5a72.png\" alt=\"\" width=\"1301\" height=\"891\" /></p>\n<p class=\"p\" data-tag=\"p\" data-spm-anchor-id=\"a2c63.p38356.0.i5.5f9052b80puEk5\"> </p>\n</div>', 0, 1740769202),
(42, '阿里云国际版混合云分布式存储', '混合云分布式存储', 'alibabacloud-hybrid-cloud-distributed-storage', 99, '混合云分布式存储利用软件定义的方式，充分利用标准化的X86服务器硬件，为私有云上的企业应用、企业数据库、虚拟桌面、云原生应用、文件共享和数据归档等业务场景提供统一的、弹性扩展的、高性能的、高可靠性的分布式块存储和对象存储服务，并无缝对接混合云平台。', '200.00', '<h2 class=\"solution-title\"><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.21818010.3899105700.i0.78967056ebsiRI\">混合云分布式存储</span></h2>\n<p class=\"solution-text text-base font-color\">以软件定义的方式提供弹性扩展的、高性能的分布式块存储和对象存储存储服务。</p>\n<h3 class=\"adv-title text-xxl col-md-4\" data-spm-anchor-id=\"a3c0i.21818010.6073928220.i1.78967056ebsiRI\">快速构建您的企业级存储系统</h3>\n<div class=\"text-box col-md-8\">\n<p class=\"adv-desc\" data-spm-anchor-id=\"a3c0i.21818010.6073928220.i0.78967056ebsiRI\">混合云分布式存储利用软件定义的方式，充分利用标准化的X86服务器硬件，为私有云上的企业应用、企业数据库、虚拟桌面、云原生应用、文件共享和数据归档等业务场景提供统一的、弹性扩展的、高性能的、高可靠性的分布式块存储和对象存储服务，并无缝对接混合云平台。</p>\n<h3 class=\"text-lg\" data-spm-anchor-id=\"a3c0i.21818010.3189326480.i0.78967056ebsiRI\">企业应用和企业数据库</h3>\n<p class=\"text-sm\">在“去中心化”的分布式架构之上支持多活<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的 FC、iSCSI 等传统 SAN 接口，与 AIX、Linux、Windows 下的企业应用无缝对接，支持 OLTP 和 OLAP 模式的企业级数据库性能及容量需求，实现弹性等、可控的数据资源池。</p>\n<h3 class=\"text-lg\" data-spm-anchor-id=\"a3c0i.21818010.3189326480.i2.78967056ebsiRI\">虚拟化和虚拟桌面</h3>\n<p class=\"text-sm\">满足 VMware、Citrix、等企业级虚拟化技术的统一存储需求，并提供企业级虚拟化场景下的交互最佳实践。</p>\n<p class=\"text-sm\"> </p>\n</div>', 0, 1740769202),
(43, '亚马逊云aws Amazon EC2', 'Amazon EC2', 'amazon-ec2', 144, '谷咕云计算代理Amazon 云服务器 Elastic Compute Cloud (EC2) 是一项Web服务，提供规模可调的云服务器托管服务，让开发人员能轻易地使用web级计算，可试用一年AWS提供的EC2免费云服务器套餐。', '500.00', '<h1 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">Amazon EC2</h1>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">安全且可调整大小的计算容量，支持几乎所有工作负载</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6 textmediacontent_module_heading__3423b844\" data-rg-n=\"HeadingText\">为什么选择 Amazon EC2？</h3>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">Amazon Elastic Compute Cloud（Amazon EC2）提供最广泛、最深入的计算平台，拥有超过 750 个实例，可选择最新的处理器、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、网络、操作系统和购买模型，以帮助您最好地满足工作负载的需求。我们是首家支持英特尔、AMD 和 Arm 处理器的主要云提供商，既是唯一具有按需 EC2 Mac 实例的云，也是唯一具有 400 Gbps 以太网网络的云。我们为机器学习培训提供最佳性价比，同时也为云中的每个推理实例提供了最低的成本。与任何其他云相比，有更多的 SAP、高性能计算 (HPC)、机器学习 (ML) 和 Windows 工作负载在 AWS 上运行。</span></p>\n<div class=\"col_module_col__728e93ad col_module_col12__728e93ad stepsCollection_module_stepsNumberCol__116a84f8\" data-rg-n=\"Col\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">Amazon EC2 的步骤</h3>\n</div>\n<div class=\"col_module_col__728e93ad col_module_col12__728e93ad stepsCollection_module_stepsContentCol__116a84f8\" data-rg-n=\"Col\">\n<div class=\"textMediaFlex_module_textMediaFlex__75e31508\">\n<div class=\"textMediaFlex_module_textContainer__75e31508\"><strong>登录 AWS 账户</strong>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>登录 AWS 管理控制台并设置您的根账户。如果您没有账户，那么系统将提示您创建一个账户。</p>\n<p>使用 AWS Free Tier，您可以免费获得 750 小时/月的精选级 EC2 实例。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"col_module_col__728e93ad col_module_col12__728e93ad stepsCollection_module_stepsContentCol__116a84f8\" data-rg-n=\"Col\">\n<div class=\"textMediaFlex_module_textMediaFlex__75e31508\">\n<div class=\"textMediaFlex_module_textContainer__75e31508\"><strong>启动您的实例</strong>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>确定哪种实例类型最适合您的工作负载。 对于第一个实例，我们建议使用低成本通用型实例类型：t2.micro 和亚马逊机器映像（AMI）：Amazon Linux 2 AMI，它们都符合免费套餐资格。</p>\n<p>打开 Amazon EC2 控制面板，选择“Launch Instance”（启动实例）以创建虚拟机。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"col_module_col__728e93ad col_module_col12__728e93ad stepsCollection_module_stepsContentCol__116a84f8\" data-rg-n=\"Col\">\n<div class=\"textMediaFlex_module_textMediaFlex__75e31508\">\n<div class=\"textMediaFlex_module_textContainer__75e31508\"><strong>配置实例</strong>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>下面是关于设置第一个实例的一些指导：</p>\n<ul>\n<li>安全组：创建您自己的防火墙规则或选择默认的 VPC 安全组。</li>\n<li><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>：EC2 同时提供磁盘和 SSD <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。我们建议从 Amazon EBS gp2 卷开始。</li>\n<li>选择“Launch Instances”（启动实例）完成设置。</li>\n</ul>\n<p><em>* 注：我们稍后将使用密钥对文件 (.pem)。</em></p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"col_module_col__728e93ad col_module_col12__728e93ad stepsCollection_module_stepsContentCol__116a84f8\" data-rg-n=\"Col\">\n<div class=\"textMediaFlex_module_textMediaFlex__75e31508\">\n<div class=\"textMediaFlex_module_textContainer__75e31508\"><strong>连接到您的实例</strong>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>启动您的实例之后，您可以连接到该实例，然后像使用您面前的计算机一样来使用它。可以通过多种方法来连接控制台，具体取决于操作系统。我们建议使用 EC2 实例连接，它是一个易于使用的基于浏览器的客户端。</p>\n<ul>\n<li>选择您创建的 EC2 实例，然后选择“Connect”（连接）。</li>\n<li>选择“EC2 Instance Connect”（EC2 实例连接）。</li>\n<li>选择“Connect”（连接）。 此时会打开一个窗口，并将您连接到您的实例。</li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n<div class=\"col_module_col__728e93ad col_module_col12__728e93ad stepsCollection_module_stepsContentCol__116a84f8\" data-rg-n=\"Col\">\n<div class=\"textMediaFlex_module_textMediaFlex__75e31508\">\n<div class=\"textMediaFlex_module_textContainer__75e31508\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_three__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">终止您的实例</h3>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>刚开始使用 Amazon EC2 时不需要支付任何费用，但您需要终止实例以避免产生额外费用。终止实例后将删除 EC2 实例以及相关数据。</p>\n<p>选择 EC2 实例，选择“Actions”（操作），然后依次选择“Instance State”（实例状态）和“Terminate”（终止）。</p>\n</div>\n</div>\n</div>\n</div>', 0, 1740855602),
(44, '亚马逊云AWS EC2 Auto Scaling', 'Amazon EC2 Auto Scaling', 'amazon-ec2-auto-scaling', 144, 'Amazon EC2 Auto Scaling 可以帮助您保持应用程序的可用性，并允许您使用您定义的扩缩策略自动添加或删除 EC2 实例。动态或预测扩缩策略允许您添加或删除 EC2 实例容量，为既定或实时的需求模式服务。Amazon EC2 Auto Scaling 的实例集管理功能有助于维护实例集的运行状况和可用性。', '500.00', '<h2 class=\"eb-headline lb-none-v-margin lb-h1 lb-title lb-txt-36 lb-txt-bold lb-txt-white\">Amazon <a href=\"https://www.kaihu123.com/vps/amazon-ec2/\" title=\"EC\" target=\"_blank\">EC</a>2 Auto Scaling</h2>\n<p>添加或删除计算容量以满足不断变化的需求</p>\n<h3 class=\"lb-txt-bold lb-txt-none lb-txt-28 lb-small-v-margin lb-h2 lb-title\">工作原理</h3>\n<div class=\"eb-pdp-how-it-works-item\">\n<div class=\"eb-pdp-how-it-works-item-summary\">\n<p>Amazon <a href=\"https://www.kaihu123.com/vps/amazon-ec2/\" title=\"EC\" target=\"_blank\">EC</a>2 Auto Scaling 可以帮助您保持应用程序的可用性，并允许您使用您定义的扩缩策略自动添加或删除 <a href=\"https://www.kaihu123.com/vps/amazon-ec2/\" title=\"EC\" target=\"_blank\">EC</a>2 实例。动态或预测扩缩策略允许您添加或删除 <a href=\"https://www.kaihu123.com/vps/amazon-ec2/\" title=\"EC\" target=\"_blank\">EC</a>2 实例容量，为既定或实时的需求模式服务。Amazon <a href=\"https://www.kaihu123.com/vps/amazon-ec2/\" title=\"EC\" target=\"_blank\">EC</a>2 Auto Scaling 的实例集管理功能有助于维护实例集的运行状况和可用性。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/fa58f4aa86439acca4dd5775c6e5ebe2.png\" alt=\"\" width=\"1173\" height=\"411\" /></p>\n<h3 class=\"lb-tiny-align-left lb-txt-bold lb-txt-none lb-txt-28 lb-txt\">为什么选择 Amazon <a href=\"https://www.kaihu123.com/vps/amazon-ec2/\" title=\"EC\" target=\"_blank\">EC</a>2 Auto Scaling？</h3>\n<div class=\"lb-txt-normal lb-txt-none lb-txt-16 lb-txt\">自动化对高效进行开发运维至关重要，因此让 Amazon <a href=\"https://www.kaihu123.com/vps/amazon-ec2/\" title=\"EC\" target=\"_blank\">EC</a>2 实例集自动启动、预置软件和自我修复是一项重大挑战。Amazon <a href=\"https://www.kaihu123.com/vps/amazon-ec2/\" title=\"EC\" target=\"_blank\">EC</a>2 Auto Scaling 提供每个实例生命周期自动化步骤的必要功能。</div>\n<div class=\"lb-txt-normal lb-txt-none lb-txt-16 lb-txt\"> </div>\n<div class=\"lb-txt-normal lb-txt-none lb-txt-16 lb-txt\"> </div>\n</div>\n</div>', 0, 1740855602),
(45, '亚马逊云AWS Amazon Lightsail', 'Amazon Lightsail', 'amazon-lightsail', 144, '谷咕云计算代理亚马逊云AWS Amazon Lightsail 以经济实惠的月度价格提供易于使用的虚拟专用服务器 (VPS) 实例、容器、存储、数据库等。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">Amazon Lightsail</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">使用低成本、预配置的云资源快速构建应用程序和网站</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6 textmediacontent_module_heading__3423b844\" data-rg-n=\"HeadingText\">为什么选择 Amazon Lightsail？</h3>\n<p>Amazon Lightsail 以经济实惠的月度价格提供易于使用的虚拟专用服务器 (VPS) 实例、容器、存储、数据库等。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/4335e83d8ec09e5ed3677f8d8c12720a.png\" /></p>\n<p> </p>', 0, 1740942002),
(46, '亚马逊云 AWS App Runner', 'AWS App Runner', 'aws-app-runner', 144, 'AWS App Runner 可以自动构建和部署 Web 应用程序，通过加密实现流量的负载均衡，扩展以满足您的流量需求，并允许您配置服务的访问方式，以及与私有 Amazon VPC 中的其他 AWS 应用程序通信。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">AWS App Runner</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">大规模部署 Web 应用程序和 API</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6 textmediacontent_module_heading__3423b844\" data-rg-n=\"HeadingText\">为什么选择 App Runner？</h3>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>AWS App Runner 可以自动构建和部署 Web 应用程序，通过加密实现流量的负载均衡，扩展以满足您的流量需求，并允许您配置服务的访问方式，以及与私有 <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> VPC 中的其他 AWS 应用程序通信。</p>\n<h3>App Runner 的优势</h3>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"0\">\n<div id=\"0-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-0\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\"><strong>加快应用程序的开发和部署</strong></div>\n<div id=\"content-0\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"0-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>无需具备容器或基础设施相关经验，即可大规模构建、运行和保护 Web 应用程序。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"1\">\n<div id=\"1-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-1\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\"><strong>自动扩展应用程序</strong></div>\n<div id=\"content-1\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"1-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>借助高可用性和低延迟，以经济高效的方式对您的应用程序进行扩展和负载均衡。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"2\">\n<div id=\"2-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-2\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\"><strong>内置安全性与合规性</strong></div>\n<div id=\"content-2\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"2-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>满足基础设施和合规性要求，同时专注于您的应用程序。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"3\">\n<div id=\"3-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-3\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\"><strong>与 AWS 服务无缝集成</strong></div>\n<div id=\"content-3\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"3-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>连接到 AWS 上支持您应用程序的数据库、缓存和消息队列服务。</p>\n<p> </p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1740942002),
(47, '亚马逊云 AWS Batch', 'AWS Batch', 'aws-batch', 144, 'AWS Batch 是一项完全托管的批处理计算服务，可在 Amazon ECS、Amazon EKS、AWS Fargate 以及竞价型或按需型实例等所有 AWS 计算产品中规划、安排和运行您的容器化批处理 ML、模拟和分析工作负载。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">AWS Batch</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">适用于机器学习模型训练、模拟和任何规模分析的批处理</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6 textmediacontent_module_heading__3423b844\" data-rg-n=\"HeadingText\">完全托管的批处理</h3>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>AWS Batch 是一项完全托管的批处理计算服务，可在 Amazon ECS、Amazon EKS、AWS Fargate 以及竞价型或按需型实例等所有 AWS 计算产品中规划、安排和运行您的容器化批处理 ML、模拟和分析工作负载。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/35b042f81e4f43f1f32e89c5cc889d25.png\" /></p>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"0\">\n<div id=\"0-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-0\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">专注于分析结果，而不是管理基础设施</h3>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\"> </div>\n</div>\n<div id=\"content-0\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"0-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">运行数以十万计的批处理机器学习（ML）、模拟和分析计算作业，无需安装软件或服务器。</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"1\">\n<div id=\"1-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-1\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">与 AWS 的原生集成</h3>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\"> </div>\n</div>\n<div id=\"content-1\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"1-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">本地集成 AWS，以实施扩展、联网和管理功能。</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"2\">\n<div id=\"2-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-2\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">优化计算成本</h3>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\"> </div>\n</div>\n<div id=\"content-2\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"2-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">根据卷和资源要求优化计算任务分发，以此降低成本。</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"3\">\n<div id=\"3-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-3\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">自动扩展计算资源</h3>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\"> </div>\n</div>\n<div id=\"content-3\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"3-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">通过支持大规模处理和模拟的完全托管式基础设施，自动扩展计算资源。</div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\"> </div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">AWS Batch 如何适用于您的行业</h3>\n<p class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_subheading__5f6a73c6\" data-rg-n=\"SubheadingText\">AWS Batch 让开发人员、科学家和工程师能够跨行业高效运行数十万个批处理计算作业，同时优化计算资源，因此您可以专注于分析结果和解决问题。</p>\n</div>\n</div>\n</div>\n</div>', 0, 1741028402),
(48, '亚马逊云 AWS Elastic Beanstalk', 'AWS Elastic Beanstalk', 'aws-elastic-beanstalk', 144, 'Elastic Beanstalk 可用于部署和扩展 Web 应用程序和服务。只需上传代码，Elastic Beanstalk 将自动处理包括容量预置、负载均衡、自动扩展和应用程序运行状况监控在内的部署工作。', '500.00', 'AWS Elastic Beanstalk\n部署和扩展 Web 应用程序\n\n\n上传和部署\n\n\n\n\n以简单、快速的方式上传和部署 Web 应用程序。\n\n\n\n\n\n\n专注于编写代码\n\n\n\n\n专注于编写代码，而不是预置和管理基础设施。\n\n\n\n\n\n\n为应用程序提供支持\n\n\n\n\n选择并保留对优化 AWS 资源的完全控制，为应用程序提供支持。\n\n\n\n\n\n\n扩展应用程序\n\n\n\n\n使用可调整设置扩展应用程序，以便处理流量峰值，同时最小化成本。\n \n为什么选择 Elastic Beanstalk？\n\nElastic Beanstalk 可用于部署和扩展 Web 应用程序和服务。只需上传代码，Elastic Beanstalk 将自动处理包括容量预置、负载均衡、自动扩展和应用程序运行状况监控在内的部署工作。\n\n\n快速启动 Web 应用程序\n\n\n\n\n在几分钟内部署可扩展的 Web 应用程序，而无需预置和管理底层基础设施的复杂性。\n\n\n\n\n\n\n为应用程序创建移动 <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> 后端\n\n\n\n\n使用您最喜欢的编程语言构建移动 <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> 后端，而 Elastic Beanstalk 将负责管理补丁和更新。\n\n\n\n\n\n\n更换关键业务应用程序的平台\n\n\n\n\n将有状态应用程序从遗留基础设施迁移到 Elastic Beanstalk 并安全地连接到专用网络。\n \n\n\n\n\n\n\n\n\n', 0, 1741028402),
(49, '亚马逊云 AWS Lambda', 'AWS Lambda', 'aws-lambda', 144, 'AWS Lambda 是一项计算服务，可以运行您的代码以响应事件并自动管理计算资源，这使其成为将想法转化为现代生产无服务器应用程序的最快方式。', '500.00', 'AWS Lambda\n无需考虑服务器或集群即可运行代码\n为什么选择 Lambda？\nAWS Lambda 是一项计算服务，可以运行您的代码以响应事件并自动管理计算资源，这使其成为将想法转化为现代生产无服务器应用程序的最快方式。\n \n\n\n\n无需管理服务器\n\n\n\n无需预置或管理基础设施即可运行代码。只需编写并将代码作为 .zip <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>或容器镜像上传即可。\n\n\n\n\n\n自动扩缩\n\n\n\n自动响应任何规模的代码执行请求，从每天十几个事件到每秒数十万个事件不等。\n\n\n\n\n\n即用即付定价模式\n\n\n\n只需为您使用的计算时间（按毫秒计算）付费，而不必预先为峰值容量预置基础设施，从而节省成本。\n\n\n\n\n\n性能优化\n\n\n\n通过合适的函数内存大小，优化代码执行时间和性能。利用预置并发在两位数毫秒内响应高需求。\n \n\n\n\n\n', 0, 1741114802),
(50, '亚马逊云 AWS Local Zones', 'AWS Local Zones', 'aws-local-zones', 144, '通过使 AWS 基础设施更靠近您的最终用户和业务中心，运行需要低于 10 毫秒的延迟或本地数据处理的应用程序。满足监管和合规敏感型工作负载的数据驻留要求。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">AWS Local Zones</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">在更靠近最终用户和工作负载的 AWS 基础设施上运行应用程序</span></p>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"0\">\n<div id=\"0-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-0\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">在更多站点运行应用程序</h3>\n</div>\n<div id=\"content-0\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"0-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>将 AWS 服务扩展到世界各地的大都市区，以便在离用户和工作负载更近的地方运行延迟敏感型应用程序，并满足受监管工作负载的数据驻留需求。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"1\">\n<div id=\"1-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-1\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">一致的 AWS 体验</h3>\n</div>\n<div id=\"content-1\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"1-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>熟悉的 AWS 基础设施、服务、API 和工具，提供真正一致的开发人员和 IT 运营体验。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"2\">\n<div id=\"2-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-2\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">灵活且可扩展</h3>\n</div>\n<div id=\"content-2\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"2-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>您可以<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>按需扩展，从小规模开始，随着需求的增长进行扩展，并采用即用即付定价模式。</p>\n<p> </p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6 textmediacontent_module_heading__3423b844\" data-rg-n=\"HeadingText\">AWS Local Zones 简介</h3>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>通过使 AWS 基础设施更靠近您的最终用户和业务中心，运行需要低于 10 毫秒的延迟或本地数据处理的应用程序。满足监管和合规敏感型工作负载的数据驻留要求。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/45bcad105d8fbb1bf38c7fe5852980aa.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1741114802),
(51, '亚马逊云 AWS Outposts', 'AWS Outposts', 'aws-outposts', 144, 'AWS Outposts 是一系列完全托管式解决方案，可为几乎任何本地或边缘站点提供 AWS 基础设施和服务，以获得真正一致的混合体验。 Outposts 解决方案允许您在本地扩展和运行原生 AWS 服务，并提供多种外形规格，从 1U 和 2U Outposts 服务器到 42U Outposts 机架，以及多机架部署。', '500.00', '<h2 id=\"AWS_Outposts_Family\" class=\"lb-txt-bold lb-txt-none lb-txt-white lb-txt-44 lb-none-v-margin lb-h1-large lb-title\">AWS Outposts 系列</h2>\n<div class=\"lb-none-pad lb-grid lb-row lb-row-max-large lb-snap\">\n<div class=\"lb-col lb-tiny-24 lb-mid-12\">运行本地 AWS 基础设施和服务以获得真正一致的混合体验</div>\n<div class=\"lb-col lb-tiny-24 lb-mid-12\"> </div>\n<div class=\"lb-col lb-tiny-24 lb-mid-12\">\n<h3 id=\"AWS_Outposts_Family_overview\" class=\"lb-txt-bold lb-txt-none lb-txt-28 lb-h1 lb-title\">AWS Outposts 系列概览</h3>\n<div class=\"lb-tiny-align-left lb-small-align-left lb-mid-align-left lb-large-align-left lb-xlarge-align-left lb-txt-light lb-txt-16 lb-rtxt\">\n<p>AWS Outposts 是一系列完全托管式解决方案，可为几乎任何本地或边缘站点提供 AWS 基础设施和服务，以获得真正一致的混合体验。 Outposts 解决方案允许您在本地扩展和运行原生 AWS 服务，并提供多种外形规格，从 1U 和 2U Outposts 服务器到 42U Outposts 机架，以及多机架部署。</p>\n<p><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> AWS Outposts，您可以在本地运行一些 AWS 服务并连接到本地 AWS 区域中提供的各种服务。<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>熟悉的 AWS 服务、工具和 API 在本地运行应用程序和工作负载。Outposts 支持需要以低延迟访问本地系统、本地数据处理、数据驻留以及具有本地系统相互依赖性的应用程序迁移的工作负载和设备。</p>\n<h2 id=\"Benefits\" class=\"lb-txt-bold lb-h2 lb-title\">优势</h2>\n<div class=\"lb-grid lb-row lb-row-max-large lb-snap lb-gutter-mid\">\n<div class=\"lb-col lb-tiny-24 lb-mid-8\">\n<h3 id=\"Run_AWS_Services_on_premises\" class=\"lb-txt-bold lb-txt-none lb-txt-18 lb-h3 lb-title\">在本地运行 AWS 服务</h3>\n<div class=\"lb-rtxt\">\n<p>在本地扩展 AWS 计算、联网、安全和其他服务，以满足低延迟、本地数据处理和数据驻留需求。</p>\n</div>\n</div>\n<div class=\"lb-col lb-tiny-24 lb-mid-8\">\n<h3 id=\"Fully_managed_infrastructure\" class=\"lb-txt-bold lb-txt-none lb-txt-18 lb-h3 lb-title\">完全托管的基础设施</h3>\n<div class=\"lb-rtxt\">\n<p>通过完全托管的体验减少管理 IT 基础设施所需的时间、资源、运营风险和维护停机时间。</p>\n</div>\n</div>\n<div class=\"lb-col lb-tiny-24 lb-mid-8\">\n<h3 id=\"Truly_consistent_hybrid_experience\" class=\"lb-txt-bold lb-txt-none lb-txt-18 lb-h3 lb-title\">真正一致的混合体验</h3>\n<div class=\"lb-rtxt\">\n<p><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>云中可用的相同硬件基础设施、API、工具和管理控件来提供真正一致的开发人员和 IT 运营体验。 </p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/996e0d313f40cace668502fec8a84fd5.png\" /></p>\n</div>\n</div>\n</div>\n<p> </p>\n</div>\n</div>\n</div>', 0, 0),
(52, 'AWS Serverless Application Repository', 'AWS Serverless Application Repository', 'aws-serverless-application-repository', 144, 'AWS Serverless Application Repository 是无服务器应用程序的托管存储库。它使团队、组织和各个开发人员能够存储和共享可重用的应用程序，并以强大的新方法轻松组装和部署无服务器架构。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">AWS Serverless Application Repository</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">发现、部署和发布无服务器应用程序</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6 textmediacontent_module_heading__3423b844\" data-rg-n=\"HeadingText\">为什么选择 AWS Serverless Application Repository？</h3>\n<p>AWS Serverless Application Repository 是无服务器应用程序的托管存储库。它使团队、组织和各个开发人员能够存储和<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>可重用的应用程序，并以强大的新方法轻松组装和部署无服务器架构。使用 Serverless Application Repository，无需在部署之前克隆、构建、打包源代码并将其发布到 AWS。相反，您可以在无服务器架构中部署 Serverless Application Repository 中的预构建应用程序，帮助您和您的团队减少重复工作、确保采用组织最佳实践，并更快地进入市场。与 AWS Identity and Access Management (IAM) 集成可为每个应用程序提供资源级控制，使您能够与所有人公开<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>应用程序或与特定 AWS 账户私下<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。</p>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"0\">\n<div id=\"0-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-0\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">开发功能更强大的应用程序</h3>\n</div>\n<div id=\"content-0\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"0-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>使用强大的新方法快速组装无服务器架构。使用 AWS SAM 的简化语法，私下或公开发现和<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>可重用的无服务器应用程序模式，并构建新的无服务器架构。 </p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"1\">\n<div id=\"1-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-1\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">轻松管理应用程序</h3>\n</div>\n<div id=\"content-1\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"1-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>在无服务器部署中使用预构建的应用程序，无需在部署之前克隆、构建、打包源代码并将其发布到 AWS。它还支持 SAM 和语义版本控制，以实现简单的应用程序管理。  </p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"2\">\n<div id=\"2-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-2\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">重新使用，不要重新构建</h3>\n</div>\n<div id=\"content-2\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"2-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>开发和发布一次无服务器应用程序，将它们存储在 Serverless Application Repository 中，并在团队或更大社区中私下使用，以减少重复工作并加快开发工作流程。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"3\">\n<div id=\"3-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-3\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">确保最佳实践</h3>\n</div>\n<div id=\"content-3\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"3-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>查找和分发常见使用案例的无服务器应用程序。在无服务器架构中构建组织最佳实践，以帮助确保团队之间的一致性，并使用权限与特定 AWS 账户<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>应用程序。</p>\n<h3>刚刚开始使用无服务器应用程序？</h3>\n<p>无服务器应用程序不需要您预置、扩展或管理任何服务器。您能够为几乎任何类型的应用程序或后端服务构建无服务器应用程序，并且运行和扩展具有高可用性的应用程序所需的所有操作都可由您负责。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/8917129e1e9a6d65112517c16f180dd6.png\" /></p>\n</div>\n</div>\n</div>\n</div>', 0, 0),
(53, 'AWS SimSpace Weaver', 'AWS SimSpace Weaver', 'aws-simspace-weaver', 144, 'AWS SimSpace Weaver 使在云中构建和运行大规模空间模拟变得更容易，让 AWS 管理规模和复杂性，从而使您可以专注于构建。了解如何跨实例扩展模拟，而无需管理实例。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">AWS SimSpace Weaver</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">在 AWS 托管的基础设施上构建动态、大规模的空间模拟</span></p>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"0\">\n<div id=\"0-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-0\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">构建城市规模的模拟</h3>\n</div>\n<div id=\"content-0\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"0-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>借助城市规模 3D 模拟，了解真实世界可能发生的结果并实现沉浸式环境<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"1\">\n<div id=\"1-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-1\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">完全托管</h3>\n</div>\n<div id=\"content-1\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"1-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>提高模拟中对象的大小、复杂性和数量，这些对象分布在由 SimSpace Weaver 完全托管的不同实例中。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"2\">\n<div id=\"2-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-2\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">保持同步</h3>\n</div>\n<div id=\"content-2\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"2-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>无需面临跨服务器数据管理、复制及时间同步方面的耗时挑战。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"itemExpander_module_expandableSection__2d018590\" data-eb-item-id=\"3\">\n<div id=\"3-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-3\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">无缝集成</h3>\n</div>\n<div id=\"content-3\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"3-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<p>与常用开发工具包和模拟引擎（例如 Unreal Engine 和 Unity）无缝集成。</p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6 textmediacontent_module_heading__3423b844\" data-rg-n=\"HeadingText\">为什么选择 SimSpace Weaver？</h3>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>了解如何跨实例扩展模拟，而无需管理实例。AWS SimSpace Weaver 使在云中构建和运行大规模空间模拟变得更容易，让 AWS 管理规模和复杂性，从而使您可以专注于构建。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250201/cec5c05fa6f283474c6779879940c352.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 0);
INSERT INTO `mx_cloud` (`id`, `title`, `name`, `alias`, `cid`, `des`, `usd`, `intro`, `status`, `addtime`) VALUES
(54, 'Amazon Elastic VMware Service', 'Amazon Elastic VMware Service', 'amazon-elastic-vmware-service', 144, 'Amazon Elastic VMware Service（Amazon EVS）为在 AWS 上迁移和运行 VMware 工作负载提供了最快途径。享受 AWS 的规模、弹性和性能，同时仍然使用熟悉的 VMware Cloud Foundation（VCF）软件和工具。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">适用于 VMware 的 AWS</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">为您迁移基于 VMware 的工作负载提供选择和灵活性</span></p>\n<div class=\"col_module_col__728e93ad col_module_colXs12__728e93ad col_module_colS12__728e93ad col_module_colM5__728e93ad col_module_colL5__728e93ad col_module_colXl5__728e93ad col_module_colXxl5__728e93ad textmediacontent_module_headingContainer__3423b844\" data-rg-n=\"Col\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6 textmediacontent_module_heading__3423b844\" data-rg-n=\"HeadingText\">为什么要为基于 VMware 的工作负载选择 AWS？</h3>\n</div>\n<div class=\"col_module_col__728e93ad col_module_colXs12__728e93ad col_module_colS12__728e93ad col_module_colM6__728e93ad col_module_colL6__728e93ad col_module_colXl6__728e93ad col_module_colXxl6__728e93ad textmediacontent_module_bodyContainer__3423b844\" data-rg-n=\"Col\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>AWS 可为您在云之旅中的各个阶段提供支持，为您基于 VMware 的工作负载提供最全面的迁移与现代化路径。AWS 是确保您基于 VMware 的应用程序经得起未来考验的首选目的地。我们提供专门构建的工具、专业的迁移计划和现代基础设施，定能帮助您实现在成本、速度和创新方面的目标，您尽可安心。</p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">向 AWS 的迁移和现代化之旅</h3>\n<p class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_subheading__5f6a73c6\" data-rg-n=\"SubheadingText\">迁移并非放之四海而皆准的方法。无论您是需要迁移、优化工作负载还是对其进行现代化改造，AWS 都有相应的服务可以帮助您实现目标，同时让您能够按照自己的节奏来移动工作负载。</p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">AWS 如何为您的云之旅提供帮助</h3>\n<h3 class=\"text_module_text__5f6a73c6 text_module_three__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">评测与迁移计划</h3>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">AWS 提供全面的迁移计划，帮助您开启云之旅。您可以首先获得免费的优化与许可评测（OLA），构建数据驱动的 AWS 迁移业务案例。获取有关降低运行和操作工作负载所需的计算、存储和许可成本的建议，这些建议甚至能帮助您在开始迁移到云之前实现成本节省。您还可以<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>迁移加速计划（MAP）来加快迁移速度。得益于最近针对基于 VMware 的工作负载进行的扩展，您可以获得专为迁移到 AWS 定制的工具、框架、资源和培训。</div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\"> </div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_three__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">专用迁移服务和工具</h3>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\"><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>创新 AWS 服务实现您的迁移目标。<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> Amazon Q 开发者版的转换功能进行 VMware 迁移，简化并自动执行 VMware 转换任务。<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> AWS Application Migration Service 迁移任何源基础设施的应用程序，通过自动将服务器转换到 AWS 以加速迁移。<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> AWS Migration Hub 在整个迁移和现代化之旅中获得引导式体验。</div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\"> </div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_three__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">专家迁移支持</h3>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">在整个迁移过程中，您可以通过多种选择和资源获取支持。利用额外的激励措施，与 AWS 合作伙伴一起加快您的云迁移之旅。我们的迁移能力合作伙伴均具备经过验证的专业知识和经验。从咨询及顾问服务到应用程序和基础设施开发服务，再到不间断的托管服务，我们的合作伙伴都可为您提供帮助，让您能够专注于自己独特的迁移计划。</div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\"> </div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_three__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">AWS 培训和认证</h3>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">随着您的团队获得云专业知识，您可以将组织的 VMware 技能扩展到 AWS，为取得长期成功创造条件。通过 AWS 培训和认证，您的团队可以参加定制课程的学习，为您进行现代化改造的每个阶段提供帮助。从“AWS 迁移基础知识”线下课程到各种线上课程（如按需提供的“将 VMware 工作负载迁移到 AWS”课程），您的团队将获得专业的培训和课堂学习。</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 0),
(55, '谷歌云GCP Compute Engine', 'Compute Engine', 'googlecloud-compute-engine', 156, '在高性能、可靠的云基础设施上轻松创建并运行在线虚拟机。从适用于 Web 服务器、数据库、AI 等的预设或自定义机器类型中进行选择。', '500.00', '<div class=\"x9K9hf dK1mgd\">\n<div class=\"jTIiId\">\n<div>\n<h2 class=\"MyvX5d D0aEmf qUKri yhYmte\">Compute Engine</h2>\n</div>\n</div>\n</div>\n<h3>适合任何工作负载的虚拟机</h3>\n<p>在高性能、可靠的云基础设施上轻松创建并运行在线虚拟机。从适用于 Web 服务器、数据库、AI 等的预设或自定义机器类型中进行选择。</p>\n<h3 class=\"MyvX5d D0aEmf  \">预设和自定义配置</h3>\n<p>使用名为快速起步解决方案的预构建示例，在数分钟内<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>应用。创建动态网站、负载均衡虚拟机、三层式 Web 应用或电子商务 Web 应用。</p>\n<p>您可以从预定义的机器类型、大小和配置中进行选择，以适配不同的工作负载，包括大型企业应用、现代工作负载（如容器）和需要使用 GPU 和 TPU 的 AI/机器学习项目等。</p>\n<p>如需获得更高的灵活性，您可以创建自定义机器类型，支持 1 到 96 个 vCPU 和每核心最多 8.0 GB 内存。还有多种块存储选项供您选择，包括灵活的 Persistent Disk 和高性能、低延迟的本地 SSD。</p>\n<h3 class=\"MyvX5d D0aEmf  \">业界领先的可靠性</h3>\n<p>Compute Engine 提供优于其他云服务提供商的单实例计算可用性服务等级协议 (SLA)：内存优化虚拟机承诺 99.95% 的可用性，所有其他虚拟机系列承诺 99.9% 的可用性。</p>\n<p>停机是否令您夜不能寐？您可以使用实时迁移在计划内和计划外事件期间保持工作负载连续性。当某个虚拟机发生故障时，Compute Engine 会实时迁移到同一可用区中的另一个主机。</p>\n<h3 class=\"MyvX5d D0aEmf  \">帮助提升资源效率的自动化功能和建议</h3>\n<p> </p>\n<p>自动添加虚拟机以处理峰值负载，并将性能不佳的实例替换为托管式实例组。</p>\n<p>根据合理容量建议，使用历史数据手动调整资源，或通过未来预留保证预留足够的容量以应对计划内的需求高峰。</p>\n<p>我们的所有最新计算实例（包括 C4A、C4、N4、C3D、X4 和 Z3）均在 Titanium 运行，该系统由专用微控制器和分层横向扩容分流组成，可提高基础设施性能、生命周期管理和安全性。</p>\n<h3 class=\"MyvX5d D0aEmf  \">透明的价格和折扣</h3>\n<p>查看各个虚拟机类型或配置的详细价格指南，或使用我们的价格计算器进行个性化估算。</p>\n<p>如需节省批量作业和容错工作负载的费用，可使用 Spot 虚拟机，使费用降低 60% 至 91%。</p>\n<p>您可以享受持续使用自动折扣，或注册承诺使用折扣并获得最高 70% 的折扣。</p>\n<h3 class=\"MyvX5d D0aEmf  \">安全控制措施和配置</h3>\n<p>通过机密虚拟机对使用中的数据以及正在处理的数据进行加密。</p>\n<p>使用安全强化型虚拟机防御 rootkit 和 bootkit。</p>\n<p>借助 Assured Workloads，满足严格的数据驻留、主权、访问和加密合规性标准。</p>\n<p> </p>', 0, 0),
(56, '谷歌云GCP：App Engine', 'App Engine', 'google-cloud-app-engine', 156, '构建服务器端渲染的单体式网站。App Engine 支持主流开发语言，并且提供各种开发者工具。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">App Engine</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>构建服务器端渲染的单体式网站。App Engine 支持主流开发语言，并且提供各种开发者工具。</p>\n<p>1、完全不需要管理服务器，也不需要部署配置，让您的开发者从这些繁琐任务中解脱出来</p>\n<p>2、借助对众多主流开发语言和各类开发者工具的支持，保持敏捷机动</p>\n<p>3、探索我们无服务器产品组合中的更多产品</p>\n<div class=\"qPg9F\">\n<div class=\"x9K9hf sJb7xe AlLELb\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">主要特性</h3>\n<p>常用编程语言</p>\n<p>使用 Node.js、Java、Ruby、C#、Go、Python 或 <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>构建应用。</p>\n<p>全代管式</p>\n<p>全代管式环境让您可以专注于编写代码，将基础架构事务交给 App Engine 管理。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250202/22113ae111311bdcd4e2307c1de0ac1b.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 0),
(57, '谷歌云GCP Cloud GPU', 'Cloud GPU', 'gcp-cloud-gpu', 156, 'Google Cloud 上的高性能 GPU，可用于机器学习、科学计算和生成式 AI。NVIDIA H200、H100、L4、P100、P4、T4、V100 及 A100 GPU 提供各种计算方案，满足您不同工作负载的多种费用和性能需求。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Cloud GPU</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>Google Cloud 上的高性能 GPU，可用于机器学习、科学计算和生成式 AI。</p>\n<p>加速生成式 AI、3D 可视化和 HPC 等计算工作</p>\n<p>不同性能和价位的多种 GPU 可供选择</p>\n<p>灵活<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和自定义机器，针对您的工作负载进行优化</p>\n<div class=\"qPg9F\">\n<div class=\"x9K9hf sJb7xe AlLELb\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">主要特性</h3>\n</div>\n</div>\n</div>\n</div>\n<div class=\"qPg9F\">\n<div class=\"AlLELb\">\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>多种 GPU</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>NVIDIA H200、H100、L4、P100、P4、T4、V100 及 A100 GPU 提供各种计算方案，满足您不同工作负载的多种费用和性能需求。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>性能灵活</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>根据您的工作负载，实现处理器、内存、高性能磁盘以及每个实例多达 8 个 GPU 之间的最佳平衡。全部按秒计费，您只用按需支付实际所用的资源。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">尽享 Google Cloud 的所有优势</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>在 Google Cloud 上运行 GPU 工作负载，受益于行业领先的存储、网络和数据分析技术。</p>\n<p> </p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 0),
(58, '谷歌云GCP Migrate to Virtual Machines', 'Migrate to Virtual Machines', 'gcp-migrate-to-virtual-machines', 156, '云迁移会产生许多问题。Google Cloud 支持的 Migrate to Virtual Machines 可以为您提供帮助。无论是从本地迁移一个应用，还是迁移来自多个数据中心的上千个企业级应用，Migrate to Virtual Machines 可帮助任何规模的 IT 团队将工作负载迁移到 Google Cloud。', '500.00', '<div class=\"x9K9hf dK1mgd\">\n<div class=\"jTIiId\">\n<div>\n<h2 class=\"MyvX5d D0aEmf qUKri yhYmte\">Migrate to Virtual Machines</h2>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf dK1mgd\">快速、灵活、安全地将虚拟机迁移到 Google Cloud。</div>\n<div class=\"x9K9hf dK1mgd\"> </div>\n<div class=\"x9K9hf dK1mgd\">\n<h3 class=\"MyvX5d D0aEmf  \">适合任何企业的企业级流畅迁移</h3>\n<p>云迁移会产生许多问题。Google Cloud 支持的 Migrate to Virtual Machines 可以为您提供帮助。无论是从本地迁移一个应用，还是迁移来自多个数据中心的上千个企业级应用，Migrate to Virtual Machines 可帮助任何规模的 IT 团队将工作负载迁移到 Google Cloud。</p>\n<h3 class=\"MyvX5d D0aEmf  \">快速高效的迁移</h3>\n<p>借助 Cloud Console 中 Migrate to Virtual Machines 简单易用的“服务化”界面和灵活的迁移选项，任何人都可以轻松减少迁移通常需要耗费的时间和繁复的工作。避免复杂的部署、设置和配置。无需使用复杂和麻烦的客户端迁移工具代理。通过使用正确的迁移工具，您可以将迁移团队的宝贵时间留给最重要的工作：迁移工作负载。</p>\n<h3 class=\"MyvX5d D0aEmf  \">轻松简单的大规模迁移</h3>\n<p>利用 Migrate to Virtual Machines 的速度、规模和灵活性为迁移项目提速。只需点击几下即可迁移单个应用，使用组可执行包含 100 个系统的迁移 Sprint，还可以使用我们的 Cloud API 构建您自己的内部迁移控制中心。通过 Migrate to Virtual Machines，您可以以最适合自己的方式自定义迁移。</p>\n<h3 class=\"MyvX5d D0aEmf  \">极少的停机时间和风险</h3>\n<p>内置的测试功能可让您在迁移之前快速轻松地进行验证。没有客户端软件代理意味着不会对工作负载本身所需的资源产生影响，也不需要开放对运行工作负载的网络的访问权限（或者从该网络访问外部的权限），并且完全无需源系统运行即可完成迁移。您可以定期将数据从源工作负载复制到目标位置，无需手动执行步骤或中断正在运行的工作负载，从而最大限度地缩短工作负载停机时间，实现快速的云割接。</p>\n<h3 class=\"MyvX5d D0aEmf  \">更低费用，更高效率</h3>\n<p>Migrate to Virtual Machines 的“服务化”模式有助于减少迁移工作量和复杂性。其速度和简易性有助于降低高昂的本地硬件和软件许可成本。此外，Migrate to Virtual Machines 提供基于用量的分析功能，帮助您合理调整目标实例的大小并避免云端过度预配。</p>\n<p>Migration to Virtual Machines 是 Migration <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> 的一部分。Migration <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> 是 Google Cloud 的统一平台，可帮助您加速从当前的本地或云环境到 Google Cloud 的端到端云之旅速度。借助云费用估算、对当前环境的资产发现以及针对不同迁移场景的各种工具等功能，Migration <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> 可为您提供迁移所需的工具。</p>\n</div>', 0, 0),
(59, 'google cloud Spot 虚拟机', 'Spot 虚拟机', 'google-cloud-spot-virtual-machine', 156, '适合批处理作业和容错工作负载的计算实例，经济实惠。 Spot 虚拟机提供与常规计算实例相同的机器类型、选项和性能。如果您的应用属于容错型应用，且可以承受可能的实例抢占，使用 Spot 虚拟机可以节省高达 91% 的 Compute Engine 费用。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Spot 虚拟机</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>适合批处理作业和容错工作负载的计算实例，经济实惠。 Spot 虚拟机提供与常规计算实例相同的机器类型、选项和性能。如果您的应用属于容错型应用，且可以承受可能的实例抢占，使用 Spot 虚拟机可以节省高达 91% 的 Compute Engine 费用。</p>\n<h3>低费用的虚拟机</h3>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<p><strong>费用低廉且可预测</strong></p>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>Spot 虚拟机的性价比比常规实例高出 91%。您可以获得稳定的价格，价格变化每月不超过一次，并且保证至少享受 60% 的折扣。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<p><strong>扩展批处理能力</strong></p>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>使用 Spot 实例可加快计算密集型工作负载的速度并降低费用。将 Spot 虚拟机用于容错工作负载，例如高性能计算、数据和分析、CI/CD、渲染/转码和测试等。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<p><strong>更充分地利用容器</strong></p>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>容器天生就无状态且具有容错性，因此非常适合 Spot 虚拟机。若要在 Google Kubernetes Engine (GKE) 中运行 Spot 虚拟机，只需在 Cloud 命令中输入“--spot”，即可准备就绪。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<p><strong>即时启用</strong></p>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>只需在 Cloud 命令行中添加 --provisioning-model=SPOT，即可启用。采用按秒计费方式，您可以在完成作业之后立即关停虚拟机。</p>\n<div class=\"qPg9F\">\n<div class=\"x9K9hf sJb7xe AlLELb\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">价格低</h3>\n<div class=\"EAoy4b giuCWe\">\n<div class=\" \">\n<p>Spot 虚拟机的价格最多比常规实例低 91%。它们会单独显示在您的账单上，让您了解自己省了多少钱。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"qPg9F\">\n<div class=\"AlLELb\">\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>轻松扩展</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>将 GPU 和本地 SSD 附加到 Spot 实例，可进一步提升性能并节省成本。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>关停提醒</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>Compute Engine 会在您的实例被抢占时为您提供 30 秒时间来关停机器，让您保存正在进行的工作，以供后续使用。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>大规模计算</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>根据需要设置和启动尽可能多的实例，并在完成之后将其关停。只需为实际用量付费。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>快速恢复容量</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>您的实例被抢占后，<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>实例组会在有可用容量时自动重新创建实例。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>控制费用</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>通过指定运行时长上限可节省更多费用，并定义实例在抢占时或超过运行时长上限时如何自行进行清理。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 0),
(60, '谷歌云GCP：批处理', '批处理', 'google-cloud-gcp-batch-processing', 156, '全代管式批处理服务，用于在 Google 的基础架构上安排批量作业、将批量作业排入队列并执行批量作业。对云计算资源运行任何扩缩批量作业，以限制作业等待时间，同时并行执行请求和扩缩资源，而无需手动干预。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">批处理</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>全代管式批处理服务，用于在 Google 的基础架构上安排批量作业、将批量作业排入队列并执行批量作业。</p>\n<p>预配和自动扩缩容量，同时无需管理第三方解决方案</p>\n<p>与 Google Cloud 原生集成，用于运行、扩缩和监控工作负载</p>\n<p>使用 Spot 机器降低工作负载的计算费用</p>\n<p>借助此快速入门<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>，即刻上手使用 Batch</p>\n<h3>专注于关键业务任务</h3>\n<p>利用可伸缩的全代管式计算基础架构，将重点转移到作业提交上，并从作业结果中提取业务数据洞见。</p>\n<h3>定义执行模型</h3>\n<p>运行由脚本或容器定义的高吞吐量或紧密耦合的计算。</p>\n<h3>改善开发者体验</h3>\n<p>Batch 简化了工作负载的开发和执行。 只需几个步骤即可提交批量作业。 利用 Cloud Storage、Pub/Sub、Cloud Logging 和 Workflows 获得端到端的开发者体验。</p>\n<h3>主要特性</h3>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>动态资源预配和自动扩缩</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>对云计算资源运行任何扩缩批量作业，以限制作业等待时间，同时并行执行请求和扩缩资源，而无需手动干预。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>支持脚本和容器化工作负载</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>Batch 可为直接在虚拟机上运行的 Docker 容器化工作负载和基于脚本的工作负载提供一致的体验。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>利用原生服务和批处理工具</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>轻松采用第一方服务，控制从预处理到后处理的端到端批量工作流。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 0),
(61, '谷歌云GCP 单租户节点', '单租户节点', 'google-cloud-gcp-single-tenant-node', 156, '借助单独租用，您可以拥有单租户节点的独占访问权限；单租户节点是一台 Compute Engine 物理服务器，该服务器专门用于仅托管您的项目的虚拟机。使用单租户节点可以将您的虚拟机与其他项目中的虚拟机进行物理隔离，或者将您的虚拟机汇集到同一主机硬件上，如下图所示。您还可以创建单租户节点组，并指定您是否希望该节点组与其他项目还是与整个组织共享。', '500.00', '<h2>单租户节点</h2>\n<p>借助单独租用，您可以拥有单租户节点的独占访问权限；单租户节点是一台 Compute Engine 物理服务器，该服务器专门用于仅托管您的项目的虚拟机。使用单租户节点可以将您的虚拟机与其他项目中的虚拟机进行物理隔离，或者将您的虚拟机汇集到同一主机硬件上，如下图所示。您还可以创建单租户节点组，并指定您是否希望该节点组与其他项目还是与整个组织共享。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250202/0b883ac47bf2ec20433510d1108be3a2.png\" /></p>\n<p>在单租户节点上运行的虚拟机可以使用的 Compute Engine 功能与其他虚拟机所用的相同，包括透明调度和块存储，但增加了一层硬件隔离。为了让您能够全面控制物理服务器上的虚拟机，每个单租户节点都会与支持该节点的物理服务器保持一对一的映射。</p>\n<p>在单租户节点中，您可以在各种规模的机器类型上预配多个虚拟机，从而高效地使用专用主机硬件的底层资源。此外，如果您选择不与其他项目共享主机硬件，则可以满足需要与其他工作负载或虚拟机物理隔离的工作负载的安全性或合规性要求。如果您的工作负载仅需要暂时单独租用，您可以根据需要修改虚拟机租用。</p>\n<p>单租户节点可以帮助您满足自带许可 (BYOL)（每个核心或每个处理器都要有许可）情况下的专用硬件要求。使用单租户节点时，您可以大致了解底层硬件，从而跟踪核心和处理器使用情况。为了跟踪此类使用情况，Compute Engine 会报告安排了虚拟机的物理服务器的 ID。然后，您可以使用 Cloud Logging 查看虚拟机的服务器历史使用情况。</p>\n<p>为优化主机硬件的使用，您可以执行以下操作：</p>\n<p>过度使用单租户虚拟机上的 CPU<br />共享单租户节点组</p>\n<p>手动实时迁移单租户虚拟机</p>\n<p>通过可配置的主机维护政策，您可以控制单租户节点在宿主机进行维护时的行为。您可以指定维护发生的时间，以及虚拟机是否与特定物理服务器保持亲和性，或者已移至节点组中的其他单租户节点。</p>\n<h3>工作负载注意事项</h3>\n<p>使用单租户节点可以带来以下类型的工作负载：</p>\n<p>具有性能要求的游戏工作负载。</p>\n<p>具有安全和合规性要求的财务或医疗保健工作负载。</p>\n<p>具有许可要求的 Windows 工作负载。</p>\n<p>机器学习、数据处理或图像渲染工作负载。对于这些工作负载，请考虑预留 GPU。</p>\n<p>需要增加每秒 I/O 操作次数 (IOPS) 并缩短延迟时间的工作负载，或者以临时存储空间的形式缓存、处理空间或低价值数据的工作负载。对于这些工作负载，请考虑预留本地 SSD。</p>\n<h3>节点模板</h3>\n<p>节点模板是一种区域级资源，用于定义节点组中每个节点的属性。通过节点模板创建节点组时，该节点模板的属性会一成不变地复制到该节点组中的每个节点。</p>\n<p>创建节点模板时，您必须指定节点类型。您可以视需要在创建节点模板时指定节点亲和性标签。您只能在节点模板上指定节点亲和性标签。您无法在节点组上指定节点亲和性标签。</p>\n<h3>节点类型</h3>\n<p>配置节点模板时，请指定节点类型以应用于基于节点模板创建的节点组中的所有节点。单租户节点类型（由节点模板引用）指定了在使用该模板的节点组中创建的节点的 vCPU 核心和内存总量。例如，n2-node-80-640 节点类型具有 80 个 vCPU 和 640 GB 内存。</p>\n<p>添加到单租户节点的虚拟机必须与节点模板中指定的节点类型相同。例如，n2 单租户节点类型仅与使用 n2 机器类型创建的虚拟机兼容。您可以将多个虚拟机添加到一个单租户节点，直到 vCPU 或内存总量超过该节点的容量。</p>\n<p>使用节点模板创建节点组时，该节点组中的每个节点都会沿用该节点模板的节点类型规范。节点类型适用于节点组中的每个单独节点（而不是整个节点组中的所有节点）。因此，如果您创建了一个节点组，其中包含两个均为 n2-node-80-640 节点类型的节点，则系统会为每个节点分配 80 个 vCPU 和 640 GB 内存。</p>\n<p>根据您的工作负载要求，您可能会在节点中放置多个运行于各种规模的机器类型上的较小虚拟机，这些机器类型包括预定义机器类型、自定义机器类型以及具有扩展内存的机器类型。如果某个节点已满载，您就无法在该节点上安排其他实例。</p>\n<p>下表显示了可用的节点类型。如需查看可用于项目的节点类型<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>，请运行 gcloud compute sole-tenancy node-types list 命令或创建 nodeTypes.list REST 请求。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250202/2d60a3c15bc02166a696719da7dafe89.png\" /></p>\n<p> </p>', 0, 0),
(62, '谷歌云GCP Oracle 裸金属解决方案', 'Oracle 裸金属解决方案', 'google-cloud-gcp-oracle-bare-metal-solution', 156, '使用裸金属解决方案将 Oracle 工作负载迁移到 Google Cloud，以极低风险开启您的云之旅。包括计算、存储和网络在内的端到端基础架构管理。全代管式且受监控的数据中心运维，例如电源、冷却、实用支持和设施。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Oracle 裸金属解决方案</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>使用裸金属解决方案将 Oracle 工作负载迁移到 Google Cloud，以极低风险开启您的云之旅。</p>\n<p>先进的认证基础架构，可精确调整以满足您的所有性能需求</p>\n<p>部署集群数据库和复制等 Oracle 功能，以及所有性能功能</p>\n<p>无缝利用所有 Google Cloud 服务，延迟时间少于 2 毫秒</p>\n<p>利用本地许可、runbook、数据库管理员和系统集成商</p>\n<p>Google Cloud 提供的结算、支持和服务等级协议 (SLA)</p>\n<h3>全代管式认证数据库基础架构</h3>\n<p>包括计算、存储和网络在内的端到端基础架构管理。全代管式且受监控的数据中心运维，例如电源、冷却、实用支持和设施。</p>\n<h3>体验最新的硬件</h3>\n<p>将您的工作负载整合到具有行业<a href=\"https://www.kaihu123.com/vps/googlecloud-compute-engine/\" title=\"最高 \" target=\"_blank\">最高 </a>DRAM 密度的 Intel Cascade Lake 服务器中。最新的 NVMe Tier-1 存储基于数十年的行业经验配置和调整而成，专为苛刻的工作负载打造。</p>\n<h3>无缝使用所有 Google Cloud 产品</h3>\n<p>全代管式的短延时网络使所有 Oracle 工作负载可以无缝访问所有 Google Cloud 服务。只需点击几下即可在 Cloud Storage 上设置 Oracle Data Guard，从而获得经济实惠的备份存储。</p>\n<h3>适用于 Oracle 工作负载的安全可靠的高性能数据库基础架构</h3>\n<p><strong>无缝访问所有 Oracle 功能</strong></p>\n<p>您可以像在本地一样运行 Oracle 数据库。在经过认证的硬件上安装 Oracle Real Application Clusters (RAC) 以实现高可用性，使用 Oracle Data Guard 进行灾难恢复，使用 Oracle Recovery Manager (RMAN) 进行备份。Google Cloud 的服务目录提供所有 Oracle Maximum Availability Architecture 模板的相似拓扑。使用您偏好的方法（即 Oracle Data Guard、Oracle GoldenGate、Oracle Data Pump 或 Oracle RMAN）迁移 Oracle 工作负载。维护您当前的所有策略方案、支持 runbook、数据库管理员团队和系统集成商。</p>\n<p><strong>集成式支持和结算</strong></p>\n<p>获享基础架构支持的无缝体验，包括最初响应的服务等级协议 (SLA)、基础架构正常运行时间和互连可用性的企业级服务等级协议 (SLA)、所有优先级 1 和 2 问题的全天候支持以及跨 Google Cloud 和 Oracle 裸金属解决方案的统一结算。</p>\n<p><strong>业界领先的数据保护</strong></p>\n<p>满足 ISO、PCI DSS 和 HIPAA 等行业认证的苛刻合规性要求，以及适用的区域认证。复制数据管理和备份，与 Oracle 裸金属解决方案全面集成。</p>\n<p><strong>简化运维的工具和服务</strong></p>\n<p>使用 Google 开源的基于 Ansible 的工具包或 Google Cloud 的适用于 Oracle 的 Kubernetes operator 来自动完成日常运营数据库管理员任务。您可以将这些工具与其现有的自动化框架集成。此外，Google Cloud 还提供数据库和系统管理专业服务，进一步协助您管理 Oracle 工作负载。</p>\n</div>\n</div>', 0, 0),
(63, 'Google Cloud VMware Engine', 'Google Cloud VMware Engine', 'google-cloud-vmware-engine', 156, '快速将基于 VMware 的应用移动和转换至 Google Cloud，而无需更改您的应用、工具或流程。包括在 Google Cloud 中的专用 VMware SDDC 中运行的所有硬件和 VMware 许可。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Google Cloud VMware Engine</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>快速将基于 VMware 的应用移动和转换至 Google Cloud，而无需<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>您的应用、工具或流程。包括在 Google Cloud 中的专用 VMware SDDC 中运行的所有硬件和 VMware 许可。</p>\n<p>阅读我们与 IDC 合作的新信息简报“成功迁移到公有云的策略”</p>\n<p>只需点击几下即可迁移 VMware 环境并快速开始在新平台上运营</p>\n<p>只需大约 30 分钟的时间，就能横跨 19 个全球区域预配整个 VMware SDDC</p>\n<p>了解我们的客户如何借助 Google Cloud VMware Engine 对应用进行现代化改造</p>\n<p>探索最新的 VMware Engine 资讯、文章和报告</p>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">完全集成的 VMware 体验</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>与其他解决方案不同，我们使用统一的身份、管理、支持和监控来简化 VMware 服务和工具的使用，同时提供您需要的所有许可、云服务和结算。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">快速预配和扩缩</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>利用云的弹性和扩缩能力，借助快速预配功能，您可以在大约 30 分钟内启动新的私有云，实现动态资源管理和自动扩缩。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">在云端使用熟悉的第三方应用</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>继续在云端使用核心企业应用，且无需进行<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。Google Cloud VMware Engine 与领先的数据库、存储、灾难恢复及备份 ISV 解决方案相集成。</p>\n<h3>主要特性</h3>\n<p><strong>快速的网络和高可用性</strong><br />VMware Engine 基于 Google Cloud 可伸缩的高性能基础设施（该基础设施采用完全冗余设计，并具备高达 200 Gbps 的网络）构建而成，可提供 99.99% 的可用性，能满足严苛的企业工作负载的需求。</p>\n<p><strong>独立于计算容量扩缩数据存储区容量</strong><br />Google Filestore 和 Google Cloud NetApp Volumes 已通过 VMware 认证，可用作与 VMware Engine 配合使用的 NFS 数据存储区。您可以使用外部 NFS 存储来增强内置 vSAN 存储，并以不受计算影响的方式为存储密集型虚拟机扩缩存储。利用 vSAN 满足低延迟虚拟机存储要求，并利用 Filestore / Google Cloud VMware Engine 将需要高容量的虚拟机的存储空间从 TB 扩容到 PB。</p>\n<p><strong>一体化的 Google Cloud 体验</strong><br />获享对创新性 Google Cloud 服务的完全访问权限。原生 VPC 网络为您提供 VMware 环境与 Google Cloud 服务之间的专用第 3 层访问通道，便于您使用标准访问机制，如 Cloud VPN 或 Interconnect。系统集成了结算、身份管理和访问权限控制功能，使用户可以获得与其他 Google Cloud 服务一致的体验。</p>\n<p><strong>稳健可靠的 VMware 生态系统解决方案</strong><br />Google Cloud 备份和灾难恢复是一项可实现应用一致的集中式数据保护的代管式备份和灾难恢复 (DR) 服务。您也可以选择利用与您的本地环境一致的 IT 管理工具和第三方服务。我们与 NetApp、Veeam、Zerto、Cohesity 和 Dell Technologies 等领先的存储、备份和灾难恢复提供商密切合作，以简化迁移过程，实现业务连续性。阅读 VMware Engine 生态系统简报。</p>\n<p><strong>熟悉的 VMware 工具和 Google Cloud 的运维套件</strong><br />借助您用于管理本地 VMware 工作负载的相同 VMware 工具、流程和政策，您可以轻松迁移。使用 Google Cloud 的运维套件可在 Google Cloud 环境中监控应用性能，排查其中的问题并加以改善。 </p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 0),
(64, '谷歌云GCP Cloud Run', 'Cloud Run', 'google-cloud-run', 156, 'Cloud Run 是一个全代管式平台，可让您直接在 Google 可扩缩的基础架构上运行代码。Cloud Run 简单易用、是自动化的，可助您提高工作效率。', '500.00', '<div class=\"x9K9hf dK1mgd\">\n<div class=\"jTIiId\">\n<div>\n<h2 class=\"MyvX5d D0aEmf qUKri yhYmte\">Cloud Run</h2>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf dK1mgd\">在全托管式平台上快速构建应用或网站\n<div class=\"x9K9hf fRAube\">\n<div class=\"wlROcd\">\n<div class=\" \">\n<p>您无需<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>基础架构，即可运行前端和后端服务、批量处理作业、托管 LLM 以及将正在处理的工作负载排入队列。</p>\n<h3 class=\"MyvX5d D0aEmf  \">支持各种语言、库和二进制文件</h3>\n<p>您可以使用自己喜欢的语言、框架和库编写代码，将其打包为容器，然后运行“gcloud run deploy”命令，您的应用立刻就可以上线，并具有在生产环境中运行所需的一切。构建容器完全可选的操作。如果您使用的是 Go、Node.js、Python、Java、.NET Core 或 Ruby，则可以使用基于来源的部署选项，它会按照您所用语言的最佳实践构建容器。</p>\n<h3 class=\"MyvX5d D0aEmf  \">快速自动弹性伸缩</h3>\n<p>无论您是拥有长期运行的事件驱动型服务，还是部署容器化作业来处理数据，Cloud Run 都可以从零开始自动扩缩容器，这意味着只有代码运行时才会产生费用。</p>\n<h3 class=\"MyvX5d D0aEmf  \">GPU</h3>\n<p>（此功能目前处于公开预览版阶段）支持按需使用 NVIDIA L4 GPU，以运行 AI 推理工作负载。GPU 实例在 5 秒内启动，并缩减至零。</p>\n<h3 class=\"MyvX5d D0aEmf  \">Cloud Run 函数</h3>\n<p>（此功能目前处于公开预览版阶段）使用 Cloud Run 直接编写和部署函数，从而完全控制底层服务配置。</p>\n<h3 class=\"MyvX5d D0aEmf  \">从来源自动构建容器映像</h3>\n<p>Cloud Run 还能将您部署到生产环境的方式自动化，它使用 Buildpack 让您直接从源代码进行部署，而不必在机器上安装 Docker。每当您提交新的代码并推送到 Git 代码库的指定分支时，您都可以自动执行构建并部署代码。</p>\n</div>\n</div>\n</div>\n</div>', 0, 0),
(65, 'Azure 虚拟机', '虚拟机', 'azure-virtual-machine', 163, 'Azure虚拟机是由微软推出的云端计算服务，用户可按需创建、部署和管理虚拟服务器，支持Windows/Linux系统，提供灵活弹性的IT基础设施解决方案，适用于企业上云、应用迁移、开发测试等场景。', '500.00', '<h2>一、什么是Azure虚拟机（Azure Virtual Machines）？</h2>\n<p>Azure虚拟机是由微软推出的**云端计算服务**，用户可按需创建、部署和管理虚拟服务器，支持Windows/Linux系统，提供灵活弹性的IT基础设施解决方案，适用于企业上云、应用迁移、开发测试等场景。  </p>\n<h3>1、Azure虚拟机的六大核心优势</h3>\n<p><strong>1. 灵活配置 &amp; 全球覆盖</strong><br />   支持从1核2GB到416核11TB内存的自定义配置<br />   覆盖全球60+区域，实现低延迟访问和本地化合规</p>\n<p><strong>2. 企业级安全性保障</strong><br />   内置微软Cyber Security防护体系<br />   免费DDoS防御 + 磁盘加密技术</p>\n<p><strong>3. 高可用性架构</strong><br />  99.9% SLA服务等级协议<br />  可用性集（Availability Sets）防止硬件故障</p>\n<p><strong>4. 无缝混合云支持</strong><br />   通过Azure Arc管理本地与云端混合资源<br />   快速对接Azure Database/Storage生态</p>\n<p><strong>5. 按需付费 &amp; 成本优化</strong><br />   支持即用即付（Pay-As-You-Go）和预留实例折扣  <br />   提供成本管理工具分析资源消耗  </p>\n<p><strong>6. AI驱动智能运维</strong><br />   Azure Monitor实时性能监控<br />   自动缩放（Autoscale）应对流量高峰</p>\n<h3>典型应用场景</h3>\n<p>Web应用托管：快速部署PHP/Java/Python等环境  <br />大数据分析：搭载HDInsight<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>海量数据  <br />灾难恢复：通过Azure Site Recovery构建容灾备份  <br />GPU计算：支持NVIDIA GPU运行AI训练/图形渲染  </p>\n<p> </p>\n<h3>Azure虚拟机与其他云服务商对比</h3>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 23.1267%; text-align: center;\"><strong>功能</strong></td>\n<td style=\"width: 23.1267%; text-align: center;\"><strong>Azure VM</strong></td>\n<td style=\"width: 23.1267%; text-align: center;\"><strong>阿里云ECS</strong></td>\n<td style=\"width: 23.1267%; text-align: center;\"><strong>腾讯云CVM</strong></td>\n</tr>\n<tr>\n<td style=\"width: 23.1267%;\">混合云支持</td>\n<td style=\"width: 23.1267%;\">✔️Azure Arc</td>\n<td style=\"width: 23.1267%;\">✖️</td>\n<td style=\"width: 23.1267%;\">✖️</td>\n</tr>\n<tr>\n<td style=\"width: 23.1267%;\">合规认证</td>\n<td style=\"width: 23.1267%;\">140+项国际认证</td>\n<td style=\"width: 23.1267%;\">50+项</td>\n<td style=\"width: 23.1267%;\">30+项</td>\n</tr>\n<tr>\n<td style=\"width: 23.1267%;\">免费防御带宽</td>\n<td style=\"width: 23.1267%;\">5Gbps DDos</td>\n<td style=\"width: 23.1267%;\">5Gbps （部分付费）</td>\n<td style=\"width: 23.1267%;\">2Gbps基础防护</td>\n</tr>\n</tbody>\n</table>\n<p> </p>\n<h3>如何快速上手Azure虚拟机？</h3>\n<p>1. 注册[微软Azure账号](https://azure.microsoft.com/)  </p>\n<p>2. 通过门户创建VM：选择镜像→配置CPU/内存→设置存储与网络  </p>\n<p>3. 通过SSH/RDP连接实例，部署您的应用  </p>\n<p> </p>\n<h3>常见问题解答（FAQ）</h3>\n<p>Q：Azure虚拟机适合中小型企业吗？</p>\n<p>A：支持从单台轻量级VM到数千节点集群，弹性扩展满足各规模需求。  </p>\n<p>Q：数据存储在Azure是否安全？</p>\n<p>A：采用AES-256加密技术，符合ISO 27001/GDPR等国际标准。  </p>\n<p> </p>', 0, 0),
(66, 'Azure Kubernetes 服务 (AKS)', 'Azure Kubernetes 服务 (AKS)', 'azure-kubernetes-service-aks', 163, 'Azure Kubernetes Service（AKS）是微软Azure提供的全托管Kubernetes容器编排服务，支持快速部署、扩展和管理容器化应用，自动化处理集群运维（如节点升级、扩缩容），帮助开发者聚焦业务代码而非基础设施。', '500.00', '<h2>什么是Azure Kubernetes Service (AKS)？</h2>\n<p>Azure Kubernetes Service（AKS）是微软Azure提供的全托管Kubernetes容器编排服务，支持快速部署、扩展和管理容器化应用，自动化处理集群运维（如节点升级、扩缩容），帮助开发者聚焦业务代码而非基础设施。</p>\n<p><strong>核心特性：</strong></p>\n<p>完全兼容原生Kubernetes API</p>\n<p>集成Azure DevOps、Monitor等云原生工具链</p>\n<p>支持无服务器容器（Azure Container Instances）突发扩展</p>\n<h3>AKS的五大核心优势</h3>\n<p><strong>1. 简化运维，降低管理成本</strong></p>\n<p>全托管控制平面：Azure自动处理Kubernetes主节点维护、安全补丁和监控</p>\n<p>一键式集群升级：通过Azure门户或CLI无缝升级Kubernetes版本</p>\n<p><strong>2. 弹性扩展与成本优化</strong></p>\n<p>自动节点扩缩容：根据负载动态调整节点数量（Cluster Autoscaler）</p>\n<p>按需计费：仅支付工作节点（Worker Nodes）费用，控制平面免费</p>\n<p><strong>3. 企业级安全与合规</strong></p>\n<p>身份集成：Azure Active Directory（AAD）认证集群访问</p>\n<p>机密容器支持：基于Intel SGX的机密计算保护敏感数据</p>\n<p>符合GDPR、HIPAA等50+项国际合规认证</p>\n<p><strong>4. 无缝混合云与多云部署</strong></p>\n<p>Azure Arc支持：跨本地数据中心、边缘和公有云统一管理K8s集群</p>\n<p>跨云兼容：通过Kubeflow、Helm实现应用多平台迁移</p>\n<p><strong>5. 深度集成Azure生态</strong></p>\n<p>快速对接Azure DevOps（CI/CD流水线）、Cosmos DB（分布式数据库）、Azure Monitor（日志分析）</p>\n<p>支持GPU节点加速AI/ML训练与<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>任务</p>\n<h3>AKS典型应用场景</h3>\n<p>微服务架构：部署Spring Cloud、.NET Core等分布式应用</p>\n<p>持续交付流水线：结合GitHub Actions实现自动化构建与发布</p>\n<p>AI模型服务化：托管TensorFlow Serving、PyTorch模型API</p>\n<p>边缘计算：通过AKS on Azure Stack HCI运行物联网边缘应用</p>\n<h3>AKS与其他Kubernetes服务对比</h3>\n<table style=\"border-collapse: collapse; width: 100%; height: 88px;\" border=\"1\">\n<tbody>\n<tr style=\"height: 22px;\">\n<td style=\"width: 23.1267%; text-align: center; height: 22px;\"><strong>功能</strong></td>\n<td style=\"width: 23.1267%; text-align: center; height: 22px;\"><strong>Azure AKS</strong></td>\n<td style=\"width: 23.1267%; text-align: center; height: 22px;\"><strong>Amazon EKS</strong></td>\n<td style=\"width: 23.1267%; text-align: center; height: 22px;\"><strong>Google GKE</strong></td>\n</tr>\n<tr style=\"height: 22px;\">\n<td style=\"width: 23.1267%; height: 22px;\">控制平面费用</td>\n<td style=\"width: 23.1267%; height: 22px;\">免费</td>\n<td style=\"width: 23.1267%; height: 22px;\">按小时收费</td>\n<td style=\"width: 23.1267%; height: 22px;\">免费(仅标准层)</td>\n</tr>\n<tr style=\"height: 22px;\">\n<td style=\"width: 23.1267%; height: 22px;\">内置CI/CD工具链</td>\n<td style=\"width: 23.1267%; height: 22px;\">Azure DevOps</td>\n<td style=\"width: 23.1267%; height: 22px;\">AWS CodePipeline</td>\n<td style=\"width: 23.1267%; height: 22px;\">Cloud Build</td>\n</tr>\n<tr style=\"height: 22px;\">\n<td style=\"width: 23.1267%; height: 22px;\">混合云管理能力</td>\n<td style=\"width: 23.1267%; height: 22px;\">✔️Azure Arc</td>\n<td style=\"width: 23.1267%; height: 22px;\">✖️</td>\n<td style=\"width: 23.1267%; height: 22px;\">✔️Anthos</td>\n</tr>\n<tr>\n<td style=\"width: 23.1267%;\">GPU节点支持</td>\n<td style=\"width: 23.1267%;\">NVIDIA Tesla系列</td>\n<td style=\"width: 23.1267%;\">NVIDIA T4</td>\n<td style=\"width: 23.1267%;\">NVIDIA A100</td>\n</tr>\n</tbody>\n</table>\n<h3><br />AKS快速入门三步曲</h3>\n<p>创建集群：通过Azure门户选择节点规模、K8s版本和网络配置</p>\n<p>部署应用：使用kubectl或Azure CLI提交YAML清单文件</p>\n<p>监控与优化：启用Azure Monitor for Containers分析性能指标</p>', 0, 0),
(67, 'Azure 中的 Linux 虚拟机', 'Linux 虚拟机', 'linux-virtual-machine-in-azure', 163, 'Azure 中超过 60% 的客户核心运行 Linux 工作负载。从以下常用的 Linux 发行版中选择：Red Hat、SUSE、Ubuntu、Debian、Flatcar 和 Oracle Linux。使用来自 Oracle 和其他与开放源代码 虚拟机 (VM) 兼容的提供商的预配置解决方案，并从所选发行商处找到经过 Azure 优化的 Linux 映像。', '500.00', '<h2 class=\"mt-md-n5 mt-lg-n5 mt-xl-n5 h4 \">启动并运行你最喜爱的 Linux 分发版</h2>\n<p>Azure 中超过 60% 的客户核心运行 Linux 工作负载。从以下常用的 Linux 发行版中选择：Red Hat、SUSE、Ubuntu、Debian、Flatcar 和 Oracle Linux。使用来自 Oracle 和其他与开放源代码 虚拟机 (VM) 兼容的提供商的预配置解决方案，并从所选发行商处找到经过 Azure 优化的 Linux 映像。只需一张工单即可以从 Azure、 Red Hat 和  SUSE  获得云的唯一并置技术支持。选择最能满足你需求的基本处理器 – AMD、Arm64 或 Intel。</p>\n<h3>1、使用你喜欢的工具和堆栈</h3>\n<p>使用 Java、Python、PHP、Node.js、Go、.NET Core 和其他技术开发应用程序，并将其部署在 Linux VM 中。在 Azure VM 中使用 Apache Tomcat、Red Hat JBoss、IBM WebSphere 或 Oracle WebLogic <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>解决方案并托管 Java 应用程序服务器。运行数据库，包括 MySQL 和 MariaDB、PostgreSQL、MongoDB、Linux 上的 SQL、Cassandra 和 Redis。</p>\n<h3>2、为 Linux VM 购买预留项，最高节省 72% 的费用</h3>\n<p>使用 1 年期或 3 年期的适用于 Linux 的 Azure 虚拟机预留实例节省成本，与即用即付价格相比节省高达 72%。将预留实例与面向 Linux 的 Azure 混合权益相结合，以便使用 Azure 上预先存在的本地 Red Hat 或 SUSE 软件订阅。或者，你可以视 SUSE 和 Red Hat 软件使用情况进行预付，与即用即付价格相比，预付方案可以节省资金。</p>\n<h3>3、自定义并加速 Linux VM 部署</h3>\n<p>使用社区提供的快速启动模板，通过 Azure 资源管理器更快地部署 Linux VM。使用你喜爱的 DevOps 工具（包括  Ansible、 OpenShift、 Chef、 Jenkins、 Puppet 和  Terraform），在 Azure 中预配并管理 Linux VM。</p>\n<h3><strong>4、获取 Linux VM 的内置安全性和管理</strong></h3>\n<p>通过将工作负载与 Microsoft Entra ID（以前称为 Azure Active Directory）身份验证集成，提高 Azure Linux VM 的安全性。 通过收集、查看和分析日志数据来监视 VM，并使用扩展来配置诊断。使用虚拟机串行控制台对生产中的 Linux VM 进行故障排除。</p>', 0, 0),
(68, 'Azure 虚拟机上的 SQL Server', 'SQL Server', 'sql-server-on-azure-virtual-machine', 163, 'Azure 虚拟机上的 SQL Server 是数据库 Azure SQL 系列 的一部分。将 SQL Server 工作负载迁移到云，同时享有 SQL Server 的性能和安全性以及 Azure 的灵活性和混合连接性。', '500.00', '<h2 class=\"mt-md-n5 mt-lg-n4 mt-xl-n4 h4 \">将 SQL Server 迁移到虚拟机并保存</h2>\n<p>Azure 虚拟机上的 SQL Server 是数据库 Azure SQL 系列 的一部分。将 SQL Server 工作负载迁移到云，同时享有 SQL Server 的性能和安全性以及 Azure 的灵活性和混合连接性。将虚拟机 (VM) 注册到  SQL Server IaaS 代理扩展后，可降低总拥有成本 (TCO)1 并获得免费的内置安全性和自动化管理，无需额外费用。</p>\n<p>在云中运行 SQL Server 的性能更高，TCO 更低。</p>\n<p>通用虚拟机的简单、熟悉的 SQL Server。</p>\n<p>具有 Always On 可用性组的可靠、简单的高可用性/灾难恢复 (HA/DR)。</p>\n<p>内置的安全和管理，具有自动安全更新和 简化的配置管理。</p>\n<h3>1、获得更高的性能和更低的 TCO</h3>\n<p>Azure 虚拟机上的 SQL Server 执行速度高达 42%，比 AWS EC21低 31%。使用 Azure 混合权益 将本地 SQL Server 许可证迁移到云，无需额外费用。将 SQL Server 工作负载迁移到 Azure，并获取 SQL Server 2008、2008 R2 和 2012 的免费扩展安全更新（仅限 Azure）。AWS 的开销是适用于 Windows Server 和 SQL Server2 的 Azure 的 5 倍。</p>\n<h3 class=\"h4 \">2、使用简单、熟悉的 SQL Server</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>Azure 虚拟机上的 SQL Server 100% 与 SQL Server 本地工作负载兼容，但具有更多的管理功能。在 Linux 或 Windows 上部署，并在 Red Hat Enterprise Linux、SUSE Linux Enterprise Server、Ubuntu Pro Linux 和 Windows Server 上使用预配置的 Azure 市场映像。无需更改代码即可迁移。</p>\n<h3>3、使用可靠且简单的 HA/DR 组合工作负载</h3>\n<p>使用 Azure 虚拟机上的 SQL Server 作为本地 SQL Server 实例的灾难恢复站点，具有高可用性/灾难恢复 (HA/DR) 软件保障权益，可通过 SQL Server IaaS 代理扩展<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。轻松配置 Always On 可用性组以监视和管理其运行状况。</p>\n<h3>4、通过内置安全性帮助保护数据</h3>\n<p>在所有云服务提供商中，Azure 的综合合规性覆盖率最高。使用扩展在具有预配置的安全和管理最佳做法的 Azure 虚拟机上部署 SQL Server，并在客户定义的维护时段内自动安装 Windows 和 SQL Server 安全更新。此外，通过 Azure Key Vault 轻松实施透明数据加密 (TDE) 以保护静态数据。</p>\n</div>\n</div>', 0, 0),
(69, 'Azure 上的 Windows Server', 'Windows Server', 'windows-server', 163, 'Azure 上的 Windows Server 结合了传统服务器操作系统的稳定性和云计算的灵活性，是企业数字化转型的理想选择。无论是迁移现有工作负载、构建混合云架构，还是开发云原生应用，Azure 均提供了全面的工具链和服务支持，助力用户实现高效、安全且经济的 IT 运营。', '500.00', '<h2>1. Windows Server on Azure概述</h2>\n<p>Windows Server on Azure 是微软将传统本地化 Windows Server 操作系统与 Azure 云平台深度集成的解决方案，旨在为企业提供灵活、可扩展且安全的云端服务器环境。用户可通过 Azure 虚拟机（VM）快速部署 Windows Server，并<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>Azure 的全球基础设施和云原生服务增强其功能。</p>\n<h3>2. 核心功能</h3>\n<p><strong>虚拟机部署</strong></p>\n<p>支持多种 Windows Server 版本（如 2022、2019、2016）的预配置镜像，快速创建云服务器。</p>\n<p>灵活选择 VM 规格（CPU、内存、存储），按需扩展资源。</p>\n<p>集成 Azure Hybrid Benefit，允许复用本地 Windows Server 许可证降低成本。</p>\n<p><strong>混合云能力（Hybrid Cloud）</strong></p>\n<p>通过 Azure Arc 统一管理本地和云端的 Windows Server 资源。</p>\n<p>无缝连接本地 Active Directory 与 Azure Active Directory（AAD）。</p>\n<p><strong>管理与监控</strong></p>\n<p>Azure Monitor 和 Log Analytics 提供性能监控、日志收集与智能告警。</p>\n<p>Azure Automation 实现脚本化运维（如 PowerShell DSC）和补丁管理。</p>\n<p><strong>安全性与合规</strong></p>\n<p>内置 Azure Security Center（现为 Microsoft Defender for Cloud）提供威胁检测与漏洞管理。</p>\n<p>支持磁盘加密（Azure Disk Encryption）、网络安全组（NSG）和合规性认证（如 ISO、GDPR）。</p>\n<p><strong>存储与备份</strong></p>\n<p>集成高性能存储选项（SSD、Ultra Disk）和 Azure Files（SMB 共享）。</p>\n<p>自动化备份与灾难恢复方案（Azure Backup 和 Azure Site Recovery）。</p>\n<h3>3. 主要优势</h3>\n<p><strong>弹性扩展</strong><br />根据业务负载自动扩缩容，避免资源浪费（支持 Azure VM Scale Sets）。</p>\n<p><strong>成本优化</strong><br />按需付费模式，节省硬件和维护成本；预留实例（RI）可降低长期费用。</p>\n<p><strong>全球化覆盖</strong><br />借助 Azure 的 60+ 全球区域，实现低延迟部署和多区域容灾。</p>\n<p><strong>与 Azure 服务无缝集成</strong><br />轻松对接 Azure SQL Database、Azure Kubernetes Service（AKS）、AI/ML 服务等。</p>\n<p><strong>简化迁移</strong><br />使用 Azure Migrate 工具将本地 Windows Server 迁移至云端，最小化停机时间。</p>\n<h3>4. 典型应用场景</h3>\n<p><strong>企业应用迁移</strong><br />将 Exchange Server、SQL Server、SharePoint 等本地应用迁移至 Azure。</p>\n<p><strong>开发与测试环境</strong><br />快速创建临时 Windows Server 环境，配合 DevOps 工具链（如 Azure DevOps）。</p>\n<p><strong>远程桌面服务（RDS）</strong><br />部署 Azure Virtual Desktop（AVD）提供安全的远程桌面体验。</p>\n<p><strong>边缘计算</strong><br />结合 Azure Stack HCI 在混合环境中运行分布式工作负载。</p>\n<h3>5. 最佳实践</h3>\n<p><strong>资源规划</strong><br />使用 Azure Pricing Calculator 预估成本，选择合适 VM 系列（如通用型、内存优化型）。</p>\n<p><strong>高可用性设计</strong><br />跨可用区（Availability Zones）部署关键业务服务器，保障 SLA 达 99.99%。</p>\n<p><strong>自动化运维</strong><br />通过 Azure Policy 强制执行安全配置，<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>ARM 模板 或 Bicep 实现 IaC（基础设施即代码）。</p>\n<p><strong>混合云管理</strong><br />启用 Azure Update Management 统一管理本地与云端服务器的补丁更新。</p>\n<h3>6. 未来趋势</h3>\n<p><strong>无服务器化</strong><br />Windows Server 容器化（如基于 Azure Kubernetes Service）与无服务器架构（Azure Functions）的融合。</p>\n<p><strong>AI 增强运维</strong><br />Azure 的 AI 驱动洞察（如预测性维护）将深度集成到服务器管理中。</p>\n<p><strong>更深度混合云</strong><br />Azure Arc 持续扩展对 Windows Server 的多云/边缘设备管理能力。</p>\n<h3>总结</h3>\n<p>Azure 上的 Windows Server 结合了传统服务器操作系统的稳定性和云计算的灵活性，是企业数字化转型的理想选择。无论是迁移现有工作负载、构建混合云架构，还是开发云原生应用，Azure 均提供了全面的工具链和服务支持，助力用户实现高效、安全且经济的 IT 运营。</p>', 0, 0),
(70, 'Azure Functions', 'Azure Functions', 'azure-functions', 163, 'Azure Functions 是微软 Azure 提供的一种 无服务器（Serverless）计算服务，允许开发者在无需管理底层基础设施（如虚拟机或容器）的情况下，按需运行事件驱动的小型代码片段（函数）。它遵循 “函数即服务”（FaaS） 模型，专注于快速构建、部署和扩展应用程序逻辑。', '500.00', '<h2>Azure Functions 简介</h2>\n<p>Azure Functions 是微软 Azure 提供的一种 无服务器（Serverless）计算服务，允许开发者在无需管理底层基础设施（如虚拟机或容器）的情况下，按需运行事件驱动的小型代码片段（函数）。它遵循 “函数即服务”（FaaS） 模型，专注于快速构建、部署和扩展应用程序逻辑。</p>\n<h3>核心功能与特性</h3>\n<p><strong>1. 事件驱动与触发器</strong></p>\n<p>自动触发执行：函数通过预定义的 触发器（Triggers） 响应事件，例如：</p>\n<p>HTTP 请求（构建 API 端点）</p>\n<p>消息队列（如 Azure Service Bus、RabbitMQ）</p>\n<p>数据库变更（Azure Cosmos DB、SQL 数据库）</p>\n<p>文件上传（Azure Blob Storage）</p>\n<p>定时任务（Cron 表达式调度）</p>\n<p>IoT 设备数据流（Azure Event Hubs）</p>\n<p>绑定（Bindings）：简化函数与外部服务的数据交互，支持输入/输出绑定（如将数据直接写入存储或发送到消息队列）。</p>\n<p><strong>2. 多语言支持</strong></p>\n<p>支持 C#、Java、JavaScript/TypeScript、Python、PowerShell 等语言，并提供自定义处理程序（Custom Handlers）以运行任意语言代码。</p>\n<p><strong>3. 弹性扩展</strong></p>\n<p>自动扩缩容：根据负载动态调整实例数量，支持从零实例冷启动到数千并发实例。</p>\n<p>按执行付费：仅在代码运行时计费（基于执行时间、内存消耗和触发次数），空闲时无成本。</p>\n<p><strong>4. 无服务器架构集成</strong></p>\n<p>与 Azure Logic Apps 结合实现低代码工作流自动化。</p>\n<p>通过 Azure Event Grid 处理大规模事件路由。</p>\n<p>配合 Azure API Management 发布和管理函数 API。</p>\n<p><strong>5. 开发与运维工具</strong></p>\n<p>本地开发：使用 Visual Studio、VS Code 或 Azure Functions Core Tools 本地调试和测试。</p>\n<p>CI/CD 集成：通过 Azure DevOps、GitHub Actions 等实现自动化部署。</p>\n<p>监控与诊断：内置 Application Insights 提供实时日志、性能跟踪和错误分析。</p>\n<h3>典型应用场景</h3>\n<p><strong>1. 微服务与 API 后端</strong><br />快速构建轻量级 RESTful API，替代传统单体应用。</p>\n<p>示例：用户身份验证、订单处理、数据转换接口。</p>\n<p><strong>2. 数据处理与 ETL</strong><br />响应数据管道事件（如新文件上传），触发数据清洗、转换或加载任务。</p>\n<p>示例：图像缩略图生成、日志分析、实时数据聚合。</p>\n<p><strong>3. 自动化与定时任务</strong><br />执行周期性任务（如每日报表生成、数据库清理）。</p>\n<p>示例：定时<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、社交媒体内容同步。</p>\n<p><strong>4. IoT 与实时流处理</strong><br />处理来自 IoT 设备的海量事件流，进行实时过滤、计算和存储。</p>\n<p>示例：设备状态监控、异常警报触发。</p>\n<p><strong>5. 扩展现有系统</strong><br />在不修改原有代码的情况下，为传统系统添加新功能（如发送通知、集成第三方服务）。</p>\n<h3>优势与价值</h3>\n<p><strong>降低成本</strong></p>\n<p>无需预置服务器，按实际资源消耗付费，尤其适合间歇性工作负载。</p>\n<p><strong>开发效率提升</strong></p>\n<p>聚焦业务逻辑而非基础设施，加速迭代周期。</p>\n<p><strong>高可用性与容错</strong></p>\n<p>Azure 自动管理跨区域冗余，确保服务 SLA（通常 ≥ 99.95%）。</p>\n<p><strong>生态整合</strong></p>\n<p>无缝对接 Azure 服务（如存储、数据库、AI/ML），支持混合云场景（通过 Azure Arc）。</p>\n<h3>与其他服务的对比</h3>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 31.4482%; text-align: center;\"><strong>服务</strong></td>\n<td style=\"width: 31.4482%; text-align: center;\"><strong>使用场景</strong></td>\n<td style=\"width: 31.4502%; text-align: center;\"><strong>关键区别</strong></td>\n</tr>\n<tr>\n<td style=\"width: 31.4482%;\">Azure Functions</td>\n<td style=\"width: 31.4482%;\">事件驱动、短时任务、无状态逻辑</td>\n<td style=\"width: 31.4502%;\">无服务器，按执行付费，支持多语言</td>\n</tr>\n<tr>\n<td style=\"width: 31.4482%;\">Azure Logic Apps</td>\n<td style=\"width: 31.4482%;\">低代码工作流、企业系统集成</td>\n<td style=\"width: 31.4502%;\">可视化设计器，专注于连接器与业务流程</td>\n</tr>\n<tr>\n<td style=\"width: 31.4482%;\">Azure App Service</td>\n<td style=\"width: 31.4482%;\">长期运行的应用（如 Web 应用、后台服务）</td>\n<td style=\"width: 31.4502%;\">需管理应用层，支持持续运行</td>\n</tr>\n</tbody>\n</table>\n<h3><br />最佳实践</h3>\n<p><strong>函数设计原则</strong></p>\n<p>单一职责：每个函数仅处理一个特定任务。</p>\n<p>无状态化：避免依赖本地存储，使用外部服务（如数据库、缓存）保存状态。</p>\n<p>短时执行：默认超时时间为 5 分钟（可配置至 10 分钟），适合轻量级任务。</p>\n<p><strong>性能优化</strong></p>\n<p>使用 Durable Functions 扩展复杂工作流（支持函数编排与状态管理）。</p>\n<p>启用 预热实例（Premium 计划）减少冷启动延迟。</p>\n<p>合理设置 并发限制 防止资源过载。</p>\n<p><strong>安全加固</strong></p>\n<p>通过 Azure Active Directory 保护 HTTP 触发器。</p>\n<p>使用 托管标识（Managed Identity） 安全访问其他 Azure 资源。</p>\n<p>配置 网络安全组（NSG） 限制函数访问来源。</p>\n<p><strong>成本控制</strong></p>\n<p>对高频任务选择 消耗计划，对低延迟需求任务选择 Premium 计划。</p>\n<p>利用 Azure Cost Management 分析函数资源消耗。</p>\n<h3>未来演进方向</h3>\n<p>更强大的事件网格集成：支持更复杂的事件驱动架构。</p>\n<p>边缘计算扩展：通过 Azure IoT Edge 在本地设备运行函数。</p>\n<p>AI 增强开发：结合 GitHub Copilot 或 Azure AI 辅助生成函数代码。</p>\n<h3>总结</h3>\n<p>Azure Functions 是构建现代化、可扩展云应用的利器，尤其适合需要快速响应事件、按需扩展且希望降低运维负担的场景。无论是初创公司还是大型企业，均可通过其灵活的编程模型和深度集成的 Azure 生态，高效实现业务逻辑的云端化与自动化。</p>', 0, 0),
(71, 'Azure 虚拟机规模集', '虚拟机规模集', 'azure-virtual-machine-scale-set', 163, '使用 Azure 虚拟机规模集，根据你的条件构建适用于批处理、大数据和容器工作负载的大规模服务，从而创建和管理一组异构负载均衡虚拟机 (VM)。根据需求或基于你定义的计划自动增加或减少 VM 的数量。集中管理、配置和更新数千个 VM，并为应用程序提供更高的可用性和安全性。', '500.00', '<h2 class=\"h4 pt-3 \">大规模创建和管理数千个虚拟机</h2>\n<p>使用 Azure 虚拟机规模集，根据你的条件构建适用于批处理、大数据和容器工作<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的大规模服务，从而创建和管理一组异构<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>均衡虚拟机 (VM)。根据需求或基于你定义的计划自动增加或减少 VM 的数量。集中管理、配置和更新数千个 VM，并为应用程序提供更高的可用性和安全性。</p>\n<h3>如何借助云实现业务关键型应用程序现代化？</h3>\n<p>1、借助内置的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>均衡和基于集中式模板的自动缩放功能，在几分钟内创建和部署数千个 VM</p>\n<p>2、基于可自定义的指标管理和自动缩放 VM 池，并持续控制和部署 VM 更新</p>\n<p>3、跨可用性区域和容错域大规模提高有状态和无状态应用程序的可用性</p>\n<p>4、选择最适合你的需求的 VM 映像和使用模型，同时对规模集中的各个 VM 进行完全控制</p>\n<h3 class=\"h5 \">简化 VM 的管理和治理</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>自动创建和部署 VM，并自动发布 OS 更新，以提高符合性和安全性。中心化你的模板，一致地推出应用程序。增加对应用程序的关注，避免额外的存储配置或网络管理任务。使用 Azure 资源管理器模板部署虚拟机规模集 - 支持 Windows 和 Linux 平台映像以及自定义的映像和扩展。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250203/3aef23fef0185a8353bccd3fda1a410d.png\" /></p>\n<h3 class=\"h5 \">提高应用程序的复原能力</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>通过使用可用性区域和可用性集，在单个数据中心内或跨多个数据中心自动分发规模集中的 VM，从而提高应用程序的正常运行时间。规模集运行应用程序的多个 VM 实例。因此，如果其中一个实例出现问题，客户将能够继续访问应用程序，并且中断的可能性保持最低。虚拟机规模集可为你的 VM 保证高达 99.99% 的服务级别协议 (SLA)。</p>\n<h3 class=\"h5 \">使用特有功能优化成本</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>在需求量较低时，最大程度地减少运行应用程序的不必要 VM 实例的数量来优化成本。使用现有许可证在 Azure 上通过 Azure 混合权益运行 Windows Server VM，并将 Azure 虚拟机预留实例与 Azure 混合权益结合，以节省更多成本。与即用即付费率相比，在规模集上使用 Azure 现成虚拟机运行可中断的工作<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>，可节省高达 90% 的成本。</p>\n<h3 class=\"h4 \">获得管理规模集的新方法</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>完全控制规模集中的各个 VM，并通过虚拟机规模集的灵活业务流程模式大规模确保高可用性。更改 VM 大小而不重新部署规模集，以提高操作敏捷性。在同一规模集中混合使用 Azure 现成虚拟机和即用即付 VM 来优化成本。使用相同的 API 管理 VM 和 VM 规模集。通过在 VM 创建过程中定义容错域来加快部署。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 0),
(72, 'Azure 现成虚拟机', '现成虚拟机', 'azure-ready-made-virtual-machines', 163, '使用现成虚拟机购买未使用的计算容量可显著节省成本。部署可以处理中断且不需要在特定时间段内完成的工作负载。以非常低的成本运行以下用途的工作负载：开发、测试、质量保证、高级分析、大数据、机器学习和 AI、作业批处理、视频、图形和图像的呈现和转码。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure 现成虚拟机</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>大规模使用低成本、未使用的 Azure 计算容量。</p>\n<div class=\"col-12 col-sm-12 col-md-4 pb-0\">\n<div class=\"d-flex w-100 h-100 position-relative material-color-light text-md-left\">\n<div class=\"d-flex flex-row w-100 h-100 \">\n<div class=\"w-100 py-2 pl-4 pr-2 d-flex align-items-center\">\n<div class=\"w-100\">\n<h3 class=\"h4 pt-3 \">以大力度折扣为可中断工作负载获取可缩放的计算容量</h3>\n使用现成虚拟机购买未使用的计算容量可显著节省成本。部署可以处理中断且不需要在特定时间段内完成的工作负载。以非常低的成本运行以下用途的工作负载：开发、测试、质量保证、高级分析、大数据、机器学习和 AI、作业批处理、视频、图形和图像的呈现和转码。</div>\n<div class=\"w-100\"> </div>\n<h3 class=\"w-100\">以更少的成本完成更多操作。使用 Azure 提高效率、降低成本并推动创新。</h3>\n<div class=\"w-100\">1、以高折扣价购买未使用的 Azure 计算容量，以运行可中断的工作负载。</div>\n<div class=\"w-100\">2、选择设置运行工作负载的最高价格。</div>\n<div class=\"w-100\">3、查找 Azure 门户中现成虚拟机的价格历史记录和逐出率。</div>\n<div class=\"w-100\">4、在类别广泛的 VM 和 Azure 虚拟机<a href=\"https://www.kaihu123.com/vps/azure-virtual-machine-scale-set/\" title=\"规模集\" target=\"_blank\">规模集</a>上大规模运行可中断的工作负载。</div>\n<div class=\"w-100\"> </div>\n<div class=\"w-100\">\n<h3 class=\"h4 \">以更低的成本获得更多云服务</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>借助现成虚拟机，以高折价预配未使用的 Azure 计算容量（与即用即付的价格相比，折扣高达 90%）。*按不超过你提前设置的最高价格付款（可选）。现成 VM 实例适合可中断的工作负载，在降低成本的同时提供可缩放性。在现成 VM 上运行 Windows Server 工作负载时，获取特殊的 Azure 定价和权益。</p>\n<p><span class=\"small mb-0\">*实际折扣可能会根据部署工作负载时可用的区域、VM 类型和可用的 Azure 计算容量而有所不同。</span></p>\n<h3 class=\"h4 \">从类别广泛的 VM 中选择适合你的预算的 VM</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>现成虚拟机定价可能会根据需要变化，且可用容量不同，价格也会有所不同。在下列情况下将逐出工作负载：</p>\n<ul>\n<li>价格高于你同意支付的最高价格。</li>\n<li>Azure 不再具有可用计算容量且必须重新分配其资源。</li>\n</ul>\n<p>获取类别广泛的 VM 和 VM <a href=\"https://www.kaihu123.com/vps/azure-virtual-machine-scale-set/\" title=\"规模集\" target=\"_blank\">规模集</a>的现成虚拟机定价。查看你选择的现成 VM 的价格历史记录和逐出率。</p>\n<h3 class=\"h4 \">运行推荐的工作负载</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>在现成 VM 上，所运行的应用程序均可应对中断情况而无需在特定时间范围内完成。</p>\n<p>现成 VM 适合以下类型的工作负载：</p>\n<ul>\n<li>开发/测试环境，包括持续集成和持续交付 (CI/CD) 工作负载。</li>\n<li>选择高性能计算方案、批处理作业或视觉对象呈现应用程序。</li>\n<li>大数据、分析、基于容器，以及大规模的无状态应用程序。</li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 0);
INSERT INTO `mx_cloud` (`id`, `title`, `name`, `alias`, `cid`, `des`, `usd`, `intro`, `status`, `addtime`) VALUES
(73, 'Azure 容器应用', 'Azure 容器应用', 'azure-container-applications', 163, 'Azure 容器应用（Azure Container Apps） 是微软 Azure 提供的全托管无服务器容器服务，专注于简化基于容器的微服务和无服务器应用的部署与管理。它结合了 Kubernetes 的灵活性与无服务器架构的便捷性，无需用户直接管理底层集群（如节点、网络），支持自动扩缩容、服务发现和分布式应用场景。', '500.00', '<h2>Azure 容器应用简介</h2>\n<p>Azure 容器应用（Azure Container Apps） 是微软 Azure 提供的全托管无服务器容器服务，专注于简化基于容器的微服务和无服务器应用的部署与管理。它结合了 Kubernetes 的灵活性与无服务器架构的便捷性，无需用户直接管理底层集群（如节点、网络），支持自动扩缩容、服务发现和分布式应用场景。</p>\n<h3>核心功能与特性</h3>\n<p><strong>1. 无服务器容器运行时</strong><br />无需管理基础设施：无需配置或维护 Kubernetes 集群（如 AKS 的节点池），由 Azure 完全托管底层基础设施。</p>\n<p>按需计费：根据实际使用的容器实例资源（vCPU、内存）付费，空闲时无成本。</p>\n<p><strong>2. 自动扩缩容</strong><br />基于流量的水平扩展：根据 HTTP 请求量、Kafka 消息吞吐量或其他自定义指标自动调整实例数量。</p>\n<p>缩容至零：当无请求时，实例可缩减为零以节省成本（适用于低频任务）。</p>\n<p><strong>3. 微服务与分布式架构支持</strong><br />服务发现与内部通信：通过内置 DNS 和 HTTP 路由实现容器应用间的无缝通信。</p>\n<p>Dapr（分布式应用运行时）集成：原生支持 Dapr，提供状态管理、发布订阅、服务调用等分布式能力。</p>\n<p><strong>4. 多容器支持</strong><br />支持部署单容器或通过 多容器组（类似 Kubernetes Pod）部署紧密耦合的容器（如主应用与日志收集 Sidecar）。</p>\n<p><strong>5. 安全与合规</strong><br />托管身份（Managed Identity）：自动分配 Azure AD 身份，安全访问其他 Azure 服务（如 Key Vault、存储）。</p>\n<p>网络安全隔离：通过虚拟网络（VNet）集成实现私有网络通信，支持 TLS 加密和私有容器注册表（如 Azure Container Registry）。</p>\n<p><strong>6. 持续交付与监控</strong><br />CI/CD 集成：支持 GitHub Actions、Azure DevOps 等工具链实现自动化构建和部署。</p>\n<p>内置监控：与 Azure Monitor、Application Insights 集成，提供日志、指标和分布式跟踪。</p>\n<h3>主要优势</h3>\n<p><strong>开发效率高</strong></p>\n<p>开发者只需关注容器镜像和业务逻辑，无需学习 Kubernetes 的复杂性（如 YAML 配置）。</p>\n<p><strong>成本优化</strong></p>\n<p>无预置资源成本，按实际容器实例运行时间和资源消耗计费。</p>\n<p><strong>企业级弹性</strong></p>\n<p>支持跨可用区（Availability Zones）部署，自动处理故障转移和负载均衡。</p>\n<p><strong>生态兼容性</strong></p>\n<p>兼容任意容器镜像（支持 Docker 和 OCI 标准），无缝集成 Azure 服务（如 Azure Database、Event Grid）。</p>\n<h3>典型应用场景</h3>\n<p><strong>1. 微服务架构</strong><br />构建可独立扩展的微服务，如用户认证服务、订单处理服务或 API 网关。</p>\n<p><strong>2. 事件驱动应用</strong><br />处理异步事件（如消息队列、数据库变更），配合 Azure Event Grid 或 Service Bus 实现实时响应。</p>\n<p><strong>3. 后台任务与批处理</strong><br />运行定时任务或数据处理作业（如生成报表、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>数据），支持缩容至零以降低成本。</p>\n<p><strong>4. Web 应用与 API 后端</strong><br />部署前端 Web 应用（如 React、ASP.NET Core）或 RESTful API，自动扩展应对流量高峰。</p>\n<p><strong>5. 现代化遗留应用</strong><br />将传统单体应用拆分为容器化模块，逐步迁移至云原生架构。</p>\n<h3>与其他容器服务的对比</h3>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 31.4482%; text-align: center;\"><strong>服务</strong></td>\n<td style=\"width: 31.4482%; text-align: center;\"><strong>使用场景</strong></td>\n<td style=\"width: 31.4502%; text-align: center;\"><strong>关键区别</strong></td>\n</tr>\n<tr>\n<td style=\"width: 31.4482%;\">Azure Container Apps</td>\n<td style=\"width: 31.4482%;\">无服务器化微服务、快速部署、无需管理 K8s 集群</td>\n<td style=\"width: 31.4502%;\">完全托管、无节点概念、内置 Dapr 支持</td>\n</tr>\n<tr>\n<td style=\"width: 31.4482%;\">Azure Kubernetes Service (AKS)</td>\n<td style=\"width: 31.4482%;\">需要精细控制 K8s 集群、复杂编排的场景</td>\n<td style=\"width: 31.4502%;\">用户管理节点、支持自定义 K8s 插件和 CRD</td>\n</tr>\n<tr>\n<td style=\"width: 31.4482%;\">Azure App Service</td>\n<td style=\"width: 31.4482%;\">长期运行的 Web 应用（非容器化或单容器）</td>\n<td style=\"width: 31.4502%;\">支持非容器化代码、内置 CI/CD 和自动扩展</td>\n</tr>\n</tbody>\n</table>\n<h3><br />最佳实践</h3>\n<p><strong>容器设计优化</strong></p>\n<p>保持容器轻量化，避免单个容器承担过多职责。</p>\n<p>使用多阶段构建（Multi-stage Build）减少镜像大小。</p>\n<p><strong>环境配置管理</strong></p>\n<p>通过 环境变量 或 Azure Key Vault 注入配置信息，避免硬编码敏感数据。</p>\n<p><strong>扩展策略配置</strong></p>\n<p>根据业务需求定义自动扩展规则（如 HTTP 并发请求 &gt; 100 时扩展至 5 个实例）。</p>\n<p><strong>日志与诊断</strong></p>\n<p>启用 Application Insights 实现端到端监控，结合 Log Analytics 分析容器日志。</p>\n<p><strong>安全加固</strong></p>\n<p>使用私有容器注册表（ACR），限制容器应用的网络暴露面（通过 VNet 和 NSG）。</p>\n<h3>未来演进方向</h3>\n<p>更深度 Serverless 集成：与 Azure Functions、Logic Apps 结合，构建混合无服务器架构。</p>\n<p>边缘计算支持：通过 Azure IoT Edge 扩展容器应用到本地边缘设备。</p>\n<p>AI 驱动的运维：利用 Azure AI 预测资源需求并自动优化扩展策略。</p>\n<h3>总结</h3>\n<p>Azure 容器应用是现代化云原生开发的理想选择，尤其适合希望摆脱基础设施管理负担、快速部署弹性容器化应用的团队。无论是构建微服务、处理事件驱动任务，还是运行后台作业，ACA 均提供了开箱即用的高可用性、自动扩展和深度 Azure 生态集成能力。对于不需要复杂 Kubernetes 编排但需容器灵活性的场景，Azure 容器应用提供了更简单、更具成本效益的解决方案。</p>', 0, 0),
(74, '腾讯云国际版CVM云服务器', '云服务器', 'tencent-cloud-international-edition-cloud-server', 110, '云服务器（Cloud Virtual Machine，CVM）为您提供安全可靠的弹性计算服务。 只需几分钟，您就可以在云端获取和启用 CVM，来实现您的计算需求。随着业务需求的变化，您可以实时扩展或缩减计算资源。 CVM 支持按实际使用的资源计费，可以为您节约计算成本。使用 CVM 可以极大降低您的软硬件采购成本，简化 IT 运维工作。', '50.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>云服务器</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>稳定、安全、弹性、高性能的云端计算服务，实时满足您的多样性业务需求</p>\n<div class=\"anchor-element\">\n<h3 id=\".E4.BB.80.E4.B9.88.E6.98.AF.E8.85.BE.E8.AE.AF.E4.BA.91.E4.BA.91.E6.9C.8D.E5.8A.A1.E5.99.A8.EF.BC.9F\" data-slate-node=\"element\"><span data-slate-node=\"text\">什么是腾讯云云服务器？</span></h3>\n</div>\n<div class=\"\" data-slate-node=\"element\" data-slate-fragment=\"\"><span data-slate-node=\"text\">腾讯云云服务器（Cloud Virtual Machine，CVM）是腾讯云提供的可扩展的计算服务。使用云服务器 CVM 避免了使用传统服务器时需要预估资源用量及前期投入，帮助您在短时间内快速启动任意数量的云服务器并即时部署应用程序。 云服务器 CVM 支持用户自定义一切资源：CPU、内存、硬盘、网络、安全等，并可以在需求发生变化时轻松地调整它们。</span></div>\n<div class=\"\" data-slate-node=\"element\" data-slate-fragment=\"\">\n<h3>如何使用云服务器？</h3>\n<p>腾讯云提供如下方式进行云服务器的配置和管理：<br /><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>：腾讯云提供的 Web 服务界面，用于配置和管理云服务器。<br />API：腾讯云也提供了 API 接口方便您管理云服务器 CVM。关于 API 说明，请参考见API 概览。<br />SDK：您可以使用 SDK 编程 或使用腾讯云 命令行工具 TCCLI 调用 CVM API。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250204/39c776ff667ec14eee2ecbb26f8f61e8.png\" /></p>\n</div>\n</div>\n</div>', 0, 1738632452),
(75, '腾讯云国际版GPU 云服务器', 'GPU 云服务器', 'tencent-cloud-international-gpu-cloud-server', 110, 'GPU 云服务器（Cloud GPU Service）是提供 GPU 算力的弹性计算服务，具有超强的并行计算能力，作为 IaaS 层的尖兵利器，服务于深度学习训练、科学计算、图形图像处理、视频编解码等场景。腾讯云随时提供触手可得的算力，有效缓解您的计算压力，提升业务效率与竞争力。', '50.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>GPU 云服务器</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>GPU 云服务器（Cloud GPU Service）是提供 GPU 算力的弹性计算服务，具有超强的并行计算能力，作为 IaaS 层的尖兵<a href=\"https://www.kaihu123.com/vps/azure-functions/\" title=\"利器\" target=\"_blank\">利器</a>，服务于深度学习训练、科学计算、图形图像处理、视频编解码等场景。腾讯云随时提供触手可得的算力，有效缓解您的计算压力，提升业务效率与竞争力。</p>\n<h3>产品优势</h3>\n<p><strong class=\"wordBreak line-break4\">1、极致并行计算能力</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>GPU 云服务器具有超强的并行计算能力，服务于AI训练/推理、科学计算、图形图像处理、视频编解码等场景。提供触手可得的算力，提升业务效率与竞争力。</p>\n<p><strong class=\"wordBreak line-break4\">2、基础环境一键部署</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>支持GPU驱动、CUDA 及 cuDNN的自动安装，并提供部分操作系统预装驱动镜像，帮助您一键部署环境，快速接入业务。</p>\n<p><strong class=\"wordBreak line-break4\">3、原生加速引擎支持</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>提供腾讯云自研 IaaS计算加速引擎TACO Kit，为用户提供开箱即用的加速工具，用于分场景支持高性能分布式训练及推理。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250204/2b73fee17a608533bf586593e38df01a.png\" /></p>\n<p><strong>客户痛点：</strong></p>\n<p>自动驾驶通过车载传感器及摄像头进行数据收集，每天将产生数TB数据，海量数据需要快速地分析处理及持久化存储。需要大规模计算集群，高IOPS 的高性能存储和高带宽的网络基础设施，充分满足标注、训练、仿真等环节的计算、存储需求。</p>\n<p><br /><strong>解决方案：</strong></p>\n<p>提供裸金属高性能计算集群，配备V100、A100高算力GPU，支持业务高性能计算需求。</p>\n<p>高性能计算集群实例间支持100G RDMA网络互联，搭配GooseFS数据加速服务，提高大规模分布式集群训练效率。</p>\n<p>数据存储于腾讯云对象存储COS中，数据跨多架构、多设备冗余存储，提供异地容灾和资源隔离，保证数据持久性和安全性。</p>\n<p><br /><strong>云上收益：</strong></p>\n<p>提供大规模并行仿真调度、高弹性且低成本存储方案的应用，为自动驾驶技术研发提供全链路服务，以支持行业更高效地开展自动驾驶研发和运营，助力车企突破成本和效率的障碍，加速技术的研发进程。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250204/d8b2c60c4c039e61e2c7c45ae9d74e79.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738632867),
(76, '腾讯云国际专用宿主机', '专用宿主机', 'tencent-cloud-international-dedicated-host', 110, '专用宿主机（CVM Dedicated Host，CDH）提供用户独享的物理服务器资源，满足您资源独享、资源物理隔离、安全、合规需求。专用宿主机搭载了腾讯云虚拟化系统，购买之后，您可在其上灵活创建、管理多个自定义规格的云服务器实例，自主规划物理资源的使用。', '100.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>专用宿主机</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>资源独享、物理隔离的云端计算服务，满足您资源独享、安全、合规的需求</p>\n<p>专用宿主机（CVM Dedicated Host，CDH）提供用户独享的物理服务器资源，满足您资源独享、资源物理隔离、安全、合规需求。专用宿主机搭载了腾讯云虚拟化系统，购买之后，您可在其上灵活创建、管理多个自定义规格的云服务器实例，自主规划物理资源的使用。</p>\n<h3>专用宿主机特性</h3>\n<p><strong class=\"wordBreak line-break4\">1、资源独享</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>专用宿主机提供物理机级别的资源独享，您可以自主规划宿主机内资源的使用，避免其他租户的资源竞争。通过腾讯云的控制台或 API 接口，您在几分钟内就能快速购买到到专用宿主机。</p>\n<p><strong class=\"wordBreak line-break4\">2、安全合规</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>CPU、内存、磁盘、网络资源均单租户专用。物理机级别资源隔离，提供敏感业务<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>保护、磁盘消磁能力，满足金融行业强监管需求。</p>\n<p><strong class=\"wordBreak line-break4\">3、自主灵活</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>用户可以在指定的专用宿主机上分配云服务器自主规划宿主机资源的使用。实例规格支持自定义，灵活配置，打破子机规格的限制，保障业务性能的同时充分利用物理服务器资源。</p>\n<p><strong class=\"wordBreak line-break4\">4、具有 CVM 特性</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>独享子机即专用宿主机上创建的云服务器 CVM，提供镜像、安全组、配置调整、SSH 密钥等支持，各功能特性的使用方式也保持跟普通 CVM 一致。</p>\n<p><strong class=\"wordBreak line-break4\">5、轻资产</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>按需购买，分钟级交付，腾讯云统一标准的运维管理服务，保障您的资源稳定运行，客户无需关注底层运维，节省人力、节约运维成本，专注于核心业务。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250204/a7d67a20802a4d5b827741a30ae711f7.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738633106),
(77, '腾讯云国际版裸金属云服务器', '裸金属云服务器', 'tencent-cloud-cloud-bare-metal', 110, '裸金属云服务器（Cloud Bare Metal，CBM）是一种可弹性伸缩的高性能云服务器实例，拥有物理服务器性能无损、资源安全隔离等优点。使用该服务，获取物理服务器的时间将缩短至分钟级。将容量管理及运维工作交给腾讯云，您可专注于业务创新。', '100.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>裸金属云服务器</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>裸金属云服务器（Cloud Bare Metal，CBM）是一种可弹性伸缩的高性能云服务器实例，拥有物理服务器性能无损、资源安全隔离等优点。使用该服务，获取物理服务器的时间将缩短至分钟级。将容量管理及运维工作交给腾讯云，您可专注于业务创新。</p>\n<h3>应用场景</h3>\n<p>1、大数据</p>\n<p>基于 Apache Hadoop 框架搭建统一的大数据和计算平台，对海量数据进行采集、存储、分析、搜索、挖掘，发现其内在价值，适用于历史數據統計、交互式查询、精准营销、欺诈检测、社交网络分析等。<br />裸金属云服务器 CBM 最高提供单机 16T(SATA HDD)×12 的大容量服务器，满足海量存储与高速读写的需求；最高可提供双 bonding 的 100G 网络，满足海量数据交换需求。<br />安全灵活的 VPC 网络让您自定义逻辑隔离的网络空间，使业务部署更安全，更可靠。</p>\n<p>2、虚拟化</p>\n<p>越来越多的企业利用在 Openstack 上构建虚拟化（例如：KVM，<a href=\"https://www.kaihu123.com/vps/azure-container-applications/\" title=\"Docker \" target=\"_blank\">Docker </a>等）私有云平台，把 IT 基础架构向资源共享方向发展，解决共享资源的环境下业务高峰期性能瓶颈问题，提高企业或组织 IT 基础架构业务支撑灵活度，降低系统管理复杂性。<br />裸金属云服务器 CBM 通过腾讯云自研虚拟化技术，支持再次虚拟化，给虚拟化平台提供最大自由性，是搭建云端搭建专有云虚拟化平台的最佳选择。<br />VPC 网络让您灵活地自定义网络空间，满足虚拟化的多网络平面需求。</p>\n<p>3、游戏</p>\n<p>MMORPG（大型多人在线角色扮演游戏）画面绚丽、场面宏大、玩法和场景多样，深受玩家喜爱。尤其是大规模的跨服活动吸引众多玩家的加入，同一区域下所有玩家都相互可见，每位玩家的操作都要视野内广播，大量玩家的加入对接入服务器负载、稳定性和网络都有着极高的要求。<br />游戏应用生命周期短，运营高峰时需有大量服务器投入运营，可依靠腾讯云庞大的资源池实现快速扩容；生命周期未端则面临裁撤和贬值等问题，利用裸金属云服务器 CBM 按需购买、按量付费的特性，可改变游戏公司的成本结构以降低 TCO（总体拥有成本）。<br />购买高性能的裸金属云服务器 CBM 部署战斗逻辑模块，利用裸机性能应对高 I/O、高 PPS 需求。<br />腾讯云数据中心自带安全防护模块，可防护 DDOS、Cc 等攻击，实时保护 裸金属云服务器CBM 安全。</p>\n<p>4、高性能计算</p>\n<p>流体力学、结构仿真、基因测序、石油勘探等高性能计算场景，对服务器的计算性能、稳定性、实时性等要求非常高。裸金属云服务器 CBM 可提供物理机极致的计算能力。搭配腾讯云定制CPU，最高可提供单机256核的超高算力。<br />裸金属云服务器 CBM 提供最新一代GPU实例，支持GPU异构硬件加速HPC作业计算，可获得更高性价比。<br />裸金属高性能计算集群，支持基于RoCEv2的RDMA低延时网络互联，时延低至2-3us，支持多机动态算力扩展，同时获得近线性的计算加速比。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250204/951f91455c5039db4bce1fd7f7a77ae7.png\" /></p>\n</div>\n</div>', 0, 1738633435),
(78, '腾讯云弹性伸缩', '弹性伸缩', 'tencent-cloud-elastic-scalability', 110, '弹性伸缩（Auto Scaling，AS）为您提供高效管理计算资源的策略。您可设定时间周期性地执行管理策略或创建实时监控策略，来管理 CVM 实例数量，并完成对实例的环境部署，保证业务平稳顺利运行。', '100.00', '<div class=\"title-tab\">\n<h2 class=\"title light-theme\">弹性伸缩</h2>\n<div class=\"title light-theme\">自动化、具备计划性、高效且高容错性的低成本计算资源管理策略</div>\n<div class=\"title light-theme\"> </div>\n<div class=\"title light-theme\">弹性伸缩（Auto Scaling，AS）为您提供高效管理计算资源的策略。您可设定时间周期性地执行管理策略或创建实时监控策略，来管理 CVM 实例数量，并完成对实例的环境部署，保证业务平稳顺利运行。在需求高峰时，弹性伸缩自动增加 CVM 实例数量，以保证性能不受影响；当需求较低时，则会减少 CVM 实例数量以降低成本。弹性伸缩策略不仅能够让需求稳定规律的应用程序实现自动化管理，同时告别业务突增或CC攻击等带来的烦恼，对于每天、每周、每月使用量不停波动的应用程序还能够根据业务负载分钟级扩展。弹性伸缩策略让集群保持恰到好处的实例数量。</div>\n<div class=\"title light-theme\"> </div>\n<h3 class=\"title light-theme\">弹性web应用</h3>\n<div class=\"title light-theme\">\n<p><strong>业务类型</strong></p>\n<p>电商网站、视频网站、在线教育等。</p>\n<p><strong>策略</strong></p>\n<p>客户端的请求通过负载均衡到达应用服务器，当访问量快速变化时，弹性伸缩服务可根据请求量弹性扩缩应用服务器的数量。</p>\n<h3>高性能计算集群部署</h3>\n<p><strong>业务类型</strong></p>\n<p>分布式大数据的计算<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、数据检索服务器等后端计算集群。</p>\n<p><strong>策略</strong></p>\n<p>根据计算量大小实时调整集群服务器数量。</p>\n<h3>请求类服务器部署</h3>\n<p><strong>业务类型</strong></p>\n<p>发送请求或收集数据的服务器集群。</p>\n<p><strong>策略</strong></p>\n<p>由于此类业务具有明显的时效性，可以考虑弹性伸缩服务快速完成请求服务器的创建和缩容。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250204/5134534991f612745fa987780f10d682.png\" /></p>\n</div>\n</div>', 0, 1738633739),
(79, '腾讯云国际批量计算', '批量计算', 'tencent-cloud-international-batch-computing', 110, '批量计算（BatchCompute，Batch）是为有大数据计算业务的企业、科研单位等提供高性价比且易用的计算服务。批量计算 Batch 可以根据用户提供的批处理规模，智能地管理作业和调动其所需的最佳资源。有了 Batch 的帮助，您可以将精力集中在如何分析和处理数据结果上。', '200.00', '<div class=\"title-tab\">\n<h2 class=\"title light-theme\">批量计算</h2>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">智能调动资源以处理任意规模作业的低成本分布式计算平台</div>\n<div class=\"content light-theme\">批量计算（BatchCompute，Batch）是为有大数据计算业务的企业、科研单位等提供高性价比且易用的计算服务。批量计算 Batch 可以根据用户提供的批处理规模，智能地管理作业和调动其所需的最佳资源。有了 Batch 的帮助，您可以将精力集中在如何分析和处理数据结果上。</div>\n<div class=\"content light-theme\"> </div>\n<div class=\"content light-theme\">\n<div class=\"global-flex-title\">\n<h3 class=\"title light-theme\">批量计算功能</h3>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list\">\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\">精细任务定义</div>\n<div class=\"tci-content line-break7\">\n<p>使用 Batch，用户需要指定批处理任务需要的云服务器配置、镜像以及需要执行的代码或命令，Batch 将按照配置的信息来调度资源和启动计算任务。</p>\n<p><strong>定义云服务器配置</strong></p>\n<p>指定云服务器的 CPU、内存、磁盘大小等信息。</p>\n<p><strong>定义执行镜像</strong></p>\n<p>指定批处理任务依赖的执行环境，支持以 CVM 镜像和 Docker 的方式来指定执行环境。</p>\n<p><strong>运行命令行和参数</strong></p>\n<p>批量处理 Batch 创建好云服务器和完成镜像部署后，将会执行用户指定的命令行并添加用户配置的参数。</p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\">存储挂载</div>\n<div class=\"tci-content line-break7\">\n<p>Batch 支持将常见的云存储服务挂载到本地的能力，用户在操作云存储产品上的文件与在本地操作文件无差别，在海量并发访问情况下保证每个节点的访问速度，实现快速访问文件。Batch 支持对象存储 COS 挂载，用户在 Batch 的任务定义里配置需要挂载的 COS 地址，以及需要挂载到的本地地址，Batch 在计算节点启动时会自动进行挂载操作。</p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\">任务依赖关系建模</div>\n<div class=\"tci-content line-break7\">\n<p>Batch 可定义不同任务之间的依赖关系，还支持一个任务里启动多个实例完成计算任务。如您需要处理的任务可分为两个不同的阶段，每个阶段需要的资源不同。利用 Batch 的任务依赖功能，您可以创建两个不同资源需求的任务，其中下一个任务依赖于上一个任务。</p>\n<p><strong>DAG 流程编辑</strong></p>\n<p>可以通过 DAG 语法，来给多个批处理任务<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>依赖关系</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250204/1f32c80cb73c2f525b9f4590eca94b57.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738633974),
(80, '腾讯云高性能计算集群', '高性能计算集群', 'tencent-cloud-high-performance-computing-cluster', 110, '高性能计算集群（Hyper Computing Cluster）以高性能云服务器为节点，通过 RDMA 互联，大幅提升网络性能，提供高带宽和低延迟的网络服务。', '200.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>高性能计算集群</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>高性能计算集群（Hyper Computing Cluster）以高性能云服务器为节点，通过 RDMA 互联，大幅提升网络性能，提供高带宽和低延迟的网络服务。</p>\n<p><strong class=\"wordBreak line-break4\">1、无损算力</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>基于弹性高性能云服务器架构，HCC可实现计算无虚拟化损耗及服务器<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>无损，支持全自动化生产及弹性扩缩容，兼具灵活弹性与高性能。</p>\n<p><strong class=\"wordBreak line-break4\">2、高性能存储</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>支持通过COS或CFS产品实现存储容量灵活扩容并保障三副本强一致性。提供IO实例选型，搭配本地Nvme SSD硬盘，满足重IO及本地缓存场景需求。</p>\n<p><strong class=\"wordBreak line-break4\">3、高速网络</strong></p>\n<div class=\"card-div-content line-break9\">\n<p>支持VPC网络及无阻塞RoCEv2 RDMA网络实现节点间互联，传输时延低至2us，能广泛支持基于以太网的应用。</p>\n<h3 class=\"global-flex-title\"><span class=\"span\">应用场景</span></h3>\n<div>\n<div class=\"flex-default-flex-default-Tab\">\n<div class=\"ant-tabs\">\n<div class=\"ant-tabs-content-holder\">\n<section class=\"ant-tabs-content-holder__section\">\n<div class=\"architecture-article\">\n<p>大规模AI训练，材料仿真，工业仿真CAE等高性能计算场景，对服务器的计算性能、稳定性、实时性等要求非常高。</p>\n<p>高性云服务器提供最新一代CPU GPU 实例，支持GPU异构硬件加速 HPC 作业计算，可获得更高性价比。</p>\n<p>高性能云服务器计算集群，支持基于RoCEv2的RDMA低延时网络互联，时延低至2-3us，支持多机动态算力扩展，同时获得近线性的计算加速比。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250204/f493c03d563f8869d71174fa0a0dd8d9.png\" /></p>\n</div>\n</section>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738634159),
(81, '腾讯云计算边缘可用区', '边缘可用区', 'tencent-cloud-computing-edge-availability-zone', 110, '腾讯云边缘可用区（TencentCloud Edge Zone）是腾讯云的本地扩展，是基础设施部署的一种新形式。边缘可用区使您可以在更靠近用户的位置提供与中心节点一致的体验，从而向用户提供低延迟访问。', '100.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>边缘可用区</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>低延时、广覆盖、少成本的边缘云计算服务</p>\n<p>腾讯云边缘可用区（TencentCloud Edge Zone）是腾讯云的本地扩展，是基础设施部署的一种新形式。边缘可用区使您可以在更靠近用户的位置提供与中心节点一致的体验，从而向用户提供低延迟访问。</p>\n<h3>游戏加速</h3>\n<p>游戏端到端之间互动<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>强，边缘可用区通过本地运营商线路实现就近公网接入，通过腾讯云内网触达主节点内的服务器，有效降低时延，提升用户体验。同时实现公网接入侧多点容灾，降低公网带宽费用。</p>\n<h3>实时音视频</h3>\n<p>腾讯云边缘可用区提供覆盖本地的网络服务，通过公网实现对本地用户的覆盖，通过腾讯云内网保证内容传输效率，助力实时音视频业务更快、更稳定地运行。</p>\n<h3>CDN回源</h3>\n<p>腾讯云边缘可用区通过公网实现 CDN 回源的就近接入，降低公网带宽费用，作为源站边缘站点，减少回源流量，通过腾讯云内网保证中心节点源站内容传输效率。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250204/dcfe3a428dbe628f116e80b95d4f40e1.png\" /></p>\n</div>\n</div>', 0, 1738634358),
(82, '腾讯云分布式云专属可用区', '专属可用区', 'tencent-cloud-distributed-cloud-exclusive-availability-zone', 110, '专属可用区（Cloud Dedicated Zone）为部署在用户指定机房，由用户独享全部资源的可用区。 用户可在专属可用区内购买计算、存储、数据库等高可用资源，并具备与腾讯云常规可用区完全一致的操作体验。专属可用区还为用户提供软硬一体交付和运维服务，助力用户快速搭建安全可靠的专属云。', '100.00', '<h2>专属可用区</h2>\n<p>客户指定部署机房，<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>资源独享</p>\n<p>专属可用区（Cloud Dedicated Zone）为部署在用户指定机房，由用户独享全部资源的可用区。 用户可在专属可用区内购买计算、存储、数据库等高可用资源，并具备与腾讯云常规可用区完全一致的操作体验。专属可用区还为用户提供软硬一体交付和运维服务，助力用户快速搭建安全可靠的专属云。</p>\n<p>1、适用于搭建行业云或本地化的专属云，并且期望腾讯侧提供建设和运维能力的用户。可借助专属可用区，以较少的人力投入快速搭建其行业云或本地化的专属云，并且享有与云上统一的监控运维能力。</p>\n<p>2、适用于应用软件厂家，期望借助公有云搭建独有的 PaaS 或 SaaS 平台。例如，AI 平台、ERP 平台、CRM 平台等。可借助腾讯云标准基础建设及云上管控运维能力，以较少的人力投入快速搭建其业务平台。</p>\n<p>3、适用于对时延要求较高的用户，满足其就近部署公有云资源的需求。通过专属可用区进一步扩展边缘覆盖，为时延要求严格的应用提供就近边缘计算，可用于提供高质量的 AR/VR/MR 体验。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250204/b7d1b4d310adb87ea8c51c9146af51fc.png\" /></p>', 0, 1738634551),
(83, '腾讯云分布式云本地专用集群', '本地专用集群', 'tencent-cloud-distributed-cloud-local-dedicated-cluster', 110, '本地专用集群（Cloud Dedicated Cluster）是全新推出的基础设施类产品，目的是将中心化的公有云服务，延伸为可在客户机房落地的近场服务，融合公有云与本地 IDC 的双重优势，用户可以以本地化的时延和数据安全来使用公有云的丰富能力。', '200.00', '<h2>本地专用集群</h2>\n<p>本地专用集群（Cloud Dedicated Cluster）是全新推出的基础设施类产品，目的是将中心化的公有云服务，延伸为可在客户机房落地的近场服务，融合公有云与本地 IDC 的双重优势，用户可以以本地化的时延和数据安全来使用公有云的丰富能力。本地专用集群通过一体化机柜的形式在用户机房部署本地化算力，资源就近接入临近公有云地域实现统一管理，用户可通过公有云现有工具（控制台、API 等）来管理本地专用集群资源。</p>\n<h3>智慧工业</h3>\n<p>本地专用集群园区部署能力可以满足低时延和数据不出厂的诉求、降低企业IT运维人力<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和成本。</p>\n<p>腾讯遨驰分布式云底座,提供本地专用集群+PaaS/SaaS能⼒(例如本地专用集群、本地专用集群+数字孪⽣、本地专用集群+能碳平台等)。本地专用集群提供零信任本地数据审计能⼒和⽆机柜⽅案。</p>\n<h3>医疗健康</h3>\n<p>本地专用集群可以帮助医疗行业各级机构向用户提供检查、诊断等过程的信息服务，同时满足敏感信息本地保留的安全需求。</p>\n<p>通过在医院本地部署本地专用集群，可以实现极低时延的服务，例如检查、诊断及分析等过程相关的信息服务，满足医疗行业对低时延服务的高要求。</p>\n<p>本地专用集群可以帮助医疗行业各级机构满足敏感信息必须本地保留的安全需求，同时支持数据本地化不出客户机房的要求。</p>\n<h3>智慧出行</h3>\n<p>本地专用集群本地化部署模式既满足车联网数据安全要求，又兼备公有云的高稳定优势，更好助力车联网大数据发展。</p>\n<p>提供公有云级高可靠架构，致力于为您提供全天候7×24故障监控/解决服务，保障云平台的稳定性，为您的业务保驾护航。<br />本地化部署，数据合规，支持监控/审计。</p>\n<h3>金融创新</h3>\n<p>本地专用集群本地化、专属化部署模式可满足金融机构系统安全隔离的要求，借助本地专用集群，传统银行可以更好地管理分支机构和快速创新。</p>\n<p>本地专用集群部署在客户指定机房，实现了计算和存储的本地化，确保数据安全。<br />本地专用集群提供了软硬件/建设/运维等⼀站式打包服务，客户⽆需进⾏复杂的底座运维⼯作，可以聚焦有限的人力在自己的核心业务上。</p>', 0, 1738634778),
(84, '华为云国际弹性云服务器 ECS', '弹性云服务器 ECS', 'huawei-cloud-elastic-cloud-server-ecs', 123, '华为云弹性云服务器(简称ECS)是一种可随时自助获取,可弹性伸缩的云服务器,用户打造可靠,安全,灵活,高效的应用环境,确保服务持久稳定运行,提升运维效率。提供安全稳定、可随时自助获取、弹性伸缩的计算服务，灵活计费，极简运维，极大降低企业成本', '200.00', '<h2 class=\"por-text-title-t2-s banner-pc\">弹性云服务器 ECS</h2>\n<p>弹性云服务器（Elastic Cloud Server）是一种可随时自助获取、可弹性伸缩的云服务器，可帮助您打造可靠、安全、灵活、高效的应用环境，确保服务持久稳定运行，提升运维效率。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/13620be9ae33b5b0479c8800eebb4ff7.png\" /></p>\n<h3>为什么选择华为云弹性云服务器 ECS</h3>\n<p><strong>具备高稳定性能，满足200+业务场景需求</strong></p>\n<ul class=\"lists\">\n<li class=\"circle\">\n<p>数据持久性高达99.9999999%，保证数据安全可靠，保护您的业务免受故障影响</p>\n</li>\n<li class=\"circle\">\n<p>提供极速型SSD、超高IO、通用型SSD、高IO等多种性能规格的云硬盘</p>\n</li>\n<li class=\"circle\">\n<p>支持共享云硬盘、云硬盘加密、云硬盘备份、云服务器备份、快照等功能</p>\n</li>\n</ul>\n<p><strong>算力引领，业界首推千万级PPS转发实例</strong></p>\n<ul class=\"lists\">\n<li class=\"circle\">\n<p>最大提供384vCPU，8,064G内存，引领业界顶级算力</p>\n</li>\n<li class=\"circle\">\n<p>业界首推千万级PPS转发实例，单实例最大内网带宽可达100Gbps</p>\n</li>\n<li class=\"circle\">\n<p>千台弹性云服务器分钟级极速发放，满足业务高效稳定的诉求</p>\n</li>\n</ul>\n<p><strong>经济高效的资源投入，节省您的业务成本</strong></p>\n<ul class=\"lists\">\n<li class=\"circle\">\n<p>企业按需支付资源费用，大大降低固定资产投入，减轻业务拓展成本压力</p>\n</li>\n<li class=\"circle\">\n<p>通过可视化<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>配置定时或周期性的监控策略，动态调整弹性云服务器实例</p>\n</li>\n<li class=\"circle\">\n<p>提供按需、包周期、竞价等多种计费模式，满足不同场景需求，使用越久成本越低</p>\n</li>\n</ul>\n<p><strong>安全防护，位居IDC中国云厂商安全领导者地位</strong></p>\n<ul class=\"lists\">\n<li class=\"circle\">\n<p>华为云视“安全、稳定、高质量”为生命线，构建安全可信的云平台和云服务</p>\n</li>\n<li class=\"circle\">\n<p>打造20+云原生安全服务，聚合400家生态产品，帮助客户构筑立体的安全服务体系</p>\n</li>\n<li class=\"circle\">\n<p>构建七层防线、一个中心的全栈安全服务体系，实现攻击不瘫，数据不丢和监管合规</p>\n</li>\n</ul>\n<p> </p>', 0, 1738717815),
(85, '华为云Flexus云服务', 'Flexus云服务', 'huawei-cloud-flexus-cloud-services', 123, '华为云Flexus云服务包含Flexus应用服务器L实例、Flexus云服务器X实例、Flexus云数据库RDS、Flexus云容器实例等，各产品之间相互独立。您可以仅使用其中一种，也可以联合使用。', '200.00', '<h2 class=\"por-text-title-t2-s banner-pc\">Flexus云服务</h2>\n<p>匠心打造的下一代跃级产品，面向中低负载场景，性能倍增、体验跃级</p>\n<h3 class=\"topictitle1\">什么是<span id=\"text47821647203\">Flexus应用服务器L实例</span></h3>\n<p id=\"pd_01_0002__p1943674192614\">华为云Flexus云服务是新一代开箱即用、体验跃级、面向中小企业和开发者打造的高品价比云服务产品。<span id=\"pd_01_0002__text121128299264\">Flexus应用服务器L实例</span>是华为云Flexus云服务的一款云服务器产品。</p>\n<p id=\"pd_01_0002__p0921111015107\"><span id=\"pd_01_0002__text11921121051015\">Flexus应用服务器L实例</span>是新一代开箱即用、面向中小企业和开发者打造的全新<strong id=\"pd_01_0002__b1339236154912\">轻量级应用服务器</strong>。<span id=\"pd_01_0002__text15921101071015\">Flexus应用服务器L实例</span>提供丰富严选的应用镜像，实现应用一键部署，适用于网站搭建、开发测试环境、企业应用、网站分析、音视频服务等中低负载场景。具有易搭建、更实惠、易维护、更安全的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。</p>\n<p id=\"pd_01_0002__p76071128162810\"><span id=\"pd_01_0002__text11558821716\">Flexus应用服务器L实例</span>使用门槛较低，如果您是正在了解云计算服务的入门用户，或是需要在服务器中部署简单应用的个人开发者、中小企业，那么推荐您选择<span id=\"pd_01_0002__text794910291214\">Flexus应用服务器L实例</span>。</p>\n<h3 class=\"topicTitle-h1\">什么是Flexus云服务器X实例</h3>\n<p id=\"pd_01_0002__p1897051403312\">华为云Flexus云服务是新一代开箱即用、体验跃级、面向中小企业和开发者打造的高品价比云服务产品。<span id=\"pd_01_0002__text1431042343310\">Flexus云服务器X实例</span>是华为云Flexus云服务的一个产品。</p>\n<p id=\"pd_01_0002__p10253957191811\"><span id=\"pd_01_0002__text56434531977\">Flexus云服务器X实例</span>是新一代面向中小企业和开发者打造的柔性算力云服务器，可智能感知业务负载，适用于电商直播、企业建站、开发测试环境、游戏服务器、音视频服务等中低负载场景。相较于<span id=\"pd_01_0002__text132513249297\">Flexus应用服务器</span>L实例，<span id=\"pd_01_0002__text1925122416294\">Flexus云服务器X实例</span>的优势包含：提供丰富的公共镜像、可灵活自定义vCPU内存配比、智能感知业务动态升降配，负载范围更高等。</p>\n<h3 class=\"topicTitle-h1\">什么是<span id=\"text374191942110\">Flexus云数据库RDS</span></h3>\n<p>华为云Flexus云服务是新一代开箱即用、体验跃级、面向中小企业和开发者打造的高性价比云服务产品。Flexus云数据库RDS是华为云Flexus云服务的一个产品。FlexusRDS支持以下引擎：</p>\n<p>MySQL<br />PostgreSQL</p>', 0, 1738719303),
(86, '华为云 GPU加速云服务器 GACS', 'GPU加速云服务器 GACS', 'huawei-cloud-gpu-accelerated-cloud-server-gacs', 123, 'GPU加速型云服务器（GPU Accelerated Cloud Server，GACS）能够提供强大的浮点计算能力，从容应对高实时、高并发的海量计算场景。该类型弹性云服务器默认开启超线程，每个vCPU对应一个底层超线程HT（Hyper-Threading）。', '500.00', '<h2>GPU加速云服务器 GACS</h2>\n<p>能够提供优秀的浮点计算能力，从容应对高实时、高并发的海量计算场景。P系列适合于深度学习，科学计算，CAE等；G系列适合于3D动画渲染，CAD等</p>\n<h3>为什么选择华为云GPU加速云服务器 GACS</h3>\n<p><strong>超强计算能力，从容应对海量计算场景</strong></p>\n<ul class=\"lists\">\n<li class=\"circle\">\n<p>提供超强算力的GPU计算卡和自研昇腾加速卡，满足人工智能、科学计算、图形工作站等计算场景</p>\n</li>\n<li class=\"circle\">\n<p>网络性能出色，支持GPU Direct over RDMA，100G超高带宽， 2us超低时延</p>\n</li>\n<li class=\"circle\">\n<p>一键式部署，分钟级实例发放，让您聚焦核心业务</p>\n</li>\n</ul>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/2a43b2245e72acca8b8e0b0bb570bd64.svg\" /></p>\n<p><strong>经济高效的资源投入，大幅节省您的业务成本</strong></p>\n<ul class=\"lists\">\n<li class=\"circle\">\n<p>企业按需支付资源费用，大大降低固定资产投入，减轻业务拓展成本压力</p>\n</li>\n<li class=\"circle\">\n<p>通过可视化控制台配置定时或周期性的监控策略，动态<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>弹性云服务器实例</p>\n</li>\n<li class=\"circle\">\n<p>提供按需、包周期、竞价等多种计费模式，满足不同场景需求，使用越久成本越低</p>\n</li>\n</ul>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/40a6c4ed102b82fe561a73e1d36aabd3.svg\" /></p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/9aed41782f1999998ced446a8e42064d.png\" /></p>\n<p> </p>', 0, 1738719626),
(87, '华为云裸金属服务器 BMS', '裸金属服务器 BMS', 'huawei-cloud-bare-metal-server-bms', 123, '裸金属服务器（Bare Metal Server）是一款兼具虚拟机弹性和物理机性能的计算类服务，为您和您的企业提供专属的云上物理服务器，为核心数据库、关键应用系统、高性能计算、大数据等业务提供卓越的计算性能以及数据安全。', '500.00', '<h2 class=\"topictitle1\">什么是裸金属服务器</h2>\n<h3 id=\"section0\" class=\"sectiontitle section-copy\">裸金属服务器介绍</h3>\n<p id=\"bms_01_0001__p6187451172440\">裸金属服务（Bare Metal Server，BMS）是一款兼具弹性云服务器和物理机性能的计算类服务，为您和您的企业提供专属的云上物理服务器，为核心数据库、关键应用系统、高性能计算、大数据等业务提供卓越的计算性能以及数据安全。租户可灵活申请，按需使用。</p>\n<p id=\"bms_01_0001__p11904111515526\">裸金属服务器的开通是自助完成的，您只需要指定具体的服务器类型、镜像、所需要的网络配置等，即可在30min内获得所需的裸金属服务器。服务器供应、运维工作交由华为云，您可以专注于业务创新。</p>\n<h3 id=\"section1\" class=\"sectiontitle section-copy\">产品架构</h3>\n<p id=\"bms_01_0001__p1583419793518\">通过和其他服务组合，裸金属服务器可以实现计算、存储、网络、镜像安装等功能：</p>\n<ul id=\"bms_01_0001__ul116211317133919\">\n<li id=\"bms_01_0001__li9621517203912\">裸金属服务器在不同可用区中部署（可用区之间通过内网连接），部分可用区发生故障后不会影响同一区域内的其他可用区。</li>\n<li id=\"bms_01_0001__li11621201773914\">可以通过虚拟<a href=\"https://www.kaihu123.com/vps/alibabacloud-elastic-bare-metal-server/\" title=\"私有云\" target=\"_blank\">私有云</a>（Virtual Private Cloud，VPC）建立专属的网络环境，设置子网、安全组，并通过弹性公网IP实现外网链接（需带宽支持）。</li>\n<li id=\"bms_01_0001__li962119176391\">通过镜像服务，可以对裸金属服务器安装镜像，也可以通过私有镜像批量创建裸金属服务器，实现快速的业务部署。</li>\n<li id=\"bms_01_0001__li17621517103917\">通过云硬盘服务实现数据存储，并通过云硬盘备份服务实现数据的备份和恢复。</li>\n<li id=\"bms_01_0001__li16218172391\">云监控是保持裸金属服务器可靠性、可用性和性能的重要部分，通过云监控，用户可以观察裸金属服务器资源。</li>\n<li id=\"bms_01_0001__li1562181720392\">云备份提供对云硬盘和裸金属服务器的备份保护服务，支持基于快照技术的备份服务，并支持利用备份数据恢复服务器和磁盘的数据。</li>\n</ul>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/96c150eb511292020dbde4cca03f141b.png\" /></p>\n<h3 id=\"section2\" class=\"sectiontitle section-copy\">裸金属服务器与物理机、虚拟机的功能对比</h3>\n<p>裸金属服务器与物理机、虚拟机的对比如表1所示。其中，Y表示支持，N表示不支持，N/A表示不涉及。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/bac736f0427c6f2f67b43eb2277f85b0.png\" /></p>\n<p> </p>\n<p> </p>\n<p> </p>', 0, 1738719904),
(88, '华为云专属主机 DeH', '专属主机 DeH', 'huawei-cloud-exclusive-host-deh', 123, '专属主机（Dedicated Host），是指用户可独享的专属物理主机资源。您可以将云服务器创建在您的专属主机上，从而满足您对隔离性、安全性、性能的更高要求。', '500.00', '<h2>专属主机 DeH</h2>\n<p>专属主机（Dedicated Host，DeH），是指用户可独享的专属物理主机资源。您可以将云服务器创建在您的专属主机上，满足您对隔离性、安全性、性能的更高要求。同时，您还可以在迁移业务至专属主机时，继续使用迁移前的服务器端软件许可，即支持自带许可（BYOL），达到节省开支、提高对云服务器的自治等目的。</p>\n<p>专属主机与普通ECS主机的区别如图1所示。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/298b22357236d99048dd0c241bb320ff.png\" /></p>\n<p>您作为专属主机的唯一租户，不需要与其他租户共享主机的物理资源，您还可以获取这台服务器的物理属性，包括Sockets、物理内核、CPU类型、内存大小，并根据专属主机规格创建指定规格族的云服务器。</p>\n<h3 id=\"section0\" class=\"sectiontitle section-copy\"><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>部署方式</h3>\n<p id=\"deh_01_0003__p12505163724215\">您在部署云服务器时，可以通过“专属主机”配置项指定DeH，也可以由系统选择DeH。</p>\n<ul id=\"deh_01_0003__ul3706839172425\">\n<li id=\"deh_01_0003__li37869255172425\">“专属主机”配置项选择某台DeH时，表示指定该DeH来创建云服务器。\n<p id=\"deh_01_0003__p65040297172429\"><a name=\"deh_01_0003__li37869255172425\"></a><a name=\"li37869255172425\"></a>您可以在DeH控制台选择一台DeH来创建云服务器；也可以在创建云服务器时，选择创建到指定的DeH上。</p>\n</li>\n<li id=\"deh_01_0003__li58263000172425\">“专属主机”配置项选择“自动放置”时，表示由系统选择一台DeH来创建云服务器。\n<p id=\"deh_01_0003__p54604270172434\"><a name=\"deh_01_0003__li58263000172425\"></a><a name=\"li58263000172425\"></a>此时系统会将云服务器创建在符合规格的DeH中剩余内存最大的那一台上，以使各DeH尽量均衡负载。</p>\n</li>\n</ul>\n<p id=\"deh_01_0003__p60219662172420\">这两种不同的使用方式相结合，既能满足您对所部署应用的隔离性、安全性、合规性等要求，同时也能合理利用资源，使云服务器的性能更优化。</p>', 0, 1738720090),
(89, '华为云弹性伸缩 AS', '弹性伸缩 AS', 'huawei-cloud-elastic-scalable-as', 123, '弹性伸缩（Auto Scaling）根据用户的业务需求和策略，自动调整资源。可配置定时、周期或告警策略，使用户资源随业务负载增长而增加，随业务负载降低而减少，节省云上业务资费，保障业务平稳健康运行。', '500.00', '<h2 class=\"topictitle1\">什么是弹性伸缩？</h2>\n<h3 id=\"section0\" class=\"sectiontitle section-copy\">弹性伸缩简介</h3>\n<p>弹性伸缩（Auto Scaling，以下简称AS）是根据用户的业务需求，通过设置伸缩规则来自动增加/缩减业务资源。当业务需求增长时，AS自动为您增加弹性云服务器（ECS）实例或带宽资源，以保证业务能力；当业务需求下降时，AS自动为您缩减弹性云服务器（ECS）实例或带宽资源，以节约成本。AS支持自动调整弹性云服务器和带宽资源。</p>\n<h3 id=\"section1\" class=\"sectiontitle section-copy\">产品架构</h3>\n<p id=\"zh-cn_topic_0042018383__p8060118\">通过伸缩控制可以实现弹性云服务器（ECS）实例伸缩和带宽伸缩：</p>\n<ul id=\"zh-cn_topic_0042018383__ul1678357173113\">\n<li id=\"zh-cn_topic_0042018383__li12783074311\">伸缩控制：配置策略设置指标<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>/伸缩活动执行的时间，通过云监控监控指标是否达到<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>，通过定时调度，实现伸缩控制。</li>\n<li id=\"zh-cn_topic_0042018383__li13522113415373\">配置策略：可以根据业务需求，配置告警策略/定时策略/周期策略。</li>\n<li id=\"zh-cn_topic_0042018383__li158742451391\">配置告警策略：可配置CPU、内存、磁盘、入网流量等监控指标。</li>\n<li id=\"zh-cn_topic_0042018383__li1681414814617\">配置定时策略：通过配置触发时间可以配置定时策略。</li>\n<li id=\"zh-cn_topic_0042018383__li196121833124918\">配置周期策略：通过配置重复周期、触发时间、生效时间可以配置周期策略。</li>\n<li id=\"zh-cn_topic_0042018383__li95761439517\">云监控监控到所配置的告警策略中的某些指标达到告警<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>，从而触发伸缩活动，实现ECS实例的增加/减少或带宽的增大/减小。</li>\n<li id=\"zh-cn_topic_0042018383__li735815075415\">到达所配置的触发时间时，触发伸缩活动，实现ECS实例的增加/减少或带宽的增大/减小。</li>\n</ul>\n<div id=\"zh-cn_topic_0042018383__fig09227462567\" class=\"fignone\"><span class=\"figcap\"><strong>图1 </strong>弹性伸缩产品架构图</span></div>\n<div class=\"fignone\"><span class=\"figcap\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/41c7d55234592ce9f27df42eda086948.png\" /></span></div>\n<div class=\"fignone\">\n<h3>访问方式</h3>\n<p>公有云提供了Web化的服务管理平台，即管理控制台和基于HTTPS请求的API（Application programming interface）管理方式。</p>\n<p>API方式<br />如果用户需要将公有云平台上的弹性伸缩服务集成到第三方系统，用于二次开发，请使用API方式访问弹性伸缩服务，具体操作请参见《弹性伸缩API参考》。</p>\n<p>控制台方式<br />其他相关操作，请使用管理控制台方式访问弹性伸缩服务。</p>\n<p>如果用户已注册公有云，可直接登录管理控制台，从主页选择“弹性伸缩”。</p>\n</div>', 0, 1738721162),
(90, '华为云镜像服务 IMS', '镜像服务 IMS', 'huawei-cloud-mirroring-service-ims', 123, '镜像是用于创建服务器或磁盘的模板。镜像服务（Image Management Service，IMS）提供镜像的全生命周期管理能力，帮助用户快速部署业务。', '500.00', '<h2 class=\"topictitle1\">什么是镜像服务</h2>\n<h3 id=\"section0\" class=\"sectiontitle section-copy\">镜像与镜像服务</h3>\n<p>镜像是用于创建服务器或磁盘的模板，包含操作系统、业务数据或应用软件。</p>\n<p>镜像服务（Image Management Service）提供镜像的生命周期管理能力。用户可以灵活地<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>公共镜像、私有镜像或共享镜像申请弹性云服务器和裸金属服务器。同时，用户还能通过已有的云服务器或<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>外部镜像文件创建私有镜像，实现业务上云或云上迁移。</p>\n<h3 id=\"section1\" class=\"sectiontitle section-copy\">镜像类型<em id=\"copy-icon1\" class=\"copy-section-icon\" data-clipboard-text=\"https://support.huaweicloud.com/intl/zh-cn/productdesc-ims/zh-cn_topic_0013901609.html#section1\"></em></h3>\n<p>镜像分为公共镜像、私有镜像、共享镜像、市场镜像。公共镜像为系统默认提供的镜像，私有镜像为用户自己创建的镜像，共享镜像为其他用户共享的私有镜像。</p>\n<p>图1以动图的形式展示了各类型镜像间的关系。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/957ae4615400872180e1312c32ba033e.gif\" /></p>\n<h3>镜像服务的功能</h3>\n<p>镜像服务主要有以下功能：</p>\n<p>提供常见的主流操作系统公共镜像。<br />由现有运行的云服务器，或由外部导入的方式来创建私有镜像。<br />管理公共镜像，例如：按操作系统类型/名称/ID搜索，查看镜像ID、系统盘大小等详情，查看镜像支持的特性（用户数据注入、磁盘热插拔等）。<br />管理私有镜像，例如：修改镜像属性，共享镜像，复制镜像等。<br />通过镜像创建云服务器。</p>\n<h3>访问方式</h3>\n<p>公有云提供了Web化的服务管理平台（即管理控制台）和基于HTTPS请求的API（Application programming interface）管理方式。</p>\n<p>API方式<br />如果用户需要将镜像服务集成到第三方系统，用于二次开发，请<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>API方式访问镜像服务。具体操作请参见《镜像服务API参考》。</p>\n<p>管理控制台方式<br />其他相关操作，请<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>管理控制台方式访问镜像服务。如果用户已在云平台注册，可直接登录管理控制台，从主页选择“镜像服务”。</p>', 0, 1738721510),
(91, '华为云函数工作流 FunctionGraph', '函数工作流 FunctionGraph', 'huawei-cloud-function-workflow-functionalgraph', 123, '函数工作流（FunctionGraph）是一项基于事件驱动的函数托管计算服务。通过函数工作流，只需编写业务函数代码并设置运行的条件，无需配置和管理服务器等基础设施，函数以弹性、免运维、高可靠的方式运行。此外，按函数实际执行资源计费，不执行不产生费用', '500.00', '<div class=\"c-div subsection_div intor_title_p01\">\n<h2 class=\"c-paragraph intro_title_01\">函数工作流</h2>\n</div>\n<div class=\"c-div div_pIJUvG\">\n<div class=\"intro_content_01\">\n<p>函数工作流（FunctionGraph）是华为云提供的一款无服务器（Serverless）计算服务，无服务器计算是一种托管服务，服务提供商会实时为你分配充足的资源，而不需要预留专用的服务器或容量。</p>\n<p>FunctionGraph是一项基于事件驱动的函数托管计算服务。使用FunctionGraph函数，只需编写业务函数代码并设置运行的条件，无需配置和管理服务器等基础设施，函数以弹性、免运维、高可靠的方式运行。此外，按函数实际执行资源计费，不执行不产生费用。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/e6797b859c00dfd56aec9aef0d3e7f7e.png\" /></p>\n<h3>功能简介</h3>\n<p>①编写代码</p>\n<p>用户编写业务代码，目前支持Node.js、Python、Java、Go、C#、PHP、Cangjie等语言，<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>请参考开发指南。</p>\n<p>②上传代码</p>\n<p>目前支持在线编辑、上传ZIP或JAR包，从OBS引用ZIP包等，<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>请参考代码上传方式说明。</p>\n<p>③API和云产品事件源触发函数执行</p>\n<p>通过RESTful API或者云产品事件源触发函数执行，生成函数实例，实现业务功能。</p>\n<p>④弹性执行</p>\n<p>函数在执行过程中，会根据请求量弹性扩容，支持请求峰值的执行，此过程用户无需配置，由FunctionGraph完成，并发数限制请参考约束与限制。</p>\n<p>⑤查看日志</p>\n<p>FunctionGraph函数实现了与云日志服务的对接，您无需配置，即可查看函数运行日志信息，请参考查询日志。</p>\n<p>⑥查看监控</p>\n<p>FunctionGraph函数实现了与应用运维管理服务的对接，您无需配置，即可查看图形化监控信息。</p>\n<p>⑦计费方式</p>\n<p>函数执行结束后，根据函数请求执行次数和执行时间计费。</p>\n</div>\n</div>', 0, 1738721670),
(92, '华为云专属计算集群服务 DCC', '专属计算集群服务 DCC', 'huawei-cloud-exclusive-computing-cluster-service-dcc', 123, '专属计算集群（Dedicated Computing Cluster）为用户提供物理隔离的云上专属计算资源池。适用于金融安全、数据仓库、基因测序、生物制药等对资源独享，性能要求高的场景。用户可申请独占物理设备，独享计算，从而保证业务稳定运行。 包年一站式购买， 不同型号资源价格不同，4台起售。', '500.00', '<h2>专属计算集群服务 DCC</h2>\n<p>专属计算集群（Dedicated Computing Cluster）为用户提供物理隔离的云上专属计算资源池。适用于金融安全、数据仓库、基因测序、生物制药等对资源独享，性能要求高的场景。用户可申请独占物理设备，独享计算，从而保证业务稳定运行。 包年一站式购买， 不同型号资源价格不同，4台起售。</p>\n<h3 class=\"topictitle1\">什么是专属计算集群</h3>\n<p id=\"zh-cn_topic_0016310838__p11844170164917\">专属计算集群（Dedicated Computing Cluster，简称DCC）是在公有云上隔离出来的专属虚拟计算资源池，<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>用户申请独占的物理设备，独享物理隔离的计算资源。</p>\n<p id=\"zh-cn_topic_0016310838__p16605450182210\">用户通过独立的租户来在该资源池内申请宿主机资源后，可以在其上发放弹性云服务器。</p>\n<p id=\"zh-cn_topic_0016310838__p460595011223\">专属计算集群需要在专属云中使用，用户在申请后才予以开通权限。用户可在专属云内对专属计算资源统一管理。</p>\n<h3 class=\"topictitle1\">功能介绍</h3>\n<ul id=\"dcc_01_0002__ul23003434165845\">\n<li id=\"dcc_01_0002__li631116363019\">计算隔离\n<p id=\"dcc_01_0002__p11311637305\"><a name=\"dcc_01_0002__li631116363019\"></a><a name=\"li631116363019\"></a>独享计算资源池，部署在独立的物理集群中，确保云服务器资源运行在物理隔离的专属计算资源池内。</p>\n</li>\n<li id=\"dcc_01_0002__li1431112319307\">灵活部署\n<p id=\"dcc_01_0002__p1431113113014\"><a name=\"dcc_01_0002__li1431112319307\"></a><a name=\"li1431112319307\"></a><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>多区域，多可用区，多计算集群部署，集成对接专属分布式存储，用户可自配置网络，提供安全组策略，方便用户构建立体防护网络。</p>\n</li>\n<li id=\"dcc_01_0002__li173118318305\">灵活创建\n<p id=\"dcc_01_0002__p20311533307\"><a name=\"dcc_01_0002__li173118318305\"></a><a name=\"li173118318305\"></a>用户可指定不同专属计算池，不同专属物理机进行弹性云服务器创建，<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>对弹性云服务器HA能力的选择。</p>\n</li>\n<li id=\"dcc_01_0002__li163111137309\">资源管控\n<p id=\"dcc_01_0002__p1311931306\"><a name=\"dcc_01_0002__li163111137309\"></a><a name=\"li163111137309\"></a>用户可以查看专属计算集群下的物理机列表和计算资源总量和消耗量以及物理机上弹性云服务器的列表，用户能直观的查看和管理计算资源。</p>\n</li>\n</ul>\n<h3 class=\"topictitle1\">使用场景</h3>\n<ul id=\"dcc_01_0003__ul4467821015174\">\n<li id=\"dcc_01_0003__li5523088415177\">对安全有高要求的行业。\n<p id=\"dcc_01_0003__p318085123108\"><a name=\"dcc_01_0003__li5523088415177\"></a><a name=\"li5523088415177\"></a>用户间计算资源物理隔离，网络资源逻辑隔离，结合分布式存储及多种安全防护产品，为用户打造一个立体的安全防护环境。</p>\n</li>\n<li id=\"dcc_01_0003__li6510503815177\">对系统稳定运行有要求的行业。\n<p id=\"dcc_01_0003__p356155151773\"><a name=\"dcc_01_0003__li6510503815177\"></a><a name=\"li6510503815177\"></a>用户独占物理资源，保障用户的业务平稳运行。</p>\n</li>\n<li id=\"dcc_01_0003__li4890149317722\">对资源使用灵活性要求高的行业。\n<p id=\"dcc_01_0003__p3069577017726\"><a name=\"dcc_01_0003__li4890149317722\"></a><a name=\"li4890149317722\"></a>用户可随时创建、删除资源，利用镜像服务及备份服务可快速创建还原环境。通过资源浏览功能，实时掌握资源的使用情况。</p>\n</li>\n</ul>', 0, 1738722815),
(93, '华为云 云手机服务器 CPH', '云手机服务器 CPH', 'huawei-cloud-mobile-phone-server-cph', 123, '云手机服务器（Cloud Phone Host，简称CPH），是基于华为云鲲鹏裸金属服务器在服务器上虚拟出N个带有原生安卓操作系统，具有虚拟手机功能的云手机实例。', '500.00', '<h2>云手机服务器</h2>\n<p>云手机服务器（Cloud Phone Host），是基于华为云裸金属服务器虚拟出的带有原生安卓操作系统，同时具有虚拟手机功能的云服务器。您可以远程实时控制云手机，实现安卓APP的云端运行；也可以基于云手机的基础算力，高效搭建应用。</p>\n<h3 class=\"topictitle1\">什么是云手机服务器？</h3>\n<h4 id=\"section0\" class=\"sectiontitle section-copy\"><strong>云手机服务器介绍</strong></h4>\n<p>云手机服务器（Cloud Phone Host，简称CPH），是基于华为云鲲鹏裸金属服务器在服务器上虚拟出N个带有原生安卓操作系统，具有虚拟手机功能的云手机服务器。简单来说，云手机服务器=云服务器+Android OS。您可以远程实时控制云手机，实现安卓APP的云端运行；也可以基于云手机服务器的基础算力，高效搭建应用，如云游戏、移动办公、直播互娱等场景。</p>\n<h3 id=\"section1\" class=\"sectiontitle section-copy\">为什么选择云手机服务器？</h3>\n<p>作为一种新型服务，云手机服务器对传统物理手机起到了非常好的延展和补充作用，可以用在诸如APP仿真测试、云手游、直播互娱、移动办公等场景，让移动应用不但可以在物理手机运行，还可以在云端智能运行。</p>\n<p>降本增效<br />面向如APP仿真测试等互联网行业场景，单台手机的处理效率非常有限，通过云手机的方式，大幅降低人工操作和设备采购维护成本。</p>\n<p>安全保障<br />云手机由于应用数据运行在云上，面向政府、金融等信息安全诉求较高的行业，提供更加安全高效的移动办公解决方案。员工通过使用云手机的方式登录办公系统，公私数据分离，同时企业也可对云手机服务器进行智能管理，降本增效的同时，信息安全也更加有保障。</p>\n<p>探索游戏、直播行业新可能<br />云手机服务器还可以为游戏、直播等行业提供全新的互动体验方式，开拓新的商业模式和市场空间。以云手游场景为例，因为游戏的内容实际是在云上虚拟手机上运行，可以提前安装部署和动态加载，所以对于最终玩家来说，游戏可以做到无需下载，即点即玩，大幅提高玩家转换率。同时可以让中低配手机用户也能流畅运行大型手游，增大游戏覆盖的用户范围。</p>\n<h3 id=\"section2\" class=\"sectiontitle section-copy\">产品架构<em id=\"copy-icon2\" class=\"copy-section-icon\" data-clipboard-text=\"https://support.huaweicloud.com/intl/zh-cn/productdesc-cph/cph_prod_0002.html#section2\"></em></h3>\n<p>云手机服务器产品架构分三部分，云手机侧、终端设备侧以及客户业务侧，如图1所示。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250205/2234dac0e2c29e30f9bd2cca42ca673b.png\" /></p>\n<p>云手机服务器基于华为TaiShan ARM服务器实现，集成多张高性价比的专业GPU显卡，可提供专业的图形图像处理能力。TaiShan服务器中运行了EulerOS作为Host OS，在Host OS中通过自研MonBox技术生成容器，在容器中运行开源AOSP系统，从而虚拟出多台云手机。由于TaiShan服务器基于ARM架构，而手机系统也基于ARM架构，所以减少了指令集转换所带来的翻译算力损耗，可以达到更好的使用体验。</p>\n<p>云手机服务器提供了视频、音频以及触控SDK。客户基于终端设备可以开发相应的APP，来获取云手机的音频、视频；也可以采集触控指令，如触摸屏、滑动、单击等操作指令，从而在云手机上来执行。</p>\n<p>在业务侧，客户通过管理控制台、API、ADB端口及其他自定义端口可以对云手机服务器进行资源管理、应用管理、运维管理和接入管理等。</p>\n<p>资源管理：购买、查询云手机服务器。<br />应用管理：云手机应用程序推送、安装、卸载等。<br />运维管理：重启、重置、关机、开机云手机服务器。<br />接入管理：云手机服务器接入认证。</p>\n<h3 id=\"section3\" class=\"sectiontitle section-copy\"><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的区域</h3>\n<p>云手机服务器当前仅<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>在部分区域使用，<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的区域如下：</p>\n<p>华东-上海一<br />华东-上海二<br />华南-广州<br />西南-贵阳一<br />中国-香港<br />亚太-新加坡<br />拉美-圣地亚哥</p>\n<h3 id=\"section4\" class=\"sectiontitle section-copy\">使用对象<em id=\"copy-icon4\" class=\"copy-section-icon\" data-clipboard-text=\"https://support.huaweicloud.com/intl/zh-cn/productdesc-cph/cph_prod_0002.html#section4\"></em></h3>\n<p>云手机服务器的使用对象以企业用户为主，用户应了解基本的计算机基础知识，并具有一定的开发能力，以便基于云手机进行二次开发。个人用户如果想试玩或执行一些简单操作，也可以购买使用，我们会提供相应的操作指导和专家协助。</p>\n<h3 id=\"section5\" class=\"sectiontitle section-copy\">使用方式<em id=\"copy-icon5\" class=\"copy-section-icon\" data-clipboard-text=\"https://support.huaweicloud.com/intl/zh-cn/productdesc-cph/cph_prod_0002.html#section5\"></em></h3>\n<p>云平台提供了Web化的服务管理系统（即管理控制台）和基于HTTPS请求的API（Application programming interface）管理方式。</p>\n<p>API方式<br />如果用户需要将云手机集成到第三方系统，用于二次开发，请使用API方式访问云手机服务器。</p>\n<p>管理控制台方式<br />其他相关操作，如购买、连接云手机实例，请使用管理控制台方式访问云手机服务器。</p>\n<p>云手机实例以服务器为单位购买，您只需要指定具体的服务器类型、实例规格、手机镜像、所需要的网络配置等，即可获得一台服务器，以及相应数量的云手机实例。</p>', 0, 1738723223),
(94, '腾讯云容器服务', '容器服务', 'tencent-cloud-container-service', 111, '腾讯云容器服务（Tencent Kubernetes Engine ，TKE）基于原生 kubernetes 提供以容器为核心、高度可扩展的高性能容器管理服务。稳定、安全、高效、灵活扩展、简单易用的 Kubernetes 容器管理平台500', '500.00', '<p>腾讯云容器服务（Tencent Kubernetes Engine ，TKE）基于原生 kubernetes 提供以容器为核心、高度可扩展的高性能容器管理服务。TKE完全兼容原生 kubernetes API ，扩展了腾讯云的云硬盘（Cloud Block Storage, CBS）、负载均衡 （Cloud Load Balancer, CLB）等kubernetes 插件，为容器化的应用提供高效部署、资源调度、服务发现和动态伸缩等一系列完整功能，解决用户开发、测试及运维过程的环境一致性问题，提高了大规模容器集群管理的便捷性，帮助用户降低成本，提高效率。容器服务提供免费使用，涉及的其他云产品另外单独计费。</p>\n<h3><strong class=\"wordBreak line-break4\">生态开源</strong></h3>\n<div class=\"card-div-content line-break9\">\n<p>腾讯云容器服务完全兼容 kubernetes 全能力，适配了腾讯云云服务器（Cloud Virtual Machine, CVM）、云硬盘（Cloud Block Storage, CBS）等 IAAS 的基本能力。同时腾讯云提供的基于 kubernetes 开放的云硬盘 CBS、负载均衡 CLB等云产品，支持多种开源应用一键部署到容器集群中，极大提升部署效率。</p>\n<h3><span class=\"wordBreak line-break4\">安全可靠</span></h3>\n<div class=\"card-div-content line-break9\">\n<p>容器服务启动于专用云服务器实例中，独享计算资源。集群运行在私有网络，支持自定义安全组和网络 ACL。容器服务采用分布式服务架构，实现服务故障自动修复、数据快速迁移；结合有状态服务后端的分布式存储，实现高可用服务和数据的安全。</p>\n<h3><span class=\"wordBreak line-break4\">简单易用</span></h3>\n<div class=\"card-div-content line-break9\">\n<p>使用容器服务，您无需再使用集群管理软件和设计容错集群架构，便可简化大规模集群管理和分布式应用的管理、运维。您只需启动容器集群，并指定想要运行的任务，容器服务即可帮您完成所有的集群管理工作，让您专心投入开发 Docker 化的应用程序。</p>\n<h3><span class=\"wordBreak line-break4\">高效部署</span></h3>\n<div class=\"card-div-content line-break9\">\n<p>容器服务运行在高品质的 BGP 网络中，能够实现镜像极速下载和上传，海量容器秒级启动，提高容器部署效率；容器服务可对提交的业务代码进行快速构建、测试和打包集成，将集成的代码部署到预<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>环境和现网环境上。</p>\n<h3><span class=\"wordBreak line-break4\">灵活扩展</span></h3>\n<div class=\"card-div-content line-break9\">\n<p>容器服务支持灵活集群托管，便于安排长期运行的应用程序和批量作业，以便扩展您的业务。容器服务同时集成负载均衡，支持在多个容器之间分配流量，自动恢复运行状况不佳的容器，保证容器数量满足您的需求，以便为应用程序提供支持。</p>\n<h3><span class=\"wordBreak line-break4\">低成本</span></h3>\n<div class=\"card-div-content line-break9\">\n<p>容器服务托管集群具有极高性价比，您只需花费少量费用即可获得高稳定、高可靠、可扩展的集群管理面，让您可专注于容器化应用的开发，而无需关心集群的管理以及维护。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738804900);
INSERT INTO `mx_cloud` (`id`, `title`, `name`, `alias`, `cid`, `des`, `usd`, `intro`, `status`, `addtime`) VALUES
(95, '腾讯云 Serverless 容器服务', 'Serverless 容器服务', 'tencent-cloud-serverless-container-service', 111, 'Serverless 容器服务（Tencent Kubernetes Engine for Serverless）是腾讯云容器服务推出的无须用户购买节点即可部署工作负载的服务模式。弹性容器服务兼容原生 Kubernetes，支持使用原生方式购买、管理资源，并扩展支持腾讯云的存储、网络等产品，开箱即用。', '200.00', '<h2>Serverless 容器服务</h2>\n<p>Serverless 容器服务（Tencent Kubernetes Engine for Serverless）是腾讯云容器服务推出的无须用户购买节点即可部署工作负载的服务模式。弹性容器服务兼容原生 Kubernetes，支持使用原生方式购买、管理资源，并扩展支持腾讯云的存储、网络等产品，开箱即用。弹性容器服务按容器真实使用的资源量计费，腾讯云保证用户容器的安全隔离。</p>\n<h3><strong class=\"wordBreak line-break4\">原生支持</strong></h3>\n<div class=\"card-div-content line-break9\">\n<p>Serverless 容器服务紧跟社区，支持最新的 Kubernetes 版本和原生的 Kubernetes 集群管理方式，以插件<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>扩展支持了腾讯云系列存储、网络、负载均衡服务，开箱即用。</p>\n<h3><strong class=\"wordBreak line-break4\">无服务器</strong></h3>\n<div class=\"card-div-content line-break9\">\n<p>Serverless 容器服务是一种全托管的 Kubernetes 服务，意味着用户无须管理任何计算节点。容器服务 以 Pod 的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>交付计算资源，支持用户使用 Kubernetes 原生的方式购买、退还、管理云资源。</p>\n</div>\n</div>\n<h3><strong class=\"wordBreak line-break4\">安全可靠</strong></h3>\n<div class=\"card-div-content line-break9\">\n<p>Serverless 容器服务基于腾讯云成熟的虚拟化技术和网络架构，提供99.95%的服务可用性。腾讯云保证用户间 容器服务 集群的虚拟化隔离和网络隔离，支持用户通过安全组、网络 ACL 等产品为具体服务配置网络策略。</p>\n<h3><strong class=\"wordBreak line-break4\">秒级伸缩</strong></h3>\n<div class=\"card-div-content line-break9\">\n<p>Serverless 容器服务通过腾讯云自研的轻量虚拟化技术保证更快的资源创建效率，您可以在几秒内创建或删除您的容器服务。Serverless 容器服务 支持通过设置 Kubernetes 原生 HPA 的方式让服务根据实际负载进行自动伸缩。</p>\n<h3><strong class=\"wordBreak line-break4\">降低成本</strong></h3>\n<div class=\"card-div-content line-break9\">\n<p>无服务器的形态决定了Serverless 容器服务能为用户带来更高的资源利用率和更低的运维成本，灵活高效的弹性伸缩保证Serverless 容器服务总是只会使用当前负载需要的资源量。</p>\n<h3><strong class=\"wordBreak line-break4\">服务集成</strong></h3>\n<div class=\"card-div-content line-break9\">\n<p>Serverless 容器服务与腾讯云的大部分业务都可以做到高度集成，比如 CBS、CFS、COS 等存储产品，云数据库 TencentDB 系列产品，私有网络 VPC 系列产品，提供满足各类业务需求的解决方案。</p>\n</div>\n</div>\n</div>\n</div>', 0, 1738805115),
(96, '腾讯云容器镜像服务', '容器镜像服务', 'tencent-cloud-container-mirroring-service', 111, '容器镜像服务（Tencent Container Registry，TCR）为您提供安全独享、高性能的容器镜像托管分发服务。您可同时在全球多个地域创建独享实例，以实现容器镜像的就近拉取，降低拉取时间，节约带宽成本。TCR 提供细颗粒度的权限管理及访问控制，保障您的数据安全。', '500.00', '<div class=\"title-tab\">\n<h2 class=\"title light-theme\">容器镜像服务</h2>\n<div class=\"title light-theme\">安全、独享的容器镜像托管分发服务，助您在全球快速部署大规模容器业务</div>\n<div class=\"title light-theme\"> </div>\n<div class=\"title light-theme\">\n<h3 class=\"global-flex-title\"><span class=\"span\">功能</span></h3>\n<div class=\"flex-default-text-article-container-children__article--list\">\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\"><strong>云端托管的独享服务</strong></div>\n<div class=\"tci-content line-break7\">\n<p>您只需在选定的地域内创建指定规格的实例，即可在云端独享托管的容器镜像托管服务，不再需要在本地进行部署，或是在云上与他人共享服务。容器镜像服务将 Registry 核心服务部署在容器环境中，可快速动态扩容以应对业务洪峰，为客户提供稳定可靠的服务；同时，容器镜像服务将容器镜像及 Helm Chart 数据存储在用户自有的对象存储中，不再与他人共用底层数据，也不再受到存储空间的限制。</p>\n<p> </p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\"><strong>安全<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的数据管理</strong></div>\n<div class=\"tci-content line-break7\">\n<p>容器镜像服务支持多种方式的访问权限控制，满足客户对数据安全<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的严苛要求。一方面，用户可配置访问控制策略，仅允许指定的公网 IP 地址段及内网 VPC 内的客户端访问实例；另一方面，容器镜像服务支持腾讯云访问管理（CAM），允许客户进行细颗粒访问控制，如仅允许指定用户拉取指定镜像仓库的镜像数据。同时，客户自身数据存储在自身账号下的对象存储中，客户具有全部管理权限。</p>\n<p> </p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\"><strong>全球多地域的数据同步</strong></div>\n<div class=\"tci-content line-break7\">\n<p>容器镜像服务支持在全球多个地域创建使用独享实例，用户根据自身业务需要可配置自定义同步规则，即可实现容器镜像及 Helm Chart 数据的全球同步。该功能可支持客户在全球拓展容器业务，无需手动复制数据，即可实现全球集群就近拉取镜像数据，缩短数据下载时间，降低带宽成本。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/d5e6df5945410cf205a9d88ca5a023f0.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738806227),
(97, '腾讯云消息队列 RocketMQ 版', '消息队列 RocketMQ 版', 'tencent-cloud-message-queue-rocketmq-version', 111, '消息队列 RocketMQ 版（TDMQ for Apache RocketMQ，简称 TDMQ RocketMQ 版）是一款分布式高可用的消息队列服务，兼容 Apache RocketMQ 的各个组件与概念，支持 RocketMQ 4.6.1及以上版本的客户端零改造接入，同时具备计算存储分离，灵活扩缩容的底层优势。', '500.00', '<h2>消息队列 RocketMQ 版</h2>\n<p>消息队列 RocketMQ 版（TDMQ for Apache RocketMQ，简称 TDMQ RocketMQ 版）是一款分布式高可用的消息队列服务，兼容 Apache RocketMQ 的各个组件与概念，支持 RocketMQ 4.6.1及以上版本的客户端零改造接入，同时具备计算存储分离，灵活扩缩容的底层优势。</p>\n<h3>应用场景</h3>\n<p>1、每笔交易订单数据需要被几十个下游业务系统关注，包括物品批价、发货、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、流计算分析等，多个系统对消息的处理逻辑不一致，单个系统不可能去适配每一个关联业务。此时，TDMQ RocketMQ 版可实现高效的异步通信和应用解耦，确保主站业务的连续性。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/80ff094d01a9ca28fbcc3245798cbe81.svg\" /></p>\n<p>2、企业不定时举办的一些营销活动，新品发布上线，节日抢红包等，往往都会带来临时性的流量洪峰，这对后端的各个应用系统考验是十分巨大的。TDMQ RocketMQ 版此时便可以承担一个缓冲器的角色，将上游突增的请求集中收集，下游可以根据自己的实际处理能力来消费请求消息。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/80ff094d01a9ca28fbcc3245798cbe81.svg\" /></p>\n<p>3、顺序消息的应用出现在业务场景中。例如 APP 或者游戏中商品购买与发放过程中的订单创建、支付、退款等流程都是严格按照顺序执行的，与先进先出（First In First Out，FIFO）原理类似，TDMQ RocketMQ 版提供一种专门应对这种情形的顺序消息功能，即保证消息 FIFO。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/970e0847329a123a2876367d2d6c52e8.svg\" /></p>', 0, 1738806449),
(98, '腾讯云消息队列 CKafka 版', '消息队列 CKafka 版', 'tencent-cloud-message-queue-ckafka-edition', 111, '消息队列 CKafka 版（TDMQ for CKafka）是一个分布式、高吞吐量、高可扩展性的消息系统，100%兼容开源 Kafka API 0.9至2.8版本。CKafka 基于发布/订阅模式，通过消息解耦，使生产者和消费者异步交互，无需彼此等待。', '500.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>消息队列 CKafka 版</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>分布式、高吞吐量、高可扩展性的消息服务，100%兼容开源 Apache Kafka 0.9-2.8</p>\n<p>消息队列 CKafka 版（TDMQ for CKafka）是一个分布式、高吞吐量、高可扩展性的消息系统，100%兼容开源 Kafka API 0.9至2.8版本。CKafka 基于发布/订阅模式，通过消息解耦，使生产者和消费者异步交互，无需彼此等待。CKafka 具有高可用、数据压缩、同时支持离线和实时数据处理等优点，适用于日志压缩收集、监控数据聚合、流式数据集成等场景。</p>\n<h3>应用场景</h3>\n<p>1、消息队列 CKafka 版 结合大数据套件 EMR，构建完整的日志分析系统。首先通过部署在客户端的 agent 进行日志采集，并将数据聚合到消息队列 CKafka 版，之后通过后端的大数据套件如 Spark 等进行数据的多次计算消费，并且对原始日志进行清理，落盘存储或进行图形化展示。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/832e733ed2182aaf7c4e1bb039cc09fc.png\" /></p>\n<p>2、</p>\n<p>消息队列 CKafka 版 结合流计算 SCS , 用于实时/离线数据处理及异常检测，满足不同场景需要：</p>\n<ul>\n<li>对实时数据进行分析和展示，并做异常检测，快速<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>系统问题。</li>\n<li>消费历史数据进行落盘存储和离线分析，对数据进行二次加工，生成趋势报表等。</li>\n</ul>\n<p> <img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/53c2b66432ccc84a6cec37909af3ce52.png\" alt=\"\" width=\"810\" height=\"295\" /></p>\n<p>3、消息队列 CKafka 版 结合无服务器云函数 SCF , 可用于日志消费处理、微服务以及大数据分析等场景。同时支持自定义数据处理，满足不同场景下的消息转储需求。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/483700689aa6c0f882b8b53e2559cd33.svg\" /></p>\n<p>4、</p>\n<p>CKafka 连接器可应用在需要进行数据上报的场景。如手机 App 的操作行为分析、前端页面的 Bug 日志上报、业务数据的上报等等。一般情况下，这些上报的数据都需要转储到下游的存储分析系统里面进行处理（如 Elasticsearch，HDFS 等）。在常规操作中，我们需要搭建 Server、购买存储系统、并在中间自定义代码进行数据接收、处理、转储等。流程繁琐，长期系统维护成本高。</p>\n<p>CKafka 连接器旨在用 SaaS 化的思路解决这个问题，目标是通过如下两步：界面配置、SDK 上报，完成整个链路的搭建，并基于 Serverless 理念，以按量计费，弹性伸缩，无需预估容量等方式，简化客户的研发投入成本和实际的使用成本。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/55526234af61e9f0c5f224c1af4d00c4.png\" /></p>\n<p>5、</p>\n<p>CKafka 连接器支持基于 CDC(Change Data Capture)机制订阅多款数据库的变更数据。如订阅MySQL 的 Binlog，MongoDB 的 Change Stream，PostgreSQL 的行级的数据变更(Row-level Change)，SQL Server 的行级的数据变更(Row-level Change)等。例如，在实际业务使用过程当中，业务经常需要订阅 MySQL 的 Binlog 日志，获取 MySQL 的变更记录(Insert、Update、Delete、DDL、DML 等)，并针对这些数据进行对应的业务逻辑处理，如查询、故障恢复、分析等。</p>\n<p>在默认情况下，客户往往需要自定义搭建基于 CDC 的订阅组件如（Canal、Debezium、Flink CDC 等）来完成对数据库的数据订阅。而在搭建、运维这些订阅组件的过程中，人力投入成本较高，需要搭建配套的监控体系，保证订阅组件的稳定运行。</p>\n<p>基于此种情况，CKafka 连接器提供 SaaS 化的组件，通过界面配置化的完成数据的订阅、处理、转储等整个流程。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/9097b645da736c8dd34e35e734b97c7f.png\" /></p>\n<p>6、</p>\n<div class=\"architecture-article\">\n<p>CKafka 连接器支持将不同环境(腾讯公有云、用户自建 IDC、跨云、混合云等)的不同数据源（数据库、中间件、日志、应用系统等）的数据集成到公有云的消息队列服务中，以便进行数据的处理和分发。在实际业务过程中，用户经常需要将多个数据源的数据汇总到消息队列中，例如同一个应用业务客户端数据、业务 DB 的数据、业务的运行日志数据汇总到消息队列中进行分析处理。正常情况下，需要先将这些数据进行清洗格式化后，再做统一的转储、分析或处理。</p>\n<p>CKafka 连接器提供了数据聚合、存储、处理、转储的能力。简而言之，就是提供数据集成的能力，将不同的数据源连接到下游的数据目标中。</p>\n</div>\n<div><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/04d441158d24a58dd2d304211b2b6025.png\" /></div>\n<p> </p>\n</div>\n</div>', 0, 1738806812),
(99, '腾讯云消息队列 RabbitMQ 版', '消息队列 RabbitMQ 版', 'tencent-cloud-message-queue-rabbitmq-edition', 111, '消息队列 RabbitMQ 版（TDMQ for RabbitMQ，简称 TDMQ RabbitMQ 版）是一款分布式高可用的消息队列服务，支持AMQP 0-9-1 协议，完全兼容开源 RabbitMQ 的各个组件与概念，同时具备计算存储分离，灵活扩缩容的底层优势。', '200.00', '<h2>消息队列 RabbitMQ 版</h2>\n<p>消息队列 RabbitMQ 版（TDMQ for RabbitMQ，简称 TDMQ RabbitMQ 版）是一款分布式高可用的消息队列服务，支持AMQP 0-9-1 协议，完全兼容开源 RabbitMQ 的各个组件与概念，同时具备计算<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>分离，灵活扩缩容的底层优势。</p>\n<h3>应用场景</h3>\n<p><strong>秒杀系统流量削峰</strong></p>\n<p>秒杀系统可能因瞬时流量过大导致系统“宕机”，TDMQ RabbitMQ 版可以缓冲上游的流量压力，保证消息系统的稳定运行。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/2f78247954b951866e3b40fcfc800f35.svg\" /></p>\n<p><strong>业务系统异步解耦</strong></p>\n<p>交易系统的订单数据涉及下游上百个业务系统，如发货、物流、订单等。TDMQ RabbitMQ 版可以实现系统间的异步通信和服务解耦，减轻不同服务之间的依赖，提升处理效率，保证系统稳定性。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/792c00fc712fe89b275e27db95ba48bc.png\" /></p>', 0, 1738807130),
(100, '腾讯云国际消息队列 Pulsar 版', '消息队列 Pulsar 版', 'tencent-cloud-international-message-queue-pulsar-edition', 111, '消息队列 Pulsar 版（TDMQ for Apache Pulsar，简称 TDMQ Pulsar 版）是一款基于 Apache Pulsar 自研的消息中间件，具备极好的云原生和 Serverless 特性，兼容 Pulsar 的各个组件与概念，具备计算存储分离，灵活扩缩容的底层优势。', '500.00', '<h2>消息队列 Pulsar 版</h2>\n<p>消息队列 Pulsar 版（TDMQ for Apache Pulsar，简称 TDMQ Pulsar 版）是一款基于 Apache Pulsar 自研的消息中间件，具备极好的云原生和 Serverless 特性，兼容 Pulsar 的各个组件与概念，具备计算存储分离，灵活扩缩容的底层优势。</p>\n<h3>应用场景</h3>\n<p><strong>1、异步解耦</strong></p>\n<p>每笔交易订单数据需要被几十个下游业务系统关注，包括物品批价、发货、积分、流计算分析等，多个系统对消息的处理逻辑不一致，单个系统不可能去适配每一个关联业务。此时，TDMQ Pulsar 版可实现高效的异步通信和应用解耦，确保主站业务的连续性。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/921441ed13d11cc7b43494356752a0e3.svg\" /></p>\n<p><strong>2、削峰填谷</strong></p>\n<p>企业不定时举办的一些营销活动，新品发布上线，节日抢红包等，往往都会带来临时性的流量洪峰，这对后端的各个应用系统考验是十分巨大的。TDMQ Pulsar 版此时便可以承担一个缓冲器的角色，将上游突增的请求集中收集，下游可以根据自己的实际处理能力来消费请求消息。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/8f655bc6bee0ee5e974e44dc62b2ad9c.svg\" /></p>\n<p><strong>3、顺序收发</strong></p>\n<p>顺序消息的应用出现在业务场景中。例如APP或者游戏中商品购买与发放过程中的订单<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、支付、退款等流程都是严格按照顺序执行的，与先进先出（First In First Out，FIFO）原理类似，TDMQ RocketMQ 版提供一种专门应对这种情形的顺序消息功能，即保证消息 FIFO。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/87b77302fd727b5fee64ba3d67bbffe1.svg\" /></p>\n<p><strong>4、数据同步</strong></p>\n<p>如果有多个数据中心存在，需要在多个数据中心之间消费，那么 TDMQ Pulsar 版可以非常方便实现数据中心之间的同步。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/dd71b4c0f248421b4f508d4b708f7540.svg\" /></p>\n<p> </p>\n<p> </p>', 0, 1738807448),
(101, '腾讯云国际消息队列 CMQ 版', '消息队列 CMQ 版', 'tencent-cloud-international-message-queue-cmq-version', 111, '消息队列 CMQ 版（TDMQ for CMQ，简称 TDMQ CMQ 版）是一款分布式高可用的消息队列服务，它能够提供可靠的，基于消息的异步通信机制，能够将分布式部署的不同应用（或同一应用的不同组件）中的信息传递，存储在可靠有效的 CMQ 队列中，防止消息丢失。', '500.00', '<h2>消息队列 CMQ 版</h2>\n<p>消息队列 CMQ 版（TDMQ for CMQ，简称 TDMQ CMQ 版）是一款分布式高可用的消息队列服务，它能够提供可靠的，基于消息的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>通信机制，能够将分布式部署的不同应用（或同一应用的不同组件）中的信息传递，存储在可靠有效的 CMQ 队列中，防止消息丢失。TDMQ CMQ 版支持多进程同时读写，收发互不干扰，无需各应用或组件始终处于运行状态。</p>\n<h3>应用场景</h3>\n<p><strong>1、消息永不丢失</strong></p>\n<p>TDMQ CMQ 版在微信红包系统的分布式事务问题上得到了体现，微信架构组在红包系统引入了 MQ 避免分布式事务增加对系统的开销。当资金入账失败时，账户系统将不断从 MQ 重新拉取重试此更新操作，保证入账消息永远不丢，避免入账失败回滚和频繁轮询数据库等弊端发生。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/6d2bc228b6e32f6c2f03d532a0858901.svg\" /></p>\n<p><strong>2、消息安全可靠</strong></p>\n<p>TDMQ CMQ 版在消息传递上支持 HTTPS + 密钥的方式进行鉴权，并基于腾讯云平台多维度的安全防护，抵御网络攻击，保护您的业务隐私。同时当您的企业有多个业务部门同时使用消息队列服务，需要做权限管控时，TDMQ CMQ 版也支持您设置细粒度的资源权限策略。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/2176d91aaa900e42e84e730ee521f662.svg\" /></p>\n<p><strong>3、同城容灾</strong></p>\n<p>TDMQ CMQ 版支持多可用区部署。 消息 body 的存储，可根据业务特性选择同步落盘（强一致性）或<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>落盘（最终一致性）的不同策略。 当主节点 MQ 数据由于不可抗力因素彻底丢失时，主备节点的 RPO 在 5min 以内。灾难恢复切换后，存在数据的差异，可关联其他 DB 做对账等处理，补回数据。 金融级的容灾方案为 Webank、财付通等核心业务保驾护航。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/014e7e66e9182eee5cfd2ea89d792629.svg\" /></p>', 0, 1738807686),
(102, '腾讯云国际云函数', '云函数', 'tencent-cloud-international-cloud-function', 111, '云函数（Serverless Cloud Function，SCF）是腾讯云为企业和开发者们提供的无服务器执行环境，帮助您在无需购买和管理服务器的情况下运行代码。您只需使用平台支持的语言编写核心代码并设置代码运行的条件，即可在腾讯云基础设施上弹性、安全地运行代码。', '500.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>云函数</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>安全稳定、管理简化、易用且高效的低成本无服务器函数计算平台</p>\n<p>云函数（Serverless Cloud Function，SCF）是腾讯云为企业和开发者们提供的无服务器执行环境，帮助您在无需购买和管理服务器的情况下运行代码。您只需使用平台支持的语言编写核心代码并设置代码运行的条件，即可在腾讯云基础设施上弹性、安全地运行代码。SCF 是实时文件处理和数据处理等场景下理想的计算平台。</p>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">代码管理</h3>\n<article>\n<blockquote>\n<p>您可以通过上传代码使用腾讯云无服务器云函数，云函数提供多种代码管理方式：</p>\n<p>通过控制台编辑代码，这种方式适用于没有外部依赖的业务代码，直接在控制台上编辑代码。</p>\n<p>上传代码 ZIP 包，将所有依赖和代码打包成 ZIP 并上传至腾讯云无服务器云函数，平台将自动抽取入口函数并执行。</p>\n<p>通过 COS 管理代码 ZIP 包，将所有依赖和代码打包成 ZIP 并上传至腾讯云对象存储，并在云函数中指定代码所在 Bucket 和 文件对象，平台将自动下载函数代码。</p>\n</blockquote>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">支持多开发环境</h3>\n<blockquote>\n<p>无服务器云函数支持多种开发环境，您可以选择适合您自身的开发语言，完成函数编写。目前已支持的语言包括：Python 2.7 &amp; 3.6、Node.js 6.10 &amp; Node.js 8.9、Java 8、Php 5 &amp; Php 7、Go。</p>\n</blockquote>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">自动伸缩</h3>\n<blockquote>\n<p>无服务器云函数支持毫秒级别的实时弹性伸缩，完全根据请求量扩容或缩容。动态负载均衡将请求分发至后端近乎无限的函数实例上，完全无需任何手动配置和操作，满足并发量从 0 到成千上万的不同场景。</p>\n</blockquote>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">事件触发</h3>\n<blockquote>\n<p>无服务器云函数支持设置多种触发器来决定代码何时运行，在满足触发器条件（Event）时，代码自动开始运行，并根据请求自动调度基础设施资源实现自动伸缩和回收，提高计算效率。目前支持以下触发器：<br /><br /></p>\n<p>对象存储 COS：支持在特定的 COS Bucket 操作文件上传或文件删除等事件时触发云函数，可以对文件进行更多操作。例如：在图片上传到特定 Bucket 时，对其进行压缩或裁剪以适应不同分辨率的移动终端。<br /><br /></p>\n<p>定时器：支持定时触发函数，助力用户构造更加灵活的自动化控制系统。</p>\n<p><br />手动触发：支持通过 云 API /控制台 手动触发函数，帮助用户更便捷、更清晰地调试和使用云函数。<br /><br />CMQ 主题队列触发：由 CMQ Topic 主题队列内的消息触发，利用 CMQ <a href=\"https://www.kaihu123.com/vps/tencent-cloud-message-queue-rocketmq-version/\" title=\"消息队\" target=\"_blank\">消息队</a>列解耦事件，可以帮助用户和更多应用完成联动。</p>\n<p><br />Ckafka <a href=\"https://www.kaihu123.com/vps/tencent-cloud-message-queue-rocketmq-version/\" title=\"消息队\" target=\"_blank\">消息队</a>列触发：由 Ckafka Topic 主题队列内的消息触发，对消息进行处理，可以帮助用户实现日志聚合、消息存储等。<br /><br />API 网关触发：支持 API 网关中的 API 配置后端为无服务器云函数，在 API 接收到客户端请求时，触发无服务器云函数，并将处理结果作为 API 响应返回给客户端。</p>\n</blockquote>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">监控和日志</h3>\n<blockquote>\n<p>无服务器云函数提供精细的日志记录，您可方便地查看函数的运行状况，并对代码进行调试、测试和审计；支持相关的监控指标上报，帮助您快速了解函数的整体运行概况，同时您还可自定义云函数的监控指标，对云函数进行更深入、更广泛的监控。</p>\n</blockquote>\n<p> </p>\n</article>\n</div>\n</div>', 0, 1738808016),
(103, '腾讯云国际Serverless 应用中心', 'Serverless 应用中心', 'tencent-cloud-international-serverless-application-center', 111, 'Serverless 应用中心 是业界非常受欢迎的无服务器应用框架，开发者无需关心底层资源即可部署完整可用的 Serverless 应用架构。Serverless 应用中心 具有资源编排、自动伸缩、事件驱动等能力，覆盖编码-调试-测试-部署等全生命周期，帮助开发者通过联动云资源，迅速构建 serverless 应用。', '500.00', '<div class=\"title-tab\">\n<h2 class=\"title light-theme\">Serverless 应用中心</h2>\n<div class=\"title light-theme\">用于构建和运行无服务器应用程序的完整开发平台</div>\n<div class=\"title light-theme\"> </div>\n<div class=\"title light-theme\">Serverless 应用中心 是业界非常受欢迎的无服务器应用框架，开发者无需关心底层资源即可部署完整可用的 Serverless 应用架构。Serverless 应用中心 具有资源编排、自动伸缩、事件驱动等能力，覆盖编码-调试-测试-部署等全生命周期，帮助开发者通过联动云资源，迅速构建 serverless 应用。</div>\n<div class=\"title light-theme\"> </div>\n<div class=\"title light-theme\">\n<h3 class=\"global-flex-title\"><span class=\"span\">应用场景</span></h3>\n<div>\n<div class=\"flex-default-flex-default-Tab\">\n<div class=\"ant-tabs\">\n<div class=\"ant-tabs-content-holder\">\n<section class=\"ant-tabs-content-holder__section\">\n<div class=\"architecture-article\">\n<p>快速创建 serverless 应用，并完成应用的调试，部署，可以<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>已发布应用运行状态并快速排障。</p>\n<p>提供多种 serverless 应用级别的组件，开发者无需关注 serverless 应用底层资源，选择并下载符合自己业务场景的组件后，编写个性化的业务逻辑即可。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250206/c2fdca8a7375d78c4b8a439ad9fd6fcb.png\" /></p>\n</div>\n</section>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738808186),
(104, 'Amazon S3', 'Amazon S3', 'amazon-simple-storage-service', 145, 'Amazon Simple Storage Service（Amazon S3）是一项对象存储服务，在可扩展性、数据可用性、安全性和能效方面业界领先。数百万不同规模和行业的客户可以为几乎任何应用场景存储、管理、分析和保护任意数量的数据，例如数据湖、云原生应用程序和移动应用程序。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">Amazon S3</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">专为从任意位置检索任意数量的数据而构建的对象存储</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6 textmediacontent_module_heading__3423b844\" data-rg-n=\"HeadingText\">什么是 Amazon S3？</h3>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6\" data-rg-n=\"BodyText\">\n<p>Amazon Simple Storage Service（Amazon S3）是一项对象存储服务，在可扩展性、数据可用性、安全性和能效方面业界领先。数百万不同规模和行业的客户可以为几乎任何应用场景存储、管理、分析和保护任意数量的数据，例如数据湖、云原生应用程序和移动应用程序。借助高成本效益的存储类和易于使用的管理功能，您可以优化成本、组织并分析数据，以及配置精细调整过的访问控制，从而满足特定的业务和合规性要求。</p>\n<div id=\"0-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-0\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">可扩展性</h3>\n</div>\n<div id=\"content-0\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"0-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">您可以使用 S3 存储几乎任何数量的数据，一直到 EB 级，性能无与伦比。S3 具有完全的弹性，可以随着您增减数据的操作自动扩展和收缩。无需预置存储，只需按实际使用量付费。</div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<div id=\"1-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-1\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">持久性和可用性</h3>\n</div>\n<div id=\"content-1\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"1-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">Amazon S3 提供最持久的云端存储和业界领先的可用性。基于其独特的架构，S3 设计为默认提供 99.999999999%（11 个 9）的数据持久性和 99.99% 的可用性，并以云端最强的 SLA 为后盾。</div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<div id=\"2-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-2\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">安全性和数据保护</h3>\n</div>\n<div id=\"content-2\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"2-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">通过无与伦比的安全性、数据保护、合规性和访问控制功能保护您的数据。S3 是安全、私有且默认加密的，还支持多种审计功能来监控对 S3 资源的访问请求。</div>\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">\n<div id=\"3-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-3\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\">\n<h3 class=\"text_module_text__5f6a73c6 text_module_four__5f6a73c6 text_module_title__5f6a73c6 qaSampler_module_qaSamplerTitle__b180ba78\" data-rg-n=\"TitleText\">最低价格和最高性能</h3>\n</div>\n<div id=\"content-3\" class=\"itemExpander_module_expandableSectionContent__2d018590\" aria-labelledby=\"3-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__2d018590\">\n<div class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_body__5f6a73c6 qaSampler_module_qaSamplerContent__b180ba78\" data-rg-n=\"BodyText\">S3 为任何工作负载和自动数据生命周期管理提供具有最佳性价比的多种存储类，因此您可以以经济高效的方式存储大量经常、不经常或很少访问的数据。S3 提供弹性、灵活性、延迟和吞吐量，确保存储永不限制性能。</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738892372),
(105, 'Amazon S3 Glacier 存储类', 'Amazon S3 Glacier', 'amazon-s3-glacier', 145, 'Amazon S3 Glacier 存储类专为数据归档而构建，旨在为您提供具有最高性能、最大检索灵活性和最低成本的云归档存储。所有 S3 Glacier 存储类都提供几乎无限的可扩展性，并且旨在实现 99.999999999%（11 个 9）的数据持久性。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">Amazon S3 Glacier 存储类</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">用于以最低成本和毫秒级访问进行数据归档的长期、安全、持久的存储类</span></p>\n<p>Amazon S3 Glacier 存储类专为数据归档而构建，旨在为您提供具有最高性能、最大检索灵活性和最低成本的云归档存储。所有 S3 Glacier 存储类都提供几乎无限的可扩展性，并且旨在实现 99.999999999%（11 个 9）的数据持久性。S3 Glacier 存储类提供了最快速访问归档数据的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>以及云中成本最低的归档存储。</p>\n<p>您可以从针对不同访问模式和存储持续时间优化的三种归档存储类中进行选择。对于需要即时访问的归档数据，例如医学图像、新闻媒体资产或基因组学数据，请选择 S3 Glacier Instant Retrieval 存储类，这种归档存储类可提供最低的存储成本及毫秒级检索速度。对于不需要立即访问但需要灵活地免费检索大量数据的归档数据，例如备份或灾难恢复使用场景，请选择 S3 Glacier Flexible Retrieval，它可在几分钟内检索，也可以在 5-12 小时内进行免费批量检索。要使长期归档存储（例如合规性归档和数字媒体保留）实现更大的成本节约，请选择 S3 Glacier Deep Archive，这是成本最低的云存储，可在 12 小时内检索数据。</p>\n<h3 id=\"How_it_works.3A_S3_Glacier_storage_classes\" class=\"lb-txt-bold lb-txt-none lb-txt-42 lb-h2 lb-title\">工作原理：S3 Glacier 存储类</h3>\n<p>Amazon S3 Glacier 存储类专为数据归档而构建，旨在为您提供具有最高性能、最大检索灵活性和最低成本的云归档存储。现在，您可以从针对不同访问模式和存储持续时间优化的三种归档存储类中进行选择。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/7c6742f5cbde6fa83d38ab86d0c31616.png\" /></p>\n<p>S3 Glacier 即时检索为每季度访问一次且需要毫秒级检索的长期数据提供成本最低的存储，成本最多降低 68%（相比 S3 Standard-Infrequent Access）。它专为很少访问但在性能敏感的用例中仍需要立即访问的数据而设计，例如图像托管、在线文件共享应用程序、医学成像和健康记录、新闻媒体资产以及卫星和航空成像。S3 Glacier 即时检索提供高持久性、高吞吐量以及与 S3 Standard-IA 类似的低延迟，每 GB 的存储价格更低，但每 GB 检索费用较高。通过在指定年份跨多个物理分隔的 AWS 可用区冗余存储数据，S3 Glacier 即时检索旨在实现 99.999999999%（11 个 9）的数据持久性和 99.9% 的可用性。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/b786516f2ae16bae64b1bbfd8192db56.png\" /></p>\n<p>S3 Glacier Flexible Retrieval 为每年访问 1-2 次且异步检索的归档数据提供低成本存储，成本最多降低 10%（相比 S3 Glacier Instant Retrieval）。S3 Glacier Flexible Retrieval 是不需要立即访问，但需要灵活地免费检索大量数据的归档数据（例如备份或灾难恢复使用案例）的理想存储类。S3 Glacier Flexible Retrieval 提供最灵活的检索<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>，可以平衡成本与访问时间（从几分钟到几小时不等），并且可批量检索。它是备份、灾难恢复、离线数据存储需求的理想解决方案，并且还非常适合于偶尔需要在几分中内取回部分数据而您不想担心成本的情况。通过跨多个物理分离的 AWS 可用区冗余存储数据，S3 Glacier 灵活检索旨在实现 99.999999999%（11 个 9）的数据持久性和 99.99% 的可用性。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/b95bc3c77accb6317d4e8be0909cce35.png\" /></p>\n<p>S3 Glacier Deep Archive 提供最低成本的存储，比 S3 Glacier Flexible Retrieval 低 75%，适用于每年访问少于一次且异步检索的长期归档数据。S3 Glacier Deep Archive 只需每 GB 每月 0.00099 美元（或每 TB 每月 1 美元），提供成本最低的云存储，其价格远低于在本地磁带中存储和维护数据或异地归档数据。S3 Glacier Deep Archive 是一种经济高效且易于管理的磁带替代方案。该存储类专为那些为了满足客户需求以及监管合规要求而将数据集保留 7-10 年或更长时间的客户设计，特别是金融服务、医疗保健、媒体娱乐和公共部门的客户。通过跨多个物理分隔的 AWS 可用区冗余存储数据，S3 Glacier Deep Archive 旨在实现 99.999999999%（11 个 9）的数据持久性和 99.99% 的可用性。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/0585dce6e5294d923671c70e5f003176.png\" /></p>', 0, 1738892645),
(106, 'Amazon Elastic Block Store', 'Amazon Elastic Block Store', 'amazon-elastic-block-store', 145, 'Amazon Elastic Block Store (EBS)块存储方案提供了可在 AWS 云中用于 Amazon EC2 实例的持久性数据块级存储卷和持久的存储解决方案。', '500.00', '<h2 class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_heading__qwr5da text_module_block__qwr5da\">Amazon Elastic Block Store</h2>\n<p><span class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_subheading__qwr5da text_module_block__qwr5da hero_module_heroSubheading__62317afc\">易于使用、适用于任何规模的高性能数据块存储</span></p>\n<h3 class=\"text_module_text__qwr5da text_module_two__qwr5da text_module_heading__qwr5da\">弹性块存储的好处</h3>\n<div id=\"0-trigger\" class=\"itemExpander_module_expandableSectionHeader__xtjs6h qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-0\" aria-expanded=\"true\"><strong>快速扩展</strong></div>\n<div id=\"content-0\" class=\"itemExpander_module_expandableSectionContent__xtjs6h\" aria-labelledby=\"0-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__xtjs6h\">\n<div class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_body__qwr5da qaSampler_module_qaSamplerContent__b180ba78\">针对要求最苛刻的高性能工作负载快速扩展，包括 SAP、Oracle 和 Microsoft 产品等任务关键型应用程序。</div>\n<div class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_body__qwr5da qaSampler_module_qaSamplerContent__b180ba78\">\n<div id=\"1-trigger\" class=\"itemExpander_module_expandableSectionHeader__xtjs6h qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-1\" aria-expanded=\"true\"><strong>高性能</strong></div>\n<div id=\"content-1\" class=\"itemExpander_module_expandableSectionContent__xtjs6h\" aria-labelledby=\"1-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__xtjs6h\">\n<div class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_body__qwr5da qaSampler_module_qaSamplerContent__b180ba78\">通过高可用性（包括在可用区[AZ]内复制）防范失败；使用 io2 Block Express 卷时持久性达到 99.999%。</div>\n<div class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_body__qwr5da qaSampler_module_qaSamplerContent__b180ba78\">\n<div id=\"2-trigger\" class=\"itemExpander_module_expandableSectionHeader__xtjs6h qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-2\" aria-expanded=\"true\"><strong>优化存储和成本</strong></div>\n<div id=\"content-2\" class=\"itemExpander_module_expandableSectionContent__xtjs6h\" aria-labelledby=\"2-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__xtjs6h\">\n<div class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_body__qwr5da qaSampler_module_qaSamplerContent__b180ba78\">选择最适合您的工作负载的存储。 卷的类型从每 GB 只需几美元的经济型到最快 IOPS 和吞吐量的高性能型，应有尽有。</div>\n<div class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_body__qwr5da qaSampler_module_qaSamplerContent__b180ba78\">\n<div id=\"3-trigger\" class=\"itemExpander_module_expandableSectionHeader__xtjs6h qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-3\" aria-expanded=\"true\"><strong>安全</strong></div>\n<div id=\"content-3\" class=\"itemExpander_module_expandableSectionContent__xtjs6h\" aria-labelledby=\"3-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__xtjs6h\">\n<div class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_body__qwr5da qaSampler_module_qaSamplerContent__b180ba78\">加密您的块存储资源，而无需构建、维护和保护自己的密钥管理基础设施。 通过限制公共访问权限和配置数据备份锁定，防止未经授权访问您的数据。</div>\n<div class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_body__qwr5da qaSampler_module_qaSamplerContent__b180ba78\">\n<div id=\"4-trigger\" class=\"itemExpander_module_expandableSectionHeader__xtjs6h qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-4\" aria-expanded=\"true\"><strong>简单的数据保护</strong></div>\n<div id=\"content-4\" class=\"itemExpander_module_expandableSectionContent__xtjs6h\" aria-labelledby=\"4-trigger\">\n<div class=\"itemExpander_module_expandableSectionContentWrapper__xtjs6h\">\n<div class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_body__qwr5da qaSampler_module_qaSamplerContent__b180ba78\">使用 Amazon EBS 快照保护云中的块存储数据以及本地块数据，该快照是一种时间点副本，可用于实现灾难恢复、跨区域和账户迁移数据以及提高备份合规性。通过与 DLM 集成，Amazon 进一步简化了快照的生命周期管理。借助 Amazon Data Lifecycle Manager，您可以创建策略，以便自动执行多项任务，包括创建、删除、保留和共享快照。</div>\n<div class=\"text_module_text__qwr5da text_module_one__qwr5da text_module_body__qwr5da qaSampler_module_qaSamplerContent__b180ba78\">\n<h3 id=\"How_it_works\" class=\"lb-txt-bold lb-txt-none lb-txt-28 lb-none-v-margin lb-h2 lb-title\">工作原理</h3>\n<p>Amazon Elastic Block Store (Amazon EBS) 是一种易于使用且可扩展的高性能数据块存储服务，适合用于 Amazon Elastic Compute Cloud (Amazon EC2)。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/d1b2355d9bc12fe2ca24ddb655b0ecd9.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738892982),
(107, 'Amazon Elastic File System', 'Amazon Elastic File System', 'amazon-elastic-file-system', 145, 'Amazon EFS 文件存储 Amazon Elastic File System (Amazon EFS) 文件存储 服务是适用于 AWS 云的共享文件存储，能够为数千个 Amazon EC2 实例提供文件系统界面和文件系统语义', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">Amazon Elastic File System</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">无服务器，完全弹性文件存储</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">Amazon EFS 的优势</h3>\n<p>1、简捷而快速地为 AWS 计算服务创建和配置共享文件系统—无需预置、部署、修补或维护。</p>\n<p>2、按需将工作负载扩展到开箱即用的 PB 级存储空间和每秒千兆字节的吞吐量。</p>\n<p>3、通过对经过成本优化（旨在将成本降低高达 97%）的不频繁访问类和 Archive 存储类进行自动生命周期管理，降低总拥有成本。</p>\n<p>4、通过为获得 99.999999999%（11 个 9）的持久性和高达 99.99%（4 个 9）的可用性而<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的完全托管式文件系统，安全可靠地访问文件。</p>\n<h3 id=\"How_it_works\" class=\"lb-txt-bold lb-txt-none lb-txt-28 lb-none-v-margin lb-h2 lb-title\">工作原理</h3>\n<p>Amazon Elastic File System (Amazon EFS) 可随着您添加和删除文件自动增大或收缩，无需管理或预置。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/a5e8577662d4b843198efe501d4d4a2d.png\" /></p>', 0, 1738893490),
(108, 'Amazon FSx for Lustre 云上的高性能文件系统', 'Amazon FSx for Lustre', 'amazon-fsx-for-lustre', 145, 'Amazon FSx for Lustre 云上的高性能文件系统 完全托管的 Lustre 文件系统与 S3 集成，适用于要求快速访问计算和高吞吐量资源的工作负载，例如高性能计算 (HPC)、媒体渲染和机器学习 (ML) 培训数据集。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">Amazon FSx for Lustre</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">在最常用高性能<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>系统上构建的完全托管式共享存储。</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">FSx for Lustre 的优势</h3>\n<p>1、适用于 Lustre 的 Amazon FSx 为云端中的 GPU 实例提供最快的存储性能</p>\n<p>2、访问和处理 Amazon S3 上的数据集</p>\n<p>3、优化工作负载的存储价格和性能</p>\n<p>4、自动压缩和配额</p>\n<h3 class=\"lb-txt-bold lb-txt-none lb-txt-28 lb-small-v-margin lb-h2 lb-title\">工作原理</h3>\n<p>Amazon FSx for Lustre 提供完全托管式共享存储，兼具常用 Lustre <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>系统的可扩展性和性能。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/23e54efbef3ca77cef3fa629a197d080.png\" /></p>', 0, 1738893781),
(109, '完全托管式云文件系统Amazon FSx for NetApp ONTAP', '完全托管式云文件系统', 'amazon-fsx-for-netapp-ontap', 145, 'Amazon FSx for NetApp ONTAP 在云中提供完全托管式共享存储以及 ONTAP 数据访问和管理功能。基于 NetApp 受欢迎的 ONTAP 文件系统构建的完全托管式共享存储', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\"><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>FSx for NetApp ONTAP</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">基于 NetApp 受欢迎的 ONTAP 文件系统构建的完全托管式共享存储</span></p>\n<h3><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">优势</span></h3>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">1、通过 ONTAP 在 AWS 上的数据访问和数据管理功能快速迁移和构建应用程序。</span></p>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">2、通过符合行业标准的 NFS、SMB、iSCSI 和 NVMe-over-TCP 协议向广泛的工作负载和用户提供您的数据。</span></p>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">3、通过自动增长和缩减的存储容量为您不断增长的数据集提供支持。</span></p>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">4、动态调整吞吐量水平，根据需要纵向扩展或缩减，并随时添加文件服务器对，提高性能。</span></p>\n<h3 id=\"How_it_works\" class=\"lb-txt-bold lb-txt-none lb-txt-28 lb-none-v-margin lb-h2 lb-title\">工作原理</h3>\n<p>适用于 NetApp ONTAP 的 <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>FSx 在 AWS Cloud 中提供完全托管式共享存储以及 ONTAP 受欢迎的数据访问和管理功能。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/b840daf6df9734b8d441056f7134b9dc.png\" /></p>', 0, 1738894158),
(110, 'aws OpenZFS 云文件系统', 'OpenZFS 云文件系统', 'amazon-fsx-for-openzfs', 145, 'Amazon FSx for OpenZFS 在常用的 OpenZFS 文件系统上构建的完全托管式共享存储 适用于 OpenZFS 的 Amazon FSx 的优势 Amazon FSx for OpenZFS 提供基于 OpenZFS 文件系统构建的完全托管式共享文件存储，并且可通过 NFS 协议（v3、v4、v4.1 和 v4.2）访问。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">Amazon FSx for OpenZFS</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">在常用的 OpenZFS 文件系统上<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的完全托管式共享存储</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">适用于 OpenZFS 的 Amazon FSx 的优势</h3>\n<p>1、轻松将 Linux 文件服务器迁移到 AWS，文件存储可匹敌或超过您当前依赖的功能，而且可以通过 NFS 协议访问。</p>\n<p>2、使用 OpenZFS 即时数据快照、数据克隆和跨文件系统的按需数据复制来简化应用程序的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和测试。</p>\n<p>3、使用高性能存储加速工作负载，实现 100 多万次的 IOPS 以及仅几百微秒的延迟。</p>\n<p>4、Intelligent-Tiering 是一种弹性存储类，旨在通过在访问模式改变时自动将数据移动到最具成本效益的层来优化成本。</p>\n<p>5、通过扩展吞吐量级别和启用数据压缩等存储效率功能，只需几次单击即可优化成本。</p>\n<h3 id=\"How_it_works\" class=\"lb-txt-bold lb-txt-none lb-txt-28 lb-none-v-margin lb-h2 lb-title\">工作原理</h3>\n<p>Amazon FSx for OpenZFS 提供基于 OpenZFS 文件系统<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的完全托管式共享文件存储，并且可通过 NFS 协议（v3、v4、v4.1 和 v4.2）访问。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/c678278efc7101ca22846397ef1a9540.png\" /></p>', 0, 1738894915),
(111, 'Amazon FSx for Windows File Server', '云文件存储', 'amazon-fsx-for-windows-file-server', 145, '适用于业务应用程序的完成托管式 Windows 文件系统。Amazon FSx for Windows File Server 提供在 Windows Server 上构建的完全托管式共享存储，以及大量数据访问、数据管理和管理功能。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">Amazon FSx for Windows File Server</h2>\n<p>适用于业务应用程序的完成托管式 Windows 文件系统。Amazon FSx for Windows File Server 提供在 Windows Server 上构建的完全托管式共享存储，以及大量数据访问、数据管理和管理功能。</p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">适用于 Windows File Server 的 FSx 的优势</h3>\n<p>1、通过全面 <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>支持，为您的 Windows 应用程序提供高可用和高性能的存储。</p>\n<p>2、通过数据去重和压缩将存储成本降低多达 60%。</p>\n<p>3、通过加密、文件访问审计和自动备份加强数据保护。</p>\n<p>4、以亚毫秒级延迟和高吞吐量提高应用程序性能。</p>\n<h3 class=\"lb-txt-bold lb-txt-none lb-txt-28 lb-small-v-margin lb-h2 lb-title\">工作原理</h3>\n<p>Amazon FSx for Windows File Server 提供在 Windows Server 上构建的完全托管式共享存储，以及大量数据访问、数据管理和管理功能。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/b16788e9b60e870c01d36d6a089b5c5f.png\" /></p>', 0, 1738895443),
(112, 'aws集中式云备份管理', 'AWS Backup', 'aws-backup', 145, 'AWS Backup 让您可以跨 AWS 服务和第三方应用程序集中管理和自动化备份。AWS Backup 是一项经济高效、完全托管且基于策略的服务，可简化大规模数据保护。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">AWS Backup</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">集中管理和自动执行数据保护</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">AWS Backup 的优势</h3>\n<div id=\"0-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-0\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\"><strong>简化 AWS 和混合服务上应用程序资源的数据保护</strong>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\">通过基于策略的完全托管式服务集中备份和恢复。</div>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\"> </div>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\">\n<div id=\"1-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-1\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\"><strong>为灾难恢复和业务连续性奠定基础</strong>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\">跨不同 AWS 区域和账户进行备份。执行备份的自动还原测试和验证。</div>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\"> </div>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\">\n<div id=\"2-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-2\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\"><strong>防护勒索软件和账户泄露并从中恢复</strong>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\">创建不可变的备份，并且使用逻辑上受物理隔离的保管库（作为深度防御策略的一部分）。</div>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\"> </div>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\">\n<div id=\"3-trigger\" class=\"itemExpander_module_expandableSectionHeader__2d018590 qaSampler_module_qaSamplerExpanderHeader__b180ba78\" tabindex=\"0\" role=\"button\" aria-controls=\"content-3\" aria-expanded=\"true\" data-rigel-analytics=\"{&quot;name&quot;:&quot;ItemExpander&quot;,&quot;properties&quot;:{&quot;expanded&quot;:true}}\"><strong>管控数据保护合规</strong>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\">使用实时<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和见解监控、审计和报告数据保护策略与运营。</div>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\"> </div>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\">\n<h3 class=\"lb-txt-bold lb-txt-none lb-txt-28 lb-small-v-margin lb-h2 lb-title\">工作原理</h3>\nAWS Backup 是一项经济高效、完全托管且基于策略的服务，可简化大规模数据保护。</div>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\"> </div>\n<div class=\"itemExpander_module_expandableSectionHeaderTrigger__2d018590\" aria-hidden=\"true\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/4c74d3600d81e24cdb84b38900e12fd0.png\" /></div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738895822),
(113, 'AWS 弹性灾难恢复', 'AWS 弹性灾难恢复', 'aws-elastic-disaster-recovery', 145, 'AWS 云灾难恢复服务让企业能够更快恢复关键 IT 系统和数据备份，无需承担构建第二个物理备份站点产生的费用。将应用程序经济高效地可扩展式恢复到 AWS', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">AWS 弹性灾难恢复</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">将应用程序经济高效地可扩展式恢复到 AWS</span></p>\n<h3 class=\"text_module_text__5f6a73c6 text_module_two__5f6a73c6 text_module_heading__5f6a73c6\" data-rg-n=\"HeadingText\">优势</h3>\n<p>1、删除闲置的恢复站点资源，从而节约成本，并且仅在需要时才为您的全部灾难恢复站点付费。</p>\n<p>2、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>最新的状态或从之前的时间点，在短短几分钟内就能恢复应用程序。</p>\n<p>3、采用统一的流程来测试、恢复和自动恢复各种应用程序，这些操作不需要专业的技能就能轻松完成。</p>\n<p>4、自动执行诸如配置环境、清理演练资源或在已启动的实例上激活监控工具之类的操作。</p>\n<h3 id=\"How_it_works\" class=\"lb-txt-bold lb-txt-none lb-txt-42 lb-none-v-margin lb-h2 lb-title\">工作原理</h3>\n<p>AWS 弹性灾难恢复 (AWS DRS) 借助经济实惠的存储、最少的计算和时间点恢复，通过快速、可靠地恢复本地部署的基于云的应用程序，最大限度减少停机时间和数据丢失。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/34df844a3952812feef4afb428618d2d.png\" /></p>', 0, 1738896131),
(114, 'AWS Snowball 数据传输', '数据传输', 'aws-snowball', 145, '在 AWS Snow 系列控制台中，选择您的首选设备：Snowball Edge Compute Optimized 或 Snowball Edge Storage Optimized。创建一个包含 Amazon S3 存储桶的任务，选择 Amazon Simple Notification Service（Amazon SNS）用于跟踪，并配置 Amazon EC2 AMI 等选项和 GPU。', '500.00', '<h2 class=\"eb-headline lb-none-v-margin lb-h1 lb-title lb-txt-36 lb-txt-bold lb-txt-white\">AWS Snowball</h2>\n<p>将离线数据或远程存储加速移动到云端</p>\n<h3>工作原理</h3>\n<p>在 AWS Snow 系列控制台中，选择您的首选设备：Snowball Edge Compute Optimized 或 Snowball Edge Storage Optimized。创建一个包含 Amazon S3 存储桶的任务，选择 Amazon Simple Notification Service（Amazon SNS）用于跟踪，并配置 <a href=\"https://www.kaihu123.com/vps/amazon-ec2-auto-scaling/\" title=\"Amazon EC\" target=\"_blank\">Amazon EC</a>2 AMI 等选项和 GPU。AWS 将准备好设备并向您发货。设备到达后，连接电源并用 AWS OpsHub 解锁设备。连接到您的 LAN。使用 AWS OpsHub 管理设备，传输数据或启动 EC2 实例。完成后，关闭设备并将设备返回给 AWS。运送标签将自动在 E Ink 屏幕上显示。设备到达 AWS 区域后，存储在板载存储桶上的任何数据都将移动至您的 S3 存储桶，大约在加载设备的同时进行验证。随后，所有数据均安全地从设备擦除并进行消毒，确保不留下任何客户信息。</p>\n<p>通过 Snowball 将 PB 级数据迁移到 AWS。对于需要多个设备的任务，请使用 Snow 的大型数据迁移管理器跟踪设备的阶段。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250207/47434a46c51295b57baf7ba36d121c43.png\" /></p>', 0, 1738896541),
(115, 'AWS Storage Gateway云存储网关', '网关虚拟磁带库', 'aws-storage-gateway', 145, 'AWS Storage Gateway云网关存储服务支持行业协议，并允许您以可扩展且经济高效的方式将数据安全存储在 AWS 云中,只需按实际使用情况付费，无需长期承诺。点击这里，了解AWS 云网关内容。', '500.00', '<h2 class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_heading__5f6a73c6 text_module_block__5f6a73c6\" data-rg-n=\"HeadingText\">AWS Storage Gateway</h2>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">提供几乎不受限制的云存储的本地应用程序访问权限</span></p>\n<h3><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">Storage Gateway 类型</span></h3>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">AWS Storage Gateway 为您的应用程序提供在本地和云中访问几乎无限的云存储的功能。您可以将 Storage Gateway 部署为 VMware、Hyper-V 或 Linux KVM 虚拟环境中的虚拟机（VM），或者部署为 Amazon Virtual Private Cloud（Amazon VPC）中的 Amazon EC2 实例。</span></p>\n<h3><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">S3 文件网关提供对 Amazon S3 数据的本地文件访问</span></h3>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">借助 S3 文件网关，您可以构建数据工作流来为数据湖提供数据、存档图像和视频等冷数据以及备份数据库（例如 Microsoft SQL、Oracle 和 SAP），所有这些数据都将存储到 S3 中。 </span></p>\n<h3><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">磁带网关可在 AWS 中虚拟化磁带备份和存档工作流</span></h3>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">借助磁带网关，您可以将本地环境中的物理磁带替换为 AWS 环境中的虚拟磁带，而无需更改现有备份工作流。磁带网关支持所有领先的备份应用程序，并在本地缓存虚拟磁带，以实现低延迟的数据访问。</span></p>\n<h3><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">卷网关可扩展本地块存储容量</span></h3>\n<p><span class=\"text_module_text__5f6a73c6 text_module_one__5f6a73c6 text_module_subheading__5f6a73c6 text_module_block__5f6a73c6 hero_module_heroSubheading__ef4a57f5\" data-rg-n=\"SubheadingText\">您可以将卷网关与本地的 Windows 和 Linux 服务器配合使用，为带有云恢复选项的本地应用程序提供可扩展的存储。<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>对频繁使用的数据进行低延迟本地访问的数据集在不断增加，而通过利用缓存卷架构，您可以让这种文件存储获得可扩展的云存储和数据保护。</span></p>', 0, 1738896864);
INSERT INTO `mx_cloud` (`id`, `title`, `name`, `alias`, `cid`, `des`, `usd`, `intro`, `status`, `addtime`) VALUES
(116, 'gcp Cloud Storage', 'Cloud Storage', 'gcp-cloud-storage', 157, 'Cloud Storage 是一种用于存储非结构化数据的托管式服务。您可以存储任意数量的数据，并且可以根据需要随时检索数据。适合各规模公司的对象存储服务', '500.00', '<div class=\"x9K9hf dK1mgd\">\n<div class=\"jTIiId\">\n<div>\n<h2 class=\"MyvX5d D0aEmf qUKri yhYmte\">Cloud Storage</h2>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf dK1mgd\">适合各规模公司的对象存储服务\n<div class=\"x9K9hf fRAube\">\n<div class=\"wlROcd\">\n<p>Cloud Storage 是一种用于存储非结构化数据的托管式服务。您可以存储任意数量的数据，并且可以根据需要随时检索数据。</p>\n<h3 class=\" \">领先的分析和机器学习/AI 工具</h3>\n<div class=\" \">将数据存储在 Cloud Storage 中后，您可以轻松运用 Google Cloud 的强大工具，包括使用 BigQuery 创建数据仓库，使用 Dataproc 执行开源分析，或者使用 Vertex AI 构建和部署机器学习 (ML) 模型。</div>\n<h3 class=\" \">存储类别自动转换</h3>\n<div class=\" \">借助对象生命周期管理 (OLM) 和 Autoclass 等功能，您可以使用不同的存储类别来存放对象，轻松优化成本。在存储桶级别，您可以选择根据上次访问时间，基于政策自动将对象转移到更冷的存储类别。对于转移到更冷的存储类别的对象，我们不收取任何提前删除或检索费用，也不收取类别转移费用。</div>\n<h3 class=\" \">有 SLA 保障的洲际规模数据复制</h3>\n<div class=\" \">先进的双区域存储桶支持数量庞大的区域。单个洲际存储桶横跨三个大洲的九个区域，恢复时间目标 (RTO) 为零。如果发生服务中断，应用会无缝访问备用区域中的数据，无需经历故障切换和故障恢复流程。如果组织有超高的可用性需求，可以考虑采用双区域存储桶的增强型复制功能，该功能可提供 15 分钟的恢复点目标 (RPO) 服务等级协议 (SLA)。</div>\n<h3 class=\" \">将 Cloud Storage 用作本地文件<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a></h3>\n<div class=\" \">Cloud Storage 是一种常见的存储选择，可让您将机器学习项目的训练数据、模型和检查点存储在 Cloud Storage 存储桶中。借助 Cloud Storage FUSE，您可以充分利用 Cloud Storage 提供的规模、可供性、吞吐量和简便性，同时保持与使用或需要文件<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>语义的应用的兼容性。Cloud Storage FUSE 目前还提供缓存功能，与原生机器学习框架数据加载器相比，训练速度最高可提升 2.2 倍，训练吞吐量最高可提升 2.9 倍。</div>\n<h3 class=\" \">使用文件资产清单报告管理您的对象存储空间</h3>\n<div class=\" \">资产清单报告包含有关对象的元数据信息，例如对象的存储类别、ETag 和内容类型。这些信息可帮助您分析存储费用、审核和验证对象，以及确保数据安全性和合规性。您可以将资产清单报告导出为逗号分隔值 (CSV) 或 Apache Parquet 文件，以便使用 BigQuery 等工具进一步分析。详细了解存储空间分析资产清单报告。</div>\n</div>\n</div>\n</div>', 0, 1738977482),
(117, '谷歌云(gcp)块存储', '块存储', 'google-cloud-gcp-block-storage', 157, '适用于任何应用场景的高性能块存储服务 用于虚拟机实例的可靠、高性能块存储服务。 您可以选择 Hyperdisk、Persistent Disk 或本地 SSD。针对工作负载优化存储空间', '500.00', '<h2>谷歌云(gcp)块存储</h2>\n<p>用于虚拟机实例的可靠、高性能块存储服务。 您可以选择 Hyperdisk、Persistent Disk 或本地 SSD。</p>\n<h3>针对工作负载优化存储空间</h3>\n<p>借助 Hyperdisk，您可以独立预配容量和性能，以便根据工作负载动态调整存储。单个 Hyperdisk 支持 10 GiB/s 吞吐量和 500,000 IOPS，可为要求最严苛的应用提供服务。 了解如何迁移到新的计算实例。</p>\n<h3>利用存储池降低总拥有成本并提高利用率</h3>\n<p>借助 Hyperdisk 存储池，您无需管理数百个磁盘，而仅需管理单个池，同时可将存储总拥有成本降低至多 40%。以聚合方式预配和管理容量和性能，简化云运维。使用精简预配、数据缩减和容量池来提高利用率。</p>\n<h3>即时保护您的工作负载</h3>\n<p>借助即时快照，大幅缩短备份时间并轻松快速地进行恢复。使用区域级 Persistent Disk 提供跨可用区的高可用性，并支持低 RPO 和 RTO。利用内置的跨区域灾难恢复功能，通过异步 Persistent Disk 为最敏感的工作负载提供<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>位置冗余。</p>\n<h3>利用我们新一代的分层式分流架构 Titanium</h3>\n<p>Hyperdisk 基于 Titanium 构建。Titanium 是一个由专门打造的定制芯片、安全微控制器和分层横向扩容分流构成的系统，它会对主机硬件的处理任务进行分流。这项新一代技术为 Hyperdisk Extreme 块存储提供每个实例高达 50 万的 IOPS。这个数据在领先的超大规模云平台中也极为亮眼。</p>\n<p>Hyperdisk 基于 Titanium 构建，是新一点的分层分流架构。Titanium 是一个由专门打造的定制芯片、安全微控制器和分层横向扩容分流构成的系统，可提高基础设施性能、生命周期管理能力、可靠性和安全性。</p>\n<p>Titanium 支持 Google Cloud 的最新计算实例类型（C3、A3、H3）、Hyperdisk 块存储、网络等，并且无需额外付费。</p>', 0, 1738977967),
(118, '谷歌云GCP Filestore', 'Filestore', 'google-cloud-filestore', 157, '全代管式高性能文件存储服务。Filestore 为应用提供了低延迟存储操作。Filestore 为那些对延迟敏感的工作负载（例如高性能计算、数据分析或其他元数据密集型应用）提供了高达 100 TB 的容量、25 GB/秒的吞吐量和 92 万 IOPS。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Filestore</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>全代管式高性能文件存储服务。</p>\n<p>1、按照快速入门指南了解如何执行 Filestore 操作。</p>\n<p>2、了解 Sabre 打算如何使用 Filestore for SAP 及其业务关键型应用</p>\n<p>3、探索有关 Filestore 的最新新闻、文章和视频</p>\n<p>4、服务等级协议承诺 99.99% 的区域可用性</p>\n<h3>优势</h3>\n<p><strong>加快向云端的迁移</strong></p>\n<p>Filestore 可让您将应用迁移到云端，而无需重写或重新设计架构，从而加快和简化迁移过程。</p>\n<p><strong>易于管理</strong></p>\n<p>通过控制台、gCloud CLI 或 API 均可轻松部署 Filestore <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。减少花在配置和监控文件存储上的时间，腾出更多时间专注于提升业务价值。</p>\n<p><strong>根据需要扩缩容量</strong></p>\n<p>用多少，付多少，无需为未使用的资源付费。根据您的应用需求自动扩缩容量。</p>\n<h3>Filestore 可满足最为严格的应用需求</h3>\n<p><strong>可扩容以满足高性能工作负载的需求</strong><br />Filestore 为应用提供了低延迟存储操作。Filestore 为那些对延迟敏感的工作负载（例如高性能计算、数据分析或其他元数据密集型应用）提供了高达 100 TB 的容量、25 GB/秒的吞吐量和 92 万 IOPS。</p>\n<p><strong>服务等级协议承诺 99.99% 的区域可用性，支持企业应用</strong><br />Filestore Enterprise 专为要求区域可用性的关键应用（例如 SAP）设计，可确保出现可用区服务中断时应用不受影响。无需重写应用，即可迅速开始迁移到云端。</p>\n<p><strong>使用备份和快照保护您的数据</strong><br />Filestore 可提供即时的备份和快照，帮助您轻松保护数据。您可以在需要时备份文件共享的数据和元数据，设置定期备份计划，或截取<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>快照。恢复数据时，仅需 10 分钟或更短的时间即可从先前的快照恢复点恢复部分或全部数据。</p>\n<p><strong>使用 Filestore 支持 GKE 工作负载</strong><br />对于在 GKE 中运行的需要文件存储的应用，全代管式 NFS 解决方案支持有状态和无状态应用。借助集成的代管式 GKE 容器存储接口 (CSI) 驱动程序，多个 pod 可以具有相同数据的共享文件系统访问权限。</p>\n<p><strong>独立于计算扩缩 GCVE 数据存储区容量</strong><br />Filestore Zonal 和 Filestore Enterprise 均已通过 VMware 认证，可作为 Google Cloud VMware Engine 的 NFS 数据存储区。独立调整 vCPU 和存储容量，以满足存储密集型虚拟机的计算和存储要求。利用 vSAN 来满足低延迟虚拟机要求，并将 Filestore 从 TB 级扩容到 PB 级，用于需要大量容量的虚拟机。</p>\n<p> </p>\n</div>\n</div>', 0, 1738978226),
(119, '谷歌云GCP Persistent Disk', 'Persistent Disk', 'google-cloud-persistent-disk', 157, '用于虚拟机实例的可靠、高性能块存储服务。 企业级规模、无限灵活性、高性价比。Persistent Disk 以耐用性为设计宗旨。我们以冗余方式自动存储您的数据，以确保最高级别的数据完整性。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Persistent Disk</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>用于虚拟机实例的可靠、高性能块存储服务。 企业级规模、无限灵活性、高性价比。</p>\n<p>1、通过创建或挂接磁盘立即开始使用</p>\n<p>2、了解如何为您的工作负载选择最佳磁盘</p>\n<p>3、最近的一项研究表明，我们的每月机器费用最多可比其他云服务低 80%</p>\n<p>4、查看所有可用的块存储方案</p>\n<h3>优势</h3>\n<p><strong>易于部署和扩缩的块存储服务</strong></p>\n<p>没有卷、空间分割和大小调整，只有磁盘。您无需费心处理分区、冗余磁盘阵列或子卷管理。可以根据需要扩容或缩容，并且只需为实际用量付费。</p>\n<p><strong>行业领先的价格与性能</strong></p>\n<p>HDD 旨在提供低成本存储空间，注重批量吞吐能力。SSD 旨在为随机访问工作负载和批量吞吐工作负载提供始终如一的优越性能。这两种类型的最大存储量都可达 64 TB。</p>\n<p><strong>灵活调整，无需停机</strong></p>\n<p>同时将多个永久性磁盘挂接到 Compute Engine 或 GKE 实例。配置快速的自动增量备份或即时调整存储空间大小，而不会中断应用。</p>\n<h3>主要特性</h3>\n<p><strong>适用于任何工作负载的高性能块存储服务</strong><br />永久性磁盘性能随磁盘大小和虚拟机实例上的 vCPU 数量而调节。您可以从多种磁盘性能选项中选择适合您的业务目标的选项，并且只需为使用的存储空间付费。</p>\n<p><strong>可确保业务持续运行的耐用性和可用性</strong><br />Persistent Disk 以耐用性为设计宗旨。我们以冗余方式自动存储您的数据，以确保最高级别的数据完整性。无论您是担心计划内维护还是意外故障，我们都可以确保您的数据可用并且业务不会中断。</p>\n<p><strong>自动安全和加密功能</strong><br />在数据从实例外部传输到永久性磁盘存储空间之前自动加密数据。每个永久性磁盘都会使用系统定义的密钥或客户提供的密钥进行加密。Google 会将永久性磁盘数据分布到多个物理磁盘，为数据构建终极安全保障。磁盘被删除时，我们会舍弃密钥，使数据无法恢复。</p>\n<p><strong>确保业务连续性的数据<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a></strong><br />使用跨可用区同步复制、跨区域异步复制、磁盘快照和磁盘克隆来<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>您的数据，确保数据可以在您需要时随时随地恢复。将数据复制到多个入网点可提高工作负载的弹性，并可让您实现多可用区或多区域业务连续性策略。</p>\n</div>\n</div>', 0, 1738978480),
(120, '谷歌云GCP Storage Transfer Service', 'Storage Transfer Service', 'google-cloud-storage-transfer-service', 157, 'Storage Transfer Service 在 Google Cloud、Amazon、Azure 和本地等对象和文件存储系统之间快速安全地转移数据。支持 VPC Service Controls，并使用校验和执行数据完整性检查，以确保您的数据完好无损地送达。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Storage Transfer Service</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>在 Google Cloud、Amazon、Azure 和本地等对象和文件存储系统之间快速安全地转移数据。</p>\n<p>1、在云环境之间转移数据、将本地数据转移到云端以及在云存储桶之间转移数据。查看所有选项。</p>\n<p>2、完全不用编写代码即可完成转移作业</p>\n<p>3、集中管理作业，借此<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>转移状态</p>\n<p>4、在每个环境都能兼顾安全性和可靠性</p>\n<p>5、根据业务需求配置数据转移作业：管理成本、时间和时间表</p>\n<h3>启用混合或多云策略</h3>\n<p>可通过一个简单易用的界面，从世界各地的私有数据中心、AWS、Azure 和 Google Cloud 转移数据。</p>\n<h3>优化基础架构管理，降低费用</h3>\n<p>通过将数据存储和应用基础架构迁移至 Google Cloud 来降低基础架构费用，同时最大程度地缩短停机时间。</p>\n<h3>快速完成大规模数据转移</h3>\n<p>通过在线网络从本地数据源或其他云转移 PB 级数据，以数十 Gbps 的网速传输数十亿个文件。利用横向扩容性能优化网络带宽并加快转移速度。</p>\n<h3>可靠、安全的数据转移服务</h3>\n<p><strong>数据加密和验证</strong><br />Storage Transfer Service 会对传输中的数据进行加密，支持 VPC Service Controls，并使用校验和执行数据完整性检查，以确保您的数据完好无损地送达。</p>\n<p><strong>增量转移</strong><br />所有转移仅转移自上次转移后新增、更新或删除的文件和对象，从而最大限度地减少需要转移的数据量。</p>\n<p><strong>元数据保留</strong><br />借助 Storage Transfer Service，您可以在转移过程中控制保留的对象和文件元数据。</p>\n</div>\n</div>', 0, 1738979022),
(121, '谷歌云GCP Parallelstore', 'Parallelstore', 'google-cloud-parallelstore', 157, '高性能代管式并行文件服务 Parallelstore 基于 DAOS 而构建，其读取吞吐量性能是竞争性 Lustre 暂存产品的 6 倍。Parallelstore 非常适合用于高性能定量分析和交易中的中间数据存储分析，也非常适合其他复杂、高速的金融服务使用场景，例如欺诈检测。', '500.00', '<h2>Parallelstore</h2>\n<p>高性能代管式并行文件服务<br />Parallelstore 基于 DAOS 而构建，其读取吞吐量性能是竞争性 Lustre 暂存产品的 6 倍。</p>\n<h3>快速、可扩缩的性能</h3>\n<p>高<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、高 IOPS 和超短延迟时间，利用字节可寻址介质来存储元数据和小型 I/O，以及本地连接的 NVMe 和用于批量 I/O 的软件管理冗余。</p>\n<h3>更快实现价值</h3>\n<p>配置 Parallelstore 以理想方式适应您的使用场景，并针对极端生成式 AI 和 HPC 模拟使用场景构建规模合适的系统。</p>\n<h3>让您的架构面向未来</h3>\n<p>使用 Parallelstore 进行构建可以帮助您的业务做好 HPC 规模、AI/机器学习收敛和 Kubernetes 集成的准备，这意味着您可以在最少中断的情况下实现增长和扩展。分布式元数据管理、极限 IOPS 和键值对存储架构与 AI 工作负载的新兴模式非常契合。</p>\n<h3>开源灵活性</h3>\n<p>Parallelstore 是基于开源的 Intel DAOS 构建的。一直以来我们都是开源领域的领导者，主导着 Kubernetes、TensorFlow 等项目。开源让您可以灵活地在各个公有云平台或公有云之外部署关键工作负载，并在必要时进行迁移。更快地将产品和服务推向市场，无需增加运营开销，也不需要专业技能。</p>\n<p>“借助 Google Cloud 上的 DAOS，用户可以轻松快速地预配能够扩容到与本地硬件类似性能水平的存储集群，还可以根据需要动态扩缩这些集群。”- Intel 的 Andrey Kudryavtsev</p>\n<p> </p>', 0, 1738979248),
(122, '谷歌云GCP NetApp Volumes', 'NetApp Volumes', 'google-cloud-netapp-volumes', 157, '在 Google Cloud 中畅享 NetApp 卓越的文件存储服务安全且高性能的文件存储服务，支持基于 SAP、Microsoft 和 Linux 的应用，并支持轻松迁移，不需要重构或重新设计。', '500.00', '<div class=\"x9K9hf dK1mgd\">\n<div class=\"jTIiId\">\n<div>\n<h2 class=\"MyvX5d D0aEmf qUKri yhYmte\">Google Cloud NetApp Volumes</h2>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf dK1mgd\">\n<h3 class=\"o2Zj5b D0aEmf  \">在 Google Cloud 中畅享 NetApp 卓越的文件存储服务</h3>\n<div class=\"x9K9hf fRAube\">\n<div class=\"wlROcd\">\n<div class=\" \">\n<p>安全且高性能的文件存储服务，支持基于 SAP、Microsoft 和 Linux 的应用，并支持轻松迁移，不需要重构或重新设计。</p>\n<div class=\"\">\n<div class=\"qPg9F  kJ4Wvd \">\n<div id=\"\" class=\"AZgcHf\">\n<h3 class=\"MyvX5d D0aEmf  \">更快速、高效地运行企业应用</h3>\n</div>\n<div class=\"AlLELb EAoy4b\">\n<div class=\" \">Google Cloud NetApp Volumes 支持大多数本地应用。无缝迁移并优化任务关键型 Linux、Windows、VMware 和 SAP 共享文件工作负载。集成并运行复杂度高、性能要求高、对延迟时间敏感度高的应用，实现快速响应，吞吐量最高可达到 4.5GiB/秒。</div>\n</div>\n</div>\n</div>\n<div class=\"\">\n<div class=\"qPg9F  q1Plf \">\n<div id=\"\" class=\"AZgcHf\">\n<h3 class=\"MyvX5d D0aEmf  \">将云存储费用降低多达 90%</h3>\n</div>\n<div class=\"AlLELb EAoy4b\">\n<div class=\" \">\n<p>利用即时、零空间占用的快照和卷克隆，设置适合您业务的自动化和优化控制措施，并减少所需的存储空间。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"\">\n<div class=\"qPg9F  q1Plf \">\n<div id=\"\" class=\"AZgcHf\">\n<h3 class=\"MyvX5d D0aEmf  \">满足对正常运行时间、可用性和安全性的要求</h3>\n</div>\n<div class=\"AlLELb EAoy4b\">\n<div class=\" \">\n<p>在发生意外数据丢失、勒索<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>攻击或数据损坏时，从占用空间接近于零的本地快照或远程备份副本即时恢复数据。利用跨区域复制功能、克隆和备份，为您的云应用提供业务连续性。</p>\n<p>IDC 分析发现，受访组织平均每年通过 NetApp Cloud Volumes 节省了 470 万美元，三年投资回报率为 457%。这些节省通过两种途径实现：其一是减少计划外服务中断的发生次数，其二是提高 IT 团队的工作效率。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738979390),
(123, '谷歌云GCP备份和灾难恢复 (DR) 服务', '备份和灾难恢复 (DR) 服务', 'google-cloud-backup-and-disaster-recovery-dr-services', 157, '备份和灾难恢复 (DR) 服务 面向 Google Cloud 工作负载的安全、集中管理的备份和恢复服务，可保护备份数据免遭恶意删除或意外删除。减少运营负担并轻松恢复', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">备份和灾难恢复 (DR) 服务</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>面向 Google Cloud 工作负载的安全、集中管理的备份和恢复服务，可保护备份数据免遭恶意删除或意外删除。</p>\n<p>在单个或多区域位置部署备份和恢复服务，以防止数据遭到恶意或意外删除。在控制台中试用。</p>\n<p>在一个位置集中保护 Compute Engine 虚拟机、VMware 虚拟机、数据库和文件系统</p>\n<p>了解如何备份和恢复 Compute Engine 虚拟机</p>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<h3>保护数据免遭恶意攻击</h3>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>使用由备份保险柜保护的不可更改、不可删除的备份，让您高枕无忧。最大限度地提高网络弹性并满足合规性目标。利用备份快速恢复数据，以继续业务运营。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<h3>在一个位置集中管理备份和恢复</h3>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>通过一个集中的信息中心保护和管理各种各样的工作负载。处理关键用例，例如从网络攻击中恢复（如勒索软件、用户错误或数据损坏）。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<h3>与<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>自动化工作流集成，实现大规模保护</h3>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>利用 gcloud CLI、API 或 Terraform 实现大规模自动化。将备份操作与<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>基础架构即代码集成，并将其无缝整合到更广泛的资源管理策略中。</p>\n<div class=\"qPg9F\">\n<div class=\"x9K9hf sJb7xe AlLELb\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">减少运营负担并轻松恢复</h3>\n<div class=\" \"><strong>备份保险柜防止修改或提前删除</strong></div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"qPg9F\">\n<div class=\"AlLELb\">\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>将备份数据存储在由 Google 管理的安全环境中，防止这些数据被篡改和提前删除。独立的、不可更改、不可删除的备份支持恢复到新的或预先存在的 Google Cloud 环境。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>通过简单的集中界面进行管理</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>使用一项服务来保护多种工作负载。易于使用，并且直接集成到 Google Cloud 控制台中。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>全面的监控、提醒和可自定义的报告</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>全面实时了解备份操作情况。轻松监控作业状态、设置通知以及定制自动化报告，以证明合规性、进行分析并获得数据洞见。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>执行和监督功能可保障贵组织的安全</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>支持将备份任务高效地委托给平台管理员（或应用开发者），同时保留对备份政策的集中式治理和控制。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738979610),
(124, '谷歌云GCP AlloyDB', 'AlloyDB', 'google-cloud-alloydb', 157, '100% 兼容 PostgreSQL 的数据库，可在任何位置运行为 要求苛刻的企业工作负载提供卓越的性能、可用性和扩缩能力，并借助 AI 技术增强它们。全面兼容 PostgreSQL，提供卓越的性能和扩缩能力，以及最全面的生成式 AI 支持', '500.00', '<div class=\"x9K9hf dK1mgd\">\n<div class=\"jTIiId\">\n<div>\n<h2 class=\"MyvX5d D0aEmf qUKri yhYmte\">AlloyDB</h2>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf dK1mgd\">100% 兼容 PostgreSQL 的数据库，可在任何位置运行\n<div class=\"x9K9hf fRAube\">\n<div class=\"wlROcd\">\n<div class=\" \">\n<p>为要求苛刻的企业工作负载提供卓越的性能、可用性和扩缩能力，并借助 AI 技术增强它们。</p>\n<h3>更高的性价比</h3>\n<p>与自行管理的 PostgreSQL 相比，AlloyDB 处理事务性工作负载的速度快至 4 倍以上，性价比高出 2 倍。*它适合要求苛刻的企业工作负载，包括需要高事务吞吐量、大型数据或多个读取副本的工作负载。读取连接可横向扩容（由低延迟提供支持）、横向扩容读取副本池，以及支持跨区域副本。 承诺<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>折扣为 1 到 3 年的承诺<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>期提供额外的优惠。</p>\n<h3>功能全面的矢量数据库</h3>\n<p>AlloyDB AI 可以帮助您构建各种生成式 AI 应用。它<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> Google ScaNN 索引（为 Google 搜索和 YouTube 等服务提供支持的技术）扩展至超过十亿个向量，提供的向量查询速度比标准 PostgreSQL 中的 HNSW 索引快多达 4 倍。*它还可以帮助您从数据库中生成矢量嵌入、访问存储在 LangChain 等开源生成式 AI 工具中的数据，以及访问 Vertex AI 和其他平台中的 AI 模型。</p>\n<h3>在任何地方运行</h3>\n<p>AlloyDB Omni 是 AlloyDB 的可下载版本，适合在数据中心、笔记本电脑、边缘设备和任何云环境中运行。它由与基于云的 AlloyDB 服务相同的引擎赋能，并提供相同的功能。AlloyDB Omni 的成本只是旧数据库的一小部分，因此这是一种非常有吸引力的方法，可以在层级 1 供应商的支持下，通过现代化改造升级为 PostgreSQL 的企业级版本。</p>\n<h3>实时业务数据分析</h3>\n<p>得益于其内置的列式引擎，AlloyDB 进行分析查询的速度比标准 PostgreSQL 快 100 倍*，并且在运行商业智能、报告以及混合事务和分析工作负载 (HTAP) 时不会对运营性能产生任何影响。您还可以通过 BigQuery 流式传输数据或<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>联合查询，并在查询或事务中直接调用 Vertex AI 中的机器学习模型。</p>\n<p>AlloyDB 与开源 PostgreSQL（包括热门扩展程序）完全兼容，具有更高的性能和可伸缩性。每个集群都有一个主实例和一个包含多个读取节点的可选读取池，您可以复制到不同区域中的次要集群。AlloyDB 提供持续备份功能，可为大多数工作负载提供高可用性和无中断维护。它<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>自适应算法来消除许多日常管理任务。</p>\n</div>\n</div>\n</div>\n</div>', 0, 1738979965),
(125, '谷歌云GCP Cloud SQL', 'Cloud SQL', 'google-cloud-cloud-sql', 157, '您只需集中精力开发应用，数据库的相关事宜交给我们来处理 一项适用于 PostgreSQL、MySQL 和 SQL Server 的经济实惠的全托管式关系型数据库服务。试用企业 Plus 版，获享服务等级协议 (SLA) 承诺 99.99% 的可用性和领先的性能。', '500.00', '<h2>Cloud SQL</h2>\n<p>您只需集中精力开发应用，数据库的相关事宜交给我们来处理<br />一项适用于 PostgreSQL、MySQL 和 SQL Server 的经济实惠的全托管式关系型数据库服务。试用企业 Plus 版，获享服务等级协议 (SLA) 承诺 99.99% 的可用性和领先的性能。</p>\n<div id=\"\" class=\"AZgcHf\">\n<h3 class=\"MyvX5d D0aEmf  \">全代管式</h3>\n</div>\n<div class=\"KXFYXb EAoy4b\">\n<div class=\" \">\n<p>Cloud SQL 为您管理数据库，让您不必亲力亲为，而且业务可以不间断地运营。我们可以自动执行所有备份、复制、修补、加密和增加存储容量的操作，为您的应用提供所需的可靠性、可伸缩性和安全性。</p>\n<h3>性价比方案</h3>\n<p>Cloud SQL 可让您根据数据库工作负载的性能、可用性和数据保护需求，灵活地选择合适的功能。企业版提供最低成本和平衡的性能，而企业 Plus 版适用于要求最严苛的事务性工作负载，通过全面优化的软件和硬件栈以及数据缓存选项，提供最高性能。数据缓存利用闪存，通过在内存和高速本地存储中智能地缓存数据来缩短读取延迟时间并提高吞吐量。SQL Server 企业 Plus 版实例提供两个新的机器系列：性能优化型（1:8 核心内存比）和内存优化型（1:32 核心内存比），可提供更好的性能。</p>\n<div id=\"\" class=\"AZgcHf\">\n<h3 class=\"MyvX5d D0aEmf  \">高可用性，停机维护时间接近亚秒</h3>\n</div>\n<div class=\"KXFYXb EAoy4b\">\n<div class=\" \">\n<p>可轻松配置通过多个可用区之间的自动故障切换功能实现的内置高可用性，保护您的应用免受各种可能的故障的影响。企业版可为通用工作负载提供可用性达 99.95% 的服务等级协议 (SLA)，而企业 Plus 版可为要求最严苛的工作负载提供可用性达 99.99% 的服务等级协议 (SLA)，支持维护和实例扩容，停机时间通常在亚秒级。它还提供增强的灾难恢复功能，允许进行故障切换并切换回原始拓扑，不会丢失数据且无需对应用进行任何更改。</p>\n<h3>Cloud SQL 中的 Gemini</h3>\n<p>借助 AI 赋能的协助功能，简化数据库历程的各个方面，帮助您专注于最重要的工作。Cloud SQL 中的 Gemini（预览版）可简化数据库操作的方方面面，包括开发、性能优化、数据库群组管理、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和迁移。</p>\n<p>Gemini in Database Migration Service（预览版）可帮助您查看和转换数据库常驻代码（如存储过程、触发器和函数），并在 Cloud SQL for PostgreSQL 中运行该代码。数据库中心目前处于预览版阶段，可通过智能的性能和安全建议，主动降低舰队的风险。启用 Gemini 后，数据库中心可让您极其直观地优化数据库舰队。使用自然语言聊天界面提问，快速解决舰队问题，并获取优化建议。</p>\n<h3>Firebase Data Connect</h3>\n<p>Firebase Data Connect 弥合了 Firebase 强大的移动/Web 开发功能与 PostgreSQL 丰富的数据管理功能之间的差距。将 Cloud SQL for PostgreSQL 的强大功能用作后端，同时获享无缝的 Firebase 开发体验。更快速、更智能、更高效地构建应用。</p>\n<p>Cloud SQL 只需几分钟即可扩容，还可跨可用区和区域复制数据。它使用代理进行维护、日志记录、监控和配置，并提供由 SRE 团队全天候支持的服务。通过控制台、CLI 或 REST API 管理数据库，并通过标准数据库驱动程序连接应用。</p>\n</div>\n</div>\n</div>\n</div>', 0, 1738980211),
(126, '谷歌云GCP Firestore', 'Firestore', 'google-cloud-firestore', 157, '使用全代管式、可扩缩的无服务器文档数据库，轻松开发各种各样的应用。全托管式无服务器文档数据库可轻松扩容或缩容来满足任何需求，没有分区维护期，也不会停机，帮助您专心进行应用开发。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Firestore</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>使用全代管式、可扩缩的无服务器文档数据库，轻松开发各种各样的应用。</p>\n<p>借助此交互式解决方案，部署并运行动态 Web 应用，以使用 Firestore 运行通过 JavaScript 构建的示例应用 (Developer Journey App)</p>\n<p>兼容 JSON 的无服务器数据库，可轻松扩缩，无需分区或维护</p>\n<p>使用 Firestore 向量搜索、LangChain 和 Llamaindex，轻松构建生成式 AI 应用</p>\n<p>可全面自定义的安全和数据验证规则，确保数据始终受到保护</p>\n<p>通过直接连接到该数据库，加速开发移动、Web 和 IoT 应用</p>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<h3>企业级文档数据库</h3>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>Firestore 是一种兼容 JSON 的文档数据库，可提供丰富的可查询性、大量的全局索引和可序列化的 ACID 事务，并与 Google Cloud 的治理工具完全集成。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<h3>随用随付，轻松扩展</h3>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>用多少付多少 - 没有前期支出，也不会有利用率不足的资源。根据需要自动扩容和缩容。无需分区或维护，服务等级协议 (SLA) 承诺的可用性高达 99.999%。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">更快地推出应用和功能</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>Firestore 提供出色的开发者体验，可帮助您更快地构建应用。它可以跨客户端库和服务器端库提供内置的实时同步、离线<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>以及 ACID 事务功能。</p>\n<div class=\"qPg9F\">\n<div class=\"x9K9hf sJb7xe AlLELb\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">主要特性</h3>\n<div class=\" \"><strong>无服务器</strong></div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"qPg9F\">\n<div class=\"AlLELb\">\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>全托管式无服务器文档数据库可轻松扩容或缩容来满足任何需求，没有分区维护期，也不会停机，帮助您专心进行应用开发。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>强大的查询引擎</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>Firestore 使您能够针对与 JSON 兼容的文档数据运行复杂查询，包括矢量搜索和 ACID 事务。这让您能更灵活地设置数据结构。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>实时同步和离线模式</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>内置实时同步和离线模式使您可以在移动 Web 和 IoT 设备上轻松构建多用户协作式应用，包括由实时资产跟踪、活动跟踪、实时分析、媒体和商品清单、通信、社交媒体用户资料和游戏排行榜构成的工作负载。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738980437),
(127, '谷歌云GCP Spanner', 'Spanner', 'google-cloud-spanner', 157, '始终开启的数据库，规模近乎无限 使用汇集了关系型、图表、键值对和搜索的单个数据库构建智能应用。没有维护窗口意味着任务关键型应用会不间断地运行。', '500.00', '<h2>Spanner</h2>\n<p>始终开启的数据库，规模近乎无限<br />使用汇集了关系型、图表、键值对和搜索的单个数据库构建智能应用。没有维护窗口意味着任务关键型应用会不间断地运行。</p>\n<h3>无限的写入和读取扩缩能力</h3>\n<p>Spanner 将计算资源与数据存储空间分离，因而可以透明地对处理资源进行横向缩容和横向扩容。每一个增加的计算容量都可以处理读取和写入操作，轻松实现横向扩缩。Spanner 通过自动处理分片、复制和事务处理来优化性能。</p>\n<div id=\"\" class=\"AZgcHf\">\n<h3 class=\"MyvX5d D0aEmf  \">自动维护</h3>\n</div>\n<div class=\"AlLELb EAoy4b\">\n<div class=\" \">为任何规模的数据库降低运营成本并提高可靠性。内置自动同步复制和维护功能。在处理流量的同时，实现 100% 的在线架构更改和维护，零停机时间。</div>\n<h3 class=\" \">Spanner Graph</h3>\n<div class=\" \">揭示隐藏的关系和<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。Spanner Graph 支持图数据库的新国际标准 ISO 图查询语言 (GQL)，提供了一种直观而简洁的方式来匹配数据中的模式并遍历数据中的关系。它结合了 SQL 和 GQL 的优势，让您只需通过一次操作即可查询结构化和关联的数据。Spanner Graph（预览版）可与全文和向量搜索功能互操作，为您提供一类依托 AI 技术的新型应用。</div>\n<div class=\" \">\n<div id=\"\" class=\"AZgcHf\">\n<h3 class=\"MyvX5d D0aEmf  \">向量搜索</h3>\n</div>\n<div class=\"KXFYXb EAoy4b\">\n<div class=\" \">\n<p>在 Spanner 中利用精确最近邻 (KNN) 和近似最近邻 (ANN) 向量搜索（预览版同时提供这两种搜索）以几乎无限的规模搜索向量嵌入，实现高度可分区的工作负载。Spanner 内置的向量搜索支持消除了对单独的、专门的向量数据库解决方案的需求，提供了运营数据的事务保证，并在横向扩容的无服务器架构上提供最新且一致的向量搜索结果，且无需任何管理。</p>\n<h3>PostgreSQL 页面</h3>\n<p>将 Spanner 的可伸缩性和可靠性与 PostgreSQL 页面的熟悉度和可移植性相结合。利用您的团队熟悉的技能和工具，保证您的投资不会过时，您可以安心无忧。</p>\n</div>\n</div>\n</div>\n</div>', 0, 1738980678),
(128, '谷歌云GCP Bigtable', 'Bigtable', 'google-cloud-bigtable', 157, '使用 NoSQL 类型中的先驱数据库服务扩缩对延迟敏感的应用 低延迟的企业级 NoSQL 数据库服务，适用于大规模机器学习、运营分析和面向用户的应用。Bigtable 是一种键值对形式的宽列存储区，非常适合快速访问结构化、半结构化或非结构化数据。', '500.00', '<div class=\"x9K9hf dK1mgd\">\n<div class=\"jTIiId\">\n<div>\n<h2 class=\"MyvX5d D0aEmf qUKri yhYmte\">Bigtable</h2>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf dK1mgd\">使用 NoSQL 类型中的先驱数据库服务扩缩对延迟敏感的应用\n<div class=\"x9K9hf fRAube\">\n<div class=\"wlROcd\">\n<div class=\" \">\n<p>低延迟的企业级 NoSQL 数据库服务，适用于大规模机器学习、运营分析和面向用户的应用。</p>\n<h3>低延迟和高吞吐量</h3>\n<p>Bigtable 是一种<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>对形式的宽列存储区，非常适合快速访问结构化、半结构化或非结构化数据。因此，对延迟敏感的工作负载（如个性化）非常适合 Bigtable。但是，其分布式计数器、很高的单位成本读写吞吐量效率使得它也非常适合点击流和 IoT 用例，甚至也非常适合用于高性能计算 (HPC) 应用的批量分析，包括训练机器学习模型。</p>\n<h3>无限的写入和读取扩缩能力</h3>\n<p>Bigtable 将计算资源与数据存储空间分离，因而可以透明地调整处理资源。每个增加的节点都能够以同样的质量处理读取和写入操作，从而轻松实现横向扩缩。Bigtable 通过自动扩缩资源来适应服务器流量、处理分片、复制和查询处理，从而优化性能。</p>\n<div id=\"\" class=\"AZgcHf\">\n<h3 class=\"MyvX5d D0aEmf  \">灵活的数据模型</h3>\n</div>\n<div class=\"KXFYXb EAoy4b\">\n<div class=\" \">\n<p>Bigtable 让您的数据模型自然发展。可存储标量、JSON、协议缓冲区、Avro、Arrow、嵌入、图片等各种对象，并根据需要动态地添加或移除新列。在单个数据库中基于原始的非结构化数据提供低延迟传送或高性能的批量分析。</p>\n<div id=\"\" class=\"AZgcHf\">\n<h3 class=\"MyvX5d D0aEmf  \">从单个可用区快速扩容至 8 个区域</h3>\n</div>\n<div class=\"AlLELb EAoy4b\">\n<div class=\" \">\n<p>无论您的用户在哪里，由 Bigtable 支持的应用都可通过全球分布的多主配置实现低延迟读写。可用区级实例有助于节省费用，并且可以通过自动复制功能无缝扩容为多区域部署。运行多区域实例时，您的数据库可以防范单区域故障，并提供业界领先的 99.999% 可用性。</p>\n<h3>从 NoSQL 数据库轻松迁移</h3>\n<p>实时迁移可减少工作量并确保准确迁移数据，帮助您更快、更轻松地完成迁移。HBase Bigtable 复制库支持使用导入和验证工具轻松地将 HBase 快照导入到 Bigtable，而 Dataflow 模板可简化从 Cassandra 到 Bigtable 的迁移。</p>\n<p>Bigtable 实例在一个或多个区域中提供计算和存储资源。每个 Bigtable 集群都可以接收读取和写入操作。数据会自动“分块”以实现可伸缩性，并在各集群之间异步复制。名为 TrueTime 的分布式时钟保证事务的顺序正确。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738980961),
(129, '谷歌云GCP Datastream', 'Datastream', 'google-cloud-datastream', 157, 'Datastream 这是一项无服务器且易于使用的变更数据捕获和复制服务。Datastream 从 MySQL、PostgreSQL、AlloyDB、SQL Server 和 Oracle 数据库中读取和传送每个更改（插入、更新和删除），以将数据加载到 BigQuery、Cloud SQL、Cloud Storage 和 Spanner 中。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Datastream</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>这是一项无服务器且易于使用的变更数据捕获和复制服务。</p>\n<p>访问 MySQL、PostgreSQL、AlloyDB、SQL Server 和 Oracle 数据库中的流式数据</p>\n<p>借助 Datastream for BigQuery，在 BigQuery 中实现近乎实时的分析</p>\n<p>通过内置安全连接轻松进行设置，可更快实现价值</p>\n<p>可自动扩缩的无服务器平台，无需预配或管理任何资源</p>\n<p>基于日志的机制可减少源数据库的负载和潜在的中断</p>\n<p><strong>以较短的延迟时间复制和同步数据</strong><br />以可靠方式跨异构数据库、存储系统和应用同步数据，同时将对源性能的影响降至最低。</p>\n<p><strong>通过无服务器架构扩容或缩容</strong><br />借助简单易用的无服务器服务快速启动，该服务可无缝扩缩并且没有基础架构需要管理。</p>\n<p><strong>通过 Google Cloud 服务实现前所未有的灵活性</strong><br />使用 BigQuery、Spanner、Dataflow 和 Data Fusion 等出色 Google Cloud 服务连接并集成您组织中的数据。</p>\n<h3>Datastream 的独特方法</h3>\n<p><strong>从关系型数据库流式传输数据</strong><br />Datastream 从 MySQL、PostgreSQL、AlloyDB、SQL Server 和 Oracle 数据库中读取和传送每个更改（插入、更新和删除），以将数据加载到 BigQuery、Cloud SQL、Cloud Storage 和 Spanner 中。作为无<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的 Google 原生服务，Datastream 以可靠的方式实时流式传输每个事件。Datastream 每月处理超过五千亿个事件。</p>\n<p><strong>具有高级恢复功能的可靠流水线</strong><br />意外中断可能会产生高昂的成本。Datastream 的强大数据流恢复功能可最大限度地减少停机时间和数据丢失，让您可以维持关键业务运营，并根据不间断的数据流水线做出明智的决策。</p>\n<p><strong>架构偏移解析</strong><br />当源架构变化时，Datastream 可以进行快速无缝的架构偏移解析。Datastream 会在每次架构更改时轮替文件，在目标存储桶中创建新文件。借助具有版本控制的最新版 Schema Registry，只需进行一次 API 调用即可轻松转换原始的源数据类型。</p>\n<p><strong>原生安全</strong><br />Datastream 支持多种安全的专用连接方法，以保护传输中的数据。此外，数据在传输过程中和静态存储时都会加密，因此在整个流式传输期间都会受到保护，您可以安心无忧。</p>\n</div>\n</div>', 0, 1738981188),
(130, '谷歌云GCP Database Migration Service', 'Database Migration Service', 'google-cloud-database-migration-service', 157, '简化迁移到云的过程。现可用于 MySQL、PostgreSQL、SQL Server 和 Oracle 数据库。引导式体验将引导您迁移 MySQL、PostgreSQL、SQL Server 和 Oracle 数据库，并提供内置的自定义源配置信息、架构和代码转换，且能设置多个安全网络连接选项。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Database Migration Service</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>简化迁移到云的过程。现可用于 MySQL、PostgreSQL、SQL Server 和 Oracle 数据库。</p>\n<ul class=\"PNKBid \">\n<li class=\"nuvzTc\">\n<div class=\"EAoy4b\">\n<div class=\" \">\n<p>从本地、Google Cloud 或其他云迁移到云端开源数据库</p>\n</div>\n</div>\n</li>\n<li class=\"nuvzTc\">\n<div class=\"EAoy4b\">\n<div class=\" \">\n<p>持续复制数据，实现最短停机时间迁移</p>\n</div>\n</div>\n</li>\n<li class=\"nuvzTc\">\n<div class=\"EAoy4b\">\n<div class=\" \">\n<p>借助 AI 赋能的协助，无缝转换架构和代码</p>\n</div>\n</div>\n</li>\n<li class=\"nuvzTc\">\n<div class=\"EAoy4b\">\n<div class=\" \">\n<p>无服务器且易于设置</p>\n</div>\n</div>\n</li>\n</ul>\n<div class=\"qPg9F\">\n<div class=\"x9K9hf sJb7xe AlLELb\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">主要特性</h3>\n<div class=\" \"><strong>易于使用</strong></div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"qPg9F\">\n<div class=\"AlLELb\">\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>引导式体验将引导您迁移 MySQL、PostgreSQL、SQL Server 和 Oracle 数据库，并提供内置的自定义源配置信息、架构和代码转换，且能设置多个安全网络连接选项。Database Migration Service 利用原生复制功能实现高度准确、高保真度的迁移，您还可以在迁移前运行验证以确保迁移成功。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>Database Migration Service 中的 Gemini</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>借助 AI 赋能的协助，让数据库迁移变得更简单快捷。借助 DMS 中的 Gemini（预览版），您可以查看数据库中驻留的代码（例如存储过程、触发器和函数）并将其转换为与 PostgreSQL 兼容的方言。为了提升 SQL 开发者的技能以及对他们进行再培训，可解释性能实现方言的对照比较，以及代码和建议的详细解释。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>集成式转换和迁移</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>通过将旧版 Oracle 工作负载迁移到 PostgreSQL，对其进行现代化改造。内置的转换工作区可减少异构迁移的手动工作，Gemini 辅助转换流程会引导您完成架构和代码转换，并突出显示转换问题以供您查看。转换工作区可用于从 Oracle 到 Cloud SQL 和 AlloyDB 的迁移。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>无服务器体验</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>消除数据库迁移的运维负担。 您不需要预配、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>或监控迁移服务器，自动扩缩可确保高性能、不间断的规模化数据复制。从创建源数据库的初始快照到持续复制更改，整个过程的停机时间极短。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \"><strong>原生安全</strong></div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>了解在迁移过程中您的数据安全无虞。Database Migration Service 支持多种安全的专用连接方法，以保护传输中的数据。迁移后，默认情况下所有数据都会被加密，Google Cloud 数据库提供多层安全性，可以满足极严格的安全性要求。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1738981363),
(131, 'Azure 存档存储', '存档存储', 'azure-archive-storage', 164, '数据呈指数式增长并不意味着数据存储和管理的成本也呈指数式增长。Azure 存档存储功能是一种低成本、持久、高度可用且安全的云存储方法，用于存储极少访问且延迟需求灵活的数据。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure 存档存储</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>在存储不常访问的数据方面具有优势的行业价位。</p>\n<ul class=\"list-unstyled \">\n<li class=\" d-flex mb-4\">\n<div id=\"custom-list-item-oc267a\" class=\"card ml-3\" data-oc=\"oc267a\">\n<div class=\"card-body\">\n<p>最低价格的存档存储层</p>\n</div>\n</div>\n</li>\n<li class=\" d-flex mb-4\">\n<div id=\"custom-list-item-oce16d\" class=\"card ml-3\" data-oc=\"oce16d\">\n<div class=\"card-body\">\n<p>自动加密静态数据</p>\n</div>\n</div>\n</li>\n<li class=\" d-flex mb-4\">\n<div id=\"custom-list-item-ocabc2\" class=\"card ml-3\" data-oc=\"ocabc2\">\n<div class=\"card-body\">\n<p>与热存储层和冷存储层无缝集成</p>\n</div>\n</div>\n</li>\n<li class=\" d-flex mb-4\">\n<div id=\"custom-list-item-oc8124\" class=\"card ml-3\" data-oc=\"oc8124\">\n<div class=\"card-body\">\n<p>由领先的数据管理合作伙伴提供支持</p>\n</div>\n</div>\n</li>\n</ul>\n<h3 class=\"h5\">低成本，高价值</h3>\n<div data-oc-token-text=\"\">\n<p>数据呈指数式增长并不意味着数据存储和管理的成本也呈指数式增长。Azure 存档存储功能是一种低成本、持久、高度可用且安全的云存储方法，用于存储极少访问且延迟需求灵活的数据。一个月只需几美元即可将数 TB 的数据存储在云中，并且可以重新调整存储基础结构的用途，以实现其他关键业务目标。</p>\n<h3 class=\"h5\">从一开始进行保护</h3>\n<div data-oc-token-text=\"\">\n<p>极少访问数据并不意味着这些数据不重要。许多行业要求组织维护存在多年的一些敏感财务、医疗或员工数据。在将该类数据迁移到云时，需要让其受到最高安全级别的保护。存档存储功能使用 HTTPS 将数据安全地传输到云，并使用 256 位 AES 密钥自动保护这类静态数据。</p>\n<h3 class=\"h5\">更轻松的管理和 Blob 级别<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a></h3>\n<div data-oc-token-text=\"\">\n<p>Azure 存档存储是可用于 Blob 存储的另一种存储层。热对象、冷对象和存档对象全都可以并排存在于同一帐户中。此外，由于引入了 Blob 级别<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>，只需在 Azure 门户中单击一下即可更改对象的层，也可以使用 REST API（或 .NET、Java、Python 和许多其他 SDK）以编程方式按需更改多个对象。</p>\n<p> </p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739158338),
(132, 'Azure Managed Lustre', 'Azure Managed Lustre', 'azure-managed-lustre', 164, 'Azure Managed Lustre 是适合高性能计算 (HPC) 和 AI 工作负载的托管、即用即付文件系统。通过一项目的明确的托管服务简化操作、降低设置成本并消除复杂的维护。可与 Azure HPC 计算、Azure Kubernetes 服务和 Azure 机器学习等 Azure 服务结合使用。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure Managed Lustre</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>提高文件系统在高性能计算 (HPC) 和 AI 工作负载方面的性能。</p>\n<div class=\"col-12 col-sm-12 col-md-4 pb-0\">\n<div class=\"d-flex w-100 h-100 position-relative material-color-light text-md-left\">\n<div class=\"d-flex flex-row w-100 h-100 \">\n<div class=\"w-100 py-2 pl-4 pr-2 d-flex align-items-center\">\n<div class=\"w-100\">\n<h3 class=\"h4 pt-3 \">通过托管并行文件系统让 HPC 和 AI 工作负载提速</h3>\n<div class=\" link-group \">Azure Managed Lustre 是适合高性能计算 (HPC) 和 AI 工作负载的托管、即用即付文件系统。通过一项目的明确的托管服务简化操作、降低设置成本并消除复杂的维护。可与 Azure HPC 计算、Azure Kubernetes 服务和 Azure 机器学习等 Azure 服务结合<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。</div>\n<div class=\" link-group \"> </div>\n<div class=\" link-group \">1、高性能的分布式并行文件系统，提供数百 GBps 的存储带宽和固态硬盘延迟。</div>\n<div class=\" link-group \"> </div>\n<div class=\" link-group \">2、在云中带给 HPC 应用程序无缝的 Lustre 功能、行为和性能，且无兼容性问题。</div>\n<div class=\" link-group \"> </div>\n<div class=\" link-group \">3、文件系统与 Azure Blob 存储互操作，实现最佳数据放置、数据处理和成本管理。</div>\n<div class=\" link-group \"> </div>\n<div class=\" link-group \">4、简化了 HPC 工作负载的管理，兼具 Lustre 和云服务的优势，可在大多数 Azure 区域中<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。</div>\n<h3 class=\" link-group \">让 HPC 作业提速</h3>\n<div class=\" link-group \">\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>能够达到数百 GBps 的存储纵向扩展计算群集和完成作业，与现有 IP 存储服务相比大大降低操作时间。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250210/66950faecd97a7ba32d05617d5abb9ac.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739158611),
(133, 'Azure Data Lake Storage', '数据湖', 'azure-data-lake-storage', 164, 'Azure Data Lake Storage 使用  Microsoft Entra ID（前 Azure Active Directory）和基于角色的访问控制 (RBAC) 对数据进行身份验证。借助静态加密和高级威胁防护等安全功能，帮助保护数据。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure Data Lake Storage</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>大规模可缩放且安全的数据湖，适用于高性能分析工作负载。</p>\n<h3 class=\"h4 \">为高性能分析建立基础</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>使用单个存储平台消除数据孤岛。通过分层存储和策略管理优化成本。使用  Microsoft Entra ID（前 Azure Active Directory）和基于角色的访问控制 (RBAC) 对数据进行身份验证。借助静态<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和高级威胁防护等安全功能，帮助保护数据。</p>\n<p>1、通过自动异地复制实现无限制的缩放和 16 个 9 的数据持久性</p>\n<p>2、高度安全存储，具有灵活的跨数据访问、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和网络级控制的保护机制</p>\n<p>3、用于引入、处理和可视化的单一存储平台，支持最常见的分析框架</p>\n<p>4、通过独立缩放存储和计算、生命周期策略管理和对象级分层实现成本优化</p>\n<h3 class=\"h4 \">缩放以匹配要求最苛刻的分析工作负载</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>借助 Azure 全局基础结构，满足任何容量要求并轻松管理数据。以始终如一的高性能运行大规模分析查询。</p>\n<h3 class=\"h4 \">利用灵活的安全机制</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>通过涵盖<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、数据访问和网络级控制的功能保护数据湖，所有这些功能都旨在帮助你更安全地获得见解。</p>\n<h3 class=\"h4 \">为分析构建可缩放的基础</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>使用各种不同的数据引入工具大规模引入数据。使用 Azure Databricks、Azure Synapse Analytics 或 Azure HDInsight 处理数据。并通过 Microsoft Power BI 对数据进行可视化，从而获取转型见解。</p>\n<h3 class=\"h4 \">构建具有成本效益的云数据湖</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>通过独立缩放存储和计算来优化成本，这是本地数据湖无法实现的功能。根据使用情况上调或下调层级，并利用自动化生命周期管理策略来优化存储成本。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739158913),
(134, 'Azure Data Share', 'Azure Data Share', 'azure-data-share', 164, '与其他组织共享来自多个源的任何格式和任何大小的数据。轻松控制共享的内容、接收数据的人员以及使用条款。通过用户友好界面，Data Share 使你可以全面了解数据共享关系。只需点击几下即可共享数据，或使用 REST API 生成自己的应用程序。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure Data Share</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>简单安全的大数据共享服务。</p>\n<p>与其他组织共享来自多个源的任何格式和任何大小的数据。轻松控制共享的内容、接收数据的人员以及使用条款。通过用户友好界面，Data Share 使你可以全面了解数据共享关系。只需点击几下即可共享数据，或使用 REST API 生成自己的应用程序。</p>\n<p>1、无服务器无代码数据共享服务，无需设置或管理基础结构</p>\n<p>2、直观的界面，可管理所有数据共享关系</p>\n<p>3、自动化数据共享流程，可提高工作效率和可预测性</p>\n<p>4、使用基础 Azure 安全措施的安全数据共享服务</p>\n<h3 class=\"h4 \">以所需方式轻松共享数据</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>只需几次单击即可与其他组织共享来自多个 Azure 数据存储的结构化和非结构化数据。无需设置或管理基础结构，不需要 SAS 密钥，并且共享不需要任何代码。你可以控制数据访问并设置与企业策略一致的使用条款。使用基于快照的共享从数据提供商复制数据，或使用就地共享引用提供商帐户中的数据。</p>\n<h3 class=\"h4 \">管理数据共享以提高共享安全性</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>使用直观的用户友好界面轻松高效地跟踪和管理数据共享关系。查看你与谁共享数据以及何时接受数据。随时阻止未来的更新流过。</p>\n<h3>扩展分析数据集以获取增强的见解</h3>\n<p>将内部数据与合作伙伴数据相结合，以获取新见解。将任何格式的数据共享到 Azure Synapse Analytics、Azure SQL 数据库、Azure Blob 存储、Azure Data Lake Storage 和 Azure 数据<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>管理器，或从这些位置接收任何格式的数据。Data Share 将在未来支持更多 Azure 数据存储。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250210/a5d2048f03cb7e45911a2225ac3d3a64.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739159201),
(135, 'Azure 文件存储', '文件存储', 'azure-file-storage', 164, '利用云中的完全托管的文件共享，这些共享项可通过行业标准的 SMB 和 NFS 协议进行访问。可在云端或本地的 Windows、Linux 和 macOS 部署中同时装载 Azure 文件存储共享。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure 文件存储</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>简单、安全且无服务器的企业级云文件共享。</p>\n<p>利用云中的完全托管的文件共享，这些共享项可通过行业标准的 SMB 和 <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>协议进行访问。可在云端或本地的 Windows、Linux 和 macOS 部署中同时装载 Azure 文件存储共享。此外，可以使用 Azure 文件同步将 Azure 文件存储共享缓存在 Windows Server 上，从而加快访问速度（在数据使用位置附近）。</p>\n<h3 class=\"h5\">无服务器文件共享</h3>\n<div data-oc-token-text=\"\">\n<p>从头开始构建的分布式文件系统具有高可用性和持久性 - 无隐藏的 IaaS VM 或 NAS 文件管理器。</p>\n<h3 class=\"h5\">专为与文件同步混合而构建</h3>\n<div data-oc-token-text=\"\">\n<p>将 Windows Server 转换为云共享的缓存，同时不影响本地性能。</p>\n<h3 class=\"h5\">优化 TCO</h3>\n<div data-oc-token-text=\"\">\n<p>根据你的性能要求和富有竞争力的定价为你的共享使用不同的层。</p>\n<h3 class=\"h5\">多个协议支持</h3>\n<div data-oc-token-text=\"\">\n<p>提供对多种协议的支持，从而能够存储不同源的数据。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250210/e29813e97e47ea5bcdfbfac73a4a45a5.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739159401),
(136, 'Azure NetApp 文件', 'Azure NetApp 文件', 'azure-netapp-file', 164, '在 Azure 中运行要求最高的 Linux 和 Windows 文件工作负载 Azure NetApp 文件在各种方案中被广泛用作基础共享文件存储服务。其中包括迁移（直接迁移）POSIX 兼容的 Linux 和 Windows 应用程序、SAP HANA、数据库、高性能计算 (HPC) 基础结构和应用以及企业 Web 应用程序。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure NetApp 文件</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>由 NetApp 提供支持的企业级 Azure 文件共享。</p>\n<h3 class=\"h4\">在 Azure 中运行要求最高的 Linux 和 Windows 文件工作<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a></h3>\n<div data-oc-token-text=\"\">\n<p>在云中运行性能密集型和延迟敏感型文件工作<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>可能很困难。利用 Azure NetApp 文件，企业业务线 (LOB) 和存储专业人员可以轻松迁移和运行复杂的基于文件的应用程序，而无需更改代码。Azure NetApp 文件在各种方案中被广泛用作基础共享文件存储服务。其中包括迁移（直接迁移）POSIX 兼容的 Linux 和 Windows 应用程序、SAP HANA、数据库、高性能计算 (HPC) 基础结构和应用以及企业 Web 应用程序。</p>\n<p>1、通过支持多个协议，可直接迁移 Linux 和 Windows 应用以使其在 Azure 中无缝运行。</p>\n<p>2、多个性能层有助于充分满足工作<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>性能要求。</p>\n<p>3、与 Azure 深入集成可实现无缝且高度安全的 Azure 体验，且没有学习或管理开销。</p>\n<p>4、领先的认证（包括 SAP HANA、GDPR 和 HIPAA）可支持将要求最高的工作<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>迁移到 Azure。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250210/e96f48371234d9c81e6234fbb4d2c67c.png\" /></p>\n<div class=\"col mb-5 mb-md-0\">\n<div id=\"content-card-vertical-oc962f\" class=\"card h-100\" data-oc=\"oc962f\">\n<div class=\"card-body pt-3\">\n<h3 class=\"h4\">获得极致的文件性能</h3>\n<div data-oc-token-text=\"\">\n<p>使用熟悉的 Azure 门户体验、CLI、PowerShell 或 REST API 在几分钟内进行设置并无缝管理，就像使用任何其他 Azure 服务一样。通过在单个服务中支持多个文件存储协议（包括 NFSv3、NFSv4.1 和 SMB3.1.x），可实现多种应用程序直接迁移方案，并且无需更改代码。</p>\n<p>Azure NetApp 文件附带三个性能层：标准性能、高级性能和超高性能。只需单击一下即可预配这些性能，获得无与伦比的灵活性。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"col mb-5 mb-md-0\">\n<div id=\"content-card-vertical-oc4a22\" class=\"card h-100\" data-oc=\"oc4a22\">\n<div class=\"card-body pt-3\">\n<h3 class=\"h4\">简化存储管理</h3>\n<div data-oc-token-text=\"\">\n<p>Azure NetApp 文件附带三个性能层：标准性能、高级性能和超高性能。只需单击一下即可预配这些性能，获得无与伦比的灵活性。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"col \">\n<div id=\"content-card-vertical-oc7bb5\" class=\"card h-100\" data-oc=\"oc7bb5\">\n<div class=\"card-body pt-3\">\n<h3 class=\"h4\">无忧迁移</h3>\n<div data-oc-token-text=\"\">\n<p>借助业界领先的安全和合规产品组合，让你高枕无忧。此领域的关键功能包括符合 FIPS-140-2 的静态数据加密、基于角色的访问控制 (RBAC)、Active Directory 身份验证，以及用于基于网络的访问控制列表 (ACL) 的导出策略。</p>\n<p>Azure NetApp 文件符合领先的行业认证，如 HIPAA 和 GDPR。凭借默认 99.99% 的可用性，你可以自信地在 Azure 中迁移和运行行业应用程序。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739159667),
(137, 'Azure Blob 存储', 'Azure Blob 存储', 'azure-blob-storage', 164, 'Azure Blob 存储可帮助你创建数据湖以满足分析需求，并提供存储以构建功能强大的云原生和移动应用。通过分层存储优化你的长期数据的成本，并灵活地纵向扩展高性能计算和机器学习工作负载。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure Blob 存储</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>适用于云原生工作负载、存档、数据湖、高性能计算和机器学习的可大规模缩放且安全的对象存储。</p>\n<h3 class=\"h4 \">大规模存储和访问非结构化数据</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>Azure Blob 存储可帮助你创建数据湖以满足分析需求，并提供存储以构建功能强大的云原生和移动应用。通过分层存储优化你的长期数据的成本，并灵活地纵向扩展高性能计算和机器学习工作负载。</p>\n<h3 class=\"h4 \">构建功能强大的云原生应用程序</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>Blob 存储是全新构建的存储，可支持移动、Web 和云原生应用程序开发人员的缩放、安全性、可用性需求。它可用作 Azure Functions 等无服务器体系结构的基础。Blob 存储支持最热门的开发框架（包括 Java、.NET、Python 和 Node.js），是唯一可为低延迟和交互式方案提供基于 SSD 的高级对象存储层的云存储服务。</p>\n<h3 class=\"h4 \">经济高效地存储 PB 级数据</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>借助多个存储层和自动化生命周期管理，经济高效地存储大量不经常访问或很少访问的数据。将磁带存档替换为 Blob 存储，不再担心跨硬件代系进行迁移。</p>\n<h3 class=\"h4 \">构建功能强大的数据湖</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>Azure Data Lake St<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>是适用于大数据分析的高度可缩放且经济高效的数据湖解决方案。它将大规模执行和经济高效的特点融入到了高性能文件系统中，帮助加快见解生成的速度。Data Lake St<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>扩展了 Azure Blob 存储的功能，并且针对分析工作负载进行了优化。</p>\n<h3 class=\"h4 \">为数十亿 IoT 设备纵向或横向扩展 HPC</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>Blob 存储满足 HPC 应用程序的严苛高吞吐量要求，并且提供了必要的缩放功能，支持存储从 IoT 终结点流入的数十亿数据点。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739160309),
(138, 'Azure Data Box', 'Azure Data Box', 'azure-data-box', 164, '当网络繁忙时，可使用 Data Box 设备轻松将数据移动到 Azure。如果受到时间、网络可用性或成本限制，可使用 Robocopy 等常用复制工具将大量数据移动到 Azure。所有数据均经过 AES 加密，上传后根据《NIST 特别出版物 800-88》修订版 1 中的标准擦除设备。', '500.00', '<h2 class=\"h2 \">Azure Data Box</h2>\n<p>当网络繁忙时，可使用 Data Box 设备轻松将数据<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>到 Azure。如果受到时间、网络可用性或成本限制，可使用 Robocopy 等常用复制工具将大量数据<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>到 Azure。所有数据均经过 AES 加密，上传后根据《NIST 特别出版物 800-88》修订版 1 中的标准擦除设备。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250210/4870bc4e3e2831e2c980fd5304fb4630.avif\" /></p>\n<h3 class=\"h4 \">Data Box</h3>\n<div data-oc-token-text=\"\">\n<p>这款加固型设备具有 100 TB 的容量，且采用标准 NAS 协议和常用复制工具。它采用 AES 256 位加密，让传输更安全。</p>\n<p> </p>\n</div>', 0, 1739160579),
(139, 'Azure 磁盘存储', 'Azure 磁盘存储', 'azure-disk-storage', 164, 'Azure 磁盘存储自信地迁移到为云搭建的具备磁盘存储选项（超级磁盘存储、高级 SSD v2、高级 SSD、标准 SSD 和标准 HDD）的 Azure 基础结构即服务 (IaaS)中，为工作负载优化成本和性能。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure 磁盘存储</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>适用于 Azure 虚拟机的高性能、高度持久的块存储。</p>\n<p>Azure 磁盘存储旨在与 Azure 虚拟机和 Azure VMware 解决方案结合使用，为任务和业务关键型应用程序提供高性能、高度持久的块存储。 自信地迁移到为云搭建的具备磁盘存储选项（超级磁盘存储、高级 SSD v2、高级 SSD、标准 SSD 和标准 HDD）的 Azure 基础结构即服务 (IaaS)中，为工作负载优化成本和性能。   获取高吞吐量和事务密集型工作负载（如 SAP HANA、SQL Server 和 Oracle）的亚毫秒级延迟。 </p>\n<h3>将投资和业务影响最大化</h3>\n<p>优化成本并获取工作负载所需的精确数据存储量。磁盘选项的大小为 4 GB 到 64 TB，价格定位和性能特征各不相同。通过 增量快照 来减少备份和灾难恢复的时间和成本，这些增量快照是磁盘的时间点备份，只包含快照之间的更改。将基于 Windows 和 Linux 的群集式应用程序或高可用性应用直接迁移到使用 共享磁盘 的 Azure 中，从而将体系结构保留原样并降低存储成本。</p>\n<h3>确保业务连续性并最大限度地减少中断</h3>\n<p>运行业务关键型应用程序，并通过冗余选项来避免代价高昂的停机；这些选项包括区域冗余存储，它可将多个区域中的数据复制到一个地区，并在出现区域故障时保护你的磁盘。</p>\n<p> Azure 为所有磁盘类型提供 单一实例服务级别协议 (SLA)，并为使用高级 SSD 或超级磁盘存储的 Azure 虚拟机提供具有 99.9% 可用性的优质单实例 SLA。借助 Azure 备份 和 Azure Site Recovery 的支持，可最大限度地减少业务中断。</p>\n<h3>根据所需的性能轻松快速地缩放</h3>\n<p>获取所需的性能和容量，存储容量可从十亿字节扩展到千万亿字节。使用 性能层 和内置 突发功能 按需缩放性能来满足业务需求。即使存储容量较低，也能实现高性能 - Azure 超级磁盘存储和高级 SSD v2 提供可独立配置 IOPS（每秒输入/输出操作）、吞吐量和容量的灵活性。选择 磁盘类型 和大小即可轻松创建和管理磁盘。</p>\n<h3>帮助保护最有<a href=\"https://www.kaihu123.com/vps/alibabacloud-elastic-bare-metal-server/\" title=\"价值\" target=\"_blank\">价值</a>的数据</h3>\n<p>利用满足安全和合规性要求的加密选项（包括静态加密、传输中加密和双重加密）保护敏感数据，从而增强安全性。使用 Azure 专用链接，仅允许从专用 Azure 虚拟网络进行导入和导出，从而限制对数据的访问。通过 Azure 基于角色的访问控制 分配特定权限，从而管理和控制对数据的访问。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250210/a85d6813b57d3eb02904459fc6a4bb73.png\" /></p>\n</div>\n</div>', 0, 1739160873),
(140, '华为云分布式云原生 UCS', '分布式云原生 UCS', 'huawei-cloud-distributed-cloud-native-ucs', 124, '业界首个分布式云原生产品，为企业构建云原生业务部署、管理、应用生态的全域一致性体验，实现客户在使用云原生应用时，感受不到地域、跨云、流量的限制', '500.00', '<h2 class=\"por-text-title-t2-s banner-pc\">分布式云原生 UCS</h2>\n<div class=\"por-text-body-t2 banner-pc\">\n<p>业界首个分布式云原生产品，为企业构建云原生业务部署、管理、应用生态的全域一致性体验，实现客户在使用云原生应用时，感受不到<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、跨云、流量的限制</p>\n<h3 class=\"por-text-title-t3\">统一算力调度</h3>\n<div class=\"por-text-body-t1\">覆盖华为云、多云、边缘云、客户IDC等场景，基于CPU、内存、流量等多种弹性策略可选择</div>\n<div class=\"por-text-body-t1\">\n<h3 class=\"por-text-title-t3\">统一配置管理</h3>\n<div class=\"por-text-body-t1\">基于 GitOps 实现 Kubernetes 原生资源的声明式版本管理与自动化交付</div>\n<div class=\"por-text-body-t1\">\n<h3 class=\"por-text-title-t3\">统一智能运维</h3>\n<div class=\"por-text-body-t1\">7*24h健康守护，全域监控、智能巡检 提供运维标准接口，支持对接到第三方监控日志运维系统</div>\n<div class=\"por-text-body-t1\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250211/7ba8c2ad67c0a60a97fbc6df76f57bf5.png\" /></div>\n</div>\n</div>\n</div>', 0, 1739240473),
(141, '华为云 云容器引擎 CCE', '云容器引擎 CCE', 'huawei-cloud-container-engine-cce', 124, '华为云 云容器引擎 CCE提供高可靠高性能的企业级容器应用管理服务，支持Kubernetes社区原生应用和工具，简化云上自动化容器运行环境搭建', '500.00', '<h2 class=\"por-text-title-t2-s banner-pc\">云容器引擎 CCE</h2>\n<p>提供高可靠高性能的企业级容器应用管理服务，支持<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>社区原生应用和工具，简化云上自动化容器运行环境搭建</p>\n<h3 class=\"por-text-title-t3\">丰富算力</h3>\n<div class=\"por-text-body-t1\">支持X86、鲲鹏、昇腾等多种异构算力；多年行业技术积累</div>\n<div class=\"por-text-body-t1\">\n<h3 class=\"por-text-title-t3\">性能强劲</h3>\n<div class=\"por-text-body-t1\">容器网络直通零损耗，支持秒级弹性伸缩，从容应对突发流量浪涌</div>\n<div class=\"por-text-body-t1\">\n<h3 class=\"por-text-title-t3\">开放生态</h3>\n<div class=\"por-text-body-t1\">兼容<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>社区版本，始终与社区稳定版本同步</div>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250211/49b1f297c2d12ab39cfc1e90d900d8a2.png\" /></p>\n</div>\n</div>', 0, 1739240675);
INSERT INTO `mx_cloud` (`id`, `title`, `name`, `alias`, `cid`, `des`, `usd`, `intro`, `status`, `addtime`) VALUES
(142, '华为云 云容器实例 CCI', '云容器实例 CCI', 'huawei-cloud-container-instance-cci', 124, '华为云 云容器实例 CCI提供Serverless容器服务，用户无需关注集群和服务器，简单三步配置即可快速创建容器负载', '500.00', '<h2 class=\"por-text-title-t2-s banner-pc\">云容器实例 CCI</h2>\n<p>提供Serverless容器服务，用户无需关注集群和服务器，简单三步配置即可快速创建容器负载</p>\n<h3>丰富的应用场景，快速启动容器应用</h3>\n<div id=\"scence-maintitle-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[0].maintitle\">\n<div class=\"por-text-title-t8 scence-maintitle-block_title\">高弹性业务</div>\n<div class=\"scence-content-block_detail scence-maintitle-block_detail\">\n<p>针对视频、电商、游戏等快速<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的业务，可将日常业务负载运行在CCE上，高峰时通过CCI快速弹性扩容，解决短时大业务量访问的问题</p>\n</div>\n</div>\n<div id=\"scence-heading-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[0].heading\">\n<div class=\"por-text-title-t8 scence-heading-block_detail\">优势</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">快速弹性伸缩</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>提供秒极的弹性扩容能力，保障业务的稳定运行</p>\n</div>\n</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">低成本与灵活计费</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>业务平稳期在CCE上包周期计费，节省成本；高峰期弹性扩容到CCI上，按需计费，高峰结束后又可快速释放资源，降低成本</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250211/f07177cd29e3a47c492b097dec09599c.jpg\" /></p>\n<div id=\"scence-maintitle-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[1].maintitle\">\n<h3 class=\"por-text-title-t8 scence-maintitle-block_title\">社交媒体</h3>\n<div class=\"scence-content-block_detail scence-maintitle-block_detail\">\n<p>突发时事热点会导致社交媒体业务流量的激增，高峰时通过CCI快速弹性扩容，避免流量洪峰冲垮业务，为社交媒体的用户提供流畅的使用体验</p>\n</div>\n</div>\n<div id=\"scence-heading-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[1].heading\">\n<div class=\"por-text-title-t8 scence-heading-block_detail\">优势</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">快速弹性伸缩</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>提供秒级弹性扩容能力，保障业务稳定运行</p>\n</div>\n</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">按需计费</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>容器按需启动，按照实际使用的资源规格和时长计费，降低IT资源使用成本</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250211/238350cafcf7d78bc5750d734a900447.png\" /></p>\n<div id=\"scence-maintitle-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[2].maintitle\">\n<h3 class=\"por-text-title-t8 scence-maintitle-block_title\">生物基因</h3>\n<div class=\"scence-content-block_detail scence-maintitle-block_detail\">\n<p>生物基因、药品研发等领域需要高性能、密集型计算，同时对成本较敏感，需要低成本、免运维的计算平台</p>\n</div>\n</div>\n<div id=\"scence-heading-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[2].heading\">\n<div class=\"por-text-title-t8 scence-heading-block_detail\">优势</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">极速弹性</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>秒极资源准备与弹性，减少计算过程中的资源处理环节消耗</p>\n</div>\n</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">免运维</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>无需感知集群和服务器，大幅降低运维成本</p>\n</div>\n</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">按需按秒付费</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>容器按需启动，按照实际使用的资源规格和时长计费，降低IT资源使用成本</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250211/f95d614993ce8b26c936c1fea8598a23.png\" /></p>\n<div id=\"scence-maintitle-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[3].maintitle\">\n<h3 class=\"por-text-title-t8 scence-maintitle-block_title\">人工智能</h3>\n<div class=\"scence-content-block_detail scence-maintitle-block_detail\">\n<p>主流的AI训练和推理等应用均采用容器化方式运行，需要大量GPU、高性能网络和存储等硬件加速能力，并且需要快速申请大量资源，完成后快速释放</p>\n</div>\n</div>\n<div id=\"scence-heading-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[3].heading\">\n<div class=\"por-text-title-t8 scence-heading-block_detail\">优势</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">计算加速</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>提供GPU/Ascend等异构芯片加速能力</p>\n</div>\n</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">网络/存储加速</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>提供高性能网络和存储，提升整体的训练和推理性能</p>\n</div>\n</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">随启随用、按需付费</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>容器实例可实现秒级启动，支持按秒按需进行付费</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250211/61d9d2b623477564cd9c8c19f4f95361.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739240945),
(143, '华为云 容器镜像服务 SWR', '容器镜像服务 SWR', 'huawei-cloud-container-mirroring-service-swr', 124, '华为云 容器镜像服务 SWR 支持容器镜像全生命周期管理的服务，提供简单易用、安全可靠的镜像管理功能，帮助用户快速部署容器化服务', '500.00', '<h2 class=\"por-text-title-t2-s banner-pc\">容器镜像服务 SWR</h2>\n<p>支持容器镜像全生命周期管理的服务，提供简单易用、安全可靠的镜像管理功能，帮助用户快速部署容器化服务</p>\n<h3>丰富的应用场景，满足您的不同业务诉求</h3>\n<div id=\"scence-maintitle-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[0].maintitle\">\n<div class=\"por-text-title-t8 scence-maintitle-block_title\"><strong>场景介绍</strong></div>\n<div class=\"scence-content-block_detail scence-maintitle-block_detail\">\n<p>基于代码源自动完成代码编译、镜像构建、灰度发布、容器化部署流程； 对接已有CI/CD，完成传统应用的容器化改造和部署</p>\n</div>\n</div>\n<div id=\"scence-heading-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[0].heading\">\n<div class=\"por-text-title-t8 scence-heading-block_detail\">优势</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">高效流程管理</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>科学的流程交互设计，脚本编写量较传统CI/CD流水线显著减少，让CI/CD管理更高效</p>\n</div>\n</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">灵活的集成方式</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>提供丰富的接口便于与企业已有CI/CD系统进行集成，灵活适配企业的个性化诉求</p>\n</div>\n</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">高性能</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>全容器化架构设计，任务<a href=\"https://www.kaihu123.com/vps/alibaba-cloud-international-batch-computing-service/\" title=\"调度\" target=\"_blank\">调度</a>更灵活，执行效率更高</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250211/02c2ed763cda010714b306be146da7b4.png\" /></p>\n<div id=\"scence-maintitle-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[1].maintitle\">\n<div class=\"scence-content-block_detail scence-maintitle-block_detail\">\n<p>提供镜像构建、镜像上传、下载、同步、删除等完整的生命周期管理能力</p>\n</div>\n</div>\n<div id=\"scence-heading-block\" class=\"scence-content-detail-block\" data-mod-name=\"child-component\" data-mod-id=\"tabs[1].heading\">\n<div class=\"por-text-title-t8 scence-heading-block_detail\">优势</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">P2P加速下载</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>华为自主专利的加速下载技术，提升华为云容器拉取镜像的速度</p>\n</div>\n</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">高可靠的存储</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>依托华为OBS专业存储，确保镜像的存储可靠性高达11个9</p>\n</div>\n</div>\n<div class=\"scence-secondary-block\">\n<div class=\"scence-heading-block_secondary\">更安全的存储</div>\n<div class=\"scence-content-block_detail scence-heading-block_detail\">\n<p>细粒度的授权管理，让用户更精准的控制镜像访问权限</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250211/bf6a9fc3af1ee7fcd5876bb1949d448b.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739241145),
(144, '阿里云国际负载均衡（SLB）', '负载均衡', 'alibaba-cloud-international-load-balancing', 100, '阿里云负载均衡通过流量分发来提升应用系统的服务能力与可用性，包含面向4层的网络型负载均衡NLB、面向7层的应用型负载均衡ALB和传统型负载均衡CLB，是阿里云官方云原生网关。', '500.00', '<h2 class=\"solution-title\"><span class=\"font-color\" data-spm-anchor-id=\"a2796.63572.1464994240.i0.f20b7070HlLcwK\">负载均衡（SLB）</span></h2>\n<p><span class=\"font-color\" data-spm-anchor-id=\"a2796.63572.1464994240.i0.f20b7070HlLcwK\">阿里云负载均衡通过流量分发来提升应用系统的服务能力与可用性，包含面向4层的网络型负载均衡NLB、面向7层的应用型负载均衡ALB和传统型负载均衡CLB，是阿里云官方云原生网关。</span></p>\n<h3 class=\"adv-title text-xxl col-md-4\" data-spm-anchor-id=\"a2796.63572.7440915110.i0.f20b7070HlLcwK\">超高性能 超大弹性<br />安全可靠 面向云原生</h3>\n<p>阿里云负载均衡SLB提供高性能负载均衡服务，具有超强的四七层处理能力。提供超强4层处理能力的网络型负载均衡NLB最大支持1亿并发连接，基于阿里云洛神云网络2.0平台构建的全新应用型负载均衡ALB最大支持100万QPS。</p>\n<p>负载均衡SLB除了具有超高的单实例性能，同时提供自动弹性伸缩能力，可以根据业务大小进行资源弹性伸缩，灵活简单，降低运维复杂度。</p>\n<h3 class=\"text-md list-title\" data-spm-anchor-id=\"a2796.63572.7440915110.i3.f20b7070HlLcwK\">安全可靠</h3>\n<p class=\"text-sm list-desc\">阿里云SLB负载均衡提供四级高可用容灾能力，CLB/ALB均默认支持Anti-DDoS安全防护能力，其中ALB更可以从控制台一键集成WAF应用层安全防护能力，为业务安全保驾护航</p>\n<h3 class=\"text-md list-title\" data-spm-anchor-id=\"a2796.63572.7440915110.i5.f20b7070HlLcwK\">协议丰富</h3>\n<p class=\"text-sm list-desc\">阿里云SLB负载均衡支持丰富的协议，包含TCP/UDP/TCPSSL等网络层协议，以及支持HTTP/<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>/QUIC/gRPC等应用层协议。其中NLB可提供大规模SSL卸载功能，ALB可提供丰富的7层高级路由转发能力</p>\n<h3 class=\"text-md list-title\" data-spm-anchor-id=\"a2796.63572.7440915110.i7.f20b7070HlLcwK\">面向云原生</h3>\n<p class=\"text-sm list-desc\">阿里云SLB负载均衡两种产品类型均支持云原生网络，其中ALB更是与ACK/SAE/K8S等深度集成，是阿里云官方云原生Ingress网关</p>\n<p class=\"text-sm list-desc\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250212/231b6eb4972e5ba8c4cf91705412ada3.png\" /></p>', 0, 1739364856),
(145, '阿里云国际弹性公网IP', '弹性公网IP', 'alibaba-cloud-international-elastic-public-ip', 100, 'EIP是一种NAT IP。它实际位于阿里云的公网网关上，通过NAT方式映射到了被绑定的云资源上。和云资源绑定后，云资源可以通过EIP与公网通信。独立的公网IP资源，帮助您实现公网IP和ECS的解耦，满足您灵活管理的能力。', '500.00', '<h2 class=\"text-thin clearfix\" data-spm-anchor-id=\"a2796.9361860.3757856680.i1.675c5f4f14HldK\"><span data-spm-anchor-id=\"a2796.9361860.3757856680.i0.675c5f4f14HldK\">弹性公网IP</span></h2>\n<p class=\"text-lg text-thin\" data-spm-anchor-id=\"a2796.9361860.3757856680.i2.675c5f4f14HldK\">独立的公网IP资源，帮助您实现公网IP和ECS的解耦，满足您灵活管理的能力。</p>\n<h3 class=\"font-common \" data-spm-anchor-id=\"a2796.9361860.7799661820.i1.675c5f4f14HldK\">独立IP资源可灵活管理</h3>\n<p class=\"text-base \" data-spm-anchor-id=\"a2796.9361860.7799661820.i0.675c5f4f14HldK\">EIP是一种NAT IP。它实际位于阿里云的公网网关上，通过NAT方式映射到了被绑定的云资源上。和云资源绑定后，云资源可以通过EIP与公网通信。</p>\n<p class=\"text-base \">● 可独立持有的公网IP<br />● 可用于VPC中的 ECS实例、NAT网关、私网负载均衡SLB等产品<br />● 可动态绑定和解绑<br />● 可自带IP<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>上云，系统架构变动小，IP品牌信誉不变</p>\n<p class=\"text-base \"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250212/c7107608197075e271f38eca67ebdce9.png\" /></p>\n<p class=\"text-base \"> </p>', 0, 1739365311),
(146, '阿里云国际版云数据传输 CDT', '云数据传输 CDT', 'alibaba-cloud-cloud-data-transmission-cdt', 100, '云数据传输 CDT 作为云网络的统一计费产品，支持EIP、共享带宽、IPv6网关、传统负载均衡（CLB）、Anycast EIP、GA、CEN、VPC peering等产品流量的统一计费', '500.00', '<h2 class=\"solution-title col-md-7\" data-spm-anchor-id=\"a3c0i.28268973.7717395120.i1.3c3e4ef7S1N7gY\"><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.28268973.7717395120.i0.3c3e4ef7S1N7gY\">云数据传输 CDT</span></h2>\n<p class=\"solution-text text-base font-color col-md-7\">云网络公网、跨域流量统一计费</p>\n<p class=\"solution-text text-base font-color col-md-7\">云数据传输 CDT 作为云网络的统一计费产品，支持EIP、共享带宽、IPv6网关、传统负载均衡（CLB）、Anycast EIP、GA、CEN、VPC peering等产品流量的统一计费<br /><br />• 公网流量按累积使用量阶梯计费，使用量越大的阶梯单价越低<br />• 跨域流量支持按量计费，对于突发带宽峰值大的场景，可以有效降低跨域流量传输成本<br />• 统一的流量使用趋势报表及账单，方便流量预算规划及对账</p>\n<p class=\"solution-text text-base font-color col-md-7\"> </p>\n<p class=\"solution-text text-base font-color col-md-7\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250212/69dbaa11f6b12b43b65c3317eeb3e9ba.png\" /></p>\n<h4 class=\"text-detail-title text-md\"><strong>能够解决</strong></h4>\n<ul class=\"list-wrap\">\n<li class=\"list-item\">\n<h5 class=\"item-title text-base\">灵活降本</h5>\n<p class=\"item-text text-sm\">CDT支持对公网类产品的公网流量按照阶梯计费，用量越大单价越低，可以有效降低成本；支持对跨<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>类产品的跨<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>流量按流量计费，这种计费方式更加灵活。</p>\n</li>\n<li class=\"list-item\">\n<h5 class=\"item-title text-base\">便捷管理</h5>\n<p class=\"item-text text-sm\">提供跨产品的统一流量账单和标签分账能力，提升业务、IT、财务协同效率。</p>\n</li>\n</ul>\n<p class=\"solution-text text-base font-color col-md-7\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250212/223880bbd59f87c665b44265d764f890.png\" /></p>', 0, 1739365606),
(147, '阿里云国际版通用流量包', '通用流量包', 'alibaba-cloud-universal-traffic-package', 100, '通用流量包是一款流量套餐产品，使用方便、价格实惠。通用流量包购买后立刻生效，并自动抵扣多款按流量计费的云产品产生的流量费用，直到通用流量包用完或到期为止。', '500.00', '<h2 data-spm-anchor-id=\"a2c63.p38356.0.i2.42a97f69ESazYy\">什么是通用流量包</h2>\n<p><span id=\"c2fbe2685ccwf\" class=\"ph\" data-tag=\"ph\" data-cond-props=\"intl\" data-spm-anchor-id=\"a2c63.p38356.0.i0.42a97f69ESazYy\">通用</span>流量包是一款流量套餐产品，<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>方便、价格实惠。<span id=\"308c455b7fvlj\" class=\"ph\" data-tag=\"ph\" data-cond-props=\"intl\">通用</span>流量包购买后立刻生效，并自动抵扣多款按流量计费的云产品产生的流量费用，直到<span id=\"18ff039f8297y\" class=\"ph\" data-tag=\"ph\" data-cond-props=\"intl\">通用</span>流量包用完或到期为止。</p>\n<h3 class=\"text-xxl h2s\" data-spm-anchor-id=\"a3c0i.20891826.4866717200.i0.435660c0n8dJtS\">精心打造的功能</h3>\n<div class=\"item\">\n<h3 data-spm-anchor-id=\"a3c0i.20891826.4866717200.i1.435660c0n8dJtS\">高性价比</h3>\n<p class=\"desc\">规格越大优惠越多，最大规格折扣最高</p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>高性价比</h4>\n<p class=\"itemDesc\">规格越大优惠越多，最大规格优惠最大</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"item\">\n<h3>超大覆盖范围</h3>\n<p class=\"desc\">可选择中国大陆通用流量包、海外通用流量包、香港地区流量包</p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>多区域共享</h4>\n<p class=\"itemDesc\">可选择中国大陆通用流量包、海外通用流量包、香港大区流量包，中国大陆通用和海外通用覆盖多个地域</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>产品覆盖面广</h4>\n<p class=\"itemDesc\">流量包会自动抵扣所在大区内所有按流量计费的云服务器ECS、弹性公网IP、负载均衡产生的流量</p>\n<h4 class=\"content-title text-lg\"><span style=\"color: #ff6a00;\" data-spm-anchor-id=\"a3c0i.20891826.3596992110.i0.435660c0n8dJtS\">菜鸟网络-通用流量包</span></h4>\n<div class=\"content-item bottom-line\">\n<h5 class=\"item-title text-base\"><strong>菜鸟网络</strong></h5>\n<p class=\"item-text text-sm\">多区域按流量计费的云服务器ECS、弹性公网IP、负载均衡、共享带宽产品优<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>通用流量包套餐中的流量，进一步降低流量<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>成本</p>\n</div>\n<div class=\"content-item bottom-line\">\n<h5 class=\"item-title text-base\">能够解决</h5>\n<p class=\"item-text text-sm\"><strong>更省钱</strong></p>\n<p class=\"item-text text-sm\"><span style=\"color: #9b9ea0;\">流量消耗量较大，通过有价格优惠的流量包套餐能节省很多流量成本</span></p>\n<p class=\"item-text text-sm\"><strong>更便于管理</strong></p>\n<p class=\"item-text text-sm\"><span style=\"color: #9b9ea0;\">流量包是公网流量的总出入口，便于流量统计和汇总</span></p>\n<p class=\"item-text text-sm\"><span style=\"color: #9b9ea0;\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250212/e7dfe32e7693aa7683e3a94bf27c9c50.avif\" /></span></p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739365960),
(148, '阿里云国际版专有网络 VPC', '专有网络 VPC', 'alibaba-cloud-private-network-vpc', 100, '专有网络 VPC帮助您基于阿里云构建出一个隔离的网络环境。您可以完全掌控自己的虚拟网络，更加安全的操作和管理资源。帮助您基于阿里云构建出一个隔离的网络环境，并可以自定义IP 地址范围、网段、路由表和网关等', '500.00', '<h2 class=\"solution-title col-md-7\"><span class=\"font-color\" data-spm-anchor-id=\"a2796.7971669.2437632270.i0.576930b7kL4jhs\">专有网络 VPC</span></h2>\n<p class=\"solution-text text-base font-color col-md-7\" data-spm-anchor-id=\"a2796.7971669.2437632270.i1.576930b7kL4jhs\">专有网络 VPC帮助您基于阿里云构建出一个隔离的网络环境。您可以完全掌控自己的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>网络，更加安全的操作和管理资源。</p>\n<p class=\"solution-text text-base font-color col-md-7\" data-spm-anchor-id=\"a2796.7971669.2437632270.i1.576930b7kL4jhs\">帮助您基于阿里云构建出一个隔离的网络环境，并可以自定义IP 地址范围、网段、路由表和网关等；此外，也可以通过专线/VPN/GRE等连接方式实现云上VPC与传统IDC的互联，构建混合云业务。</p>\n<h3 class=\"hd\" data-spm-anchor-id=\"a2796.7971669.6595737050.i1.576930b7kL4jhs\">领军客户实战场景</h3>\n<p class=\"tit\" data-spm-anchor-id=\"a2796.7971669.6595737050.i2.576930b7kL4jhs\">云上私网</p>\n<p class=\"subtit\">完全隔离的网络环境</p>\n<p class=\"intr\">业务系统同时存在于本地机房和云上机房，基于阿里云VPC搭建不同的业务模块，构建完全隔离的云上环境，云上云下通过公网进行业务交互</p>\n<div class=\"part part-01\">\n<h3>能够解决</h3>\n<ul>\n<li>\n<p class=\"list-tit\">灵活配置</p>\n<p class=\"list-con\">软件定义网络，按需自定义网络设置，管理操作实时生效</p>\n</li>\n<li>\n<p class=\"list-tit\">安全隔离</p>\n<p class=\"list-con\">不与其他用户共享公共网络，VPC间完全隔离</p>\n<img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250212/da100a629eb19fdef837f8f30a72d3d5.png\" alt=\"\" width=\"1530\" height=\"1140\" /></li>\n</ul>\n</div>', 0, 1739366196),
(149, '阿里云国际版NAT网关', 'NAT网关', 'alibaba-cloud-nat-gateway', 100, '在VPC环境下构建一个安全隔离的公私网流量的出入口网关，通过自定义SNAT，DNAT规则灵活使用网络资源。NAT网关提供超大性能、弹性伸缩、灵活计费、丰富运维等优势能力', '500.00', '<h2 class=\"solution-title\" data-spm-anchor-id=\"a2796.166383.7117108510.i1.13b935cdIKMEhZ\"><span class=\"font-color\" data-spm-anchor-id=\"a2796.166383.7117108510.i0.13b935cdIKMEhZ\">NAT网关</span></h2>\n<p class=\"solution-text text-base font-color\" data-spm-anchor-id=\"a2796.166383.7117108510.i2.13b935cdIKMEhZ\">在VPC环境下构建一个安全隔离的公私网流量的出入口网关，通过自定义SNAT，DNAT规则灵活使用网络资源。</p>\n<h3 data-spm-anchor-id=\"a2796.166383.5706592400.i0.13b935cdIKMEhZ\">公网地址转换</h3>\n<p class=\"desc\">灵活的SNAT/DNAT管理，简单快捷的构建VPC公网访问和服务能力。</p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>源地址转换(SNAT)</h4>\n<p class=\"itemDesc\">VPC内多台ECS可以通过SNAT功能使用同一个公网地址访问公网，避免ECS直接暴露在公网而产生安全隐患。</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>目的地址转换(DNAT)</h4>\n<p class=\"itemDesc\">VPC内服务器可通过DNAT开放指定的服务端口被公网用户访问，可以使用同一个公网地址为多台服务器开放服务。</p>\n</div>\n</div>\n<div class=\"cont 2 col-md-4\">\n<div>\n<h4>多弹性公网地址</h4>\n<p class=\"itemDesc\">单个NAT网关<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>绑定多个弹性公网IP，快捷实现公网地址的水平扩容。</p>\n<div class=\"item\">\n<h3 data-spm-anchor-id=\"a2796.166383.5706592400.i2.13b935cdIKMEhZ\">私网地址转换</h3>\n<p class=\"desc\">灵活的SNAT/DNAT管理，使用指定地址私网互访，有效解决私网互访地址冲突问题，实现安全隔离的私网互访。</p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>源地址转换(SNAT)</h4>\n<p class=\"itemDesc\">VPC内多台ECS可以通过SNAT功能使用同一个私网地址访问对接私有网络，屏蔽ECS的实际源地址，避免地址冲突，同时降低服务器被直接攻击的风险。</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>目的地址转换(DNAT)</h4>\n<p class=\"itemDesc\">VPC内服务器可通过DNAT开放指定的服务端口被对接网络访问，可以使用指定私网地址开放服务。</p>\n</div>\n</div>\n<div class=\"cont 2 col-md-4\">\n<div>\n<h4>自定义转换地址</h4>\n<p class=\"itemDesc\">可以灵活管理互访的私网地址，满足指定地址互访的业务需求。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"item\">\n<h3>高性能高弹性</h3>\n<p class=\"desc\"> </p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>自动弹性</h4>\n<p class=\"itemDesc\">按使用量（CU）付费实例<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>根据用户使用量自动扩容的能力，最高可弹性扩容到15G吞吐能力。</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>超强性能</h4>\n<p class=\"itemDesc\">专属NAT实例，最高可<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>百G级吞吐量和千万级并发连接，有效应对海量公网访问需求。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"item\">\n<h3>可视化管理</h3>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>多维度监控指标</h4>\n<p class=\"itemDesc\">图形化展示多个维度的流量指标，同时<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>基于各个指标设定告警，快速及时的定位和解决问题。</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>TOP ECS</h4>\n<p class=\"itemDesc\"><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>基于ECS维度的流量监控展示，快速分析业务使用情况，精准找到业务流量异常服务器。</p>\n<p class=\"itemDesc\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250212/6634de41dc167a50ec9e9816540fe31f.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739366943),
(150, '阿里云国际网络智能服务 NIS (Beta)', '网络智能服务 NIS (Beta)', 'alibaba-cloud-network-intelligence-service-nis-beta', 100, '网络智能服务（Network Intelligence Service）是一个对网络进行健康分析、性能监控、诊断修复、流量分析和测量仿真的云服务，通过集成机器学习、知识图谱等AIOps方法减少网络使用复杂性，提供自助运维能力，方便网络架构师和运维工程师更快捷的设计和使用网络。', '500.00', '<h2 class=\"solution-title\" data-spm-anchor-id=\"a3c0i.26990196.9772107410.i1.2945a638KAk8zY\"><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.26990196.9772107410.i0.2945a638KAk8zY\">网络智能服务 NIS (Beta)</span></h2>\n<p class=\"solution-text text-base font-color\">具备网络状态可视化、故障智能诊断能力的自助式网络运维服务。</p>\n<h3 class=\"adv-title text-xxl col-md-4\" data-spm-anchor-id=\"a3c0i.26990196.8604384490.i1.2945a638KAk8zY\">即开即用的网络智能服务</h3>\n<div class=\"text-box col-md-8\">\n<p class=\"adv-desc\" data-spm-anchor-id=\"a3c0i.26990196.8604384490.i0.2945a638KAk8zY\">网络智能服务（Network Intelligence Service）是一个对网络进行健康分析、性能监控、诊断修复、流量分析和测量仿真的云服务，通过集成机器学习、知识图谱等AIOps方法减少网络使用复杂性，提供自助运维能力，方便网络架构师和运维工程师更快捷的设计和使用网络。</p>\n<div class=\"item\">\n<h3 data-spm-anchor-id=\"a3c0i.26990196.1677344130.i0.2945a638KAk8zY\">实例诊断</h3>\n<p class=\"desc\">检测实例配置和运行状态，一键诊断异常并智能修复。</p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>自助式服务</h4>\n<p class=\"itemDesc\">用户可以一键发起实例诊断，给出诊断结果，操作简单方便。</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>全方位诊断</h4>\n<p class=\"itemDesc\"><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>实例的配置、状态、规格、资费、安全策略等多种诊断项，对实例进行全面诊断。</p>\n</div>\n</div>\n<div class=\"cont 2 col-md-4\">\n<div>\n<h4>全流程覆盖</h4>\n<p class=\"itemDesc\">从发起实例诊断，给出诊断结果，提供诊断修复建议，形成全流程覆盖能力。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"item\">\n<h3>路径分析</h3>\n<p class=\"desc\">端到端连通和性能分析，网络拓扑和互访关系呈现。</p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>路径问题自助诊断</h4>\n<p class=\"itemDesc\">实时发现连通问题，并<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>路由、安全组和ACL等配置的核查。</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>连接拓扑一目了然</h4>\n<p class=\"itemDesc\">展示端到端连接途经的网卡(ENI)、交换机(VSW)、路由器(VRT)等逐跳节点信息。</p>\n</div>\n</div>\n<div class=\"cont 2 col-md-4\">\n<div>\n<h4>全面覆盖多类场景</h4>\n<p class=\"itemDesc\"><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>VPC内、跨域、专线和公网互访链路的诊断。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"item\">\n<h3>流量分析</h3>\n<p class=\"desc\">监测各场景流量异常，及时告警并分析根因。</p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>实时定位分析</h4>\n<p class=\"itemDesc\">实时的数据分析，快速发现异常流量，找出发生问题的IP/实例。</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>历史问题追溯</h4>\n<p class=\"itemDesc\">非实时的数据分析，可以对历史的问题进行分析追溯，还原当时发生的问题，找出发生问题的原因。</p>\n</div>\n</div>\n<div class=\"cont 2 col-md-4\">\n<div>\n<h4>场景覆盖丰富</h4>\n<p class=\"itemDesc\">覆盖云上网络多种访问场景，如NAT、公网、跨域、专线等访问。</p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739367190),
(151, '阿里云国际版云解析 PrivateZone', '云解析 PrivateZone', 'alibaba-cloud-private-zone-analysis', 100, '云解析 PrivateZone 为客户在企业内网（如阿里云 VPC 内网、线下 IDC 内网）的容器、云主机 ECS 或物理机提供本地 DNS 解析和管理服务，包含内置权威、缓存、转发、递归、自定义服务地址、流量分析等丰富的内网 DNS 服务模块，分别满足自定义私有域名和智能解析、缓存保持加速解析、云上云下混合云互联、公网域名解析、端到端解析行为分析等场景化需求。', '500.00', '<h2 class=\"solution-title col-md-7\" data-spm-anchor-id=\"a3c0i.20889771.3475175930.i2.52d15282b0Fi3O\"><span class=\"font-color font-title\" data-spm-anchor-id=\"a3c0i.20889771.3475175930.i1.52d15282b0Fi3O\">云解析 PrivateZone</span></h2>\n<p class=\"solution-text text-base font-color col-md-7\">企业<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> DNS 解析和管理服务，服务于阿里云 VPC <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和线下 IDC <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>中的容器、云服务器 ECS、物理机等。</p>\n<h3 class=\"adv-title text-xxl col-md-4\" data-spm-anchor-id=\"a3c0i.20889771.8221922100.i2.52d15282b0Fi3O\">多云+传统 IDC 融合场景下的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> DNS 服务平台</h3>\n<div class=\"text-box col-md-8\">\n<p class=\"adv-desc\" data-spm-anchor-id=\"a3c0i.20889771.8221922100.i1.52d15282b0Fi3O\"><span data-spm-anchor-id=\"a3c0i.20889771.8221922100.i0.52d15282b0Fi3O\">云解析 PrivateZone 为客户在企业<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>（如阿里云 VPC <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、线下 IDC <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>）的容器、云主机 ECS 或物理机提供本地 DNS 解析和管理服务，包含内置权威、缓存、转发、递归、自定义服务地址、流量分析等丰富的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> DNS 服务模块，分别满足自定义私有域名和智能解析、缓存保持加速解析、云上云下混合云互联、公网域名解析、端到端解析行为分析等场景化需求。</span></p>\n<p class=\"adv-desc\" data-spm-anchor-id=\"a3c0i.20889771.8221922100.i1.52d15282b0Fi3O\"><span data-spm-anchor-id=\"a3c0i.20889771.8221922100.i0.52d15282b0Fi3O\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250212/723663be522e121defe006c48eef1d42.avif\" /></span></p>\n</div>', 0, 1739367738),
(152, '阿里云国际版边缘安全加速 ESA（原DCDN）', '边缘安全加速 ESA（原DCDN）', 'alibaba-cloud-edge-security-accelerator-esa-formerly-dcdn', 100, '阿里云国际版边缘安全加速 ESA（原DCDN）全新架构升级，基于稳定网络传输、高性能节点引擎，实现加速、安全、计算的一键接入，相比上一代产品丰富了日志服务，简化用户和接入管理，提升数据分析模块能力，提供高效安全、化繁为简的边缘云服务。', '500.00', '<h2 class=\"solution-title col-md-7\" data-spm-anchor-id=\"a3c0i.29612482.9098896610.i2.189b186bX0hG3k\"><span class=\"font-color font-title\" data-spm-anchor-id=\"a3c0i.29612482.9098896610.i0.189b186bX0hG3k\">边缘安全加速 ESA（原DCDN）</span></h2>\n<p class=\"solution-text text-base font-color col-md-7\" data-spm-anchor-id=\"a3c0i.29612482.9098896610.i3.189b186bX0hG3k\">ESA提供边缘加速、边缘安全、边缘计算的产品能力，简单易用的产品交互设计，加速和保护网站、应用程序、API，提升Web应用接入性能和体验</p>\n<h3 class=\"text-xxl\">为什么<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>ESA</h3>\n<div class=\"clearfix \">\n<ul>\n<li class=\"item col-xs-12 col-md-4 colli\">\n<h5 class=\"text-md lister \">简化接入</h5>\n<p class=\"text-sm  align-left otherLister\">按主域名汇聚，无需对单个子域名重复配置，使域名清单更加整洁清晰；支持超过15种记录类型，无需跳转第三方DNS平台; 减少50%的域名与 DNS 配置工作。</p>\n</li>\n<li class=\"item col-xs-12 col-md-4 colli\">\n<h5 class=\"text-md lister \">超低时延</h5>\n<p class=\"text-sm  align-left otherLister\">全球节点间端到端网络延时平均50ms，Anycast 接入，站点DNS平均解析时延10ms。智能路由实时感知并绕过网络拥塞，提升 Web 应用性能30%。智能拥塞控制算法提升静态文件下载速度30%。</p>\n</li>\n<li class=\"item col-xs-12 col-md-4 colli\">\n<h5 class=\"text-md lister \">全业务安全防护</h5>\n<p class=\"text-sm  align-left otherLister\">全球Tbps级DDoS防护和千万级QPS CC攻击防护，内置多种AI模型算法驱动的自动对抗功能，准确率高达99.9%。对访问时序、操作轨迹和资源异常进行高效检测和处理。</p>\n</li>\n</ul>\n</div>\n<div class=\"clearfix \">\n<ul>\n<li class=\"item col-xs-12 col-md-4 colli\">\n<h5 class=\"text-md lister \">免费 SSL/TLS 证书</h5>\n<p class=\"text-sm  align-left otherLister\">ESA产品提供免费证书，同时在证书过期前自动续签，免除您证书运维的负担，预期每年减少数千元证书成本。 ESA 支持接入侧和回源链路 mTLS双向认证，最大程度保护访问流量的安全性。</p>\n</li>\n<li class=\"item col-xs-12 col-md-4 colli\">\n<h5 class=\"text-md lister \">中国内地网络接入</h5>\n<p class=\"text-sm  align-left otherLister\">基于网络优化技术降低跨地域回源链路的延迟，在全球各地快速接入中国内地网络资源，提升您的业务可用性和访问体验。</p>\n</li>\n<li class=\"item col-xs-12 col-md-4 colli\">\n<h5 class=\"text-md lister \">边缘无服务器部署</h5>\n<p class=\"text-sm  align-left otherLister\">面向开发者提供算存一体的serverless平台，20ms极速部署。支持KV存储，边缘函数直接修改缓存。无缝对接Deno/Node.js生态，EdgeStar CLI简化代码迁移及全生命周期管理，加速业务进程。</p>\n</li>\n</ul>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250213/bcc449936b0e1cb179660d84f48a079c.png\" /></p>\n<p> </p>\n</div>', 0, 1739428112),
(153, '阿里云国际版云企业网 CEN', '云企业网 CEN', 'alibaba-cloud-enterprise-network-cen', 100, 'CEN将各个地域的转发路由器(TR)通过阿里云全球骨干传输网络组成一个全网状结构网络，提供一种能够快速构建全球跨域网络的能力 快捷构建、集中管理一张云上云下全球跨域网络服务', '500.00', '<h2 class=\"solution-title\" data-spm-anchor-id=\"a3c0i.11197503.3636596270.i1.a7516c80zAnbtk\"><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.11197503.3636596270.i0.a7516c80zAnbtk\">云企业网 CEN</span></h2>\n<p class=\"solution-text text-base font-color\" data-spm-anchor-id=\"a3c0i.11197503.3636596270.i2.a7516c80zAnbtk\">快捷构建、集中<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>一张云上云下全球跨域网络服务</p>\n<p class=\"solution-text text-base font-color\" data-spm-anchor-id=\"a3c0i.11197503.3636596270.i2.a7516c80zAnbtk\">CEN将各个地域的转发路由器(TR)通过阿里云全球骨干传输网络组成一个全网状结构网络，提供一种能够快速构建全球跨域网络的能力：<br /><br />● 任何两个TR之间通过多条高可靠线路连接，保证可靠性<br />● TR作为中心辐射模式（spoke and hube）网络核心，将云上同一个地域、不同地域的VPC、云下网络全部接入CEN实现互联互通<br />● CEN通过统一仪表盘对全球跨域网络进行监控及<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a></p>\n<p class=\"solution-text text-base font-color\" data-spm-anchor-id=\"a3c0i.11197503.3636596270.i2.a7516c80zAnbtk\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250213/fbff3bb73ea9141aa664af53be45eabc.avif\" /></p>\n<p class=\"solution-text text-base font-color\" data-spm-anchor-id=\"a3c0i.11197503.3636596270.i2.a7516c80zAnbtk\"> </p>', 0, 1739428559),
(154, '阿里云国际全球加速', '全球加速', 'alibaba-cloud-global-acceleration', 100, '全球加速（Global Accelerator）是一款覆盖全球的公网加速服务，依托阿里云优质的带宽和全球传输网络，实现全球网络就近接入和应用跨地域部署，提升公网服务的用户访问体验。 全球加速大幅提升网络的质量和安全性，降低网络延时，保障服务高可用性。', '500.00', '<h2 class=\"solution-title col-md-7\"><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.14075583.7528791940.i0.3c3571c53SU0lB\">全球加速</span></h2>\n<p><span class=\"font-color\" data-spm-anchor-id=\"a3c0i.14075583.7528791940.i0.3c3571c53SU0lB\">依托阿里云优质网络，为您提供全球公网加速服务。</span></p>\n<h3 class=\"adv-title text-xxl col-md-4\" data-spm-anchor-id=\"a3c0i.14075583.9272843010.i1.3c3571c53SU0lB\">提升全球访问体验</h3>\n<div class=\"text-box col-md-8\">\n<p class=\"adv-desc\" data-spm-anchor-id=\"a3c0i.14075583.9272843010.i0.3c3571c53SU0lB\">全球加速（Global Accelerator）是一款覆盖全球的公网加速服务，依托阿里云优质的带宽和全球传输网络，实现全球网络就近接入和应用跨地域部署，提升公网服务的用户访问体验。 全球加速大幅提升网络的质量和安全性，降低网络延时，保障服务高可用性。此外，全球加速支持分钟级开通，业务部署更加敏捷。</p>\n<div class=\"item\">\n<h3 data-spm-anchor-id=\"a3c0i.14075583.2762683690.i0.3c3571c53SU0lB\">网络质量优化</h3>\n<p class=\"desc\">智能调度网络传输流量，自动就近接入阿里云全球网络</p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>就近接入</h4>\n<p class=\"itemDesc\">用户的流量通过访问接入点IP地址，或CNAME地址就近接入到阿里云网络</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>传输协议优化</h4>\n<p class=\"itemDesc\">传输层协议优化，大幅提高网络传输的稳定性和性能</p>\n</div>\n</div>\n<div class=\"cont 2 col-md-4\">\n<div>\n<h4>全局智能选路</h4>\n<p class=\"itemDesc\">将用户访问流量路由到最合适的应用所在终端节点</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"item\">\n<h3>高安全能力</h3>\n<p class=\"desc\">保护公网服务免受攻击，加固后端服务的安全访问。</p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>访问控制策略</h4>\n<p class=\"itemDesc\">控制和管理客户对应用访问的安全策略，支持配置黑白名单。</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>云安全服务联动</h4>\n<p class=\"itemDesc\">可以与阿里云的高防相关安全服务联动，自动检测攻击并切换到安全防护链路。</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"item\">\n<h3>高可用服务</h3>\n<p class=\"desc\">协助业务平滑升级和<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>，最大限度保证服务连续性。</p>\n<div class=\"clearfix child\">\n<div class=\"cont 0 col-md-4\">\n<div>\n<h4>后端应用跨地域部署</h4>\n<p class=\"itemDesc\">实现不同地域服务之间的负载分担和高可用容灾。</p>\n</div>\n</div>\n<div class=\"cont 1 col-md-4\">\n<div>\n<h4>可用性健康检查</h4>\n<p class=\"itemDesc\">通过健康检查机制监测后端应用的可用性。</p>\n<p class=\"itemDesc\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250213/66d2bb4a7a115dc954f59a1652f6ee89.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739428731),
(155, '腾讯云国际对象存储', '对象存储', 'tencent-cloud-object-storage', 112, '对象存储（Cloud Object Storage，COS）是由腾讯云推出的无目录层次结构、无数据格式限制，可容纳海量数据且支持 HTTP/HTTPS 协议访问的分布式存储服务。腾讯云 COS 的存储桶空间无容量上限，无需分区管理，适用于 CDN 数据分发、数据万象处理或大数据计算与分析的数据湖等多种场景。', '100.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>对象存储</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>安全稳定、便捷易用、低成本的海量云端存储服务</p>\n<p>对象存储（Cloud Object Storage，COS）是由腾讯云推出的无目录层次结构、无数据格式限制，可容纳海量数据且支持 HTTP/<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>协议访问的分布式存储服务。腾讯云 COS 的存储桶空间无容量上限，无需分区管理，适用于 CDN 数据分发、数据万象处理或大数据计算与分析的数据湖等多种场景。COS 提供网页端管理界面、多种主流开发语言的 SDK、API 以及命令行和图形化工具，并且兼容 S3 的 API 接口，方便用户直接使用社区工具和插件。</p>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">对象与存储桶管理</h3>\n<article>\n<p><strong>1. 断点续传</strong></p>\n<p>当上传意外终止，用户再次上传该文件时，可以从中断处继续上传，减少重复上传时间。</p>\n<p><strong>2. 自定义对象头部</strong></p>\n<p>对象头部 （Header） 是服务器以 HTTP 协议传输 HTML 资料到浏览器前所送出的字串。通过修改头部，可以改变页面的响应形式，或者传达配置信息，例如修改缓存时间，不会修改文件本身。</p>\n<p><strong>3. 静态网站</strong></p>\n<p>静态网站是指只包含静态内容（如 HTML）或客户端脚本的网站。对于不需要展示动态网页的用户，仅需要使用 COS 服务就能完成从存储到展示的流程。用户可在 COS 上通过为网站配置存储桶（绑定了自定义域名的存储桶）来托管静态网站。</p>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">安全保障</h3>\n<article>\n<p><strong>1. Referer 防盗链</strong></p>\n<p>通过设置存储桶的防盗链黑白名单，在外部请求 COS 资源时，判断 HTTP 请求头部（Header）的 Referer 字段是否在黑白名单中，从而禁止或允许外部请求。可以用来防止资源盗用及被盗用后产生的额外流量费用。</p>\n<p><strong>2. 跨域访问</strong></p>\n<p>通过配置存储桶的跨域访问规则，实现了当 HTTP 请求与资源处于不同域的情况下的资源获取。</p>\n<p><strong>3. 多地域存储</strong></p>\n<p>用户可以根据业务热点选择就近存储地域，减少资源获取延迟。同时，多地存储帮助客户实现异地容灾。</p>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">大数据及开放能力</h3>\n<article>\n<p><strong>1. 持久化音视频处理</strong></p>\n<p>COS 还为 UGC 类小视频、短视频等移动应用提供了音视频处理能力，您仅需通过集成 SDK 便可快速接入，之后您即可在 COS 上一站式地完成视频上传、转码、存储、审核和播放等操作。数据上传处理下发一体化，完美闭环。</p>\n<p><strong>2. PS 级图片处理</strong></p>\n<p>COS 可使用 数据万象 为移动开发者提供多样灵活的图片加工服务及深度定制的图片内容鉴定（如敏感内容审核、人脸识别等）。您可以通过数据万象直接对 COS 上的图片资源完成裁剪、水印、转码、旋转等操作，无需调用其他公共接口。</p>\n<p><strong>3. FTP 工具</strong></p>\n<p>基于 FTP 协议来管理文件的服务端工具。方便用户上传和下载存储在 COS 上的文件。</p>\n<p><strong>4. Hadoop 工具</strong></p>\n<p>通过 COS 提供的 Hadoop 工具，用户可以很方便的使用 Hadoop 大数据处理引擎，如 MapReduce、Hive、Spark、Tez 处理存储在 COS 上的数据。</p>\n<p><strong>5. 多种数据迁移工具</strong></p>\n<p>支持将多种平台（如 Amazon S3、阿里云、七牛云等）上的数据迁移至 COS。详情请查阅 COS Migration 工具 和 迁移数据至对象存储 COS。</p>\n</article>\n</article>\n</article>\n</div>\n</div>', 0, 1739496451),
(156, '腾讯云国际文件存储', '文件存储', 'tencent-cloud-file-storage', 112, '文件存储（Cloud File Storage，CFS）为您提供安全可靠、可扩展的共享文件存储服务。CFS 可与腾讯云服务器、容器服务、批量计算等服务搭配使用，为多个计算节点提供容量和性能可弹性扩展的高性能共享存储。', '500.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>文件存储</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>安全可靠、集成化、容量可扩展的低成本共享文件存储服务</p>\n<p>文件存储（Cloud File Storage，CFS）为您提供安全可靠、可扩展的共享文件存储服务。CFS 可与腾讯云服务器、容器服务、批量计算等服务搭配使用，为多个计算节点提供容量和性能可<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>扩展的高性能共享存储。腾讯云 CFS 的管理界面简单、易使用，可实现对现有应用的无缝集；按实际用量付费，为您节约成本，简化 IT 运维工作。</p>\n<p> </p>\n</div>\n</div>', 0, 1739496895),
(157, '腾讯云国际云硬盘', '云硬盘', 'tencent-cloud-drive', 112, '云硬盘（Cloud Block Storage，CBS）为您提供用于 CVM 的持久性数据块级存储服务。云硬盘中的数据自动地在可用区内以多副本冗余方式存储，避免数据的单点故障风险，提供高达99.9999999%的数据可靠性。云硬盘提供多种类型及规格的磁盘实例，满足稳定低延迟的存储性能要求。', '200.00', '<div class=\"title-tab\">\n<h2 class=\"title light-theme\">云硬盘</h2>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">稳定可靠、低延迟、可扩展的持久性块存储设备，可作为 CVM 的独立硬盘使用</div>\n<div class=\"content light-theme\"> </div>\n<div class=\"content light-theme\">云硬盘（Cloud Block Storage，CBS）为您提供用于 CVM 的持久性数据块级存储服务。云硬盘中的数据自动地在可用区内以多副本冗余方式存储，避免数据的单点故障风险，提供高达99.9999999%的数据可靠性。云硬盘提供多种类型及规格的磁盘实例，满足稳定低延迟的存储性能要求。云硬盘支持在同可用区的实例上挂载/卸载，并且可以在几分钟内调整存储容量，满足弹性的数据需求。您只需为配置的资源量支付低廉的价格就能享受到以上的功能特性。</div>\n<div class=\"content light-theme\">\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len4\">\n<h3 class=\"tci-title line-break4\">弹性</h3>\n<div class=\"tci-content line-break7\">\n<p>云盘可在区域内自由挂载、卸载，无需关闭或重启服务器；云盘的容量可弹性配置，您可按需升级容量；单台虚拟机最多可挂载 20 块云盘，总容量达 640TB，满足大容量的文件系统要求，用于大数据、数据仓库、日志处理等业务。</p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len4\">\n<h3 class=\"tci-title line-break4\">数据备份</h3>\n<div class=\"tci-content line-break7\">\n<p>快照是对云硬盘的完全拷贝，该拷贝包括磁盘在拷贝开始的时间点的映像，并以冗余的方式存储在多个可用区。您可以使用快照来应对业务数据误<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、被攻击、被篡改等场景。</p>\n<p>CBS 选用 CoW（Copy on Write）的方式制作快照，您无需担忧在制作快照时因为硬盘性能下降导致业务中断。同时，您可以根据业务特点设置自动快照以定期为您块存储上的业务数据做备份。如果您发现因误<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、被攻击或被篡改等导致数据丢失或不一致，可以对快照做回滚<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>，帮助您将数据恢复到快照时间点的业务状态。同时，使用快照可以帮助您快速将数据复制到新服务器上，实现业务的快速批量部署或业务迁移。游戏客户可使用快照创建新 CBS 卷的能力，快速部署几十个大区，满足公测首日开服需求，极大节省运维人力。</p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len4\">\n<h3 class=\"tci-title line-break4\">高可靠性保障</h3>\n<div class=\"tci-content line-break7\">\n<p>CBS 数据自动地在可用区内跨机架三副本存储，保障单点的磁盘故障不会影响您数据的可靠性；腾讯云为应对跨资源池容灾的问题，将云硬盘系统与快照系统相互独立，部署于不同机房，且外网不可访问，隔绝黑客攻击。在同一个机房内，云硬盘及快照的数据将跨机架存储，避免了同一个机架由于掉电、风冷故障等中断业务。即使在极端情况下 CBS 系统的多份数据冗余全部丢失时，也可以保障从快照系统恢复数据。</p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len4\">\n<h3 class=\"tci-title line-break4\">灵活计费</h3>\n<div class=\"tci-content line-break7\">\n<p>CBS是现收现付制。在这种灵活的计费模式下，可以随时激活/终止CBS卷，并根据实际使用情况进行收费。计费以每秒为单位，按小时计费，这使得它特别适合于电子商务快速销售这样的场景，在这种情况下，业务需求可能会在瞬间发生显著波动。</p>\n</div>\n</div>\n</div>\n</div>', 0, 1739497030),
(158, '腾讯云国际日志服务', '日志服务', 'tencent-cloud-log-service', 112, '日志服务（Cloud Log Service，CLS）是腾讯云提供的一站式日志服务平台，提供了从日志采集、日志存储到日志检索分析、实时消费、日志投递等多项服务，协助用户通过日志来解决业务运营、安全监控、日志审计、日志分析等问题。', '500.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>日志服务</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>稳定、可靠、便捷、易用的一站式日志服务平台，轻松管理海量日志数据，助力企业数字化升级</p>\n<p>日志服务（Cloud Log Service，CLS）是腾讯云提供的一站式日志服务平台，提供了从日志采集、日志存储到日志检索分析、实时消费、日志投递等多项服务，协助用户通过日志来解决业务运营、安全监控、日志审计、日志分析等问题。用户无需关注资源扩容问题，五分钟便捷接入，即可享受稳定可靠的日志服务。</p>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">实时采集</h3>\n<article>\n<p><strong>LogListener集合</strong></p>\n<p>使用腾讯云 LogListener 采集日志，便捷安装，服务稳定可靠安全、支持大部分主流 <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>操作系统，兼顾高性能与低资源占用。</p>\n<p><strong>API/SDK集合</strong></p>\n<p>无需安装 Agent，直接调用 API 上传日志，支持多种语言。</p>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">索引查询</h3>\n<article>\n<p><strong>实时索引</strong></p>\n<p>采集的日志数据实时建索引，支持秒级检索。</p>\n<p><strong>查询性能优异</strong></p>\n<p>秒级返回查询结果，支持亿级日志数据检索，精确快速定位。</p>\n<p><strong>查询灵活</strong></p>\n<p>支持全文检索、多关键词检索、跨主题查询等功能。</p>\n<h3 class=\"scene-tabs-h4 scene-tabs-h4-right\">投递</h3>\n<article>\n<p><strong>数据传送</strong></p>\n<p>打通其他云产品，利用日志服务投递至 COS 等云产品，满足日志数据的存储与分析需求。</p>\n<p><strong>日志投递至 COS</strong></p>\n<p>日志服务支持将日志数据投递至您账户下的 COS 存储桶中，实现对日志数据的存储与管理。</p>\n</article>\n</article>\n</article>\n</div>\n</div>', 0, 1739497205),
(159, '腾讯云国际数据万象', '数据万象', 'tencent-cloud-data-wanxiang', 112, '数据万象（Cloud Infinite，CI）为开发者提供图片等多种数据的智能处理服务。CI 可以根据您的需求提供定制化的图片识别服务；同时也提供灵活的图像编辑服务，如裁剪、压缩、水印、转码等，满足您的各种业务场景需求。', '500.00', '<div class=\"title-tab\">\n<div class=\"title light-theme\">\n<h2>数据万象</h2>\n</div>\n</div>\n<div class=\"content-swap\">\n<div class=\"content light-theme\">\n<p>安全、稳定、高效的云端数据处理服务，满足您图片处理的多种需求</p>\n<p>数据万象（Cloud Infinite，CI）为开发者提供图片等多种数据的智能处理服务。CI 可以根据您的需求提供定制化的图片识别服务；同时也提供灵活的图像编辑服务，如裁剪、压缩、水印、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>等，满足您的各种业务场景需求。</p>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\">图片处理</div>\n<div class=\"tci-content line-break7\">\n<p>数据万象可对存储在 COS 上的图片资源直接进行处理，如缩放、裁剪、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、压缩、水印等。</p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\">持久化处理</div>\n<div class=\"tci-content line-break7\">\n<p>通过数据万象，您可在上传时直接实现图片处理，也可以对已存放在 COS 的图片资源进行处理，并将处理结果持久化保存。</p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\">原图保护</div>\n<div class=\"tci-content line-break7\">\n<p>针对图片这种易被非法盗用的资源，数据万象提供原图保护功能，开启后资源仅能以样式化 url 访问，有效防止原图泄露。</p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\">域名管理</div>\n<div class=\"tci-content line-break7\">\n<p>您可通过域名管理选择是否开启 CDN 加速功能、设置自定义域名，并可通过设置防盗链（黑白名单）来防止流量盗刷。</p>\n</div>\n</div>\n<div class=\"flex-default-text-article-container-children__article--list__content flex-default-text-article-container-children__article--list__content-len3\">\n<div class=\"tci-title line-break4\">回源设置</div>\n<div class=\"tci-content line-break7\">\n<p>数据万象的回源设置功能可以帮助您在不中断访问的情况下，无缝迁移原站内容至腾讯云对象存储。</p>\n<p> </p>\n</div>\n</div>\n</div>\n</div>', 0, 1739497305),
(160, '华为云对象存储服务 OBS', '对象存储服务 OBS', 'huawei-cloud-object-storage-service-obs', 125, '对象存储服务（Object Storage Service，OBS）是一个基于对象的海量存储服务，为客户提供海量、安全、高可靠、低成本的数据存储能力。OBS系统和单个桶都没有总数据容量和对象/文件数量的限制，为用户提供了超大存储容量的能力，适合存放任意类型的文件，适合普通用户、网站、企业和开发者使用。', '500.00', '<h2 class=\"topictitle1\">什么是对象存储服务</h2>\n<p>对象存储服务（Object Storage Service，OBS）是一个基于对象的海量存储服务，为客户提供海量、安全、高可靠、低成本的数据存储能力。</p>\n<p>OBS系统和单个桶都没有总数据容量和对象/文件数量的限制，为用户提供了超大存储容量的能力，适合存放任意类型的文件，适合普通用户、网站、企业和开发者使用。OBS是一项面向Internet访问的服务，提供了基于HTTP/HTTPS协议的Web服务接口，用户可以随时随地连接到Internet，通过OBS管理控制台或各种OBS工具访问和管理存储在OBS中的数据。此外，OBS支持SDK和OBS API接口，可使用户方便管理自己存储在OBS上的数据，以及开发多种类型的上层业务应用。</p>\n<p>在全球多区域部署了OBS基础设施，具备高度的可扩展性和可靠性，用户可根据自身需要指定区域使用OBS，由此获得更快的访问速度和实惠的服务价格。</p>\n<h3>产品架构</h3>\n<p>OBS的基本组成是桶和对象。</p>\n<p>桶是OBS中存储对象的容器，每个桶都有自己的存储<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、访问权限、所属区域等属性，用户在互联网上通过桶的访问域名来定位桶。</p>\n<p>对象是OBS中数据存储的基本单位，一个对象实际是一个文件的数据与其相关属性信息的集合体，包括Key、Metadata、Data三部分：</p>\n<p>Key：键值，即对象的名称，为经过UTF-8编码的长度大于0且不超过1024的字符序列。一个桶里的每个对象必须拥有唯一的对象键值。<br />Metadata：元数据，即对象的描述信息，包括系统元数据和用户元数据，这些元数据以键值对（Key-Value）的形式被上传到OBS中。<br />系统元数据由OBS自动产生，在处理对象数据时使用，包括Date，Content-length，Last-modify，ETag等。<br />用户元数据由用户在上传对象时指定，是用户自定义的对象描述信息。<br />Data：数据，即文件的数据内容。<br />针对OBS提供的REST API进行了二次开发，为您提供了控制台、SDK和各类工具，方便您在不同的场景下轻松访问OBS桶以及桶中的对象。您也可以利用OBS提供的SDK和API，根据您业务的实际情况自行开发，以满足不同场景的海量数据存储诉求。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250215/600a62262c671d600ab4c0fc04e9aaa3.png\" /></p>', 0, 1739586706),
(161, '华为云 云硬盘 EVS', '云硬盘 EVS', 'huawei-cloud-drive-evs', 125, '云硬盘（Elastic Volume Service）可以为云服务器提供高可靠、高性能、规格丰富并且可弹性扩展的块存储服务，可满足不同场景的业务需求，适用于分布式文件系统、开发测试、数据仓库以及高性能计算等场景。', '500.00', '<div class=\"c-div subsection_div intor_title_p01\">\n<h2 class=\"c-paragraph intro_title_01\">云硬盘</h2>\n</div>\n<div class=\"c-div div_pIJUvG\">\n<div class=\"intro_content_01\">\n<p><span id=\"cce_productdesc_0001__keyword1375422513571\" class=\"keyword\">云硬盘（Elastic Volume Service）可以为云服务器提供高可靠、高性能、规格丰富并且可弹性扩展的块存储服务，可满足不同场景的业务需求，适用于分布式文件系统、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>测试、数据仓库以及高性能计算等场景。</span></p>\n<p><span class=\"keyword\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250215/d94a47e7776799a9dc1b6de74d3dd6a3.png\" /></span></p>\n</div>\n</div>', 0, 1739587148),
(162, '华为云 云备份 CBR', '云备份 CBR', 'huawei-cloud-backup-cbr', 125, '云备份 CBR针对病毒入侵、人为误删除、软硬件故障等场景，为华为云服务器、云硬盘、云数据库、云桌面、SFS Turbo、云上及本地文件目录，VMware虚拟化环境，提供统一的备份服务', '500.00', '<div class=\"c-div subsection_div intor_title_p01\">\n<h2 class=\"c-paragraph intro_title_01\">云备份</h2>\n</div>\n<div class=\"c-div div_pIJUvG\">\n<div class=\"intro_content_01\">\n<p>云备份（Cloud Backup and Recovery，CBR）为云上的<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>云服务器、裸金属服务器和云硬盘等，提供简单易用的备份服务，针对病毒入侵、人为误删除、软硬件故障等场景，可将数据恢复到任意备份点。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250215/f53278b54ff3d61fd827dcdb8d4feb50.png\" /></p>\n</div>\n</div>', 0, 1739587271),
(163, '华为云专属分布式存储服务 DSS', '专属分布式存储服务 DSS', 'huawei-cloud-exclusive-distributed-storage-service-dss', 125, '专属分布式存储服务（Dedicated Distributed Storage Service）为您提供独享的物理存储资源，通过数据冗余和缓存加速等多项技术，提供高可用性和持久性，以及稳定的低时延性能；可灵活对接ECS、BMS以及DCC等多种不同类型的计算服务，适用于HPC、OLAP以及混合负载等应用场景', '500.00', '<div class=\"product-banner-title\">\n<h2 class=\"banner-title\" title=\"<a href=\"https://www.kaihu123.com/vps/huawei-cloud-exclusive-host-deh/\" title=\"专属\" target=\"_blank\">专属</a>分布式存储服务 DSS\"><a href=\"https://www.kaihu123.com/vps/huawei-cloud-exclusive-host-deh/\" title=\"专属\" target=\"_blank\">专属</a>分布式存储服务 DSS</h2>\n</div>\n<div class=\"product-banner-paragraph-box\">\n<p class=\"product-banner-paragraph product-banner-paragraph-pc\" title=\"<a href=\"https://www.kaihu123.com/vps/huawei-cloud-exclusive-host-deh/\" title=\"专属\" target=\"_blank\">专属</a>分布式存储服务（Dedicated Distributed Storage Service）为您提供独享的物理存储资源，通过数据冗余和缓存加速等多项技术，提供高可用性和持久性，以及稳定的低时延性能；可灵活对接ECS、BMS以及DCC等多种不同类型的计算服务，适用于HPC、OLAP以及混合负载等应用场景\"><a href=\"https://www.kaihu123.com/vps/huawei-cloud-exclusive-host-deh/\" title=\"专属\" target=\"_blank\">专属</a>分布式存储服务（Dedicated Distributed Storage Service）为您提供独享的物理存储资源，通过数据冗余和缓存加速等多项技术，提供高可用性和持久性，以及稳定的低时延性能；可灵活对接ECS、BMS以及DCC等多种不同类型的计算服务，适用于HPC、OLAP以及混合负载等应用场景</p>\n<div class=\"product-banner-paragraph-sub\">\n<p>包年一站式购买，不同型号资源价格不同。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250215/3eb35f4d324eac231386ecc2d6de7c41.png\" /></p>\n</div>\n</div>', 0, 1739587530),
(164, '华为云弹性文件服务', '弹性文件服务', 'huawei-cloud-elastic-file-service', 125, '弹性文件服务（Scalable File Service，SFS）提供按需扩展的高性能文件存储（NAS），可为云上多个弹性云服务器（Elastic Cloud Server，ECS），容器（CCE），裸金属服务器（BMS）提供共享访问', '500.00', '<div class=\"c-div subsection_div intor_title_p01\">\n<h2 class=\"c-paragraph intro_title_01\">弹性文件服务</h2>\n</div>\n<div class=\"c-div div_pIJUvG\">\n<div class=\"intro_content_01\">\n<p>弹性文件服务（Scalable File Service，SFS）提供按需扩展的高性能文件<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>（NAS），可为云上多个弹性云服务器（Elastic Cloud Server，ECS），容器（CCE），裸金属服务器（BMS）提供共享访问</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250215/1510cfa9ed7657fe050e79348db04052.png\" /></p>\n</div>\n</div>', 0, 1739587635);
INSERT INTO `mx_cloud` (`id`, `title`, `name`, `alias`, `cid`, `des`, `usd`, `intro`, `status`, `addtime`) VALUES
(165, '华为云高性能弹性文件服务', '高性能弹性文件服务', 'huawei-cloud-high-performance-elastic-file-service', 125, '高性能弹性文件服务（Scalable File Service Turbo，SFS Turbo）提供按需扩展的高性能文件存储（NAS），可为云上多个弹性云服务器（Elastic Cloud Server，ECS）、容器（CCE）、裸金属服务器（BMS）提供共享访问。', '500.00', '<h2 class=\"topictitle1\">什么是高性能弹性文件服务</h2>\n<p>高性能弹性文件服务（Scalable File Service Turbo，SFS Turbo）提供按需扩展的高性能文件存储（NAS），可为云上多个弹性云服务器（Elastic Cloud Server，ECS）、容器（CCE）、裸金属服务器（BMS）提供共享访问。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250215/d95c4c209c188e9957d61cbe9cd42a19.png\" /></p>\n<p>与传统的文件共享存储相比，高性能弹性文件服务具有以下优势：</p>\n<ul id=\"sfsturbo_01_0360__ul6856245171013\">\n<li id=\"sfsturbo_01_0360__zh-cn_topic_0059757418_li42363120164311\">文件共享\n<p id=\"sfsturbo_01_0360__zh-cn_topic_0059757418_p5170663164322\"><a name=\"sfsturbo_01_0360__zh-cn_topic_0059757418_li42363120164311\"></a><a name=\"zh-cn_topic_0059757418_li42363120164311\"></a>同一区域跨多个可用区的云服务器可以访问同一文件系统，实现多台云服务器共同访问和分享文件。</p>\n</li>\n<li id=\"sfsturbo_01_0360__zh-cn_topic_0059757418_li3575400164325\">弹性扩展\n<p id=\"sfsturbo_01_0360__p6421105621437\"><a name=\"sfsturbo_01_0360__zh-cn_topic_0059757418_li3575400164325\"></a><a name=\"zh-cn_topic_0059757418_li3575400164325\"></a>高性能弹性文件服务可以根据您的使用需求，在不中断应用的情况下，增加文件系统的容量。一键式操作，轻松完成您的容量定制。</p>\n</li>\n<li id=\"sfsturbo_01_0360__zh-cn_topic_0059757418_li10245495164653\">高性能、高<a href=\"https://www.kaihu123.com/vps/googlecloud-compute-engine/\" title=\"可靠性\n\" target=\"_blank\">可靠性\n</a><p id=\"sfsturbo_01_0360__p66109542214337\"><a name=\"sfsturbo_01_0360__zh-cn_topic_0059757418_li10245495164653\"></a><a name=\"zh-cn_topic_0059757418_li10245495164653\"></a>性能随容量增加而提升，同时保障数据的高持久度，满足业务增长需求。</p>\n<p id=\"sfsturbo_01_0360__p8547884414\">存储底层包含HDD和SSD两种存储介质；存储系统采用分布式存储架构，全模块架构冗余设计，无单一故障点。</p>\n</li>\n<li id=\"sfsturbo_01_0360__zh-cn_topic_0059757418_li48777570165450\">无缝集成\n<p id=\"sfsturbo_01_0360__zh-cn_topic_0059757418_p48915676104816\"><a name=\"sfsturbo_01_0360__zh-cn_topic_0059757418_li48777570165450\"></a><a name=\"zh-cn_topic_0059757418_li48777570165450\"></a>高性能弹性文件服务支持NFS，通过标准协议访问数据，无缝适配主流应用程序进行数据读写。</p>\n</li>\n<li id=\"sfsturbo_01_0360__li20856445181014\">操作简单、低成本\n<p id=\"sfsturbo_01_0360__p6856645161013\"><a name=\"sfsturbo_01_0360__li20856445181014\"></a><a name=\"li20856445181014\"></a>操作界面简单易用，您可轻松快捷地创建和管理文件系统。并根据使用的存储容量按需付费，有效降低成本。</p>\n</li>\n</ul>\n<h4 id=\"section1\" class=\"sectiontitle section-copy\">如何访问高性能弹性文件服务<em id=\"copy-icon1\" class=\"copy-section-icon\" data-clipboard-text=\"https://support.huaweicloud.com/intl/zh-cn/productdesc-sfsturbo/sfsturbo_01_0360.html#section1\"></em></h4>\n<p id=\"sfsturbo_01_0360__p87556854319\">基于HTTPS请求的API（Application programming interface）管理方式或管理控制台方式均可访问高性能弹性文件服务。</p>\n<ul id=\"sfsturbo_01_0360__ul147560817436\">\n<li id=\"sfsturbo_01_0360__li87561681438\">API方式\n<p id=\"sfsturbo_01_0360__p375613824311\"><a name=\"sfsturbo_01_0360__li87561681438\"></a><a name=\"li87561681438\"></a>如果用户需要将云服务平台上的高性能弹性文件服务集成到第三方系统，用于二次开发，请使用API方式访问高性能弹性文件服务，具体操作请参见《高性能弹性文件服务API参考》。</p>\n</li>\n<li id=\"sfsturbo_01_0360__li1275610874315\">管理控制台方式\n<p id=\"sfsturbo_01_0360__p3756118114319\"><a name=\"sfsturbo_01_0360__li1275610874315\"></a><a name=\"li1275610874315\"></a>非API方式，请使用管理控制台方式访问高性能弹性文件服务。</p>\n</li>\n</ul>', 0, 1739587793),
(166, '华为云存储容灾服务', '存储容灾服务', 'huawei-cloud-storage-disaster-recovery-service', 125, '存储容灾服务（Storage Disaster Recovery Service）是一种为弹性云服务器、云硬盘和专属分布式存储等服务提供容灾的服务。通过存储复制、数据冗余和缓存加速等多项技术，提供给用户高级别的数据可靠性以及业务连续性，简称存储容灾。', '500.00', '<div class=\"c-div subsection_div intor_title_p01\">\n<h2 class=\"c-paragraph intro_title_01\">存储容灾服务</h2>\n</div>\n<div class=\"c-div div_pIJUvG\">\n<div class=\"intro_content_01\">\n<p>存储容灾服务（Storage Disaster Recovery Service）是一种为弹性云服务器、云硬盘和专属分布式存储等服务提供容灾的服务。通过存储复制、数据<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和缓存加速等多项技术，提供给用户高级别的数据可靠性以及业务连续性，简称存储容灾。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250215/26190cdc0088653403e22d5e77587bc5.png\" /></p>\n</div>\n</div>', 0, 1739587910),
(167, 'Amazon Aurora', 'Aurora', 'amazon-aurora', 146, 'Amazon Aurora 为 PostgreSQL、MySQL 和 DSQL 在全球范围内提供无与伦比的高性能和高可用性。Aurora 的吞吐量是 MySQL 的 5 倍，是 PostgreSQL 的 3 倍，并且与 PostgreSQL 和 MySQL 完全兼容。Aurora 还提供 DSQL，这是速度最快的与 PostgreSQL 兼容的分布式 SQL 数据库。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon Aurora</h2>\n<p>通过 PostgreSQL、MySQL 和 DSQL 在全球范围内实现无与伦比的高性能和可用性</p>\n<h3>为什么选择 Aurora？</h3>\n<p>Amazon Aurora 为 PostgreSQL、MySQL 和 DSQL 在全球范围内提供无与伦比的高性能和高可用性。Aurora 的吞吐量是 MySQL 的 5 倍，是 PostgreSQL 的 3 倍，并且与 PostgreSQL 和 MySQL 完全兼容。Aurora 还提供 DSQL，这是速度最快的与 PostgreSQL 兼容的分布式 SQL 数据库。Aurora 专为实现高达 99.999% 的多区域可用性而设计。借助 Aurora DSQL，Aurora 无需基础设施管理即可在区域内和跨区域能实现几乎无限制的扩展。Aurora 符合广泛的合规标准，具备企业级安全功能，并支持全球分布式应用程序。</p>\n<h3 class=\"basetext_module_text__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size2__00ee2f90\" data-rg-n=\"HeadingText\">Aurora 的优势</h3>\n<p><strong>1、高性能</strong></p>\n<p>为性能密集型应用程序和关键工作负载提供支持，同时以商业数据库十分之一的成本保持与 MySQL 和 PostgreSQL 的完全兼容性。</p>\n<p><strong>2、高可用性</strong></p>\n<p>构建具有多可用区可用性的应用程序，支持 99.99% 的正常运行时间 SLA 和在不到 1 分钟内实现跨区域灾难恢复的全局<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。</p>\n<p><strong>3、经济高效</strong></p>\n<p>通过完全托管式数据库（包括无服务器等创新）提高生产率并降低总体拥有成本，这样您就可以专注于构建令用户满意的应用程序。</p>\n<p><strong>4、易与迁移</strong></p>\n<p>使用标准工具在 Aurora 中来回轻松迁移 MySQL 或 PostgreSQL 数据库，或者使用 Babelfish for Aurora PostgreSQL 运行旧式 SQL Server 应用程序，只需少量的代码更改。</p>\n<p>Aurora 是一个专为云打造的关系数据库管理系统（RDBMS），可与 MySQL 和 PostgreSQL 完全兼容。Aurora 以十分之一的成本为您提供商业级数据库的性能和可用性。</p>', 0, 1739674452),
(168, '亚马逊云Aurora Serverless', 'Aurora Serverless', 'amazon-aurora-serverless', 146, 'Amazon Aurora Serverless 是 Amazon Aurora 的一种按需自动扩展配置版本。Amazon Aurora Serverless 会根据应用程序的需求自动启动、关闭以及扩展或缩减容量。可在云中运行数据库，而无需管理任何数据库实例。还可以在现有或新的数据库集群中将 Aurora Serverless v2 实例与预置实例搭配使用。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon Aurora Serverless</h2>\n<p>Amazon Aurora Serverless 是 Amazon Aurora 的一种按需自动扩展配置版本。Amazon Aurora Serverless 会根据应用程序的需求自动启动、关闭以及扩展或缩减容量。可在云中运行数据库，而无需管理任何数据库实例。还可以在现有或新的数据库集群中将 Aurora Serverless v2 实例与预置实例搭配使用。</p>\n<p>手动管理数据库容量需要占用宝贵的时间，也可能导致数据库资源的使用效率低下。 借助 Aurora Serverless，您可以创建数据库，指定所需的数据库容量范围，然后连接您的应用程序。您需要在数据库处于活动状态期间按照每秒使用的数据库容量进行付费，并且只需在 Amazon Relational Database Service（Amazon RDS）控制台中执行几个步骤即可在标准配置和无服务器配置之间进行迁移。</p>\n<p>Amazon Aurora Serverless v2 可在不到一秒钟的时间内立即扩展到能够处理数十万个事务的能力。在扩展过程中，系统会以极为精细的增量调整容量，从而确保恰好提供应用程序所需的数据库资源量。无需管理数据库容量。您只需为您的应用程序使用的容量付费。与按照峰值负载来预置容量相比，您最高可以节省 90% 的数据库成本。</p>\n<p>Aurora Serverless v2 支持所有形式的数据库工作负载。示例包括具有不频繁、间歇性或不可预见工作负载的开发和测试环境、网站和应用程序，以及要求极高的需要大规模和高可用性的业务关键型应用程序。它支持所有的 Aurora 功能，包括全球数据库、多可用区部署以及只读副本。 Aurora Serverless v2 适用于 Amazon Aurora MySQL 兼容版本和 PostgreSQL 兼容版本。</p>\n<h3>应用场景</h3>\n<p><strong>可变工作负载</strong></p>\n<p>您正在运行不常用的应用程序，每天或每年会出现数次峰期，每次持续 30 分钟到几个小时，例如当运行人力资源、预算或业务汇报应用程序时。您不再需要按峰值容量预置，从而避免了为不经常使用的资源付费；也无需按平均容量预置，从而避免了可能导致的性能问题和糟糕的用户<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。</p>\n<p><strong>不可预测的工作负载</strong></p>\n<p>您正在运行的工作负载需要全天使用数据库，并且活动峰期也很难预测。例如，下雨时您可能会看到流量站点的活动激增。您的数据库将自动扩展容量以满足应用程序的峰期负载需求，并在活动量激增结束后缩减容量。</p>\n<p><strong>企业数据库队列管理</strong></p>\n<p>如果企业拥有数以百计甚至千计的应用程序，每个应用程序都由一个或多个数据库支持，则必须妥善管理其整个数据库队列的资源。由于应用程序的需求是波动的，要持续监控并调节各个数据库的容量以确保高性能、高可用性，同时将成本控制在预算范围内，将是一件难度极高的工作。借助 Aurora Serverless v2，数据库容量将会根据应用程序需求自动调整。您不再需要手动管理数据库实例集中的数千个数据库。借助全球数据库和多可用区部署等功能，还可以确保高可用性和快速恢复能力。</p>\n<p><strong>软件即服务应用程序</strong></p>\n<p>软件即服务（SaaS）供应商通常会在单个集群中运行数以百计甚至千计的 Aurora 数据库，每个数据库支持一个不同的客户，从而提高利用率和成本效率。但是，这些供应商仍需要逐一管理每个数据库，包括监控同一集群中对共享资源的消耗超出最初计划的并置数据库并进行相应的处理。借助 Aurora Serverless v2，SaaS 供应商可以为每个单独的客户预置 Aurora 数据库集群，无需担心所预置容量的成本。系统会在数据库未使用时自动关闭数据库以节省成本，并且会即时调整数据库的容量以满足不断变化的应用程序需求</p>\n<p><strong>跨多个服务器横向扩展数据库</strong></p>\n<p>写入或读取需求高的客户经常会跨多个实例来分拆数据库，从而实现更高的吞吐量。然而，客户预置的实例数量往往不是太多就是太少，导致成本增加或扩展能力受到限制。借助 Aurora Serverless v2，客户会跨多个 Aurora 实例来分拆其数据库，并让服务根据需求即时自动调整容量。系统会无缝调整每个节点的容量，不会造成任何停机或中断，并且仅使用支持应用程序所需的资源量。</p>\n<p><strong>如何开始使用</strong></p>\n<p>Aurora Serverless v2 适用于 Aurora MySQL 兼容版本和 PostgreSQL 兼容版本。 它的入门非常简单：您只需在创建 Aurora 数据库集群时选择 Serverless v2，选择性地指定所需的数据库容量范围或使用默认值，然后连接您的应用程序即可。</p>', 0, 1739674683),
(169, '亚马逊云AWS DocumentDB（与 MongoDB 兼容）', 'DocumentDB（与 MongoDB 兼容）', 'amazon-documentdb', 146, 'Amazon DocumentDB（与 MongoDB 兼容）是一个完全托管的本机 JSON 文档数据库，有助于轻松且经济高效地处理几乎任何规模的关键文档工作负载，并且无需管理基础设施。Amazon DocumentDB 通过提供内置的安全最佳实践、连续备份，以及与其他 AWS 服务的本机集成，简化了您的架构。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon DocumentDB（与 MongoDB 兼容）</h2>\n<p>使用完全托管的本机 JSON 文档数据库轻松扩展企业工作负载</p>\n<p>Amazon DocumentDB（与 MongoDB 兼容）是一个完全托管的本机 JSON 文档数据库，有助于轻松且经济高效地处理几乎任何规模的关键文档工作负载，并且无需管理基础设施。Amazon DocumentDB 通过提供内置的安全最佳实践、连续备份，以及与其他 AWS 服务的本机集成，简化了您的架构。可以使用 Amazon DocumentDB 的向量搜索以及与 Amazon <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>Canvas 的集成，借助生成式人工智能（AI）和机器学习（ML）功能增强应用程序。</p>\n<p> </p>', 0, 1739674808),
(170, '亚马逊云aws DynamoDB', 'DynamoDB', 'amazon-dynamodb', 146, 'Amazon DynamoDB 是一项无服务器的 NoSQL 数据库服务，您可以通过它来开发任何规模的现代应用程序。作为无服务器数据库，您只需按使用量为其付费，DynamoDB 可以扩展到零，没有冷启动，没有版本升级，没有维护窗口，没有修补，也没有停机维护。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon DynamoDB</h2>\n<p>无服务器、NoSQL、完全托管的数据库，在任何规模下均具有个位数毫秒级的性能</p>\n<h3 class=\"basetext_module_text__61099e5e headingtext_module_heading__00ee2f90 textmediacontent_module_heading__d28b7a4a headingtext_module_size2__00ee2f90\" data-rg-n=\"HeadingText\">为什么选择 DynamoDB？</h3>\n<div class=\"basetext_module_text__61099e5e bodytext_module_body__ca32720c bodytext_module_size1__ca32720c\" data-rg-n=\"BodyText\">\n<p>Amazon DynamoDB 是一项无服务器的 NoSQL 数据库服务，您可以通过它来开发任何规模的现代应用程序。作为无服务器数据库，您只需按使用量为其付费，DynamoDB 可以扩展到零，没有冷启动，没有版本升级，没有维护窗口，没有修补，也没有停机维护。DynamoDB 提供一系列广泛的安全控制措施和合规性标准。对于全球分布式应用程序，DynamoDB 全局表是一个多区域、多活动数据库，具有 99.999% 的可用性 SLA 和更高的弹性。托管备份、时间点恢复等功能有助于确保 DynamoDB 的可靠性。<a href=\"https://www.kaihu123.com/vps/windows-server/\" title=\"借助 \" target=\"_blank\">借助 </a>DynamoDB 流，您可以构建无服务器的事件驱动型应用程序。</p>\n<div class=\"grid_module_grid__590284f4\" data-rg-n=\"Grid\">\n<div class=\"col_module_col__66940a30 col_module_col12__66940a30\" data-rg-n=\"Col\">\n<div class=\"templateHeader_module_templateHeader__b496fe91\">\n<div class=\"grid_module_grid__590284f4 grid_module_noPadding__590284f4\" data-rg-n=\"Grid\">\n<div class=\"col_module_col__66940a30 col_module_colXs12__66940a30 col_module_colS10__66940a30 col_module_colM8__66940a30 col_module_colL8__66940a30 col_module_colXl8__66940a30 col_module_colXxl8__66940a30\" data-rg-n=\"Col\">\n<h3 class=\"basetext_module_text__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size2__00ee2f90\" data-rg-n=\"HeadingText\">DynamoDB 的规模和价值</h3>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"grid_module_grid__590284f4\" data-rg-n=\"Grid\">\n<div class=\"col_module_col__66940a30 col_module_colXs12__66940a30 col_module_colS12__66940a30 col_module_colM6__66940a30 col_module_colL6__66940a30 col_module_colXl6__66940a30 col_module_colXxl6__66940a30 dataPointStandardCollection_module_dataPointCol__6a37a23c \" data-rg-n=\"Col\">\n<h3 class=\"basetext_module_text__61099e5e headingtext_module_heading__00ee2f90 dataPointStandardCollection_module_statNumber__6a37a23c headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">1 百万以上 客户</h3>\n</div>\n<div class=\"col_module_col__66940a30 col_module_colXs12__66940a30 col_module_colS12__66940a30 col_module_colM6__66940a30 col_module_colL6__66940a30 col_module_colXl6__66940a30 col_module_colXxl6__66940a30 dataPointStandardCollection_module_dataPointCol__6a37a23c \" data-rg-n=\"Col\">\n<h3 class=\"basetext_module_text__61099e5e headingtext_module_heading__00ee2f90 dataPointStandardCollection_module_statNumber__6a37a23c headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">超过 1/2 百万每秒请求数200TB+表大小成本降低 25%</h3>\n</div>\n<div class=\"col_module_col__66940a30 col_module_colXs12__66940a30 col_module_colS12__66940a30 col_module_colM6__66940a30 col_module_colL6__66940a30 col_module_colXl6__66940a30 col_module_colXxl6__66940a30 dataPointStandardCollection_module_dataPointCol__6a37a23c \" data-rg-n=\"Col\"><span class=\"basetext_module_text__61099e5e titletext_module_title__e23b0698 dataPointStandardCollection_module_title__6a37a23c titletext_module_size3__e23b0698\" data-rg-n=\"TitleText\">与等效数据库环境相比的成本节省</span></div>\n</div>\n</div>', 0, 1739674977),
(171, '亚马逊云aws ElastiCache', 'ElastiCache', 'amazon-elasticache', 146, 'Amazon ElastiCache 是一项完全托管且兼容 Valkey、Memcached 和 Redis OSS 的服务，可为现代应用程序提供实时、成本优化的性能，可用性高达 99.99%。ElastiCache 可加快数据库和应用程序性能，以微秒级响应时间扩展到每秒数百万次操作。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon ElastiCache</h2>\n<p>实时应用程序的实时性能</p>\n<h3 class=\"basetext_module_text__61099e5e headingtext_module_heading__00ee2f90 textmediacontent_module_heading__d28b7a4a headingtext_module_size2__00ee2f90\" data-rg-n=\"HeadingText\">为什么选择 Amazon ElastiCache？</h3>\n<div class=\"basetext_module_text__61099e5e bodytext_module_body__ca32720c bodytext_module_size1__ca32720c\" data-rg-n=\"BodyText\">\n<p>Amazon ElastiCache 是一项完全托管且兼容 Valkey、Memcached 和 Redis OSS 的服务，可为现代应用程序提供实时、成本优化的性能，可用性高达 99.99%。ElastiCache 可加快数据库和应用程序性能，以微秒级响应时间扩展到每秒数百万次操作。与开源替代方案相比，ElastiCache 还可提供更高的安全性和可靠性。对于现代应用程序，ElastiCache 全局数据存储通过完全托管的跨区域复制提供本地化读取。ElastiCache 还通过数据<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>等额外的成本优化功能，为读取密集型和内存密集型工作负载节省成本。ElastiCache 提供领先的安全性（Amazon VPC、AWS IAM）和合规标准（符合 HIPAA 要求、FedRAMP 授权和 PCI DSS）。</p>\n<p> </p>\n</div>', 0, 1739675109),
(172, '亚马逊云aws Apache Cassandra', 'Apache Cassandra', 'amazon-keyspaces', 146, 'Amazon Keyspaces（for Apache Cassandra）是一种可扩展、高度可用、托管式 Apache Cassandra 兼容数据库服务。借助 Amazon Keyspaces，您可以继续使用当前的相同 Cassandra 应用程序代码和开发人员工具在 AWS 上运行 Cassandra 工作负载。', '500.00', '<h2 id=\"Amazon_Keyspaces_.28for_Apache_Cassandra.29\" class=\"lb-txt-bold lb-txt-white lb-none-v-margin lb-h1 lb-title\">Amazon Keyspaces (for Apache Cassandra)</h2>\n<div class=\"lb-none-pad lb-grid lb-row lb-row-max-large lb-snap\">\n<div class=\"lb-col lb-tiny-24 lb-mid-12\">\n<div class=\"lb-txt-light lb-txt-none lb-txt-white lb-txt-20 lb-txt\">可扩展、高度可用且兼容 Apache Cassandra 的托管数据库服务</div>\n<div class=\"lb-txt-light lb-txt-none lb-txt-white lb-txt-20 lb-txt\"> </div>\n<div class=\"lb-txt-light lb-txt-none lb-txt-white lb-txt-20 lb-txt\">Amazon Keyspaces（for Apache Cassandra）是一种可扩展、高度可用、托管式 Apache Cassandra 兼容数据库服务。借助 Amazon Keyspaces，您可以继续使用当前的相同 Cassandra 应用程序代码和开发人员工具在 AWS 上运行 Cassandra 工作负载。您无需预置、修补或管理服务器，并且不需要安装、维护或操作软件。Amazon Keyspaces 是无服务器服务，因此您只需为实际使用的资源付费，并且该服务会根据应用程序流量自动扩展和缩减表。您可以构建每秒可处理数千个请求，且吞吐量和存储空间几乎无限的应用程序。数据默认会被加密，而 Amazon Keyspaces 则让您可以使用时间点恢复持续<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>您的表数据。Amazon Keyspaces 可以为您提供大规模运行业务关键型 Cassandra 工作负载所需的性能、弹性和企业级功能。</div>\n<div class=\"lb-txt-light lb-txt-none lb-txt-white lb-txt-20 lb-txt\"> </div>\n<div class=\"lb-txt-light lb-txt-none lb-txt-white lb-txt-20 lb-txt\">\n<div class=\"lb-col lb-tiny-24 lb-mid-6\">\n<h3 id=\"Compatible_with_Apache_Cassandra\" class=\"lb-txt-bold lb-txt-none lb-txt-18 lb-h3 lb-title\">与 Apache Cassandra 兼容</h3>\n<div class=\"lb-rtxt\">\n<p>Amazon Keyspaces 使您能够使用您已使用的 Cassandra Query Language (CQL) API 代码、Cassandra 驱动程序和开发人员工具。更新应用程序以使用 Amazon Keyspaces 就像将 Cassandra 主机名更改为 Amazon Keyspaces 服务终端节点一样简单。</p>\n</div>\n</div>\n<div class=\"lb-col lb-tiny-24 lb-mid-6\">\n<h3 id=\"No_servers_to_manage\" class=\"lb-txt-bold lb-txt-none lb-txt-18 lb-h3 lb-title\">无需管理服务器</h3>\n<div class=\"lb-rtxt\">\n<p>您无需预置、修补或管理服务器，因此可以专注于构建更好的应用程序。表可以自动扩展和缩减，并且您可以通过选择按需或预置容量模式，根据应用程序的流量模式来优化读写成本。</p>\n</div>\n</div>\n<div class=\"lb-col lb-tiny-24 lb-mid-6\">\n<h3 id=\"Performance_at_scale\" class=\"lb-txt-bold lb-txt-none lb-txt-18 lb-h3 lb-title\">规模性能</h3>\n<div class=\"lb-rtxt\">\n<p>在任何规模都能始终如一地实现个位数毫秒级响应。构建具有几乎无限的吞吐量和存储能力的应用程序，每秒可处理数千个请求，而无需提前规划容量。您可以使用 Amazon CloudWatch 监控性能 ，帮助应用程序流畅运行。</p>\n</div>\n</div>\n<div class=\"lb-col lb-tiny-24 lb-mid-6\">\n<h3 id=\"Highly_available_and_secure\" class=\"lb-txt-bold lb-txt-none lb-txt-18 lb-h3 lb-title\">可用性高，安全可靠</h3>\n<div class=\"lb-rtxt\">\n<p>Amazon Keyspaces 在 AWS 区域内可提供 99.99% 的可用性 SLA。默认情况下，表处于加密状态，并在多个 AWS 可用区中复制 3 次，以保证高可用性。您可以立即创建数百 TB 数据的持续表<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>，而不会对您的应用程序产生影响，并且可以恢复到先前的 35 天内的任何时间点。</p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739675226),
(173, '亚马逊云aws MemoryDB', 'MemoryDB', 'amazon-memorydb', 146, '亚马逊云aws MemoryDB 与 Valkey 和 Redis OSS 兼容的持久型内存数据库服务，可实现超快性能 在 AWS 上的常用向量数据库中提供相关性最高、语义搜索体验最快的实时个性化体验。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon MemoryDB</h2>\n<p>与 Valkey 和 Redis OSS 兼容的持久型内存数据库服务，可实现超快性能</p>\n<p>1、实时生成式人工智能应用程序</p>\n<p>在 AWS 上的常用向量数据库中提供相关性最高、语义搜索体验最快的实时个性化体验。</p>\n<p>2、构建 Web 和移动应用程序</p>\n<p>通过对 Valkey 和 Redis OSS 中可用的灵活数据结构的内置访问权限，简化应用程序<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>并缩短上市时间。</p>\n<p>3、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>在线游戏</p>\n<p>为需要大规模、低延迟和高并发性来进行实时更新的游戏应用程序，构建玩家数据存储、会话历史和排行榜。</p>\n<p>4、流媒体和娱乐</p>\n<p>运行高并发串流数据馈送以提取用户活动，并支持媒体和娱乐应用程序的每天数百万次请求。</p>', 0, 1739675467),
(174, '亚马逊云AWS Neptune数据库', 'Neptune', 'amazon-neptune', 146, 'Neptune 数据库是一个无服务器图形数据库，旨在实现卓越的可扩展性和可用性。Neptune 数据库提供内置安全性、持续备份以及与其他 AWS 服务的集成。Neptune 全球数据库为全球分布式应用程序提供跨区域数据复制，以实现低延迟读写、灾难恢复和可扩展性。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon Neptune</h2>\n<p>高性能图形分析和无服务器数据库，可提供卓越的可扩展性和可用性</p>\n<div class=\"col_module_col__66940a30 col_module_colXs12__66940a30 col_module_colS12__66940a30 col_module_colM5__66940a30 col_module_colL5__66940a30 col_module_colXl5__66940a30 col_module_colXxl5__66940a30 textmediacontent_module_textContainer__d28b7a4a\" data-rg-n=\"Col\" data-text-form=\"long\">\n<div class=\"basetext_module_text__61099e5e bodytext_module_body__ca32720c bodytext_module_size1__ca32720c\" data-rg-n=\"BodyText\">\n<p>Neptune 数据库是一个无服务器图形数据库，旨在实现卓越的可扩展性和可用性。Neptune 数据库提供内置安全性、持续备份以及与其他 AWS 服务的集成。Neptune 全球数据库为全球分布式应用程序提供跨区域数据复制，以实现低延迟读写、灾难恢复和可扩展性。</p>\n<p>Neptune Analytics 是一款分析数据库引擎，用于快速分析大量图形数据，从存储在 Amazon S3 存储桶或 Neptune 数据库的数据中获得见解并找出趋势。Neptune Analytics 使用内置算法、<a href=\"https://www.kaihu123.com/vps/google-cloud-alloydb/\" title=\"向量\" target=\"_blank\">向量</a>搜索和内存中的计算，在几秒钟内对具有数百亿个关系的数据运行查询。</p>\n<p> </p>\n</div>\n</div>', 0, 1739675599),
(175, '亚马逊云AWS Quantum Ledger Database', 'Quantum Ledger Database', 'amazon-quantum-ledger-database', 146, 'Amazon Quantum Ledger Database（Amazon QLDB）是一种完全托管式分类账数据库，提供了一个透明、不可变、可以加密方式验证的交易日志。维护不可改变的、可加密验证的数据更改日志', '500.00', '<h2 id=\"Amazon_Quantum_Ledger_Database\" class=\"lb-txt-bold lb-txt-none lb-txt-white lb-txt-36 lb-none-v-margin lb-h4 lb-title\">Amazon Quantum Ledger Database</h2>\n<p>维护不可改变的、可<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>验证的数据更改日志</p>\n<p>Amazon Quantum Ledger Database（Amazon QLDB）是一种完全托管式分类账数据库，提供了一个透明、不可变、可以<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>方式验证的交易日志。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250216/a55fd953d5ac7cf950da3af441605079.png\" /></p>\n<p> </p>', 0, 1739675733),
(176, '亚马逊云AWS RDS', 'RDS', 'amazon-relational-database-service', 146, 'Amazon Relational Database Service（Amazon RDS）是一种易于管理的关系数据库服务，针对总拥有成本进行了优化。我们可根据需求进行设置、操作和扩展，非常简便。Amazon RDS 自动执行无差别的数据库管理任务，例如预置、配置、备份和修补。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon Relational Database Service</h2>\n<p>易于管理关系数据库，针对总拥有成本进行了优化</p>\n<h3>为什么选择 Amazon RDS？</h3>\n<p>Amazon Relational Database Service（Amazon RDS）是一种易于管理的关系数据库服务，针对总拥有成本进行了优化。我们可根据需求进行设置、操作和扩展，非常简便。Amazon RDS 自动执行无差别的数据库管理任务，例如预置、配置、备份和修补。Amazon RDS 使客户能够在几分钟内创建新数据库，并允许他们灵活地自定义数据库，以满足他们在 8 个引擎和 2 个部署选项中的需求。客户可以利用多种功能优化性能，例如具有两个可读备用区的 Multi-AZ、优化型写入和读取以及基于 AWS Graviton3 的实例，并从多个定价选项中进行选择，以便有效地管理成本。</p>\n<h3>Amazon RDS</h3>\n<p>通过 Amazon RDS，您可以开始使用您熟悉和信任的开源和商业数据库软件，包括 PostgreSQL、MySQL、MariaDB、SQL Server、Oracle 和 Db2。您可以消除无差别管理任务的繁重工作，并从支持 Amazon EBS io2 Block Express <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和基于 AWS Graviton3 的实例的 AWS 堆栈创新中受益。</p>', 0, 1739675869),
(177, '亚马逊云AWS RDS on Outposts', 'RDS on Outposts', 'amazon-rds-on-aws-outposts', 146, 'Amazon Relational Database Service（Amazon RDS）on AWS Outposts 让您能够在本地环境中部署完全托管式数据库实例。 Outposts 是一项完全托管式服务，可将 AWS 基础设施、AWS 服务、API 和工具扩展到几乎任何数据中心、主机托管空间或本地设施，以实现真正一致的混合体验。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon RDS on AWS Outposts</h2>\n<p>在本地环境中<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> Amazon RDS 托管数据库</p>\n<h3>为什么选择 Amazon RDS on Outposts？</h3>\n<p>Amazon Relational Database Service（Amazon RDS）on AWS Outposts 让您能够在本地环境中<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>完全托管式数据库实例。 Outposts 是一项完全托管式服务，可将 AWS 基础设施、AWS 服务、API 和工具扩展到几乎任何数据中心、主机托管空间或本地设施，以实现真正一致的混合体验。通过<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> Amazon RDS on Outposts，您可以像在云环境一样，在本地环境中设置、操作、扩展 Microsoft SQL Server、MySQL 和 PostgreSQL 关系数据库。Amazon RDS on Outposts 为本地数据库提供经济高效且可调整大小的容量，同时自动执行耗时的管理任务，包括基础设施预置、数据库设置、修补和备份，让您可以专注于应用程序。</p>\n<p><a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a> Amazon RDS on Outposts 时，您可以在本地环境中运行 Amazon RDS 以处理需要在本地数据和应用程序附近运行的低延迟工作负载。Amazon RDS on Outposts 还支持自动备份到您的 Outpost 或 AWS 区域。您可以使用相同的 AWS 管理控制台、API 和命令行界面（CLI），在云端和本地环境中管理 Amazon RDS 数据库。Amazon RDS on Outposts 支持 Microsoft SQL Server、MySQL 和 PostgreSQL 数据库引擎，不久之后还会支持其他数据库引擎。</p>\n<p> </p>', 0, 1739675999),
(178, '亚马逊云AWS Redshift', 'Redshift', 'amazon-redshift', 146, 'Amazon Redshift 与 Amazon SageMaker Lakehouse 无缝集成，让您可以在 Amazon Redshift 数据仓库和 Amazon Simple Storage Service（Amazon S3）数据湖的统一数据上使用其强大的 SQL 分析功能。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon Redshift</h2>\n<p>使用 SQL 为您的数据湖仓实现大规模的卓越性价比</p>\n<h3 class=\"basetext_module_text__61099e5e headingtext_module_heading__00ee2f90 textmediacontent_module_heading__d28b7a4a headingtext_module_size2__00ee2f90\" data-rg-n=\"HeadingText\">为什么选择 Amazon Redshift？</h3>\n<div class=\"basetext_module_text__61099e5e bodytext_module_body__ca32720c bodytext_module_size1__ca32720c\" data-rg-n=\"BodyText\">\n<p>数以万计的客户使用 Amazon Redshift 进行大规模的现代数据分析，与其他云数据仓库相比，其性价比最高可提高 3 倍，吞吐量最高可提高 7 倍。Amazon Redshift 与 Amazon SageMaker Lakehouse 无缝集成，让您可以在 Amazon Redshift 数据仓库和 Amazon <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>Storage Service（Amazon S3）数据湖的统一数据上使用其强大的 SQL 分析功能。利用 Amazon Redshift 零 ETL 集成实现近实时分析，从而加快决策速度，无需构建复杂的数据管道即可连接来自流媒体服务、运营数据库和第三方企业应用程序的数据。Amazon Redshift Serverless 让您可以轻松扩展分析功能，分析 PB 级的数据，而无需承担基础设施管理的负担。Amazon Redshift 中的 Amazon Q 可通过自然语言简化 SQL 编写，从而提高团队的工作效率。通过将 Amazon Redshift 在 Amazon Bedrock 中用作生成式人工智能助手的结构化知识库，可大幅提高数据的价值，从而为应用程序提供更相关、更准确的输出。</p>\n<h3 id=\"How_it_works\" class=\"lb-txt-bold lb-txt-none lb-txt-40 lb-none-v-margin lb-h1 lb-title\">工作原理</h3>\n<div class=\"lb-txt-normal lb-txt-none lb-txt-16 lb-txt\">Amazon Redshift 使用 SQL 在数据仓库、运营数据库和数据湖间分析结构化和半结构化数据，使用 AWS 设计的硬件和 ML 在任意规模上提供最佳的性价比。</div>\n<div class=\"lb-txt-normal lb-txt-none lb-txt-16 lb-txt\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250216/262952a756c2c2c9f81d0f5819260e8b.png\" /></div>\n</div>', 0, 1739676136),
(179, '亚马逊云AWS Timestream', 'Timestream', 'amazon-timestream', 146, 'Amazon Timestream 为从低延迟查询到大规模数据摄取的工作负载提供完全托管、专门构建的时间序列数据库引擎。借助 Timestream for LiveAnalytics，您可以每分钟摄取数十 GB 以上的时间序列数据，并在几秒钟内对数 TB 的时间序列数据运行 SQL 查询，可用性最高达 99.99%。', '500.00', '<h2 class=\"basetext_module_text__61099e5e basetext_module_block__61099e5e headingtext_module_heading__00ee2f90 headingtext_module_size1__00ee2f90\" data-rg-n=\"HeadingText\">Amazon Timestream</h2>\n<p>易于管理的时间序列数据库，针对安全性、性能、可用性和可扩展性进行了优化</p>\n<h3 class=\"basetext_module_text__61099e5e headingtext_module_heading__00ee2f90 textmediacontent_module_heading__d28b7a4a headingtext_module_size2__00ee2f90\" data-rg-n=\"HeadingText\">为什么使用 Amazon Timestream？</h3>\n<div class=\"basetext_module_text__61099e5e bodytext_module_body__ca32720c bodytext_module_size1__ca32720c\" data-rg-n=\"BodyText\">\n<p>Amazon Timestream 为从低延迟查询到大规模数据摄取的工作负载提供完全托管、专门构建的时间序列数据库引擎。借助 Timestream for LiveAnalytics，您可以每分钟摄取数十 GB 以上的时间序列数据，并在几秒钟内对数 TB 的时间序列数据运行 <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>查询，可用性最高达 99.99%。它内置了时间序列分析函数，可帮助您近乎实时地识别趋势和模式。借助 Timestream for InfluxDB，您可以轻松地在 AWS 上为时间序列应用程序运行开源 InfluxDB 数据库，例如对基础设施的可靠性提供实时警报和监控，其响应时间为毫秒级。Timestream for InfluxDB 最高提供 99.9% 的可用性。</p>\n<h3 id=\"How_it_works\" class=\"lb-txt-bold lb-h2 lb-title\">工作原理</h3>\n<div class=\"lb-rtxt\">\n<p>Timestream 是一项快速、可扩展的数据库服务，为从低延迟查询到大规模数据摄取的工作负载提供完全托管、专门构建的时间序列数据库引擎。由于 Timestream 是完全托管的，因此可以省去耗时的数据库基础设施任务，例如安装、升级、存储、高可用性复制和手动备份，从而为您腾出时间。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250216/53c50eba41517440b7b7af7fdf977c22.png\" /></p>\n</div>\n</div>', 0, 1739676264),
(180, '谷歌云GCP Cloud Armor', 'Cloud Armor', 'google-cloud-armor', 158, 'Google Cloud Armor 可帮助您保护 Google Cloud 部署免受多种类型的威胁，包括分布式拒绝服务 (DDoS) 攻击以及跨站脚本攻击 (XSS) 和 SQL 注入 (SQLi) 等应用攻击。Google Cloud Armor 具有一些自动保护功能，还有一些您需要手动配置。', '500.00', '<h2>Google Cloud Armor</h2>\n<p>Google Cloud Armor 可帮助您保护 Google Cloud 部署免受多种类型的威胁，包括分布式拒绝服务 (DDoS) 攻击以及跨站脚本攻击 (XSS) 和 SQL 注入 (SQLi) 等应用攻击。Google Cloud Armor 具有一些自动保护功能，还有一些您需要手动配置。</p>\n<h3>安全政策</h3>\n<p>使用 Google Cloud Armor 安全政策来保护在负载平衡器后面运行的应用，以免它们受到分布式拒绝服务 (DDoS) 攻击和其他基于网络的攻击，无论这些应用是部署在 Google Cloud、混合部署还是多云架构中。您可以在安全政策中使用可配置的匹配条件和操作来配置安全政策。Google Cloud Armor 还提供了预配置的安全政策，其中涵盖各种用例。</p>\n<h3>规则语言</h3>\n<p>利用 Google Cloud Armor，您可以在安全政策中使用可配置的匹配条件和操作来定义优先规则。规则生效，这意味着如果规则是最高优先级规则，且其特性与传入请求的特性匹配，则系统会应用配置的操作。</p>\n<h3>预配置的 WAF 规则</h3>\n<p>Google Cloud Armor 预配置的 WAF 规则是具有数十个签名的复杂 Web 应用防火墙 (WAF) 规则，这些规则是根据开源业界标准编译而成的。每个签名都对应于规则集中的攻击检测规则。Google 按原样提供这些规则。通过这些规则，Google Cloud Armor 可以通过引用方便命名的规则评估数十种不同的流量签名，而无需您手动定义每个签名。</p>\n<p>Google Cloud Armor 预配置规则有助于保护您的 Web 应用和服务免受来自互联网的常见的攻击，并且有助于缓解 OWASP 十大风险。规则来源为 OWASP 核心规则集 3.3.2 (CRS)。</p>\n<p>可以对这些预先配置的规则进行调整，以停用杂乱或不必要的签名。</p>\n<h3>Google Cloud Armor Enterprise</h3>\n<p>Cloud Armor Enterprise 是一项代管式应用保护服务，可帮助保护您的 Web 应用和服务免受分布式拒绝服务 (DDoS) 攻击和来自互联网的其他威胁。Cloud Armor Enterprise 会为负载平衡器提供始终有效的保护，并可让您访问 WAF 规则。</p>\n<p>无论什么层级，全球外部应用负载均衡器、传统版应用负载均衡器和外部代理网络负载均衡器都会自动获得 DDoS 攻击防护。HTTP、HTTPS、HTTP/2 和 QUIC 协议均受支持。</p>\n<h3>Google Threat Intelligence</h3>\n<p>借助 Google Cloud Armor Google 威胁情报，您可以根据多个类别的威胁情报数据允许或阻止流向全球外部应用负载平衡器和传统版应用负载平衡器的流量，从而保护流量。</p>\n<h3>Google Cloud Armor 自动调节式保护</h3>\n<p>通过分析流向后端服务的流量格式、检测可疑攻击并生成提醒及生成建议的可缓解此类攻击的 WAF 规则，自适应保护功能可保护您的应用和服务免受 L7 分布式拒绝服务攻击 (DDoS)。您可以调整这些规则来满足您的需求。</p>\n<h3>高级网络 DDoS 攻击防护</h3>\n<p>高级网络 DDoS 防护可为使用网络负载平衡器、协议转发或具有公共 IP 地址的虚拟机的 Managed Protection Plus 订阅者提供额外防护。高级网络 DDoS 防护提供始终开启的攻击监控和提醒、有针对性的攻击缓解措施以及缓解遥测。</p>\n<h3>Google Cloud Armor 的工作原理</h3>\n<p>Google Cloud Armor 提供始终开启的 DDoS 防护，以防范基于网络或协议的耗尽容量的 DDoS 攻击。此防护功能用于负载均衡器后端的应用或服务。它能够检测和缓解网络攻击，以便仅允许格式正确的请求通过负载均衡代理。安全政策强制执行自定义的第 7 层过滤政策，包括可缓解 OWASP 十大 Web 应用漏洞风险的预配置 WAF 规则。您可以将安全政策附加到以下负载平衡器的后端服务：<br />所有外部应用负载平衡器，包括传统应用负载平衡器<br />区域级内部应用负载均衡器<br />全球外部代理网络负载平衡器 (TCP/SSL)<br />传统代理网络负载均衡器 (TCP/SSL)<br />外部直通网络负载均衡器 (TCP/UDP)<br />利用 Google Cloud Armor 安全政策，您可以在 Google Cloud <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>尽可能靠近传入流量来源的位置允许或拒绝对您的部署的访问。这样可以防止不受欢迎的流量占用资源或进入您的 Virtual Private Cloud (VPC) 网络。</p>\n<p>下图说明了全球外部应用负载平衡器、传统版应用负载平衡器、Google 网络和 Google 数据中心的位置。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250217/b15ff2e3fbc09a771cc248333be4be6e.png\" /></p>', 0, 1739792501),
(181, '谷歌云GCP Cloud CDN 和媒体 CDN', 'Cloud CDN 和媒体 CDN', 'google-cloud-cdn-and-media-cdn', 158, '借力于 Google 十年来在内容分发方面积累的经验。Google 的内容分发网络（Cloud CDN 和媒体 CDN）全面扩展，可将内容分发到更靠近全球受众的位置。', '500.00', '<div class=\"x9K9hf dK1mgd\">\n<div class=\"jTIiId\">\n<div>\n<h2 class=\"MyvX5d D0aEmf qUKri yhYmte\">Cloud CDN 和媒体 CDN</h2>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf dK1mgd\">借力于 Google 十年来在内容分发方面积累的经验\n<div class=\"x9K9hf fRAube\">\n<div class=\"wlROcd\">\n<div class=\" \">\n<p>Google 的内容分发网络（Cloud CDN 和媒体 CDN）全面扩展，可将内容分发到更靠近全球受众的位置。</p>\n<p>Cloud CDN 利用 Google 的全球边缘网络来加速 Web 应用的分发速度。</p>\n<p>媒体 CDN 利用 YouTube 的基础架构将视频流（VoD 和直播）和大型文件下载功能<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>在更靠近用户的位置，以快速可靠的分发内容。</p>\n<h3>全面支持所有源站和后端</h3>\n<p>可从任何支持 HTTP 协议的源站（包括 Compute Engine、Cloud Storage 和 Google Kubernetes Engine后端）及 Google Cloud 之外的源站（例如其他云平台中的存储桶）拉取内容。</p>\n<h3>深度安全性</h3>\n<p>Cloud CDN 和媒体 CDN 与 Cloud Armor 集成。 Cloud Armor 能够帮助企业防范大规模的 DDoS 攻击，进而保护企业布置在边缘位置的内容。</p>\n<h3>精细的缓存控制</h3>\n<p>按源站配置缓存行为，让您能够根据传送的内容类型对缓存键、TTL 和其他缓存功能进行精细控制。</p>\n<h3>路由匹配和源站选择</h3>\n<p>Cloud CDN 和媒体 CDN 提供高级 HTTP 路由功能，让您能够将流量映射到特定的边缘配置和源站，实现精确的控制。</p>\n<p>Cloud CDN 和媒体 CDN 利用 Google 的全球边缘网络，将内容布置在尽可能靠近用户的位置，从而加快 Web 内容和视频内容的分发速度。 通过缩短后端服务器的延迟时间、降低其成本和负载，令其轻松扩容至数百万用户。</p>\n</div>\n</div>\n</div>\n</div>', 0, 1739792821),
(182, '谷歌云GCP Cloud DNS', 'Cloud DNS', 'google-cloud-dns', 158, '可靠、弹性佳、延迟低的 DNS 服务，以 Google 的全球网络为后盾，为您提供所需的一切资源，帮助您注册、管理和托管域名。使用 Google 的基础架构提供生产级质量的高流量权威 DNS 服务。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Cloud DNS</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>可靠、弹性佳、延迟低的 DNS 服务，以 Google 的全球网络为后盾，为您提供所需的一切资源，帮助您注册、管理和托管域名。</p>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">100% 的可用性和<a href=\"https://www.kaihu123.com/vps/aws-app-runner/\" title=\"低延迟\" target=\"_blank\">低延迟</a></h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>使用 Google 的基础架构提供生产级质量的高流量权威 DNS 服务。得益于我们的任播域名服务器，您的用户可从世界各处进行可靠的<a href=\"https://www.kaihu123.com/vps/aws-app-runner/\" title=\"低延迟\" target=\"_blank\">低延迟</a>访问。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<h3>自动扩缩</h3>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>Cloud DNS 可扩容以支持大量的 DNS 区域和记录。您可以可靠地创建和更新数以百万计的 DNS 记录。我们的域名服务器会自动根据查询量来扩缩容量。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">端到端域名管理</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>使用 Cloud Domains 在 Google Cloud 中注册和管理域名，并为您的域名自动设置 DNS 区域。</p>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">权威 DNS 查找</h3>\n<div class=\" \">Cloud DNS 会将 www.google.com 这样的域名请求转换为 74.125.29.101 这样的 IP 地址。</div>\n<h3 class=\" \">域名注册和管理</h3>\n<div class=\" \">Cloud Domains 允许客户在 Google Cloud 中注册和管理域名，并提供与 Cloud DNS 的紧密集成。</div>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf sJb7xe\">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">快速任播域名服务器</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">借助我们的全球任播域名服务器网络，Cloud DNS 从遍布全球的冗余位置托管您的 DNS 区域，从而让您的用户享受可用性高且延迟低的服务。</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739793011),
(183, '谷歌云GCP Cloud Load Balancing', 'Cloud Load Balancing', 'google-cloud-load-balancing', 158, 'Cloud Load Balancing Google Cloud 上高性能、可伸缩的负载平衡服务。高性能的可伸缩负载均衡功能，选择最适合您的负载均衡器类型 Google Cloud Load Balancing 如何支持每秒超过 100 万次查询', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Cloud Load Balancing</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>Google Cloud 上高性能、可伸缩的负载平衡服务。</p>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">通过单个任播 IP 实现全球负载均衡</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>提供跨区域负载均衡，包括自动多区域故障切换。Cloud Load Balancing 能够对用户、流量、网络、后端健康状况和其他相关条件的变化做出即时响应。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">软件定义的灵活服务</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>Cloud Load Balancing 是适用于所有流量的完全分布式、软件定义的托管服务。您可以将 Cloud Load Balancing 用于 HTTP(S)、TCP/SSL 和 UDP 等所有流量。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<div class=\" \">\n<h3>无缝自动扩缩</h3>\n</div>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>可随着用户和流量的增长而调整。通过将流量转移到全球其他可以接收流量的区域，轻松处理数量巨大的瞬间意外峰值。只需数秒便可从零扩容到所需的容量。</p>\n<h3>HTTP(S) 负载均衡</h3>\n<p>应用负载均衡器可以在多个后端实例和多个区域之间均衡 HTTP 和 HTTPS 流量。您的整个应用都可通过一个全局 IP 地址访问，因而简化了 DNS 设置。应用负载均衡器可扩缩、可容错、不需要预热，并且支持基于内容的负载均衡。对于 HTTPS 流量，它们提供 SSL 终结和负载均衡功能。</p>\n<h3>TCP/SSL/UDP 负载均衡</h3>\n<p>网络负载均衡器是第 4 层负载均衡器，可将流量分配到位于单个区域或多个区域的后端。这些负载平衡器具有可扩缩性、不需要预热，并使用健康检查来确保只有运行正常的实例会收到流量。可用的网络负载均衡器：代理网络负载均衡器和直通式网络负载均衡器。</p>\n<h3>SSL 分流</h3>\n<p>SSL 分流使您能够集中管理 SSL 证书和解密。您可以在负载平衡层与后端之间启用加密，以确保最高级别的安全性，这会在后端上产生一些额外的处理开销。</p>\n<h3>Cloud CDN 集成</h3>\n<p>只需选中一个复选框，即可通过应用负载均衡器启用 Cloud CDN，从而为用户优化应用交付。</p>\n<h3>可扩展性和可编程性</h3>\n<p>Service Extensions 在负载均衡数据路径上提供可编程性和可扩展性。Service Extensions 调用支持在数据处理期间对用户管理的服务的 gRPC 调用，而 Service Extensions 插件允许使用 WebAssembly (Wasm) 将自定义代码插入到网络数据路径中。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739793259),
(184, '谷歌云GCP Cloud NAT', 'Cloud NAT', 'google-cloud-nat', 158, '云优先的高性能网络地址转换 Cloud NAT 为 Google Cloud 提供软件定义的全托管式网络地址转换支持。Cloud NAT 具有出色的性能、可靠性和可伸缩性，因此无需使用中间代理。它允许您限制到应用实例的入站通信，同时允许应用实例在不使用公共 IP 的情况下与互联网进行出站通信。', '500.00', '<div class=\"x9K9hf dK1mgd\">\n<div class=\"jTIiId\">\n<div>\n<h2 class=\"MyvX5d D0aEmf qUKri yhYmte\">Cloud NAT</h2>\n</div>\n</div>\n</div>\n<div class=\"x9K9hf dK1mgd\">云优先的高性能网络地址转换\n<div class=\"x9K9hf fRAube\">\n<div class=\"wlROcd\">\n<div class=\" \">\n<p>Cloud NAT 为 Google Cloud 提供<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>定义的全托管式网络地址转换支持。</p>\n<h3>高性能网络地址转换</h3>\n<p>Cloud NAT 具有出色的性能、可靠性和可伸缩性，因此无需使用中间代理。它允许您限制到应用实例的入站通信，同时允许应用实例在不使用公共 IP 的情况下与互联网进行出站通信。</p>\n<h3>动态端口分配</h3>\n<p>借助动态端口分配 (DPA) 功能，Cloud NAT 可以根据需求扩缩端口分配，同时提供运营商控制功能来设置端口数下限和上限。</p>\n<h3>灵活分配 IP 地址</h3>\n<p>根据网络需求选择 NAT IP 分配。手动模式可让您在指定 IP 时拥有完全控制权，而自动模式可让您自动分配和扩缩 NAT IP</p>\n<h3>简化的部署和运营</h3>\n<p>单个 Cloud NAT 网关可以为一个 VPC 区域中的所有子网提供 NAT，并且可以配置为支持多个 NAT IP 地址。Cloud NAT 简化了应用部署和运营，无需更改网络、转发或路由配置。</p>\n<h3>实现了出色的网络性能</h3>\n<p>可自动扩缩 NAT 操作，最大限度地减少对吞吐量和延迟时间的影响，并提供 99.99% 的服务等级协议 (SLA)。</p>\n<p> </p>\n</div>\n</div>\n</div>\n</div>', 0, 1739793484),
(185, '谷歌云GCP 云连接', '云连接', 'google-cloud-gcp-cloud-connection', 158, '根据您的实际情况从任何位置连接到 Google Cloud 通过 Cloud VPN 或专用互连、合作伙伴互连或 Cross-Cloud Interconnect，借助高可用性、低延迟的连接将本地和其他云网络扩展到 Google Cloud。', '500.00', '<h2>云连接</h2>\n<p>根据您的实际情况从任何位置连接到 Google Cloud</p>\n<div class=\"x9K9hf fRAube\">\n<div class=\"wlROcd\">\n<div class=\" \">\n<p>通过 Cloud VPN 或专用互连、合作伙伴互连或 Cross-Cloud Interconnect，借助高可用性、低<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的连接将本地和其他云网络扩展到 Google Cloud。</p>\n<h3>高带宽，专用连接</h3>\n<p>实现从本地到 Google Cloud 或 Google Cloud 与其他云服务提供商之间的高可用性、低<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>和高吞吐量的专用连接。</p>\n<h3>灵活的低成本 VPN</h3>\n<p>对于数据量较少的连接，Cloud VPN 提供了费用更低的选项，可通过加密的公共互联网连接为每个隧道提供 1.5-3.0 Gbps 的带宽。Cloud VPN 灵活的路由选项让您可以使用静态或动态路由连接到不同的 VPN 网关。</p>\n<h3>以服务为中心的连接</h3>\n<p>使用通过互连实现的 Private Service Connect (PSC)，可实现从本地和公有云对托管在 Google Cloud 上的 SaaS、Google Cloud 服务或客户管理的服务的访问。</p>\n<h3>加密的专用连接</h3>\n<p>使用通过 Cloud Interconnect 实现的高可用性 VPN (IPSec) 或 Cloud Interconnect 上的 MACsec，可实现从本地环境对 VPC 的加密访问。</p>\n<h3>流量区分和优先级确定</h3>\n<p>通过业界首创（Cloud Interconnect 上的 Application Awareness），确保优先处理任务关键型应用流量。</p>\n<p> </p>\n</div>\n</div>\n</div>', 0, 1739793775),
(186, '谷歌云GCP Network Connectivity Center', 'Network Connectivity Center', 'google-cloud-network-connectivity-center', 158, 'Network Connectivity Center 重新构想如何部署、管理和扩展您的网络。在一个位置集中管理全球连接，跨 Google Cloud、多云端和混合网络的弹性连接性。深入了解 Google Cloud 及其与第三方解决方案的紧密集成', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Network Connectivity Center</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>重新构想如何部署、管理和扩展您的网络。</p>\n<ul class=\"PNKBid \">\n<li class=\"nuvzTc\">\n<div class=\"EAoy4b\">\n<div class=\" \">\n<p>在一个位置集中管理全球连接</p>\n</div>\n</div>\n</li>\n<li class=\"nuvzTc\">\n<div class=\"EAoy4b\">\n<div class=\" \">\n<p>跨 Google Cloud、多云端和混合网络的弹性连接性</p>\n</div>\n</div>\n</li>\n<li class=\"nuvzTc\">\n<div class=\"EAoy4b\">\n<div class=\" \">\n<p>深入了解 Google Cloud 及其与第三方解决方案的紧密集成</p>\n</div>\n</div>\n</li>\n</ul>\n<h3>简化连接</h3>\n<p>Network Connectivity Center 提供的独特功能使您能够轻松连接本地、Google Cloud 和其他云企业网络，并通过 Google Cloud 上的集中式逻辑中心，以中心辐射方式管理这些网络。</p>\n<h3>弹性云连接</h3>\n<p>Network Connectivity Center 通过允许您使用 Google 的全球网络，利用合作伙伴和专用互连、Cloud VPN 连接以及第三方路由器/SD-WAN 虚拟机在本地站点、云资源和其他云（通过 VPN 连接启用）之间可靠地传输数据，从而提供了统一的连接体验。</p>\n<h3>深入了解您的全球网络</h3>\n<p>Network Connectivity Center 与 Network Intelligence Center 无缝配对以提供端到端可见性，因此您可以监控、可视化和<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>在 Google Cloud、本地和其他云上部署的中心辐射架构的连接。</p>\n</div>\n</div>', 0, 1739794148),
(187, '谷歌云GCP Network Intelligence Center', 'Network Intelligence Center', 'google-cloud-network-intelligence-center', 158, 'Network Intelligence Center 通过单个控制台实现 Google Cloud 网络可观测性、监控和问题排查。降低服务中断的风险并确保安全与合规性。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Network Intelligence Center</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>通过单个控制台实现 Google Cloud 网络可观测性、监控和问题排查。降低服务中断的风险并确保安全与合规性。</p>\n</div>\n</div>\n<p>利用这五个模块设计和实施健全的网络可观测性策略</p>\n<p>主动检测网络问题或配置错误，而无需人工干预</p>\n<p>浏览 Network Intelligence Center 及其功能的最新资讯、文章和视频</p>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">诊断连接问题，防止网络故障</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>Network Intelligence Center 提供对云端网络出色的可见性，以及主动式网络验证功能。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">提高网络安全性和合规性</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>进行一系列连接检查，以验证网络的安全性和合规性。深入了解防火墙规则使用情况，严守安全边界。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"z7M7uc OIw4If \">\n<div class=\"\">\n<div class=\"yTFDmd \">\n<h3 class=\" \">使用智能监控功能节省时间</h3>\n<div class=\"gUKm9 giuCWe\">\n<div class=\" \">\n<p>监控实时性能指标并轻松直观呈现网络运行状况。主动防范因配置有误或配置欠佳而导致的网络中断和性能问题。</p>\n<p>网络拓扑<br />直观呈现虚拟私有云 (VPC) 网络、与本地网络之间的混合连接、与 Google 代管式服务的连接的拓扑以及相关指标。</p>\n<p>Connectivity Tests<br />诊断工具，可让您检查网络端点（例如虚拟机、GKE <a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>、负载均衡器转发规则或互联网 IP 地址等网络流量来源或目标）之间的连接。</p>\n<p>性能信息中心<br />了解整个 Google Cloud 网络的性能和项目资源的性能。</p>\n<p>防火墙数据分析<br />提供了有关防火墙规则使用方式的数据、公开配置错误，以及标识可能更严格的规则。</p>\n<p>网络分析器<br />自动监控 VPC 网络配置，并检测错误配置和欠佳配置。识别底层网络导致的故障，提供根本原因信息，并建议可能的解决方法。</p>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1739794615),
(188, '谷歌云GCP 虚拟私有云', 'Virtual Private Cloud (VPC)', 'google-cloud-virtual-private-cloud', 158, 'Virtual Private Cloud (VPC)覆盖所有区域的全球虚拟网络。整个组织使用一个 VPC，在项目中进行隔离。无需停机就能增加 IP 空间。VPC 可自动为您设置虚拟拓扑，配置子网前缀范围和网络政策，不过您也可以自行配置这些内容。', '500.00', '<h2 class=\"o2Zj5b D0aEmf \">Virtual Private Cloud (VPC)</h2>\n<div class=\"EAoy4b x9K9hf dK1mgd x9K9hf Idevi\">\n<div class=\" \">\n<p>覆盖所有区域的全球虚拟网络。整个组织使用一个 VPC，在项目中进行隔离。无需停机就能增加 IP 空间。</p>\n<p>参考这些方法指南，开始使用 VPC 网络</p>\n<p>网络覆盖 40 个区域、121 个可用区、200 多个国家和地区，并拥有长达 320 万公里的陆地和海底光缆</p>\n<p>单个 VPC 可以跨越多个区域，而无需在公共互联网上进行通信</p>\n<h3>VPC 网络</h3>\n<p>VPC 可自动为您设置虚拟拓扑，配置子网前缀范围和网络政策，不过您也可以自行配置这些内容。您还可以扩展 CIDR 范围，而无需停机。</p>\n<h3>VPC 流日志</h3>\n<p>VPC 流日志可采集有关进出 Compute Engine 网络接口的 IP 流量的信息。这些日志有助于网络监控、取证、实时安全分析和费用优化。VPC 流日志每 5 秒更新一次，可让您即时了解相关信息，并可通过 Flow Analyzer 轻松快速地直观呈现。</p>\n<h3>VPC 对等互连</h3>\n<p>配置同个组织内或不同组织间的私密通信，杜绝带宽瓶颈或单点故障。</p>\n<h3>共享 VPC</h3>\n<p>配置在组织内部多个项目中共享的 VPC 网络。 集中管理<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的连接路由和防火墙。不同开发者有各自的项目并独立计算费用和配额，只需连接到共享专用网络即可进行通信。</p>\n<h3>接入您自己的 IP</h3>\n<p>在跨所有区域的 Google 网络中接入您自己的 IP 地址，从而在迁移过程中最大限度地缩短停机时间，并降低网络基础架构成本。在您接入自己的 IP 之后，Google Cloud 会在全球范围内将这些 IP 通告到所有对等网络。您的前缀可以被拆分为小至 16 个地址 (/28) 的块，确保您能够更为灵活地利用您的资源。</p>\n</div>\n</div>', 0, 1739794865),
(189, '微软云azure 数据工厂', '数据工厂', 'azure-data-factory', 165, '使用 Azure 数据工厂整合所有数据，这是一种完全托管、无需服务器的数据集成服务。借助 90 多个免维护的内置连接器直观整合数据源，无需额外费用。', '500.00', '<h2 class=\"h2 \">Azure 数据工厂</h2>\n<div class=\"mb-4\" data-oc-token-text=\"\">\n<p>简化的企业级混合数据集成。</p>\n<h3 class=\"h4 \">简化的企业级混合数据集成</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>使用 Azure 数据工厂整合所有数据，这是一种完全托管、无需服务器的数据集成服务。借助 90 多个免维护的内置连接器直观整合数据源，无需额外费用。在直观环境中轻松构建 ETL（提取、转换和加载）和 ELT（提取、加载和转换）进程，无需代码或编写自己的代码。然后将集成数据传递到 Azure Synapse Analytics 以获取业务见解。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/fd92d5ac75bd80f3bae7405038ca1960.png\" /></p>\n<h2 class=\"h4 \">利用无代码数据流加速数据转换</h2>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>数据工厂提供可跨数字转换计划工作的数据集成和转换层。</p>\n<ul>\n<li>助力公众开发者和数据工程师推进业务发展、推动 IT 引领的分析/商业智能进步。</li>\n<li>无需代码即可准备数据、构建 ETL 和 ELT 进程以及无代码协调和监视管道。托管的 Apache Spark™ 服务负责生成和维护代码。</li>\n<li>通过智能意向<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>的映射自动执行复制活动，从而实现更快的转换。</li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1740366892),
(190, 'Azure Cache for Redis', 'Azure Cache for Redis', 'azure-cache-for-redis', 165, '分布式可缩放内存中解决方案，提供超快速数据访问功能 随着应用上的流量和需求增加，可以简单且经济地缩放性能。在应用程序体系结构中添加快速缓存层，以准实时的速度同时处理成千上万个用户 - 所有这些都基于完全托管服务的优势。', '500.00', '<h2>Azure Cache for Redis</h2>\n<p>分布式可缩放内存中解决方案，提供超快速数据访问功能</p>\n<h3 class=\"h4 \">尽情使用现有应用、加快决策速度。</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>随着应用上的流量和需求增加，可以简单且经济地缩放性能。在应用程序体系结构中添加快速缓存层，以准实时的速度同时处理成千上万个用户 - 所有这些都基于完全托管服务的优势。</p>\n<h3 class=\"h4 \">改善应用程序的吞吐量和延迟性能</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>使用 Azure Cache for Redis 通过缓存为数据层加速。添加 Azure Cache for Redis 可将数据吞吐量提高 800% 以上，同时将延迟性能提高 1000%<sup> </sup>以上，且价格经济实惠。这是一种高效缩放应用程序和改善用户体验的好方法，并且无需花钱重新架构底层数据库。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/191a1dc06c943c74fa2a53e1fb25e701.png\" /></p>\n<h2 class=\"h4 \">使用分布式缓存加快应用程序速度</h2>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>通过使数据层以较低成本（相较于通过扩展数据库实例）扩展吞吐量来补充 Azure SQL 数据库和 Azure Cosmos DB 等数据库服务。使用常见预置式缓存模式存储和共享数据库查询结果、<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>状态和静态内容，使应用程序更加灵活且可缩放。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/adaa9011327340dccee2b9b4cd24c699.png\" /></p>\n<p> </p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1740367171),
(191, '微软云Azure数据库MariaDB', 'MariaDB', 'azure-database-for-mariadb', 165, '企业就绪且完全托管的社区 MariaDB。将 MariaDB 社区版与完全托管式服务提供程序的优势相结合，让开发人员摆脱复杂的基础结构和数据库管理工作，以便能够专注于构建卓越的应用。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure Database for MariaDB</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>企业就绪且完全托管的社区 MariaDB。</p>\n<ul class=\"list-unstyled \">\n<li class=\" d-flex mb-4\">\n<div id=\"custom-list-item-oc3f1f\" class=\"card ml-3\" data-oc=\"oc3f1f\">\n<div class=\"card-body\">\n<p>使用所选语言和框架将应用程序轻松部署到云</p>\n</div>\n</div>\n</li>\n<li class=\" d-flex mb-4\">\n<div id=\"custom-list-item-oc2c60\" class=\"card ml-3\" data-oc=\"oc2c60\">\n<div class=\"card-body\">\n<p>通过内置的高可用性和弹性缩放，实现业务连续性并动态响应客户需求的变化</p>\n</div>\n</div>\n</li>\n<li class=\" d-flex mb-4\">\n<div id=\"custom-list-item-ocda9a\" class=\"card ml-3\" data-oc=\"ocda9a\">\n<div class=\"card-body\">\n<p>通过全球 Microsoft 数据中心网络获得无与伦比的安全性和符合性，包括 Azure IP Advantage 和业界领先的业务覆盖范围</p>\n</div>\n</div>\n</li>\n<li class=\" d-flex mb-4\">\n<div id=\"custom-list-item-oc1aa4\" class=\"card ml-3\" data-oc=\"oc1aa4\">\n<div class=\"card-body\">\n<p>灵活定价：为工作负载选择合适的资源，没有任何隐藏费用</p>\n</div>\n</div>\n</li>\n</ul>\n<h3 id=\"heading-areaheading-uid646a\" class=\"component-heading h4 \" data-automation-test-id=\"heading-areaheading-uid646a\">使用 Azure Database for MariaDB 进行构建</h3>\n<strong>1、智能应用</strong>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>使用最先进的机器学习算法和集成式可视化工具进行分析和获取可操作<a href=\"https://www.kaihu123.com/vps/azure-data-lake-storage/\" title=\"见解\" target=\"_blank\">见解</a>，开发复杂的转型应用。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/56660cbdb34208233648bd4e34075ee2.png\" /></p>\n<strong>2、零售和电子商务</strong>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>构建高度安全且可缩放的电子商务解决方案，以同时满足消费者和企业客户需求。通过定向产品和优惠吸引客户，快速处理事务并优化产品交付和客户服务。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/929f0500283a90041bea2b898d83a85e.png\" /></p>\n<p> </p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1740367463),
(192, '微软云Azure数据库MySQL', 'MySQL', 'azure-database-for-mysql', 165, '使用可缩放的开源 MySQL 数据库进行创新。使用经济高效且易于设置、操作和缩放的 Azure Database for MySQL 专注于应用程序开发。享受高级安全性、高可用性，以及最高 99.99% 的服务级别协议 (SLA)。阅读概述，并了解如何将本地 MySQL 数据库迁移到 Azure。', '500.00', '<h2 class=\"h2 \">Azure Database for MySQL</h2>\n<div class=\"mb-4\" data-oc-token-text=\"\">\n<p>使用可缩放的开源 MySQL 数据库进行创新</p>\n<div class=\"col-12 col-sm-12 col-md-4 pb-0\">\n<div class=\"d-flex w-100 h-100 position-relative material-color-light theme-light material-surface text-md-left\">\n<div class=\"d-flex flex-row w-100 h-100 \">\n<div class=\"w-100 py-2 pl-4 pr-2 d-flex align-items-center\">\n<h3 class=\"w-100\">利用完全托管的 MySQL 数据库加速创新</h3>\n使用经济高效且易于设置、操作和缩放的 Azure Database for MySQL 专注于应用程序开发。享受高级安全性、高可用性，以及最高 99.99% 的服务级别协议 (SLA)。阅读概述，并了解如何将本地 MySQL 数据库迁移到 Azure。 </div>\n<div class=\"w-100 py-2 pl-4 pr-2 d-flex align-items-center\">\n<h3 class=\"h4 \">使用经济高效的 MySQL 数据库进行构建并节约成本</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>轻松构建工作负载或将其迁移到 Azure Database for MySQL。设置和管理 MySQL 数据库服务器并自动完成其维护，包括日常更新、备份和安全性。通过可突发实例或启停功能<span class=\"small mb-0\">将总拥有成本降低 48%</span>，节省成本，确保在数据库停止时仅支付存储费用。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/3b5fb7363d0bb30b41cd643131d0b1e0.png\" /></p>\n<h3 class=\"h4 \">快速轻松地进行预配和缩放</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>不到两分钟即可预配 MySQL 数据库，并通过 AI 支持的数据库监视和优化功能提高查询速度。使用查询性能见解识别<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>缓慢的查询，并使用性能建议进一步优化数据库。通过支持多达 96 个 vCore、672 GB 内存、16 TB 存储和每秒 48,000 次输入/输出操作 (IOPS)，最大限度地提高大型数据库的性能，以实现每秒高达 150,000 次查询的吞吐量。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/6a2bde662d7007330492a73de04f7ad9.png\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 0, 1740367737),
(193, '微软云Azure PostgreSQL', 'PostgreSQL', 'azure-database-for-postgresql', 165, '利用完全托管、智能且可扩展的 PostgreSQL 创建。通过完全托管的智能 Azure Database for PostgreSQL，专注于应用程序创新，而不必担心数据库管理。快速、轻松、自信地扩展工作负载。', '500.00', '<h2 class=\"h2 \">Azure Database for PostgreSQL</h2>\n<div class=\"mb-4\" data-oc-token-text=\"\">\n<p>利用完全托管、智能且可扩展的 PostgreSQL 创建。</p>\n<h3>利用完全托管的 PostgreSQL 数据库加速创新</h3>\n通过完全托管的智能 Azure Database for PostgreSQL，专注于应用程序创新，而不必担心数据库管理。快速、轻松、自信地扩展工作负载。获享高可用性，运行时高达 99.99% 的《服务等级协议》(SLA)，且可选择同区域或区域冗余高可用性，还可使用 AI 支持的性能建议和内置企业级安全措施。</div>\n<div class=\"mb-4\" data-oc-token-text=\"\"> </div>\n<h3 class=\"mb-4\">高度可用的灵活托管数据库可确保性能</h3>\n<div class=\"mb-4\" data-oc-token-text=\"\">完全托管的 PostgreSQL 数据库即服务，正常运行时间高达 99.99%，可专注于应用创新。区域冗余高可用性会自动执行维护、修补和更新。在数分钟内完成预配，并独立扩展计算或存储。使用全面的数据库监视和<a href=\"https://www.kaihu123.com/stand/hong-kong-computing-cloud-server-universal-computing-12-core-24-thread/\" title=\"优化\" target=\"_blank\">优化</a>工具降低成本。利用智能性能建议确保达到峰值性能。</div>\n<div class=\"mb-4\" data-oc-token-text=\"\"><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/41f4aae175894e6ff0de212a74409e69.png\" /></div>\n<h3 class=\"mb-4\">迁移到开源 PostgreSQL 数据库</h3>\n<p>使用完全托管的 PostgreSQL 数据库轻松迁移，支持 最新版本。使用喜爱的 PostgreSQL  扩展 构建，例如 Cron、PostGIS 和 PLV8 以及热门的 框架和语言 ，例如 Ruby on Rails、Python with Django、Java with Spring Boot 和 Node.js。使用 Microsoft 开源数据库资源，包括 GitHub 和适用于 Azure Data Studio 的  PostgreSQL 扩展 （预览版）。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/fd1290fbf6b109a57697e701a4e355e9.png\" /></p>\n<h2 class=\"h4 \">以较低的总拥有成本<a href=\"https://www.kaihu123.com/stand/hong-kong-computing-cloud-server-universal-computing-12-core-24-thread/\" title=\"优化\" target=\"_blank\">优化</a>价值</h2>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>迁移到 Azure Database for PostgreSQL ，最高可将总拥有成本降低 62%。通过减少的基础结构和开源数据库管理以及简化的安全性和可用性来节省运营成本。利用停止/启动功能、可突发服务层和预留实例来节省成本，并且仅在数据库停止运行时支付存储费用。简化部署和操作，并加快缩放速度。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/caaa0fa62d082b7c30df44f4a12e4604.png\" /></p>\n</div>\n</div>\n<div class=\"mb-4\" data-oc-token-text=\"\"> </div>', 0, 1740368082);
INSERT INTO `mx_cloud` (`id`, `title`, `name`, `alias`, `cid`, `des`, `usd`, `intro`, `status`, `addtime`) VALUES
(194, '微软云Azure数据库SQL Server', 'SQL Server', 'azure-sql-server', 165, 'Azure 虚拟机上的 SQL Server 是数据库 Azure SQL 系列 的一部分。将 SQL Server 工作负载迁移到云，同时享有 SQL Server 的性能和安全性以及 Azure 的灵活性和混合连接性。', '500.00', '<div class=\"col-12 col-md-8 \">\n<h2 class=\"h2 \">Azure 虚拟机上的 SQL Server</h2>\n</div>\n<div class=\"col-12 col-md-8 col-xl-6 \">\n<div data-oc-token-text=\"\">\n<p>在云中托管企业 SQL Server 应用并保存。</p>\n<h3>将 SQL Server 迁移到虚拟机并保存</h3>\n<p>Azure 虚拟机上的 SQL Server 是数据库 Azure SQL 系列 的一部分。将 SQL Server 工作负载迁移到云，同时享有 SQL Server 的性能和安全性以及 Azure 的灵活性和混合连接性。将虚拟机 (VM) 注册到  SQL Server IaaS 代理扩展后，可降低总拥有成本 (TCO)1 并获得免费的内置安全性和自动化管理，无需额外费用。</p>\n<h3>获得更高的性能和更低的 TCO</h3>\n<p>Azure 虚拟机上的 SQL Server 执行速度高达 42%，比 AWS EC21低 31%。使用 Azure 混合权益 将本地 SQL Server 许可证迁移到云，无需额外费用。将 SQL Server 工作负载迁移到 Azure，并获取 SQL Server 2008、2008 R2 和 2012 的免费扩展安全更新（仅限 Azure）。AWS 的开销是适用于 Windows Server 和 SQL Server2 的 Azure 的 5 倍。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/08cb48935f932461d2573fea467eb075.png\" /></p>\n<h3 class=\"h4 \">使用简单、熟悉的 SQL Server</h3>\n<div class=\"mb-3 \">\n<div data-oc-token-text=\"\">\n<p>Azure 虚拟机上的 SQL Server 100% 与 SQL Server 本地工作负载兼容，但具有更多的管理功能。在 Linux 或 Windows 上部署，并在 Red Hat Enterprise Linux、SUSE Linux Enterprise Server、Ubuntu Pro Linux 和 Windows Server 上使用预配置的 Azure 市场映像。无需更改代码即可迁移。</p>\n<p><img src=\"https://kaihudata.oss-cn-shenzhen.aliyuncs.com/storage/editor/20250224/5cc7961c7f9d2be7903a6a0f4d8f84bc.png\" /></p>\n<h3>使用可靠且简单的 HA/DR 组合工作负载</h3>\n<p>使用 Azure 虚拟机上的 SQL Server 作为本地 SQL Server 实例的灾难恢复站点，具有高可用性/灾难恢复 (HA/DR) 软件保障权益，可通过 SQL Server IaaS 代理扩展<a href=\"https://www.kaihu123.com/tag/\" title=\"\" target=\"_blank\"></a>。轻松配置 Always On 可用性组以监视和管理其运行状况。</p>\n</div>\n</div>\n</div>\n</div>', 0, 1740368431);
